INSERT INTO `film` (`id`, `code`, `titre`, `date`, `synopsis`, `synopsisCourt`, `duree`, `note`, `trailer`, `affiche`) VALUES
(1, 219715, 'Gemma Bovery', '2014-09-10', 'Martin est un ex-bobo parisien reconverti plus ou moins volontairement en boulanger d''un village normand. De ses ambitions de jeunesse, il lui reste une forte capacité d''imagination, et une passion toujours vive pour la grande littérature, celle de Gustave Flaubert en particulier.', 'Martin est un ex-bobo parisien reconverti plus ou moins volontairement en boulanger d''un village normand. De ses ambitions de jeunesse, il lui reste une forte capacité d''imagination, et une passion toujours vive pour la grande littérature, celle de Gustave Flaubert en particulier.', '01:39:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19547345', 'http://fr.web.img6.acsta.net/pictures/14/07/28/11/43/326431.jpg'),
(2, 228624, 'Near Death Experience', '2014-09-10', 'Paul, un employé sur une plateforme téléphonique, est en plein burn-out. Un vendredi 13, la chronique du journal télévisé sur ce jour particulier lui apparaît comme un signal pour passer à l''acte.', 'Paul, un employé sur une plateforme téléphonique, est en plein burn-out. Un vendredi 13, la chronique du journal télévisé sur ce jour particulier lui apparaît comme un signal pour passer à l''acte.', '01:27:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19546508', 'http://fr.web.img2.acsta.net/pictures/14/07/24/17/23/328167.jpg'),
(3, 221899, 'Maintenant ou jamais', '2014-09-03', 'Quand on est une mère de famille, en principe, on ne braque pas les banques. Mais par les temps qui courent, ça peut être une solution pour assurer l''avenir de son foyer, et ne pas renoncer à ses rêves. Même si jouer les voleuses peut vite devenir dangereux, et les mauvaises rencontres se transformer en histoire d''amour?', 'Quand on est une mère de famille, en principe, on ne braque pas les banques. Mais par les temps qui courent, ça peut être une solution pour assurer l''avenir de son foyer, et ne pas renoncer à ses rêves. Même si jouer les voleuses peut vite devenir dangereux, et les mauvaises rencontres se transformer en histoire d''amour?', '01:35:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19545972', 'http://fr.web.img2.acsta.net/pictures/14/07/28/11/28/350727.jpg'),
(4, 216480, 'Hipokrat', '2014-09-03', '<span>Benjamin va devenir un grand médecin, il en est certain. </span><span>Mais pour son premier stage d''interne dans le service de son père, rien ne se passe comme prévu. </span><span>La pratique se révèle plus rude que la théorie.</span>', '<span>Benjamin va devenir un grand médecin, il en est certain. </span><span>Mais pour son premier stage d''interne dans le service de son père, rien ne se passe comme prévu. </span><span>La pratique se révèle plus rude que la théorie.</span>', '01:42:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19546346', 'http://fr.web.img1.acsta.net/pictures/14/07/04/14/59/301675.jpg'),
(5, 212263, 'Délivre-nous du mal', '2014-09-03', 'A New York, le policier Ralph Sarchie enquête sur une série de crimes. Il s''associe avec un prêtre non conventionnel, spécialisé dans les rituels d''exorcisme. Tous deux vont lutter contre les possessions qui terrorisent leur ville.', 'A New York, le policier Ralph Sarchie enquête sur une série de crimes. Il s''associe avec un prêtre non conventionnel, spécialisé dans les rituels d''exorcisme. Tous deux vont lutter contre les possessions qui terrorisent leur ville.', '01:59:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543589', 'http://fr.web.img2.acsta.net/pictures/14/06/18/10/13/310746.jpg'),
(6, 138335, 'Hercule', '2014-08-27', 'Mi-homme mi-légende, Hercule prend la tête d''un groupe de mercenaires pour mettre un terme à la sanglante guerre civile qui sévit au royaume de Thrace et replacer le roi légitime sur le trône.', 'Mi-homme mi-légende, Hercule prend la tête d''un groupe de mercenaires pour mettre un terme à la sanglante guerre civile qui sévit au royaume de Thrace et replacer le roi légitime sur le trône.', '01:38:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19547000', 'http://fr.web.img3.acsta.net/pictures/14/07/22/14/05/515154.jpg'),
(7, 220982, 'The Salvation', '2014-08-27', '1870, Amérique. Lorsque John tue le meurtrier de sa famille, il déclenche la fureur du chef de gang, Delarue. Trahi par sa communauté, lâche et corrompue, le paisible pionnier doit alors traquer seul les hors-la-loi.', '1870, Amérique. Lorsque John tue le meurtrier de sa famille, il déclenche la fureur du chef de gang, Delarue. Trahi par sa communauté, lâche et corrompue, le paisible pionnier doit alors traquer seul les hors-la-loi.', '01:33:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19546700', 'http://fr.web.img5.acsta.net/pictures/14/07/18/17/04/286303.jpg'),
(8, 205131, 'Enemy', '2014-08-27', '<p style="">Adam, un professeur discret, mène une vie paisible avec sa fiancée Mary. Un jour qu''il découvre son sosie parfait en la personne d''Anthony, un acteur fantasque, il ressent un trouble profond. Il commence alors à observer à distance la vie de cet homme et de sa mystérieuse femme enceinte.', '<p style="">Adam, un professeur discret, mène une vie paisible avec sa fiancée Mary. Un jour qu''il découvre son sosie parfait en la personne d''Anthony, un acteur fantasque, il ressent un trouble profond. Il commence alors à observer à distance la vie de cet homme et de sa mystérieuse femme enceinte.', '01:30:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19546663', 'http://fr.web.img1.acsta.net/pictures/14/07/11/10/33/317481.jpg'),
(9, 228021, 'Party Girl', '2014-08-27', 'Angélique a soixante ans. Elle aime encore la fête, elle aime encore les hommes. La nuit, pour gagner sa vie, elle les fait boire dans un cabaret à la frontière allemande. Avec le temps, les clients se font plus rares. Mais Michel, son habitué, est toujours amoureux d''elle. Un jour, il lui propose de l''épouser.', 'Angélique a soixante ans. Elle aime encore la fête, elle aime encore les hommes. La nuit, pour gagner sa vie, elle les fait boire dans un cabaret à la frontière allemande. Avec le temps, les clients se font plus rares. Mais Michel, son habitué, est toujours amoureux d''elle. Un jour, il lui propose de l''épouser.', '01:35:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19546845', 'http://fr.web.img2.acsta.net/pictures/14/06/26/10/39/395906.jpg'),
(10, 205445, 'Expendables 3', '2014-08-20', 'Barney, Christmas et le reste de l''équipe affrontent Conrad Stonebanks, qui fut autrefois le fondateur des Expendables avec Barney. Stonebanks devint par la suite un redoutable trafiquant d''armes, que Barney fut obligé d''abattre? Du moins, c''est ce qu''il croyait.', 'Barney, Christmas et le reste de l''équipe affrontent Conrad Stonebanks, qui fut autrefois le fondateur des Expendables avec Barney. Stonebanks devint par la suite un redoutable trafiquant d''armes, que Barney fut obligé d''abattre? Du moins, c''est ce qu''il croyait.', '02:07:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19547302', 'http://fr.web.img3.acsta.net/pictures/14/07/10/11/30/285929.jpg'),
(11, 220034, 'Sils Maria', '2014-08-20', 'À dix-huit ans, Maria Enders a connu le succès au théâtre en incarnant Sigrid, jeune fille ambitieuse et au charme trouble qui conduit au suicide une femme plus mûre, Helena. Vingt ans plus tard on lui propose de reprendre cette pièce, mais cette fois de l''autre côté du miroir, dans le rôle d''Helena...', 'À dix-huit ans, Maria Enders a connu le succès au théâtre en incarnant Sigrid, jeune fille ambitieuse et au charme trouble qui conduit au suicide une femme plus mûre, Helena. Vingt ans plus tard on lui propose de reprendre cette pièce, mais cette fois de l''autre côté du miroir, dans le rôle d''Helena...', '02:04:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19545706', 'http://fr.web.img1.acsta.net/pictures/14/08/25/11/45/454322.jpg'),
(12, 201386, 'Des Lendemains qui chantent', '2014-08-20', 'Olivier et Léon, deux frères qui sont montés à Paris et que la vie a éloigné... Si le premier se voit comme un journaliste sans concessions, le second est un communicant ambitieux et opportuniste. Noémie, une charmante conseillère présidentielle, n''arrive pas, au fil des ans, à choisir entre eux.', 'Olivier et Léon, deux frères qui sont montés à Paris et que la vie a éloigné... Si le premier se voit comme un journaliste sans concessions, le second est un communicant ambitieux et opportuniste. Noémie, une charmante conseillère présidentielle, n''arrive pas, au fil des ans, à choisir entre eux.', '01:34:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19546421', 'http://fr.web.img2.acsta.net/pictures/14/06/24/17/21/587352.jpg'),
(13, 196604, 'Les Gardiens de la Galaxie', '2014-08-13', 'Un groupe d''aliens, derniers survivants de leur espèce, viennent sur Terre afin de protéger notre planète, menacée par une invasion d''extraterrestres.', 'Un groupe d''aliens, derniers survivants de leur espèce, viennent sur Terre afin de protéger notre planète, menacée par une invasion d''extraterrestres.', '02:01:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19546177', 'http://fr.web.img5.acsta.net/pictures/14/08/04/15/09/405662.jpg'),
(14, 198975, 'Black Storm', '2014-08-13', 'En une journée, la petite ville de Silverton est dévastée par une multitude de tornades sans précédent. Les habitants sont désormais à la merci de ces cyclones ravageurs et meurtriers, alors même que les météorologues annoncent que le pire est à venir?', 'En une journée, la petite ville de Silverton est dévastée par une multitude de tornades sans précédent. Les habitants sont désormais à la merci de ces cyclones ravageurs et meurtriers, alors même que les météorologues annoncent que le pire est à venir?', '01:29:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19546863', 'http://fr.web.img3.acsta.net/pictures/14/07/07/12/39/300235.jpg'),
(15, 186452, 'Lucy', '2014-08-06', 'A la suite de circonstances indépendantes de sa volonté, une jeune étudiante voit ses capacités intellectuelles se développer à l''infini. Elle « colonise » son cerveau, et acquiert des pouvoirs illimités.', 'A la suite de circonstances indépendantes de sa volonté, une jeune étudiante voit ses capacités intellectuelles se développer à l''infini. Elle « colonise » son cerveau, et acquiert des pouvoirs illimités.', '01:29:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19545914', 'http://fr.web.img6.acsta.net/pictures/14/06/05/09/47/324245.jpg'),
(16, 206986, 'La Planète des singes : l''affrontement', '2014-07-30', 'Une nation de plus en plus nombreuse de singes évolués, dirigée par César, est menacée par un groupe d''humains qui a survécu au virus dévastateur qui s''est répandu dix ans plus tôt.', 'Une nation de plus en plus nombreuse de singes évolués, dirigée par César, est menacée par un groupe d''humains qui a survécu au virus dévastateur qui s''est répandu dix ans plus tôt.', '02:11:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19546235', 'http://fr.web.img6.acsta.net/pictures/14/07/03/16/07/192966.jpg'),
(17, 56902, 'Coldwater', '2014-07-09', 'Brad Lunders est un adolescent envoyé de force par sa mère dans un camp de rééducation situé en pleine forêt. Le contact avec l''extérieur lui est impossible. Dans cet établissement, des choses étranges se passent, le personnel abuse de son pouvoir. Brad tente alors de s''en échapper.', 'Brad Lunders est un adolescent envoyé de force par sa mère dans un camp de rééducation situé en pleine forêt. Le contact avec l''extérieur lui est impossible. Dans cet établissement, des choses étranges se passent, le personnel abuse de son pouvoir. Brad tente alors de s''en échapper.', '01:48:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543676', 'http://fr.web.img5.acsta.net/pictures/14/05/22/12/03/354014.jpg'),
(18, 222392, 'Big Bad Wolves', '2014-07-02', 'Une série de meurtres d''une rare violence bouleverse la vie de trois hommes : le père de la dernière victime qui rêve de vengeance ; un policier en quête de justice qui n''hésitera pas à outrepasser la loi ; et le principal suspect ? un professeur de théologie arrêté et remis en liberté suite aux excès de la police.', 'Une série de meurtres d''une rare violence bouleverse la vie de trois hommes : le père de la dernière victime qui rêve de vengeance ; un policier en quête de justice qui n''hésitera pas à outrepasser la loi ; et le principal suspect ? un professeur de théologie arrêté et remis en liberté suite aux excès de la police.', '01:50:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19544101', 'http://fr.web.img5.acsta.net/pictures/14/04/09/13/17/474499.jpg'),
(19, 221896, 'On a failli être amies', '2014-06-25', 'Marithé travaille dans un centre de formation pour adultes. Sa mission : aider les autres à changer de métier et à trouver leur vocation. Se présente alors Carole, qui vit et travaille dans l''ombre de Sam, son mari, énergique et talentueux chef étoilé.', 'Marithé travaille dans un centre de formation pour adultes. Sa mission : aider les autres à changer de métier et à trouver leur vocation. Se présente alors Carole, qui vit et travaille dans l''ombre de Sam, son mari, énergique et talentueux chef étoilé.', '01:31:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19545507', 'http://fr.web.img1.acsta.net/pictures/14/05/12/18/02/062595.jpg'),
(20, 224178, 'L''Ex de ma vie', '2014-06-25', 'Ariane, une jeune violoniste française, accepte la demande en mariage enflammée de Christen, un irrésistible chef d''orchestre. Seul hic : elle est encore un tout petit peu? mariée !', 'Ariane, une jeune violoniste française, accepte la demande en mariage enflammée de Christen, un irrésistible chef d''orchestre. Seul hic : elle est encore un tout petit peu? mariée !', '01:20:00', 1.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19545398', 'http://fr.web.img5.acsta.net/pictures/14/05/16/12/05/307596.jpg'),
(21, 173271, 'Le Conte de la princesse Kaguya', '2014-06-25', '<strong></strong>Adaptation d''un conte populaire dans lequel une princesse est découverte, alors qu''elle est bébé, dans une tige de bambou.', '<strong></strong>Adaptation d''un conte populaire dans lequel une princesse est découverte, alors qu''elle est bébé, dans une tige de bambou.', '02:17:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19545291', 'http://fr.web.img6.acsta.net/pictures/14/04/25/12/27/122290.jpg'),
(22, 214763, 'Transcendance', '2014-06-25', 'Dans un futur proche, un groupe de scientifiques tente de concevoir le premier ordinateur doté d''une conscience et capable réfléchir de manière autonome. Ils doivent faire face aux attaques de terroristes anti-technologie qui voient dans ce projet une menace pour l''espèce humaine.', 'Dans un futur proche, un groupe de scientifiques tente de concevoir le premier ordinateur doté d''une conscience et capable réfléchir de manière autonome. Ils doivent faire face aux attaques de terroristes anti-technologie qui voient dans ce projet une menace pour l''espèce humaine.', '01:53:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19545149', 'http://fr.web.img1.acsta.net/pictures/14/05/05/15/38/543364.jpg'),
(23, 201568, 'Jersey Boys', '2014-06-18', 'Quatre garçons du New Jersey, issus d''un milieu modeste, montent le groupe "The Four Seasons" qui deviendra mythique dans les années 60. Leurs épreuves et leurs triomphes sont ponctués par les tubes emblématiques de toute une génération qui sont repris aujourd''hui par les fans de la comédie musicale?', 'Quatre garçons du New Jersey, issus d''un milieu modeste, montent le groupe "The Four Seasons" qui deviendra mythique dans les années 60. Leurs épreuves et leurs triomphes sont ponctués par les tubes emblématiques de toute une génération qui sont repris aujourd''hui par les fans de la comédie musicale?', '02:14:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19544803', 'http://fr.web.img6.acsta.net/pictures/14/05/26/16/30/147796.jpg'),
(24, 215685, 'Triple alliance', '2014-06-18', 'Carly découvre que son nouveau petit ami Marc est un imposteur, lorsqu''elle rencontre accidentellement sa femme, Kate. Carly va se prendre d''affection pour elle, et leur improbable amitié va se renforcer encore un peu plus lorsqu''elles réalisent que Marc les trompe toutes les deux avec une autre femme, Amber. <br/><br/>', 'Carly découvre que son nouveau petit ami Marc est un imposteur, lorsqu''elle rencontre accidentellement sa femme, Kate. Carly va se prendre d''affection pour elle, et leur improbable amitié va se renforcer encore un peu plus lorsqu''elles réalisent que Marc les trompe toutes les deux avec une autre femme, Amber. <br/><br/>', '01:49:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543490', 'http://fr.web.img1.acsta.net/pictures/14/04/30/14/38/201479.jpg'),
(25, 195432, 'The Two Faces of January', '2014-06-18', '1962. Un couple d''américains très élégants, le charismatique Chester MacFarland et sa jeune épouse Colette viennent d''arriver à Athènes. A l''Acropole ils font la rencontre de Rydal, un jeune guide touristique, américain mais parlant grec, arnaqueur de touristes à l''occasion.', '1962. Un couple d''américains très élégants, le charismatique Chester MacFarland et sa jeune épouse Colette viennent d''arriver à Athènes. A l''Acropole ils font la rencontre de Rydal, un jeune guide touristique, américain mais parlant grec, arnaqueur de touristes à l''occasion.', '01:37:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542540', 'http://fr.web.img2.acsta.net/pictures/14/02/12/10/48/344396.jpg'),
(26, 213225, 'La Ritournelle', '2014-06-11', 'Brigitte et Xavier sont éleveurs bovins en Normandie. Elle est rêveuse, la tête dans les étoiles. Lui, les pieds ancrés dans la terre, vit surtout pour son métier. Avec le départ des enfants, la routine de leur couple pèse de plus en plus à Brigitte.', 'Brigitte et Xavier sont éleveurs bovins en Normandie. Elle est rêveuse, la tête dans les étoiles. Lui, les pieds ancrés dans la terre, vit surtout pour son métier. Avec le départ des enfants, la routine de leur couple pèse de plus en plus à Brigitte.', '01:38:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19545189', 'http://fr.web.img5.acsta.net/pictures/14/05/05/17/17/130107.jpg'),
(27, 223474, 'Palo Alto', '2014-06-11', 'Piégés dans le confort de leur banlieue chic, Teddy, April, Fred et Emily, adolescents livrés à eux-mêmes, cherchent leur place dans le monde. Ils ont soif de sensations fortes et testent leurs limites. L''alcool, les drogues et le sexe trompent leur ennui', 'Piégés dans le confort de leur banlieue chic, Teddy, April, Fred et Emily, adolescents livrés à eux-mêmes, cherchent leur place dans le monde. Ils ont soif de sensations fortes et testent leurs limites. L''alcool, les drogues et le sexe trompent leur ennui', '01:40:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543933', 'http://fr.web.img2.acsta.net/pictures/14/05/13/12/40/304237.jpg'),
(28, 197317, 'Les Voies du destin', '2014-06-11', 'Le lieutenant écossais Eric Lomax, a été fait prisonnier par les Japonais à Singapour durant la Seconde Guerre mondiale et envoyé dans un camp en Thaïlande. Là-bas, il a été forcé de contribuer à la construction du fameux pont sur la rivière Kwaï.', 'Le lieutenant écossais Eric Lomax, a été fait prisonnier par les Japonais à Singapour durant la Seconde Guerre mondiale et envoyé dans un camp en Thaïlande. Là-bas, il a été forcé de contribuer à la construction du fameux pont sur la rivière Kwaï.', '01:48:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537802', 'http://fr.web.img4.acsta.net/pictures/14/04/16/11/04/553553.jpg'),
(29, 227394, 'Cupcakes', '2014-06-11', 'A Tel-Aviv, une bande d''amis décide de composer une chanson pour l''anniversaire de l''une d''entre eux. Amusé par le résultat, Ofer décide de la soumettre au comité de sélection d''un concours international dont il est fan. Contre toute attente, leur composition est choisie et le groupe est invité à l''interpréter lors de la compétition télévisuelle.', 'A Tel-Aviv, une bande d''amis décide de composer une chanson pour l''anniversaire de l''une d''entre eux. Amusé par le résultat, Ofer décide de la soumettre au comité de sélection d''un concours international dont il est fan. Contre toute attente, leur composition est choisie et le groupe est invité à l''interpréter lors de la compétition télévisuelle.', '01:30:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19545110', 'http://fr.web.img4.acsta.net/pictures/14/06/06/10/47/281107.jpg'),
