(32, 185030, 'Edge Of Tomorrow', '2014-06-04', 'Dans un futur proche, des hordes d''extraterrestres extrêmement organisés, appelés les Mimics, ont livré une bataille acharnée contre la Terre, réduisant les grandes villes en cendres et causant la mort de millions d''êtres humains.', 'Dans un futur proche, des hordes d''extraterrestres extrêmement organisés, appelés les Mimics, ont livré une bataille acharnée contre la Terre, réduisant les grandes villes en cendres et causant la mort de millions d''êtres humains.', '01:53:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540735', 'http://fr.web.img5.acsta.net/pictures/14/05/23/17/03/300170.jpg'),
(33, 210255, 'Swim Little Fish Swim', '2014-06-04', 'Dans son petit appartement new-yorkais où il vit avec sa femme, Leeward, musicien talentueux et atypique, compose des morceaux à l''aide de jouets de sa fille de trois ans, Rainbow. Lilas, jeune vidéaste, traîne sa valise de squats d''artistes underground en galeries branchées...<br/><br/>', 'Dans son petit appartement new-yorkais où il vit avec sa femme, Leeward, musicien talentueux et atypique, compose des morceaux à l''aide de jouets de sa fille de trois ans, Rainbow. Lilas, jeune vidéaste, traîne sa valise de squats d''artistes underground en galeries branchées...<br/><br/>', '01:40:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543929', 'http://fr.web.img5.acsta.net/pictures/14/05/09/14/15/435124.jpg'),
(34, 221658, 'Les Poings contre les murs', '2014-06-04', 'Eric est un jeune délinquant violent prématurément jeté dans le monde sinistre d''une prison pour adultes. Alors qu''il lutte pour s''affirmer face aux surveillants et aux autres détenus, il doit également se mesurer à son propre père, Nev, un homme qui a passé la majeure partie de sa vie derrière les barreaux.', 'Eric est un jeune délinquant violent prématurément jeté dans le monde sinistre d''une prison pour adultes. Alors qu''il lutte pour s''affirmer face aux surveillants et aux autres détenus, il doit également se mesurer à son propre père, Nev, un homme qui a passé la majeure partie de sa vie derrière les barreaux.', '01:45:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543928', 'http://fr.web.img4.acsta.net/pictures/14/05/02/14/59/468986.jpg'),
(35, 227196, 'La Mante religieuse', '2014-06-04', 'Jézabel, jeune femme séductrice, libre et rebelle a soif de tout vivre à l''extrême, jusqu''à toucher le fond. Elle refuse de croire en l''homme et surtout en elle-même. Véritable Marie-Madeleine des temps modernes, elle cache sa fragilité et sa peur d''aimer en repoussant toujours plus loin les limites de la transgression. Jusqu''au jour où son chemin croise celui de David, un jeune prêtre?', 'Jézabel, jeune femme séductrice, libre et rebelle a soif de tout vivre à l''extrême, jusqu''à toucher le fond. Elle refuse de croire en l''homme et surtout en elle-même. Véritable Marie-Madeleine des temps modernes, elle cache sa fragilité et sa peur d''aimer en repoussant toujours plus loin les limites de la transgression. Jusqu''au jour où son chemin croise celui de David, un jeune prêtre?', '01:28:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543051', 'http://fr.web.img1.acsta.net/pictures/14/02/18/12/12/027581.jpg'),
(36, 201429, 'Maléfique', '2014-05-28', 'Maléfique est une belle jeune femme au coeur pur qui mène une  vie idyllique au sein d''une paisible forêt dans un royaume où règnent le bonheur et l''harmonie. Un jour, une armée d''envahisseurs menace les frontières du pays et Maléfique, n''écoutant que son courage, s''élève en féroce protectrice de cette terre.', 'Maléfique est une belle jeune femme au coeur pur qui mène une  vie idyllique au sein d''une paisible forêt dans un royaume où règnent le bonheur et l''harmonie. Un jour, une armée d''envahisseurs menace les frontières du pays et Maléfique, n''écoutant que son courage, s''élève en féroce protectrice de cette terre.', '01:37:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541828', 'http://fr.web.img3.acsta.net/pictures/14/04/03/12/56/160545.jpg'),
(37, 222590, 'Le Vieux qui ne voulait pas fêter son anniversaire', '2014-05-28', 'Le jour de son 100ème anniversaire, un homme s''échappe de sa maison de retraite pour une cavale rocambolesque, certain qu''il n''est pas trop tard pour tout recommencer à zéro. Débute alors une aventure inattendue et hilarante...', 'Le jour de son 100ème anniversaire, un homme s''échappe de sa maison de retraite pour une cavale rocambolesque, certain qu''il n''est pas trop tard pour tout recommencer à zéro. Débute alors une aventure inattendue et hilarante...', '01:54:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19544833', 'http://fr.web.img6.acsta.net/pictures/14/03/21/10/02/069474.jpg'),
