(40, 213464, 'The Homesman', '2014-05-18', 'En 1854, trois femmes ayant perdu la raison sont confiées à Mary Bee Cuddy, une pionnière forte et indépendante originaire du Nebraska. Sur sa route vers l''Iowa, où ces femmes pourront trouver refuge, elle croise le chemin de George Briggs, un rustre vagabond qu''elle sauve d''une mort imminente.', 'En 1854, trois femmes ayant perdu la raison sont confiées à Mary Bee Cuddy, une pionnière forte et indépendante originaire du Nebraska. Sur sa route vers l''Iowa, où ces femmes pourront trouver refuge, elle croise le chemin de George Briggs, un rustre vagabond qu''elle sauve d''une mort imminente.', '02:03:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19544682', 'http://fr.web.img6.acsta.net/pictures/14/04/23/15/55/106160.jpg'),
