(42, 215447, 'Maps To The Stars', '2014-05-21', 'A Hollywood, la ville des rêves, se télescopent les étoiles : Benjie, 13 ans et déjà star; son père, Sanford Weiss, auteur à succès et coach des célébrités; sa cliente, la belle Havana Segrand, qu''il aide  à se réaliser en tant que femme et actrice.', 'A Hollywood, la ville des rêves, se télescopent les étoiles : Benjie, 13 ans et déjà star; son père, Sanford Weiss, auteur à succès et coach des célébrités; sa cliente, la belle Havana Segrand, qu''il aide  à se réaliser en tant que femme et actrice.', '01:51:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19544700', 'http://fr.web.img1.acsta.net/pictures/15/01/09/12/18/175493.jpg'),
