(45, 186124, 'Cristeros', '2014-05-14', 'En 1926, un soulèvement populaire secoue le Mexique suite aux lois du président Callès, qui interdisent toutes pratiques religieuses dans l''ensemble du pays. Des hommes et des femmes de tous horizons, les Cristeros, vont alors risquer leur vie pour défendre leur liberté et lutter contre les persécutions...', 'En 1926, un soulèvement populaire secoue le Mexique suite aux lois du président Callès, qui interdisent toutes pratiques religieuses dans l''ensemble du pays. Des hommes et des femmes de tous horizons, les Cristeros, vont alors risquer leur vie pour défendre leur liberté et lutter contre les persécutions...', '02:23:00', 0, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543395', 'http://fr.web.img4.acsta.net/pictures/14/03/04/11/43/302064.jpg'),
(46, 181402, 'Charlie Countryman', '2014-05-14', 'À la mort de sa mère, Charlie Countryman décide de tout quitter et d''entamer un voyage en Europe de l''est. À Budapest il tombe follement amoureux de Gabi, mais la jeune femme est promise à un redoutable chef de gang?', 'À la mort de sa mère, Charlie Countryman décide de tout quitter et d''entamer un voyage en Europe de l''est. À Budapest il tombe follement amoureux de Gabi, mais la jeune femme est promise à un redoutable chef de gang?', '01:48:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19544811', 'http://fr.web.img2.acsta.net/pictures/14/03/04/15/29/509258.jpg'),
(47, 222402, 'Au Nom Du Fils', '2014-05-07', 'Quand une femme de foi, animatrice d''une tribune sur une station de radio catholique, dévouée à sa famille et a la souffrance du monde, est confrontée à la pédophilie des prêtres et au suicide de son fils, la croyance fait place à la rage et à la violence quand le silence de l''église crée le chaos et la désespérance de ses brebis.', 'Quand une femme de foi, animatrice d''une tribune sur une station de radio catholique, dévouée à sa famille et a la souffrance du monde, est confrontée à la pédophilie des prêtres et au suicide de son fils, la croyance fait place à la rage et à la violence quand le silence de l''église crée le chaos et la désespérance de ses brebis.', '01:23:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19544623', 'http://fr.web.img2.acsta.net/pictures/14/03/17/16/12/597065.jpg'),
(48, 198701, 'Arthur Newman', '2014-05-07', 'Wallace Avery ne supporte plus sa vie. Divorcé et insatisfait en amour, il a même laissé la distance s''installer entre lui et son fils. Il opte alors pour une solution radicale : il met en scène sa propre mort, s''achète une nouvelle identité : Arthur Newman...', 'Wallace Avery ne supporte plus sa vie. Divorcé et insatisfait en amour, il a même laissé la distance s''installer entre lui et son fils. Il opte alors pour une solution radicale : il met en scène sa propre mort, s''achète une nouvelle identité : Arthur Newman...', '01:41:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542521', 'http://fr.web.img4.acsta.net/pictures/14/02/07/18/00/387010.jpg'),
(49, 203583, 'La Voie de l''ennemi', '2014-05-07', 'Garnett, ancien membre d''un gang du Nouveau Mexique vient de passer 18 ans en prison pour meurtre. Avec l''aide de l''agent, Emily Smith, policière chargée de sa mise à l''épreuve, il tente de se réinsérer et de reprendre une vie normale.', 'Garnett, ancien membre d''un gang du Nouveau Mexique vient de passer 18 ans en prison pour meurtre. Avec l''aide de l''agent, Emily Smith, policière chargée de sa mise à l''épreuve, il tente de se réinsérer et de reprendre une vie normale.', '02:00:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19544237', 'http://fr.web.img6.acsta.net/pictures/14/03/28/18/26/032994.jpg'),
(50, 221488, 'Libre et assoupi', '2014-05-07', 'Sébastien n''a qu''une ambition dans la vie : ne rien faire. Son horizon, c''est son canapé. Sa vie il ne veut pas la vivre mais la contempler. Mais aujourd''hui, si tu ne fais rien... Tu n''es rien.', 'Sébastien n''a qu''une ambition dans la vie : ne rien faire. Son horizon, c''est son canapé. Sa vie il ne veut pas la vivre mais la contempler. Mais aujourd''hui, si tu ne fais rien... Tu n''es rien.', '01:33:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19544830', 'http://fr.web.img2.acsta.net/pictures/14/02/26/17/13/523960.jpg'),
(51, 208628, 'Le Promeneur d''oiseau', '2014-05-07', 'Afin de tenir la promesse faite à sa femme, Zhigen décide de retourner dans son village natal pour y libérer son oiseau, unique compagnon de ses vieilles années. Il fera le voyage avec Renxing, sa petite-fille, jeune citadine gâtée, contrainte de partir avec lui.', 'Afin de tenir la promesse faite à sa femme, Zhigen décide de retourner dans son village natal pour y libérer son oiseau, unique compagnon de ses vieilles années. Il fera le voyage avec Renxing, sa petite-fille, jeune citadine gâtée, contrainte de partir avec lui.', '01:40:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543217', 'http://fr.web.img6.acsta.net/pictures/14/03/27/14/59/109541.jpg'),
(52, 222422, 'Barbecue', '2014-04-30', 'Pour ses 50 ans, Antoine a reçu un cadeau original : un infarctus. A partir de maintenant, il va devoir "faire attention". Or, Antoine a passé sa vie entière à faire attention : attention à sa santé, à ce qu''il mangeait, attention à sa famille, à accepter les travers de ses amis, et à avaler de trop nombreuses couleuvres?', 'Pour ses 50 ans, Antoine a reçu un cadeau original : un infarctus. A partir de maintenant, il va devoir "faire attention". Or, Antoine a passé sa vie entière à faire attention : attention à sa santé, à ce qu''il mangeait, attention à sa famille, à accepter les travers de ses amis, et à avaler de trop nombreuses couleuvres?', '01:38:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19544584', 'http://fr.web.img3.acsta.net/pictures/14/03/07/11/35/320689.jpg'),
(53, 208367, 'Le Dernier Diamant', '2014-04-30', 'Simon, un cambrioleur en liberté surveillée, accepte de monter sur le plus gros coup de sa vie: Le vol du "Florentin", un diamant mythique mis en vente aux enchères par ses propriétaires. Pour réussir, il devra approcher Julia, l''experte diamantaire, pour qui la vente constitue un enjeu personnel et familial considérable.', 'Simon, un cambrioleur en liberté surveillée, accepte de monter sur le plus gros coup de sa vie: Le vol du "Florentin", un diamant mythique mis en vente aux enchères par ses propriétaires. Pour réussir, il devra approcher Julia, l''experte diamantaire, pour qui la vente constitue un enjeu personnel et familial considérable.', '01:49:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543714', 'http://fr.web.img2.acsta.net/pictures/14/03/07/10/19/300380.jpg'),
(54, 214061, 'Ali a les yeux bleus', '2014-04-30', 'Nader, jeune romain d''origine égyptienne, tente de se rebeller contre les valeurs de sa famille. Tiraillé entre le poids de ses origines et son désir d''intégration, courageux et amoureux à l''instar du héros d''une fable contemporaine, Nader, livré à lui-même, va affronter la solitude et la peur, et devra se résigner à la perte d''une amitié pour affirmer sa propre identité.', 'Nader, jeune romain d''origine égyptienne, tente de se rebeller contre les valeurs de sa famille. Tiraillé entre le poids de ses origines et son désir d''intégration, courageux et amoureux à l''instar du héros d''une fable contemporaine, Nader, livré à lui-même, va affronter la solitude et la peur, et devra se résigner à la perte d''une amitié pour affirmer sa propre identité.', '01:39:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543188', 'http://fr.web.img2.acsta.net/pictures/14/03/28/18/43/333063.jpg'),
(55, 192186, 'The Amazing Spider-Man : le destin d''un Héros', '2014-04-30', 'Ce n''est un secret pour personne que le combat le plus rude de Spider-Man est celui qu''il mène contre lui-même en tentant de concilier la vie quotidienne de Peter Parker et les lourdes responsabilités de Spider-Man. Mais Peter Parker va se rendre compte qu''il fait face à un conflit de bien plus grande ampleur.', 'Ce n''est un secret pour personne que le combat le plus rude de Spider-Man est celui qu''il mène contre lui-même en tentant de concilier la vie quotidienne de Peter Parker et les lourdes responsabilités de Spider-Man. Mais Peter Parker va se rendre compte qu''il fait face à un conflit de bien plus grande ampleur.', '02:21:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543830', 'http://fr.web.img4.acsta.net/pictures/14/04/08/14/38/427284.jpg'),
(56, 221635, 'Girafada', '2014-04-23', 'Yacine est vétérinaire dans le dernier zoo de Palestine. Son fils Ziad, 10 ans, passe beaucoup de temps avec les animaux et a un lien particulier avec les deux girafes. Une nuit, après un raid aérien sur la ville, le mâle meurt.', 'Yacine est vétérinaire dans le dernier zoo de Palestine. Son fils Ziad, 10 ans, passe beaucoup de temps avec les animaux et a un lien particulier avec les deux girafes. Une nuit, après un raid aérien sur la ville, le mâle meurt.', '01:25:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541485', 'http://fr.web.img5.acsta.net/pictures/14/02/10/16/47/255809.jpg'),
(57, 219424, '96 Heures', '2014-04-23', 'Carré est le patron de la BRB (Brigade de Répression du Banditisme). 3 ans plus tôt, il a fait tomber un grand truand, Kancel. Aujourd''hui, à la faveur d''une extraction, Kancel kidnappe le flic. Il a 96 heures pour lui soutirer une seule information : savoir qui l''a balancé.', 'Carré est le patron de la BRB (Brigade de Répression du Banditisme). 3 ans plus tôt, il a fait tomber un grand truand, Kancel. Aujourd''hui, à la faveur d''une extraction, Kancel kidnappe le flic. Il a 96 heures pour lui soutirer une seule information : savoir qui l''a balancé.', '01:36:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19544331', 'http://fr.web.img1.acsta.net/pictures/14/01/09/18/26/473917.jpg'),
(58, 213893, 'Une Rencontre', '2014-04-23', 'Pierre est marié depuis 15 ans et père de famille. Toujours amoureux de sa femme et épanoui dans sa vie de famille, c''est un homme heureux.<br/> Un soir, il rencontre Elsa. Ils parlent, rient, se plaisent. Comme cela arrive parfois.', 'Pierre est marié depuis 15 ans et père de famille. Toujours amoureux de sa femme et épanoui dans sa vie de famille, c''est un homme heureux.<br/> Un soir, il rencontre Elsa. Ils parlent, rient, se plaisent. Comme cela arrive parfois.', '01:22:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543660', 'http://fr.web.img6.acsta.net/pictures/14/03/12/11/20/048773.jpg'),
(59, 221967, 'States of Grace', '2014-04-23', 'Sensible et déterminée, Grace est à la tête d''un foyer californien d''adolescents en difficulté. Dans son équipe de formateurs, tous aussi jeunes qu''elle, tout le monde n''a pas la même expérience mais, face aux problèmes des ados, la solidarité et le bon esprit sont de mise.', 'Sensible et déterminée, Grace est à la tête d''un foyer californien d''adolescents en difficulté. Dans son équipe de formateurs, tous aussi jeunes qu''elle, tout le monde n''a pas la même expérience mais, face aux problèmes des ados, la solidarité et le bon esprit sont de mise.', '01:41:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543893', 'http://fr.web.img3.acsta.net/pictures/14/03/19/15/44/124941.jpg'),
(60, 213859, 'Dans la cour', '2014-04-23', 'Antoine est musicien. A quarante ans, il décide brusquement de mettre fin à sa carrière. Après quelques jours d''errance, il se fait embaucher comme gardien d''immeuble. Jeune retraitée, Mathilde découvre une inquiétante fissure sur le mur de son salon...', 'Antoine est musicien. A quarante ans, il décide brusquement de mettre fin à sa carrière. Après quelques jours d''errance, il se fait embaucher comme gardien d''immeuble. Jeune retraitée, Mathilde découvre une inquiétante fissure sur le mur de son salon...', '01:37:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19544301', 'http://fr.web.img1.acsta.net/pictures/14/03/21/17/33/033857.jpg'),
(61, 222259, 'Qu''est-ce qu''on a fait au Bon Dieu?', '2014-04-16', 'Claude et Marie Verneuil, issus de la grande bourgeoisie catholique provinciale sont des parents plutôt "vieille France". Mais ils se sont toujours obligés à faire preuve d''ouverture d''esprit...<br/><br/><br/>', 'Claude et Marie Verneuil, issus de la grande bourgeoisie catholique provinciale sont des parents plutôt "vieille France". Mais ils se sont toujours obligés à faire preuve d''ouverture d''esprit...<br/><br/><br/>', '01:37:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542577', 'http://fr.web.img2.acsta.net/pictures/14/03/04/14/58/474265.jpg'),
(62, 222512, 'Babysitting', '2014-04-16', 'Faute de baby-sitter pour le week-end, Marc Schaudel confie son fils Remy à Franck, son employé, "un type sérieux" selon lui. Sauf que Franck a 30 ans ce soir et que Rémy est un sale gosse capricieux.', 'Faute de baby-sitter pour le week-end, Marc Schaudel confie son fils Remy à Franck, son employé, "un type sérieux" selon lui. Sauf que Franck a 30 ans ce soir et que Rémy est un sale gosse capricieux.', '01:24:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540809', 'http://fr.web.img1.acsta.net/pictures/14/01/22/09/59/509268.jpg'),
(63, 193147, 'Une Promesse', '2014-04-16', 'Allemagne, 1912. Un jeune diplômé, d''origine modeste, intègre le service administratif d''une usine de sidérurgie. Le patron, un homme sévère et âgé, apprécie son travail et lui confie bientôt un poste de secrétaire particulier.', 'Allemagne, 1912. Un jeune diplômé, d''origine modeste, intègre le service administratif d''une usine de sidérurgie. Le patron, un homme sévère et âgé, apprécie son travail et lui confie bientôt un poste de secrétaire particulier.', '01:38:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540808', 'http://fr.web.img6.acsta.net/pictures/13/12/19/10/23/234510.jpg'),
(64, 215942, 'The Best Offer', '2014-04-16', '<p style="">Un expert d''art et commissaire priseur de renom, adulé et redouté de tous, tombe amoureux d''une cliente atteinte d''un mal étrange. Il ne lui parle qu''au téléphone et tombe sous son charme quand il la voit pour la première fois?', '<p style="">Un expert d''art et commissaire priseur de renom, adulé et redouté de tous, tombe amoureux d''une cliente atteinte d''un mal étrange. Il ne lui parle qu''au téléphone et tombe sous son charme quand il la voit pour la première fois?', '02:11:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543064', 'http://fr.web.img6.acsta.net/pictures/14/03/07/11/24/214323.jpg'),
(65, 194659, 'African Safari 3D', '2014-04-16', '<span>Après Le Voyage Extraordinaire de Samy, le spécialiste de la 3D et réalisateur reconnu, Ben Stassen, nous transporte dans une expédition extraordinaire à travers l''Afrique. </span>', '<span>Après Le Voyage Extraordinaire de Samy, le spécialiste de la 3D et réalisateur reconnu, Ben Stassen, nous transporte dans une expédition extraordinaire à travers l''Afrique. </span>', '01:26:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542828', 'http://fr.web.img2.acsta.net/pictures/14/02/11/10/43/281639.jpg'),
(66, 195022, 'Divergente', '2014-04-09', 'Tris vit dans un monde post apocalyptique où la société est divisée en cinq clans (Audacieux, Erudits, Altruistes, Sincères, Fraternels). A 16 ans, elle doit choisir son appartenance pour le reste de sa vie. Cas rarissime, son test d''aptitudes n''est pas concluant ; elle est Divergente.', 'Tris vit dans un monde post apocalyptique où la société est divisée en cinq clans (Audacieux, Erudits, Altruistes, Sincères, Fraternels). A 16 ans, elle doit choisir son appartenance pour le reste de sa vie. Cas rarissime, son test d''aptitudes n''est pas concluant ; elle est Divergente.', '02:19:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543448', 'http://fr.web.img5.acsta.net/pictures/14/02/07/17/46/287879.jpg'),
(67, 204226, 'Apprenti Gigolo', '2014-04-09', 'Deux amis, l''un libraire, l''autre fleuriste, ont des problèmes d''argent. Le premier devient le mac du second. Ils feront le bonheur de leurs clientes.', 'Deux amis, l''un libraire, l''autre fleuriste, ont des problèmes d''argent. Le premier devient le mac du second. Ils feront le bonheur de leurs clientes.', '01:31:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542278', 'http://fr.web.img4.acsta.net/pictures/13/12/12/14/03/149022.jpg'),
(68, 177166, 'Les Yeux jaunes des crocodiles', '2014-04-09', 'Deux s?urs que tout oppose. Joséphine, 40 ans, historienne spécialisée dans le 12ème siècle, confrontée aux difficultés de la vie; et Iris, outrageusement belle, menant une vie de parisienne aisée et futile. Un soir, lors d''un diner mondain, Iris se vante d''écrire un roman.', 'Deux s?urs que tout oppose. Joséphine, 40 ans, historienne spécialisée dans le 12ème siècle, confrontée aux difficultés de la vie; et Iris, outrageusement belle, menant une vie de parisienne aisée et futile. Un soir, lors d''un diner mondain, Iris se vante d''écrire un roman.', '02:02:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542172', 'http://fr.web.img5.acsta.net/pictures/14/01/31/16/50/583089.jpg'),
(69, 194938, 'Noé', '2014-04-09', '<span>Noé est un homme promis à un destin exceptionnel alors qu''un déluge apocalyptique va détruire le monde. </span><span>La fin du monde? n''est que le commencement.</span>\r\n<span><span> </span></span>', '<span>Noé est un homme promis à un destin exceptionnel alors qu''un déluge apocalyptique va détruire le monde. </span><span>La fin du monde? n''est que le commencement.</span>\r\n<span><span> </span></span>', '02:18:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19539990', 'http://fr.web.img6.acsta.net/pictures/14/03/12/18/33/096867.jpg');
INSERT INTO `film` (`id`, `code`, `titre`, `date`, `synopsis`, `synopsisCourt`, `duree`, `note`, `trailer`, `affiche`) VALUES
(70, 206727, 'Rio 2', '2014-04-09', 'Blu a pris son envol et se sent désormais chez lui à Rio de Janeiro, aux côtés de Perla et de leurs trois enfants. Mais la vie de perroquet ne s''apprend pas en ville et Perla insiste pour que la famille s''installe dans la forêt amazonienne alors qu''ils découvrent que d''autres aras bleus y vivent.', 'Blu a pris son envol et se sent désormais chez lui à Rio de Janeiro, aux côtés de Perla et de leurs trois enfants. Mais la vie de perroquet ne s''apprend pas en ville et Perla insiste pour que la famille s''installe dans la forêt amazonienne alors qu''ils découvrent que d''autres aras bleus y vivent.', '01:42:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540317', 'http://fr.web.img3.acsta.net/pictures/13/12/09/12/44/212843.jpg'),
(71, 207787, 'Salaud, on t''aime', '2014-04-02', 'Un photographe de guerre et père absent, qui s''est plus occupé de son appareil photo que de ses 4 filles, coule des jours heureux dans les Alpes avec sa nouvelle compagne. Il va voir sa vie basculer le jour où son meilleur ami va tenter de le réconcilier avec sa famille en leur racontant un gros mensonge.', 'Un photographe de guerre et père absent, qui s''est plus occupé de son appareil photo que de ses 4 filles, coule des jours heureux dans les Alpes avec sa nouvelle compagne. Il va voir sa vie basculer le jour où son meilleur ami va tenter de le réconcilier avec sa famille en leur racontant un gros mensonge.', '02:04:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543203', 'http://fr.web.img5.acsta.net/pictures/14/03/04/11/47/354408.jpg'),
(72, 208812, 'La Braconne', '2014-04-02', 'Driss, pas vingt ans, vit de petits rackets et d''expédients. Il croise la route de Danny, voleur fatigué, qui arpente les zones commerciales au volant de sa vieille Merco. Sous la houlette de Danny, le jeune Driss, frimeur et naïf, fait ses classes et apprend quelques ficelles.', 'Driss, pas vingt ans, vit de petits rackets et d''expédients. Il croise la route de Danny, voleur fatigué, qui arpente les zones commerciales au volant de sa vieille Merco. Sous la houlette de Danny, le jeune Driss, frimeur et naïf, fait ses classes et apprend quelques ficelles.', '01:22:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543713', 'http://fr.web.img3.acsta.net/pictures/14/03/10/10/31/053571.jpg'),
(73, 215769, 'La Crème de la Crème', '2014-04-02', 'Dan, Kelliah et Louis sont trois étudiants d''une des meilleures écoles de commerce de France. Ils sont formés pour devenir l''élite de demain et sont bien décidés à passer rapidement de la théorie à la pratique.', 'Dan, Kelliah et Louis sont trois étudiants d''une des meilleures écoles de commerce de France. Ils sont formés pour devenir l''élite de demain et sont bien décidés à passer rapidement de la théorie à la pratique.', '01:30:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541822', 'http://fr.web.img6.acsta.net/pictures/14/01/24/13/08/540023.jpg'),
(74, 189640, 'Nebraska', '2014-04-02', 'Un vieil homme, persuadé qu''il a gagné le gros lot à un improbable tirage au sort par correspondance, cherche à rejoindre le Nebraska pour y recevoir son gain, à pied puisqu''il ne peut plus conduire. ', 'Un vieil homme, persuadé qu''il a gagné le gros lot à un improbable tirage au sort par correspondance, cherche à rejoindre le Nebraska pour y recevoir son gain, à pied puisqu''il ne peut plus conduire. ', '01:55:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538023', 'http://fr.web.img2.acsta.net/pictures/14/03/03/10/19/240408.jpg'),
(75, 141505, '47 Ronin', '2014-04-02', 'Un perfide seigneur de guerre ayant tué leur maître et banni leur tribu, 47 samouraïs errants jurent de se venger et de restaurer l''honneur de leurs compatriotes. Arrachés à leurs foyers et perdus aux quatre coins des terres connues, cette poignée de rebelles se voit contrainte de recourir à l''aide de Kai...', 'Un perfide seigneur de guerre ayant tué leur maître et banni leur tribu, 47 samouraïs errants jurent de se venger et de restaurer l''honneur de leurs compatriotes. Arrachés à leurs foyers et perdus aux quatre coins des terres connues, cette poignée de rebelles se voit contrainte de recourir à l''aide de Kai...', '01:59:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19539375', 'http://fr.web.img6.acsta.net/pictures/210/535/21053501_2013102818193882.jpg'),
(76, 223008, 'All about Albert', '2014-03-26', '<p style="text-align: justify;">Julia et Albert, tous les deux divorcés, font connaissance lors d''une soirée entre amis. Ils ne tardent pas à devenir amants. Tout va pour le mieux jusqu''au jour où Julia sympathise avec Marianne, qu''elle ignore être l''ex-femme d''Albert.', '<p style="text-align: justify;">Julia et Albert, tous les deux divorcés, font connaissance lors d''une soirée entre amis. Ils ne tardent pas à devenir amants. Tout va pour le mieux jusqu''au jour où Julia sympathise avec Marianne, qu''elle ignore être l''ex-femme d''Albert.', '01:33:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536901', 'http://fr.web.img6.acsta.net/pictures/210/530/21053020_20131025171524518.jpg'),
(77, 207625, 'Aimer, boire et chanter', '2014-03-26', 'Dans la campagne anglaise du Yorkshire, la vie de trois couples est bouleversée pendant quelques mois, du printemps à l''automne, par le comportement énigmatique de leur ami George Riley.', 'Dans la campagne anglaise du Yorkshire, la vie de trois couples est bouleversée pendant quelques mois, du printemps à l''automne, par le comportement énigmatique de leur ami George Riley.', '01:48:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542483', 'http://fr.web.img1.acsta.net/pictures/14/01/29/12/09/469027.jpg'),
(78, 193113, 'Captain America, le soldat de l''hiver', '2014-03-26', 'Après les événements cataclysmiques de New York, Steve Rogers aka Captain America vit tranquillement à Washington, D.C. et essaye de s''adapter au monde moderne. Mais quand un collègue du S.H.I.E.L.D. est attaqué, Steve se retrouve impliqué dans un réseau d''intrigues...', 'Après les événements cataclysmiques de New York, Steve Rogers aka Captain America vit tranquillement à Washington, D.C. et essaye de s''adapter au monde moderne. Mais quand un collègue du S.H.I.E.L.D. est attaqué, Steve se retrouve impliqué dans un réseau d''intrigues...', '02:08:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19539268', 'http://fr.web.img1.acsta.net/pictures/14/01/31/17/06/486036.jpg'),
(79, 209297, 'De toutes nos forces', '2014-03-26', 'Comme tous les adolescents, Julien rêve d''aventures et de sensations fortes. Mais lorsqu''on vit dans un fauteuil roulant, ces rêves-là sont difficilement réalisables. Pour y parvenir, il met au défi son père de concourir avec lui au triathlon « Ironman » de Nice.', 'Comme tous les adolescents, Julien rêve d''aventures et de sensations fortes. Mais lorsqu''on vit dans un fauteuil roulant, ces rêves-là sont difficilement réalisables. Pour y parvenir, il met au défi son père de concourir avec lui au triathlon « Ironman » de Nice.', '01:29:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542166', 'http://fr.web.img4.acsta.net/pictures/13/12/18/15/02/564759.jpg'),
(80, 224951, 'Les Gazelles', '2014-03-26', '<p style="">Marie et Eric, trentenaires en couple depuis le lycée, signent l''achat de leur premier appartement quand Marie est saisie d''un doute vertigineux. Sa rencontre avec un beau brun ténébreux va précipiter sa décision : elle quitte Eric pour plonger dans le grand bain...', '<p style="">Marie et Eric, trentenaires en couple depuis le lycée, signent l''achat de leur premier appartement quand Marie est saisie d''un doute vertigineux. Sa rencontre avec un beau brun ténébreux va précipiter sa décision : elle quitte Eric pour plonger dans le grand bain...', '01:39:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542459', 'http://fr.web.img2.acsta.net/pictures/14/02/13/11/25/435431.jpg'),
(81, 206103, 'Closed Circuit', '2014-03-26', 'Martin et Claudia, deux avocats et anciens amants, se retrouvent lors d''un procès où ils doivent défendre un terroriste international. Le danger les guette alors.', 'Martin et Claudia, deux avocats et anciens amants, se retrouvent lors d''un procès où ils doivent défendre un terroriste international. Le danger les guette alors.', '01:36:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536850', 'http://fr.web.img2.acsta.net/pictures/14/02/21/15/14/212356.jpg'),
(82, 219362, 'Valse pour Monica', '2014-03-19', 'Au début des années 60, Monica, une jeune suédoise déterminée à devenir une icône du jazz, se lance dans la carrière de ses rêves qui la mènera de Stockholm à New York.', 'Au début des années 60, Monica, une jeune suédoise déterminée à devenir une icône du jazz, se lance dans la carrière de ses rêves qui la mènera de Stockholm à New York.', '01:51:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19539137', 'http://fr.web.img5.acsta.net/pictures/13/12/02/17/24/156941.jpg'),
(83, 206675, 'Wrong Cops', '2014-03-19', '<p style=""><span style="line-height: 20px; color: #333333; font-family: Tahoma,Arial,Verdana;">Los Angeles 2014. Duke, un flic pourri et mélomane, deale </span><span style="line-height: 20px; color: #333333; font-family: Tahoma,Arial,Verdana;">de l''herbe et terrorise les passants. Ses collègues au commissariat: un obsédé sexuel, une flic maître chanteur, un chercheur de trésor au passé douteux, un borgne difforme se rêvant star de techno?</span>', '<p style=""><span style="line-height: 20px; color: #333333; font-family: Tahoma,Arial,Verdana;">Los Angeles 2014. Duke, un flic pourri et mélomane, deale </span><span style="line-height: 20px; color: #333333; font-family: Tahoma,Arial,Verdana;">de l''herbe et terrorise les passants. Ses collègues au commissariat: un obsédé sexuel, une flic maître chanteur, un chercheur de trésor au passé douteux, un borgne difforme se rêvant star de techno?</span>', '01:22:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542905', 'http://fr.web.img4.acsta.net/pictures/14/03/10/13/05/207672.jpg'),
(84, 222096, 'Situation amoureuse : C''est compliqué', '2014-03-19', 'À trente ans, Ben est sur le point d''épouser Juliette. Sa petite vie tranquille et sans danger va basculer lorsqu''il retombe sur la personne qu''il a secrètement le plus envie de revoir : Vanessa, la bombe du lycée qui ne l''avait jamais regardé. Elle est de retour à Paris et ne connaît, aujourd''hui, que lui?', 'À trente ans, Ben est sur le point d''épouser Juliette. Sa petite vie tranquille et sans danger va basculer lorsqu''il retombe sur la personne qu''il a secrètement le plus envie de revoir : Vanessa, la bombe du lycée qui ne l''avait jamais regardé. Elle est de retour à Paris et ne connaît, aujourd''hui, que lui?', '01:40:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19543061', 'http://fr.web.img3.acsta.net/pictures/14/02/04/12/26/509803.jpg'),
(85, 206799, 'Her', '2014-03-19', '<p style="text-align: justify;">Los Angeles, dans un futur proche. Theodore Twombly, un homme sensible au caractère complexe, est inconsolable suite à une rupture difficile. Il fait alors l''acquisition d''un programme informatique ultramoderne, capable de s''adapter à la personnalité de chaque utilisateur.', '<p style="text-align: justify;">Los Angeles, dans un futur proche. Theodore Twombly, un homme sensible au caractère complexe, est inconsolable suite à une rupture difficile. Il fait alors l''acquisition d''un programme informatique ultramoderne, capable de s''adapter à la personnalité de chaque utilisateur.', '02:06:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541325', 'http://fr.web.img5.acsta.net/pictures/14/03/10/10/26/014107.jpg'),
(86, 201434, 'Monuments Men', '2014-03-12', '<p style=""><span>Venus de 13 pays différents, les Monuments Men se lancent dans la plus grande chasse au trésor du XXème siècle : retrouver les ?uvres d''art volées par les nazis durant la Seconde Guerre mondiale.</span>', '<p style=""><span>Venus de 13 pays différents, les Monuments Men se lancent dans la plus grande chasse au trésor du XXème siècle : retrouver les ?uvres d''art volées par les nazis durant la Seconde Guerre mondiale.</span>', '01:58:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540445', 'http://fr.web.img2.acsta.net/pictures/14/01/15/12/03/470425.jpg'),
(87, 218634, 'Fiston', '2014-03-12', 'Depuis qu''il a 7 ans, Alex n''a qu''une obsession : séduire Sandra Valenti, la plus jolie fille d''Aix en Provence et, à ses yeux, la plus jolie fille du monde. Aujourd''hui, il lui faut un plan infaillible pour pouvoir enfin l''aborder.', 'Depuis qu''il a 7 ans, Alex n''a qu''une obsession : séduire Sandra Valenti, la plus jolie fille d''Aix en Provence et, à ses yeux, la plus jolie fille du monde. Aujourd''hui, il lui faut un plan infaillible pour pouvoir enfin l''aborder.', '01:28:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542205', 'http://fr.web.img6.acsta.net/pictures/14/03/18/11/27/014254.jpg'),
(88, 199292, 'Un amour d''hiver', '2014-03-12', '<p style="">New York, au tout début du XXème siècle. Passé maître dans l''art du cambriolage, Peter Lake n''aurait jamais cru qu''un jour son c?ur lui serait ravi par la charmante Beverly Penn. Mais leur idylle est maudite : tandis que Beverly est atteinte de tuberculose, Peter a été condamné à une mort bien plus violente par son ancien mentor, le diabolique Pearly Soames.', '<p style="">New York, au tout début du XXème siècle. Passé maître dans l''art du cambriolage, Peter Lake n''aurait jamais cru qu''un jour son c?ur lui serait ravi par la charmante Beverly Penn. Mais leur idylle est maudite : tandis que Beverly est atteinte de tuberculose, Peter a été condamné à une mort bien plus violente par son ancien mentor, le diabolique Pearly Soames.', '01:58:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542229', 'http://fr.web.img6.acsta.net/pictures/14/01/14/15/28/269516.jpg'),
(89, 200881, 'How I Live Now (Maintenant c''est ma vie)', '2014-03-12', '<p style="text-align: justify;">Daisy, une adolescente new-yorkaise, passe pour la première fois ses vacances chez ses cousins dans la campagne anglaise. Rires, jeux, premiers émois? Une parenthèse enchantée qui va brutalement se refermer quand éclate sur cette lande de rêve la Troisième Guerre Mondiale?', '<p style="text-align: justify;">Daisy, une adolescente new-yorkaise, passe pour la première fois ses vacances chez ses cousins dans la campagne anglaise. Rires, jeux, premiers émois? Une parenthèse enchantée qui va brutalement se refermer quand éclate sur cette lande de rêve la Troisième Guerre Mondiale?', '01:41:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536982', 'http://fr.web.img6.acsta.net/pictures/14/01/30/16/24/217516.jpg'),
(90, 204100, 'Dans l''ombre de Mary - La promesse de Walt Disney', '2014-03-05', '<p style="text-align: justify;">Inspiré de faits réels, le film raconte l''histoire extraordinaire et méconnue de la création du film Mary Poppins. C''est aussi l''histoire de la relation houleuse qu''entretinrent le légendaire Walt Disney et l''auteure P.L. Travers, une relation si tendue que le film faillit bien ne jamais voir le jour?', '<p style="text-align: justify;">Inspiré de faits réels, le film raconte l''histoire extraordinaire et méconnue de la création du film Mary Poppins. C''est aussi l''histoire de la relation houleuse qu''entretinrent le légendaire Walt Disney et l''auteure P.L. Travers, une relation si tendue que le film faillit bien ne jamais voir le jour?', '02:05:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540088', 'http://fr.web.img4.acsta.net/pictures/13/12/30/16/21/252469.jpg'),
(91, 195120, 'Diplomatie', '2014-03-05', '<p style="text-align: justify;">La nuit du 24 au 25 août 1944. Le sort de Paris est entre les mains du Général Von Choltitz, Gouverneur du Grand Paris, qui se prépare, sur ordre d''Hitler, à faire sauter la capitale. Issu d''une longue lignée de militaires prussiens, le général n''a jamais eu d''hésitation quand il fallait obéir aux ordres.', '<p style="text-align: justify;">La nuit du 24 au 25 août 1944. Le sort de Paris est entre les mains du Général Von Choltitz, Gouverneur du Grand Paris, qui se prépare, sur ordre d''Hitler, à faire sauter la capitale. Issu d''une longue lignée de militaires prussiens, le général n''a jamais eu d''hésitation quand il fallait obéir aux ordres.', '01:24:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542374', 'http://fr.web.img4.acsta.net/pictures/14/01/24/16/11/590379.jpg'),
(92, 181022, '300 : La naissance d''un Empire', '2014-03-05', '<span>Le général grec Thémistocle tente de mobiliser toutes les forces de la Grèce pour mener une bataille qui changera à jamais le cours de la guerre. </span><span>Il doit désormais affronter les redoutables Perses, emmenés par Xerxès, homme devenu dieu, et Artémise, à la tête de la marine perse?</span>', '<span>Le général grec Thémistocle tente de mobiliser toutes les forces de la Grèce pour mener une bataille qui changera à jamais le cours de la guerre. </span><span>Il doit désormais affronter les redoutables Perses, emmenés par Xerxès, homme devenu dieu, et Artémise, à la tête de la marine perse?</span>', '01:42:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540572', 'http://fr.web.img5.acsta.net/pictures/14/01/24/17/51/046973.jpg'),
(93, 222338, 'Un week-end à Paris', '2014-03-05', 'Un couple anglais vient à Paris fêter leurs trente ans de mariage. Ils redécouvrent la ville, mais aussi l''humour, la fantaisie, et le plaisir d''être ensemble.', 'Un couple anglais vient à Paris fêter leurs trente ans de mariage. Ils redécouvrent la ville, mais aussi l''humour, la fantaisie, et le plaisir d''être ensemble.', '01:33:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538446', 'http://fr.web.img2.acsta.net/pictures/210/387/21038781_20130911124359576.jpg'),
(94, 212120, 'Supercondriaque', '2014-02-26', 'Romain Faubert est un homme seul qui, à bientôt 40 ans, n''a ni femme ni enfant. Le métier qu''il exerce, photographe pour dictionnaire médical en ligne, n''arrange rien à une hypocondrie maladive qui guide son style de vie depuis bien trop longtemps et fait de lui un peureux névropathe.', 'Romain Faubert est un homme seul qui, à bientôt 40 ans, n''a ni femme ni enfant. Le métier qu''il exerce, photographe pour dictionnaire médical en ligne, n''arrange rien à une hypocondrie maladive qui guide son style de vie depuis bien trop longtemps et fait de lui un peureux névropathe.', '01:48:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541120', 'http://fr.web.img2.acsta.net/pictures/210/575/21057533_20131113175943179.jpg'),
(95, 207825, 'The Grand Budapest Hotel', '2014-02-26', '<span>Le film retrace les aventures de Gustave H, l''homme aux clés d''or d''un célèbre hôtel européen de l''entre-deux-guerres et du garçon d''étage Zéro Moustafa, son allié le plus fidèle.</span>', '<span>Le film retrace les aventures de Gustave H, l''homme aux clés d''or d''un célèbre hôtel européen de l''entre-deux-guerres et du garçon d''étage Zéro Moustafa, son allié le plus fidèle.</span>', '01:40:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19539015', 'http://fr.web.img3.acsta.net/pictures/14/01/20/12/06/239820.jpg'),
(96, 186179, 'Un été à Osage County', '2014-02-26', '<p style="text-align: justify;">En famille, on se soutient. En famille, on se déchire... Suite à la disparition de leur père, les trois filles Weston se retrouvent après plusieurs années de séparation, dans leur maison familiale.', '<p style="text-align: justify;">En famille, on se soutient. En famille, on se déchire... Suite à la disparition de leur père, les trois filles Weston se retrouvent après plusieurs années de séparation, dans leur maison familiale.', '02:01:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19535266', 'http://fr.web.img5.acsta.net/pictures/14/01/17/10/17/335126.jpg'),
(97, 222418, 'Week-ends', '2014-02-26', '<p style="text-align: justify;">Un rien suffit parfois à gâcher un week-end à la campagne. Un simple malentendu sur un parking de supermarché, un mauvais réflexe, et voilà que tout se détraque. Rien ne va plus pour Christine. Jean la quitte.', '<p style="text-align: justify;">Un rien suffit parfois à gâcher un week-end à la campagne. Un simple malentendu sur un parking de supermarché, un mauvais réflexe, et voilà que tout se détraque. Rien ne va plus pour Christine. Jean la quitte.', '01:30:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541884', 'http://fr.web.img1.acsta.net/pictures/210/530/21053018_20131128112104474.jpg'),
(98, 171198, 'La Grande Aventure Lego', '2014-02-19', '<span>Emmet est un petit personnage banal et conventionnel que l''on prend par erreur pour un être extraordinaire, capable de sauver le monde. Il se retrouve entraîné, parmi d''autres, dans un périple des plus mouvementés, dans le but de mettre hors d''état de nuire un redoutable despote. Mais le pauvre Emmet n''est absolument pas prêt à relever un tel défi !</span>', '<span>Emmet est un petit personnage banal et conventionnel que l''on prend par erreur pour un être extraordinaire, capable de sauver le monde. Il se retrouve entraîné, parmi d''autres, dans un périple des plus mouvementés, dans le but de mettre hors d''état de nuire un redoutable despote. Mais le pauvre Emmet n''est absolument pas prêt à relever un tel défi !</span>', '01:40:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540767', 'http://fr.web.img4.acsta.net/pictures/210/618/21061838_20131128144957302.jpg'),
(99, 207788, 'Le Crocodile du Botswanga', '2014-02-19', '<p style="text-align: justify;">Leslie Konda, jeune footballer français talentueux, repéré à son adolescence par Didier, un agent de faible envergure qui a su le prendre sous sa coupe, vient de signer son premier contrat d''attaquant dans un grand club espagnol.', '<p style="text-align: justify;">Leslie Konda, jeune footballer français talentueux, repéré à son adolescence par Didier, un agent de faible envergure qui a su le prendre sous sa coupe, vient de signer son premier contrat d''attaquant dans un grand club espagnol.', '01:30:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541785', 'http://fr.web.img3.acsta.net/pictures/13/12/16/11/51/058213.jpg'),
(100, 193927, 'Only Lovers Left Alive', '2014-02-19', '<p style="text-align: justify;">Dans les villes romantiques et désolées que sont Détroit et Tanger, Adam, un musicien underground, profondément déprimé par la tournure qu''ont prise les activités humaines, retrouve Eve, son amante, une femme endurante et énigmatique.', '<p style="text-align: justify;">Dans les villes romantiques et désolées que sont Détroit et Tanger, Adam, un musicien underground, profondément déprimé par la tournure qu''ont prise les activités humaines, retrouve Eve, son amante, une femme endurante et énigmatique.', '02:03:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540179', 'http://fr.web.img2.acsta.net/pictures/14/01/16/12/06/445377.jpg'),
(101, 216817, 'Gloria', '2014-02-19', 'Santiago, Chili. À 58 ans, Gloria, divorcée de longue date, est bien décidée à défier la solitude. Libre d''esprit elle passe sa vie de fêtes de célibataires en fêtes de célibataires, à la recherche de la satisfaction d''un soir qui amène souvent son lot de déception et de vide...', 'Santiago, Chili. À 58 ans, Gloria, divorcée de longue date, est bien décidée à défier la solitude. Libre d''esprit elle passe sa vie de fêtes de célibataires en fêtes de célibataires, à la recherche de la satisfaction d''un soir qui amène souvent son lot de déception et de vide...', '01:50:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541145', 'http://fr.web.img3.acsta.net/pictures/14/01/03/18/21/096188.jpg'),
(102, 223339, 'Bethléem', '2014-02-19', '<p style="text-align: justify;">2005. Bethlehem sud de Jerusalem. Sanfur, un jeune palestinien vit dans l''ombre de son frère Ibrahim un terroriste à la tête d''un réseau influent. Razi, un agent des services secrets israëliens qui recrute des informateurs dans les territoires occupés s''en fait un allié, lui offrant ce qui manque à sa vie, l''estime et la bienveillance d''un père.', '<p style="text-align: justify;">2005. Bethlehem sud de Jerusalem. Sanfur, un jeune palestinien vit dans l''ombre de son frère Ibrahim un terroriste à la tête d''un réseau influent. Razi, un agent des services secrets israëliens qui recrute des informateurs dans les territoires occupés s''en fait un allié, lui offrant ce qui manque à sa vie, l''estime et la bienveillance d''un père.', '01:39:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541778', 'http://fr.web.img4.acsta.net/pictures/14/01/10/12/37/026260.jpg'),
(103, 203397, 'La Belle et La Bête', '2014-02-12', '<p style="text-align: justify;"><span>1810. Après le naufrage de ses navires, un marchand ruiné doit s''exiler à la campagne avec ses six enfants. Parmi eux se trouve Belle, la plus jeune de ses filles, joyeuse et pleine de grâce.</span>', '<p style="text-align: justify;"><span>1810. Après le naufrage de ses navires, un marchand ruiné doit s''exiler à la campagne avec ses six enfants. Parmi eux se trouve Belle, la plus jeune de ses filles, joyeuse et pleine de grâce.</span>', '01:54:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540369', 'http://fr.web.img2.acsta.net/pictures/13/12/18/10/01/110035.jpg'),
(104, 201599, 'Abus de faiblesse', '2014-02-12', '<p style="text-align: justify;"><span>Victime d''une hémorragie cérébrale, Maud, cinéaste, se réveille un matin dans un corps à moitié mort qui la laisse hémiplégique, face à une solitude inéluctable. </span><span>Alitée mais déterminée à poursuivre son projet de film, elle découvre Vilko, arnaqueur de célébrités, en regardant un talk-show télévisé.</span>', '<p style="text-align: justify;"><span>Victime d''une hémorragie cérébrale, Maud, cinéaste, se réveille un matin dans un corps à moitié mort qui la laisse hémiplégique, face à une solitude inéluctable. </span><span>Alitée mais déterminée à poursuivre son projet de film, elle découvre Vilko, arnaqueur de célébrités, en regardant un talk-show télévisé.</span>', '01:45:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541620', 'http://fr.web.img4.acsta.net/pictures/13/12/26/15/37/591914.jpg'),
(105, 169812, 'Les Trois frères, le retour', '2014-02-12', 'Ils sont trois, Ils sont frères, Ils sont de retour. 15 ans après, Didier, Bernard et Pascal sont enfin réunis... par leur mère... Cette fois sera peut-être la bonne.', 'Ils sont trois, Ils sont frères, Ils sont de retour. 15 ans après, Didier, Bernard et Pascal sont enfin réunis... par leur mère... Cette fois sera peut-être la bonne.', '01:46:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542442', 'http://fr.web.img5.acsta.net/pictures/13/12/26/10/26/068920.jpg'),
(106, 220886, 'For Those in Peril', '2014-02-12', '<p style="text-align: justify;">Aaron, un jeune marginal vivant dans une communauté isolée en Ecosse, est le seul survivant d''un accident de pêche ayant coûté la vie à cinq hommes dont son frère aîné. Les habitants du village le blâment pour cette tragédie et le rejettent.', '<p style="text-align: justify;">Aaron, un jeune marginal vivant dans une communauté isolée en Ecosse, est le seul survivant d''un accident de pêche ayant coûté la vie à cinq hommes dont son frère aîné. Les habitants du village le blâment pour cette tragédie et le rejettent.', '01:32:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541740', 'http://fr.web.img2.acsta.net/pictures/210/597/21059748_20131121121734432.jpg'),
(107, 204237, 'La Voleuse de livres', '2014-02-05', 'L''histoire de Liesel, une jeune fille envoyée dans sa famille d''adoption allemande pendant la Seconde Guerre mondiale. Elle apprend à lire avec le soutien de sa nouvelle famille, et de Max, un réfugié Juif qu''ils cachent sous leurs escaliers. Pour Liesel et Max, le pouvoir des mots ainsi que leur propre imagination vont devenir leur seule échappatoire face à la guerre.', 'L''histoire de Liesel, une jeune fille envoyée dans sa famille d''adoption allemande pendant la Seconde Guerre mondiale. Elle apprend à lire avec le soutien de sa nouvelle famille, et de Max, un réfugié Juif qu''ils cachent sous leurs escaliers. Pour Liesel et Max, le pouvoir des mots ainsi que leur propre imagination vont devenir leur seule échappatoire face à la guerre.', '02:11:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19539113', 'http://fr.web.img2.acsta.net/pictures/210/607/21060774_20131125172423153.jpg'),
(108, 205330, 'American Bluff', '2014-02-05', '<p style="text-align: justify;">Un escroc, Irving Rosenfeld et sa complice se retrouvent obligés par un agent du FBI de nager dans les eaux troubles de la mafia pour piéger un homme politique corrompu.', '<p style="text-align: justify;">Un escroc, Irving Rosenfeld et sa complice se retrouvent obligés par un agent du FBI de nager dans les eaux troubles de la mafia pour piéger un homme politique corrompu.', '02:18:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538798', 'http://fr.web.img2.acsta.net/pictures/13/12/17/13/00/199998.jpg'),
(109, 212386, 'Mea Culpa', '2014-02-05', 'Flics sur Toulon, Simon et Franck fêtent la fin d''une mission ? De retour vers chez eux, ils percutent une voiture. Bilan : deux victimes dont un enfant. Franck est indemne. Simon, qui était au volant et alcoolisé, sort grièvement blessé?', 'Flics sur Toulon, Simon et Franck fêtent la fin d''une mission ? De retour vers chez eux, ils percutent une voiture. Bilan : deux victimes dont un enfant. Franck est indemne. Simon, qui était au volant et alcoolisé, sort grièvement blessé?', '01:31:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540829', 'http://fr.web.img3.acsta.net/pictures/13/12/18/12/43/406041.jpg'),
(110, 210275, 'Un beau dimanche', '2014-02-05', 'Baptiste est instituteur dans le sud de la France. Lors du week-end de la Pentecôte, il hérite malgré lui d''un élève oublié par un père négligent. Sandra, mère intermittente et désireuse de se racheter accueille son fils et Baptiste dans un bungalow près de la plage.', 'Baptiste est instituteur dans le sud de la France. Lors du week-end de la Pentecôte, il hérite malgré lui d''un élève oublié par un père négligent. Sandra, mère intermittente et désireuse de se racheter accueille son fils et Baptiste dans un bungalow près de la plage.', '01:35:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541170', 'http://fr.web.img4.acsta.net/pictures/14/01/03/14/44/587765.jpg'),
(111, 174401, 'Goltzius et la Compagnie du Pélican', '2014-02-05', 'Cinq ans après "La Ronde de Nuit", Peter Greenaway livre le deuxième volet d''une série de films consacrée aux Maîtres Flamands en s''intéressant cette fois ci à Hendrik Goltzius, graveur érotique de la fin du 16e siècle...', 'Cinq ans après "La Ronde de Nuit", Peter Greenaway livre le deuxième volet d''une série de films consacrée aux Maîtres Flamands en s''intéressant cette fois ci à Hendrik Goltzius, graveur érotique de la fin du 16e siècle...', '01:56:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541791', 'http://fr.web.img5.acsta.net/pictures/13/12/10/14/37/078074.jpg'),
(112, 137097, 'Dallas Buyers Club', '2014-01-29', '<p style="text-align: justify;">L''histoire vraie de Ron Woodroof, un électricien qui a été diagnostiqué séropositif en 1986 et dont l''espérance de vie ne devait pas dépasser 6 mois.', '<p style="text-align: justify;">L''histoire vraie de Ron Woodroof, un électricien qui a été diagnostiqué séropositif en 1986 et dont l''espérance de vie ne devait pas dépasser 6 mois.', '01:57:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537471', 'http://fr.web.img3.acsta.net/pictures/14/01/24/12/09/007448.jpg'),
(113, 193312, 'The Ryan Initiative', '2014-01-29', '<p style="text-align: justify;">Ancien Marine, Jack Ryan est un brillant analyste financier. Thomas Harper le recrute au sein de la CIA pour enquêter sur une organisation financière terroriste. Jack Ryan part à Moscou pour rencontrer l''homme d''affaires qu''il soupçonne d''être à la tête du complot.', '<p style="text-align: justify;">Ancien Marine, Jack Ryan est un brillant analyste financier. Thomas Harper le recrute au sein de la CIA pour enquêter sur une organisation financière terroriste. Jack Ryan part à Moscou pour rencontrer l''homme d''affaires qu''il soupçonne d''être à la tête du complot.', '01:45:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19539107', 'http://fr.web.img2.acsta.net/pictures/210/619/21061922_20131128171836198.jpg'),
(114, 198853, 'Beaucoup de bruit pour rien', '2014-01-29', '<p style="text-align: justify;">De retour de la guerre, Don Pédro et ses fidèles compagnons d''armes, Bénédict et Claudio, rendent visite au seigneur Léonato, gouverneur de Messine. Dans sa demeure, les hommes vont se livrer à une autre guerre. Celle de l''amour.', '<p style="text-align: justify;">De retour de la guerre, Don Pédro et ses fidèles compagnons d''armes, Bénédict et Claudio, rendent visite au seigneur Léonato, gouverneur de Messine. Dans sa demeure, les hommes vont se livrer à une autre guerre. Celle de l''amour.', '01:49:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19506171', 'http://fr.web.img3.acsta.net/pictures/13/12/23/14/49/218927.jpg'),
(115, 208007, 'Jacky au royaume des filles', '2014-01-29', '<p style="text-align: justify;">En république démocratique de Bubunne, les femmes ont le pouvoir, commandent et font la guerre, et les hommes portent le voile et s''occupent de leur foyer. Parmi eux, Jacky, un garçon de 20 ans, a le même fantasme que tous les célibataires de son pays : épouser la Colonelle.', '<p style="text-align: justify;">En république démocratique de Bubunne, les femmes ont le pouvoir, commandent et font la guerre, et les hommes portent le voile et s''occupent de leur foyer. Parmi eux, Jacky, un garçon de 20 ans, a le même fantasme que tous les célibataires de son pays : épouser la Colonelle.', '01:34:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540366', 'http://fr.web.img5.acsta.net/pictures/210/445/21044559_20131107153522637.jpg'),
(116, 197310, 'Minuscule - La vallée des fourmis perdues', '2014-01-29', 'Dans une paisible vallée, des fourmis noires vivent une série d''aventures extraordinaires après la découverte d''une boîte de sucres, un trésor convoité également par les terribles fourmis rouges ! ', 'Dans une paisible vallée, des fourmis noires vivent une série d''aventures extraordinaires après la découverte d''une boîte de sucres, un trésor convoité également par les terribles fourmis rouges ! ', '01:29:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540621', 'http://fr.web.img4.acsta.net/pictures/14/01/23/10/07/543188.jpg'),
(117, 196885, '12 Years a Slave', '2014-01-22', '<p style="text-align: justify;">Les États-Unis, quelques années avant la guerre de Sécession. <br/> Solomon Northup, jeune homme noir originaire de l''État de New York, est enlevé et vendu comme esclave. Face à la cruauté d''un propriétaire de plantation de coton, Solomon se bat pour rester en vie et garder sa dignité. ', '<p style="text-align: justify;">Les États-Unis, quelques années avant la guerre de Sécession. <br/> Solomon Northup, jeune homme noir originaire de l''État de New York, est enlevé et vendu comme esclave. Face à la cruauté d''un propriétaire de plantation de coton, Solomon se bat pour rester en vie et garder sa dignité. ', '02:13:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538046', 'http://fr.web.img6.acsta.net/pictures/210/415/21041568_2013091910085449.jpg'),
(118, 220725, 'Lulu femme nue', '2014-01-22', '<p style="text-align: justify;">À la suite d''un entretien d''embauche qui se passe mal, Lulu décide de ne pas rentrer chez elle et part en laissant son mari et ses trois enfants. Elle n''a rien prémédité, ça se passe très simplement.', '<p style="text-align: justify;">À la suite d''un entretien d''embauche qui se passe mal, Lulu décide de ne pas rentrer chez elle et part en laissant son mari et ses trois enfants. Elle n''a rien prémédité, ça se passe très simplement.', '01:27:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540568', 'http://fr.web.img3.acsta.net/pictures/13/12/04/16/53/529485.jpg'),
(119, 197176, 'Le Vent se lève', '2014-01-22', '<p style="text-align: justify;"><span>L''histoire de l''ingénieur japonais Jiro Horikoshi, connu pour avoir créé l''avion de chasse Mitsubishi A6M, surnommé </span>chasseur Zero et devenu le symbole de la lutte aérienne du Japon durant la Seconde Guerre mondiale.', '<p style="text-align: justify;"><span>L''histoire de l''ingénieur japonais Jiro Horikoshi, connu pour avoir créé l''avion de chasse Mitsubishi A6M, surnommé </span>chasseur Zero et devenu le symbole de la lutte aérienne du Japon durant la Seconde Guerre mondiale.', '02:07:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19539872', 'http://fr.web.img1.acsta.net/pictures/210/525/21052583_2013102415340471.jpg'),
(120, 186903, 'Match retour', '2014-01-22', '<p style="text-align: justify;">Deux boxeurs ayant plus de la soixantaine envisagent de remonter sur le ring pour se combattre l''un l''autre...', '<p style="text-align: justify;">Deux boxeurs ayant plus de la soixantaine envisagent de remonter sur le ring pour se combattre l''un l''autre...', '01:53:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540630', 'http://fr.web.img3.acsta.net/pictures/13/12/16/15/27/209115.jpg'),
(121, 209312, 'Prêt à tout', '2014-01-22', '<p style="text-align: justify;">À 30 ans, Max a fait fortune sur internet avec ses deux potes et profite de la vie au soleil. Mais il se lasse de cette existence et ne cesse de penser à son amour de fac, Alice, une fille pétillante, engagée, pleine d''idéaux... qui ne s''est jamais intéressée à lui.', '<p style="text-align: justify;">À 30 ans, Max a fait fortune sur internet avec ses deux potes et profite de la vie au soleil. Mais il se lasse de cette existence et ne cesse de penser à son amour de fac, Alice, une fille pétillante, engagée, pleine d''idéaux... qui ne s''est jamais intéressée à lui.', '01:39:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540359', 'http://fr.web.img4.acsta.net/pictures/210/181/21018129_20130708112533735.jpg'),
(122, 218186, 'L''Amour est un crime parfait', '2014-01-15', '<p style="text-align: justify;">Professeur de littérature à l''université de Lausanne, Marc a la réputation de collectionner les aventures amoureuses avec ses étudiantes. Quelques jours après la disparition de la plus brillante d''entre elles qui était sa dernière conquête, il rencontre Anna...', '<p style="text-align: justify;">Professeur de littérature à l''université de Lausanne, Marc a la réputation de collectionner les aventures amoureuses avec ses étudiantes. Quelques jours après la disparition de la plus brillante d''entre elles qui était sa dernière conquête, il rencontre Anna...', '01:55:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540398', 'http://fr.web.img2.acsta.net/pictures/210/300/21030060_20131127151707828.jpg'),
(123, 197047, 'Les Brasiers de la Colère', '2014-01-15', '<p style="text-align: justify;">Russell sort de prison, après 4 ans passés derrière les barreaux. Il se lance à la recherche de son jeune frère, porté disparu. Depuis son retour d''Irak, celui-ci s''était retrouvé mêlé aux agissements d''un redoutable gang...', '<p style="text-align: justify;">Russell sort de prison, après 4 ans passés derrière les barreaux. Il se lance à la recherche de son jeune frère, porté disparu. Depuis son retour d''Irak, celui-ci s''était retrouvé mêlé aux agissements d''un redoutable gang...', '01:57:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536239', 'http://fr.web.img4.acsta.net/pictures/13/12/17/13/08/318843.jpg'),
(124, 209675, 'A coup sûr', '2014-01-15', '<p style="text-align: justify;">Elevée dans le culte de la performance et dans l''idée que toute compétence doit être optimisée, Emma est une jeune femme méthodique, volontaire et, en apparence, relativement sûre d''elle. Mais deux échecs consécutifs lui laissent croire qu''elle a un vrai problème : elle est nulle au lit.', '<p style="text-align: justify;">Elevée dans le culte de la performance et dans l''idée que toute compétence doit être optimisée, Emma est une jeune femme méthodique, volontaire et, en apparence, relativement sûre d''elle. Mais deux échecs consécutifs lui laissent croire qu''elle a un vrai problème : elle est nulle au lit.', '01:31:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19539390', 'http://fr.web.img5.acsta.net/pictures/210/537/21053745_20131029164340332.jpg'),
(125, 217634, 'Yves Saint-Laurent', '2014-01-08', '<p style="text-align: justify;">Paris, 1957. A tout juste 21 ans, Yves Saint Laurent est appelé à prendre en main les destinées de la prestigieuse maison de haute couture fondée par Christian Dior, récemment décédé. Lors de son premier défilé triomphal, il fait la connaissance de Pierre Bergé, rencontre qui va bouleverser sa vie.', '<p style="text-align: justify;">Paris, 1957. A tout juste 21 ans, Yves Saint Laurent est appelé à prendre en main les destinées de la prestigieuse maison de haute couture fondée par Christian Dior, récemment décédé. Lors de son premier défilé triomphal, il fait la connaissance de Pierre Bergé, rencontre qui va bouleverser sa vie.', '01:46:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541103', 'http://fr.web.img4.acsta.net/pictures/13/12/03/12/25/245119.jpg'),
(126, 216916, 'Cadences obstinées', '2014-01-08', 'Une femme a abandonné sa brillante carrière de violoncelliste pour l''amour d''un homme.<br/>Mais cet homme a un contrat a remplir, contrat qui ne peut pas s''encombrer d''amour?<br/>On n''aime jamais de la même façon et en même temps.', 'Une femme a abandonné sa brillante carrière de violoncelliste pour l''amour d''un homme.<br/>Mais cet homme a un contrat a remplir, contrat qui ne peut pas s''encombrer d''amour?<br/>On n''aime jamais de la même façon et en même temps.', '01:41:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540606', 'http://fr.web.img2.acsta.net/pictures/13/12/10/15/24/301886.jpg'),
(127, 189851, 'Lovelace', '2014-01-08', 'L''itinéraire de Linda Lovelace, devenue une star mondiale du cinéma X dans les années 1970, grâce au succès de "Gorge Profonde", et qui s''est ensuite muée en une militante farouchement opposée à l''industrie du porno.', 'L''itinéraire de Linda Lovelace, devenue une star mondiale du cinéma X dans les années 1970, grâce au succès de "Gorge Profonde", et qui s''est ensuite muée en une militante farouchement opposée à l''industrie du porno.', '01:33:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540291', 'http://fr.web.img2.acsta.net/pictures/210/580/21058017_20131114172015089.jpg'),
(128, 213656, 'Philomena', '2014-01-08', '<p style="text-align: justify;">Irlande, 1952 : Philomena Lee, encore adolescente, tombe enceinte. Considérée comme une « femme déchue », elle est envoyée au couvent de Roscrea. Alors que l''enfant est encore un nouveau-né, il est arraché aux mains de sa mère pour être adopté par des américains.', '<p style="text-align: justify;">Irlande, 1952 : Philomena Lee, encore adolescente, tombe enceinte. Considérée comme une « femme déchue », elle est envoyée au couvent de Roscrea. Alors que l''enfant est encore un nouveau-né, il est arraché aux mains de sa mère pour être adopté par des américains.', '01:38:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536976', 'http://fr.web.img6.acsta.net/pictures/210/587/21058784_20131118171801678.jpg'),
(129, 200956, 'All Is Lost', '2013-12-11', '<p style="text-align: justify;">Au cours d''un voyage en solitaire à travers l''Océan Indien, un homme découvre à son réveil que la coque de son voilier de 12 mètres a été percée lors d''une collision avec un container flottant à la dérive.', '<p style="text-align: justify;">Au cours d''un voyage en solitaire à travers l''Océan Indien, un homme découvre à son réveil que la coque de son voilier de 12 mètres a été percée lors d''une collision avec un container flottant à la dérive.', '01:46:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537418', 'http://fr.web.img2.acsta.net/pictures/205/419/20541978_20131010174200124.jpg'),
(130, 189687, 'Je fais le mort', '2013-12-11', '<p style="text-align: justify;">A 40 ans, Jean, comédien, est dans le creux de la vague? Il court le cachet sans succès. Au pôle Emploi Spectacle, sa conseillère lui propose un job un peu particulier : prendre la place du mort pour permettre à la justice de reconstituer les scènes de crime.', '<p style="text-align: justify;">A 40 ans, Jean, comédien, est dans le creux de la vague? Il court le cachet sans succès. Au pôle Emploi Spectacle, sa conseillère lui propose un job un peu particulier : prendre la place du mort pour permettre à la justice de reconstituer les scènes de crime.', '01:44:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538873', 'http://fr.web.img3.acsta.net/pictures/14/05/22/11/23/155654.jpg'),
(131, 203587, '100% Cachemire', '2013-12-11', '<p style="text-align: justify;">Aleksandra et Cyrille forment un couple très chanceux très tendance qui apparemment a tout. Enfin tout, sauf un enfant. Alekseï, petit garçon russe de 7 ans va débarquer dans leur vie...', '<p style="text-align: justify;">Aleksandra et Cyrille forment un couple très chanceux très tendance qui apparemment a tout. Enfin tout, sauf un enfant. Alekseï, petit garçon russe de 7 ans va débarquer dans leur vie...', '01:38:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538170', 'http://fr.web.img1.acsta.net/pictures/210/584/21058423_20131118094249973.jpg'),
(132, 186918, 'Le Hobbit : la Désolation de Smaug', '2013-12-11', '<p style="text-align: justify;">Les aventures de Bilbon Sacquet, paisible hobbit, qui sera entraîné, lui et une compagnie de Nains, par le magicien Gandalf pour récupérer le trésor détenu par le dragon Smaug. Au cours de ce périple, il mettra la main sur l''anneau de pouvoir que possédait Gollum...', '<p style="text-align: justify;">Les aventures de Bilbon Sacquet, paisible hobbit, qui sera entraîné, lui et une compagnie de Nains, par le magicien Gandalf pour récupérer le trésor détenu par le dragon Smaug. Au cours de ce périple, il mettra la main sur l''anneau de pouvoir que possédait Gollum...', '02:41:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19540033', 'http://fr.web.img4.acsta.net/pictures/210/552/21055250_20131106114016251.jpg'),
(133, 193911, 'Casse-tête chinois', '2013-12-04', '<p style="text-align: justify;">On retrouve Xavier avec Wendy, Isabelle et Martine quinze ans après l''Auberge Espagnole et dix ans après les Poupées Russes. Tout paraissait si simple alors mais la vie de Xavier ne cessera de prendre des détours inattendus entre Paris et New-York.', '<p style="text-align: justify;">On retrouve Xavier avec Wendy, Isabelle et Martine quinze ans après l''Auberge Espagnole et dix ans après les Poupées Russes. Tout paraissait si simple alors mais la vie de Xavier ne cessera de prendre des détours inattendus entre Paris et New-York.', '01:57:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19539378', 'http://fr.web.img2.acsta.net/pictures/210/182/21018207_2013102210303588.jpg'),
(134, 203691, 'La Reine des neiges', '2013-12-04', '<p style="text-align: justify;">L''accomplissement d''une prophétie a plongé un royaume lointain dans un éternel hiver. Anna, une jeune fille aussi audacieuse qu''optimiste, se lance alors dans un incroyable voyage à la recherche de sa s?ur, Elsa, la Reine des Neiges, en compagnie de Kristoff.', '<p style="text-align: justify;">L''accomplissement d''une prophétie a plongé un royaume lointain dans un éternel hiver. Anna, une jeune fille aussi audacieuse qu''optimiste, se lance alors dans un incroyable voyage à la recherche de sa s?ur, Elsa, la Reine des Neiges, en compagnie de Kristoff.', '01:42:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538238', 'http://fr.web.img5.acsta.net/pictures/210/521/21052146_20131023144339759.jpg');
INSERT INTO `film` (`id`, `code`, `titre`, `date`, `synopsis`, `synopsisCourt`, `duree`, `note`, `trailer`, `affiche`) VALUES
(135, 190335, 'Zulu', '2013-12-04', '<p style="text-align: justify;">Dans une Afrique du Sud encore hantée par l''apartheid, deux policiers, un noir, un blanc, pourchassent le meurtrier sauvage d''une jeune adolescente. Des Townships de Capetown aux luxueuses villas du bord de mer, cette enquête va bouleverser la vie des deux hommes...', '<p style="text-align: justify;">Dans une Afrique du Sud encore hantée par l''apartheid, deux policiers, un noir, un blanc, pourchassent le meurtrier sauvage d''une jeune adolescente. Des Townships de Capetown aux luxueuses villas du bord de mer, cette enquête va bouleverser la vie des deux hommes...', '01:51:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538977', 'http://fr.web.img2.acsta.net/pictures/210/384/21038412_20130910105406795.jpg'),
(136, 196666, 'Hunger Games - L''embrasement', '2013-11-27', '<p style="text-align: justify;">Katniss Everdeen est rentrée chez elle saine et sauve après avoir remporté la 74e édition des Hunger Games avec son partenaire Peeta Mellark. Puisqu''ils ont gagné, ils sont obligés de laisser une fois de plus leur famille et leurs amis pour partir faire la Tournée de la victoire...', '<p style="text-align: justify;">Katniss Everdeen est rentrée chez elle saine et sauve après avoir remporté la 74e édition des Hunger Games avec son partenaire Peeta Mellark. Puisqu''ils ont gagné, ils sont obligés de laisser une fois de plus leur famille et leurs amis pour partir faire la Tournée de la victoire...', '02:26:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536496', 'http://fr.web.img3.acsta.net/pictures/210/453/21045319_2013101714250983.jpg'),
(137, 108743, 'Mesmer', '0000-00-00', 'La vie du physicien autrichien Franz Anton Mesmer.', 'La vie du physicien autrichien Franz Anton Mesmer.', '01:47:00', 0, '', 'http://images.allocine.fr/commons/emptymedia/AffichetteAllocine.gif'),
(138, 194666, 'The Immigrant', '2013-11-27', '<p style="text-align: justify;">1921. Ewa et sa s?ur Magda quittent leur Pologne natale pour la terre promise, New York. Arrivées à Ellis Island, Magda, atteinte de tuberculose, est placée en quarantaine. Ewa, seule et désemparée, tombe dans les filets de Bruno, un souteneur sans scrupules.', '<p style="text-align: justify;">1921. Ewa et sa s?ur Magda quittent leur Pologne natale pour la terre promise, New York. Arrivées à Ellis Island, Magda, atteinte de tuberculose, est placée en quarantaine. Ewa, seule et désemparée, tombe dans les filets de Bruno, un souteneur sans scrupules.', '01:53:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19539362', 'http://fr.web.img1.acsta.net/pictures/210/497/21049757_20131015170623847.jpg'),
(139, 194901, 'Les Interdits', '2013-11-27', '1979. Carole et Jérôme ont 20 ans et partent en voyage organisé à Odessa, derrière le rideau de  fer. Ils sont cousins et se prétendent fiancés. Le jour, simples touristes, ils visitent monuments et musées.', '1979. Carole et Jérôme ont 20 ans et partent en voyage organisé à Odessa, derrière le rideau de  fer. Ils sont cousins et se prétendent fiancés. Le jour, simples touristes, ils visitent monuments et musées.', '01:36:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19539042', 'http://fr.web.img3.acsta.net/pictures/210/501/21050144_20131016164208095.jpg'),
(140, 180103, 'Les Garçons et Guillaume, à table !', '2013-11-20', '<p style="text-align: justify;"><span>Le premier souvenir que j''ai de ma mère c''est quand j''avais quatre ou cinq ans. Elle nous appelle, mes deux frères et moi, pour le dîner en disant : "Les garçons et Guillaume, à table !" </span>', '<p style="text-align: justify;"><span>Le premier souvenir que j''ai de ma mère c''est quand j''avais quatre ou cinq ans. Elle nous appelle, mes deux frères et moi, pour le dîner en disant : "Les garçons et Guillaume, à table !" </span>', '01:27:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538962', 'http://fr.web.img2.acsta.net/pictures/205/298/20529833_20131017171932686.jpg'),
(141, 191696, 'Capitaine Phillips', '2013-11-20', '<p style="text-align: justify;">Capitaine Phillips retrace l''histoire vraie de la prise d''otages du navire de marine marchande américain <i>Maersk Alabama</i>, menée en 2009 par des pirates somaliens.', '<p style="text-align: justify;">Capitaine Phillips retrace l''histoire vraie de la prise d''otages du navire de marine marchande américain <i>Maersk Alabama</i>, menée en 2009 par des pirates somaliens.', '02:14:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19512047', 'http://fr.web.img2.acsta.net/pictures/210/407/21040713_20130919122153669.jpg'),
(142, 126367, 'Victor Young Perez', '2013-11-20', 'Victor Young Perez, 136 combats, 91 victoires dont 27 par KO, Champion du monde des poids mouches, est sur le ring. En face de lui Kurtz, le soldat allemand ; 20 centimètres et 20 kilos de plus que lui.', 'Victor Young Perez, 136 combats, 91 victoires dont 27 par KO, Champion du monde des poids mouches, est sur le ring. En face de lui Kurtz, le soldat allemand ; 20 centimètres et 20 kilos de plus que lui.', '01:50:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537835', 'http://fr.web.img1.acsta.net/pictures/210/326/21032641_20131001153758528.jpg'),
(143, 213080, 'La Vénus à la fourrure', '2013-11-13', '<p style="text-align: justify;">Seul dans un théâtre parisien après une journée passée à auditionner des comédiennes pour la pièce qu''il s''apprête à mettre en scène, Thomas se lamente au téléphone sur la piètre performance des candidates.', '<p style="text-align: justify;">Seul dans un théâtre parisien après une journée passée à auditionner des comédiennes pour la pièce qu''il s''apprête à mettre en scène, Thomas se lamente au téléphone sur la piètre performance des candidates.', '01:33:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538157', 'http://fr.web.img3.acsta.net/pictures/205/418/20541851_20130930175039697.jpg'),
(144, 214521, 'Les rencontres d''après minuit', '2013-11-13', '<p style="text-align: justify;">Au c?ur de la nuit, un jeune couple et leur gouvernante travestie préparent une orgie. Sont attendus La Chienne, La Star, L''Etalon et L''Adolescent.', '<p style="text-align: justify;">Au c?ur de la nuit, un jeune couple et leur gouvernante travestie préparent une orgie. Sont attendus La Chienne, La Star, L''Etalon et L''Adolescent.', '01:33:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537851', 'http://fr.web.img1.acsta.net/pictures/210/355/21035588_20130902155928563.jpg'),
(145, 202971, 'Cartel', '2013-11-13', '<p style="text-align: justify;">La descente aux enfers d''un avocat pénal, attiré par l''excitation, le danger et l''argent facile du trafic de drogues à la frontière américano-mexicaine. Il découvre qu''une décision trop vite prise peut le faire plonger dans une spirale infernale, aux conséquences fatales.', '<p style="text-align: justify;">La descente aux enfers d''un avocat pénal, attiré par l''excitation, le danger et l''argent facile du trafic de drogues à la frontière américano-mexicaine. Il découvre qu''une décision trop vite prise peut le faire plonger dans une spirale infernale, aux conséquences fatales.', '01:51:00', 1.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537239', 'http://fr.web.img4.acsta.net/pictures/210/453/21045366_20130930183256669.jpg'),
