(147, 205978, 'En Solitaire', '2013-11-06', '<p style="text-align: justify;">Yann Kermadec voit son rêve se réaliser quand il remplace au pied levé, son ami Franck Drevil, au départ du Vendée Globe, le tour du monde à la voile en solitaire. Habité par une farouche volonté de gagner, alors qu''il est en pleine course, la découverte à son bord d''un jeune passager va tout remettre en cause.', '<p style="text-align: justify;">Yann Kermadec voit son rêve se réaliser quand il remplace au pied levé, son ami Franck Drevil, au départ du Vendée Globe, le tour du monde à la voile en solitaire. Habité par une farouche volonté de gagner, alors qu''il est en pleine course, la découverte à son bord d''un jeune passager va tout remettre en cause.', '01:41:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538305', 'http://fr.web.img4.acsta.net/medias/nmedia/18/93/41/63/20282436.jpg'),
(148, 203464, 'Quai d''Orsay', '2013-11-06', '<p style="text-align: justify;">Alexandre Taillard de Worms est grand, magnifique, un homme plein de panache qui plait aux femmes et est accessoirement ministre des Affaires Étrangères du pays des Lumières : la France. Sa crinière argentée posée sur son corps d''athlète légèrement halé est partout, de la tribune des Nations Unies à New-York jusque dans la poudrière de l''Oubanga.', '<p style="text-align: justify;">Alexandre Taillard de Worms est grand, magnifique, un homme plein de panache qui plait aux femmes et est accessoirement ministre des Affaires Étrangères du pays des Lumières : la France. Sa crinière argentée posée sur son corps d''athlète légèrement halé est partout, de la tribune des Nations Unies à New-York jusque dans la poudrière de l''Oubanga.', '01:53:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538117', 'http://fr.web.img2.acsta.net/pictures/210/404/21040497_20130917180148438.jpg'),
(149, 193112, 'Violette', '2013-11-06', 'Violette Leduc, née bâtarde au début du siècle dernier, rencontre Simone de Beauvoir dans les années d''après-guerre à St-Germain-des-Prés.', 'Violette Leduc, née bâtarde au début du siècle dernier, rencontre Simone de Beauvoir dans les années d''après-guerre à St-Germain-des-Prés.', '02:19:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538367', 'http://fr.web.img3.acsta.net/pictures/210/264/21026445_20131011162524469.jpg'),
(150, 220738, 'Le médecin de famille', '2013-11-06', '<p style="text-align: justify;">Patagonie, 1960. Un médecin allemand rencontre une famille argentine sur la longue route qui mène à Bariloche où Eva, Enzo et leurs trois enfants s''apprêtent à ouvrir une chambre d''hôtes au bord du lac Nahuel Huapi.', '<p style="text-align: justify;">Patagonie, 1960. Un médecin allemand rencontre une famille argentine sur la longue route qui mène à Bariloche où Eva, Enzo et leurs trois enfants s''apprêtent à ouvrir une chambre d''hôtes au bord du lac Nahuel Huapi.', '01:33:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538684', 'http://fr.web.img6.acsta.net/pictures/210/468/21046883_20131004154745231.jpg'),
(151, 195051, 'Inside Llewyn Davis', '2013-11-06', '<p style="text-align: justify;">Llewyn Davis est à la croisée des chemins. Alors qu''un hiver rigoureux sévit sur New York, le jeune homme, sa guitare à la main, lutte pour gagner sa vie comme musicien, et affronte des obstacles qui semblent insurmontables, à commencer par ceux qu''il se crée lui-même.', '<p style="text-align: justify;">Llewyn Davis est à la croisée des chemins. Alors qu''un hiver rigoureux sévit sur New York, le jeune homme, sa guitare à la main, lutte pour gagner sa vie comme musicien, et affronte des obstacles qui semblent insurmontables, à commencer par ceux qu''il se crée lui-même.', '01:45:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19539332', 'http://fr.web.img6.acsta.net/pictures/210/052/21005275_20130927183847948.jpg'),
(152, 199113, 'Blood Ties', '2013-10-30', '<p style="text-align: justify;">New York, 1974. Chris, la cinquantaine, est libéré pour bonne conduite après plusieurs années de prison pour un règlement de compte meurtrier. Devant la prison, Franck, son jeune frère, un flic prometteur, est là, à contrec?ur.', '<p style="text-align: justify;">New York, 1974. Chris, la cinquantaine, est libéré pour bonne conduite après plusieurs années de prison pour un règlement de compte meurtrier. Devant la prison, Franck, son jeune frère, un flic prometteur, est là, à contrec?ur.', '02:08:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537494', 'http://fr.web.img4.acsta.net/pictures/210/070/21007028_20130520103948701.jpg'),
(153, 54342, 'Attila Marcel', '2013-10-30', 'Paul a la trentaine, il vit dans un appartement parisien avec ses tantes, deux vieilles aristocrates qui l''ont élevé depuis ses deux ans et rêvent de le voir devenir pianiste virtuose. Sa vie se résume à une routine quotidienne, jusqu''au jour où il rencontre Madame Proust...', 'Paul a la trentaine, il vit dans un appartement parisien avec ses tantes, deux vieilles aristocrates qui l''ont élevé depuis ses deux ans et rêvent de le voir devenir pianiste virtuose. Sa vie se résume à une routine quotidienne, jusqu''au jour où il rencontre Madame Proust...', '01:42:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537362', 'http://fr.web.img5.acsta.net/pictures/210/414/21041438_20130918153131316.jpg'),
(154, 219309, 'Fonzy', '2013-10-30', '<p style="text-align: justify;">Fonzy, le pseudonyme sous lequel Diego Costa a fourni il y a 20 ans du sperme à maintes reprises dans le cadre d''un protocole de recherche. Aujourd''hui, à 42 ans, il est livreur dans la poissonnerie familiale et mène une vie d''adolescent irresponsable et gaffeur.', '<p style="text-align: justify;">Fonzy, le pseudonyme sous lequel Diego Costa a fourni il y a 20 ans du sperme à maintes reprises dans le cadre d''un protocole de recherche. Aujourd''hui, à 42 ans, il est livreur dans la poissonnerie familiale et mène une vie d''adolescent irresponsable et gaffeur.', '01:42:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538083', 'http://fr.web.img6.acsta.net/pictures/210/357/21035711_20130903101944234.jpg'),
(155, 123530, 'Snowpiercer, Le Transperceneige', '2013-10-30', '<p style="text-align: justify;">2031. Une nouvelle ère glaciaire. Les derniers survivants ont pris place à bord du Snowpiercer, un train gigantesque condamné à tourner autour de la Terre sans jamais s''arrêter.', '<p style="text-align: justify;">2031. Une nouvelle ère glaciaire. Les derniers survivants ont pris place à bord du Snowpiercer, un train gigantesque condamné à tourner autour de la Terre sans jamais s''arrêter.', '02:06:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538042', 'http://fr.web.img3.acsta.net/pictures/210/380/21038075_20130909110053289.jpg'),
(156, 193108, 'Thor : Le Monde des ténèbres', '2013-10-30', '<p style="text-align: justify;">Thor se bat pour restaurer l''ordre dans le cosmos, mais une ancienne race, sous la conduite du terrible Malekith, un être assoiffé de vengeance, revient pour répandre les ténèbres.', '<p style="text-align: justify;">Thor se bat pour restaurer l''ordre dans le cosmos, mais une ancienne race, sous la conduite du terrible Malekith, un être assoiffé de vengeance, revient pour répandre les ténèbres.', '01:52:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536919', 'http://fr.web.img1.acsta.net/pictures/210/407/21040735_20130916181657638.jpg'),
(157, 178496, 'Gravity', '2013-10-23', '<p style="text-align: justify;">Pour sa première expédition à bord d''une navette spatiale, le docteur Ryan Stone, brillante experte en ingénierie médicale, accompagne l''astronaute chevronné Matt Kowalsky qui effectue son dernier vol avant de prendre sa retraite.', '<p style="text-align: justify;">Pour sa première expédition à bord d''une navette spatiale, le docteur Ryan Stone, brillante experte en ingénierie médicale, accompagne l''astronaute chevronné Matt Kowalsky qui effectue son dernier vol avant de prendre sa retraite.', '01:30:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19538824', 'http://fr.web.img1.acsta.net/pictures/210/232/21023233_20130729173134181.jpg'),
(158, 207801, 'Malavita', '2013-10-23', 'Fred Blake alias Giovanni Manzoni, repenti de la mafia new-yorkaise sous protection du FBI, s''installe avec sa famille dans un petit village de Normandie.', 'Fred Blake alias Giovanni Manzoni, repenti de la mafia new-yorkaise sous protection du FBI, s''installe avec sa famille dans un petit village de Normandie.', '01:52:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537426', 'http://fr.web.img1.acsta.net/pictures/210/412/21041261_20130918111051913.jpg'),
(159, 213856, '9 mois ferme', '2013-10-16', '<p style="text-align: justify;">Ariane Felder est enceinte ! C''est d''autant plus surprenant que c''est une jeune juge aux m?urs strictes et une célibataire endurcie. Mais ce qui est encore plus surprenant, c''est que d''après les tests de paternité, le père de l''enfant n''est autre que Bob, un criminel...', '<p style="text-align: justify;">Ariane Felder est enceinte ! C''est d''autant plus surprenant que c''est une jeune juge aux m?urs strictes et une célibataire endurcie. Mais ce qui est encore plus surprenant, c''est que d''après les tests de paternité, le père de l''enfant n''est autre que Bob, un criminel...', '01:22:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537099', 'http://fr.web.img3.acsta.net/pictures/210/303/21030330_20130823114607709.jpg'),
(160, 191356, 'Turbo', '2013-10-16', '<p style="text-align: justify;">Turbo est un escargot qui n''a qu''un seul rêve en tête : être incroyablement rapide ! Son obsession pour la vitesse l''a rendu quelque peu impopulaire chez les siens, où lenteur et prudence sont de rigueur. Mais il est hors de question pour lui de se conformer.', '<p style="text-align: justify;">Turbo est un escargot qui n''a qu''un seul rêve en tête : être incroyablement rapide ! Son obsession pour la vitesse l''a rendu quelque peu impopulaire chez les siens, où lenteur et prudence sont de rigueur. Mais il est hors de question pour lui de se conformer.', '01:36:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19494795', 'http://fr.web.img2.acsta.net/pictures/210/240/21024051_20130802102929359.jpg'),
(161, 199842, 'L''Extravagant voyage du jeune et prodigieux T.S. Spivet', '2013-10-16', '<p style="text-align: justify;">T.S. Spivet, vit dans un ranch isolé du Montana avec ses parents, sa soeur Gracie et son frère Layton. Petit garçon surdoué et passionné de science, il a inventé la machine à mouvement perpétuel, ce qui lui vaut de recevoir le très prestigieux prix Baird du Musée Smithsonian de Washington.', '<p style="text-align: justify;">T.S. Spivet, vit dans un ranch isolé du Montana avec ses parents, sa soeur Gracie et son frère Layton. Petit garçon surdoué et passionné de science, il a inventé la machine à mouvement perpétuel, ce qui lui vaut de recevoir le très prestigieux prix Baird du Musée Smithsonian de Washington.', '01:45:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537595', 'http://fr.web.img5.acsta.net/pictures/210/060/21006006_20130913150332044.jpg'),
(162, 220424, 'Gabrielle', '2013-10-16', '<p style="text-align: justify;">Gabrielle et Martin tombent fous amoureux l''un de l''autre. Mais leur entourage ne leur permet pas de vivre cet amour comme ils l''entendent car Gabrielle et Martin ne sont pas tout à fait comme les autres...', '<p style="text-align: justify;">Gabrielle et Martin tombent fous amoureux l''un de l''autre. Mais leur entourage ne leur permet pas de vivre cet amour comme ils l''entendent car Gabrielle et Martin ne sont pas tout à fait comme les autres...', '01:43:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537259', 'http://fr.web.img1.acsta.net/pictures/210/212/21021277_2013092617375681.jpg'),
(163, 206605, 'Room 514', '2013-10-09', '<p style="text-align: justify;">Anna, enquêtrice dans l''armée israélienne, est une jeune femme idéaliste. Quand elle confronte un officier supérieur à des accusations de violence gratuite à l''encontre d''un Palestinien, sa propre intégrité et sa détermination sont mises à l''épreuve.', '<p style="text-align: justify;">Anna, enquêtrice dans l''armée israélienne, est une jeune femme idéaliste. Quand elle confronte un officier supérieur à des accusations de violence gratuite à l''encontre d''un Palestinien, sa propre intégrité et sa détermination sont mises à l''épreuve.', '01:30:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536306', 'http://fr.web.img5.acsta.net/pictures/201/894/20189438_20130805184128353.jpg'),
(164, 216514, 'Shérif Jackson', '2013-10-09', '<p style="text-align: justify;">Dans les plaines arides du Nouveau-Mexique, Sarah, une ancienne prostituée, découvre le corps sans vie de son mari, sauvagement assassiné par un fanatique religieux. Meurtrie, elle part en croisade vengeresse, mais c''est sans compter sur l''arrivée de l''extravagant shérif Jackson.', '<p style="text-align: justify;">Dans les plaines arides du Nouveau-Mexique, Sarah, une ancienne prostituée, découvre le corps sans vie de son mari, sauvagement assassiné par un fanatique religieux. Meurtrie, elle part en croisade vengeresse, mais c''est sans compter sur l''arrivée de l''extravagant shérif Jackson.', '01:39:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536989', 'http://fr.web.img4.acsta.net/pictures/210/386/21038688_20130911102925701.jpg'),
(165, 180887, 'Prisoners', '2013-10-09', 'Dans la banlieue de Boston, deux fillettes de 6 ans, Anna et Joy, ont disparu. Le détective Loki privilégie la thèse du kidnapping suite au témoignage de Keller, le père d''Anna. Le suspect numéro 1 est rapidement arrêté mais est relâché quelques jours plus tard faute de preuve, entrainant la fureur de Keller.', 'Dans la banlieue de Boston, deux fillettes de 6 ans, Anna et Joy, ont disparu. Le détective Loki privilégie la thèse du kidnapping suite au témoignage de Keller, le père d''Anna. Le suspect numéro 1 est rapidement arrêté mais est relâché quelques jours plus tard faute de preuve, entrainant la fureur de Keller.', '02:33:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536953', 'http://fr.web.img6.acsta.net/pictures/210/280/21028038_20130813155654441.jpg'),
(166, 183447, 'Planes', '2013-10-09', '<p style="text-align: justify;">Un avion au grand coeur, va se surpasser pour donner des ailes à son rêve et voler en compétition parmi les avions les plus rapides du monde.', '<p style="text-align: justify;">Un avion au grand coeur, va se surpasser pour donner des ailes à son rêve et voler en compétition parmi les avions les plus rapides du monde.', '01:32:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19504934', 'http://fr.web.img1.acsta.net/pictures/210/103/21010313_20130604174723216.jpg'),
(167, 203302, 'La Vie d''Adèle - Chapitres 1 et 2', '2013-10-09', 'À 15 ans, Adèle ne se pose pas de question : une fille, ça sort avec des garçons. Sa vie bascule le jour où elle rencontre Emma, une jeune femme aux cheveux bleus, qui lui fait découvrir le désir et lui permettra de s''affirmer en tant que femme et adulte.', 'À 15 ans, Adèle ne se pose pas de question : une fille, ça sort avec des garçons. Sa vie bascule le jour où elle rencontre Emma, une jeune femme aux cheveux bleus, qui lui fait découvrir le désir et lui permettra de s''affirmer en tant que femme et adulte.', '02:57:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537141', 'http://fr.web.img5.acsta.net/pictures/210/359/21035935_20130903173858999.jpg'),
(168, 199230, 'Diana', '2013-10-02', 'La grande histoire d''amour méconnue entre la princesse Diana et un chirurgien d''origine pakistanaise, 2 ans avant sa mort.', 'La grande histoire d''amour méconnue entre la princesse Diana et un chirurgien d''origine pakistanaise, 2 ans avant sa mort.', '01:53:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537358', 'http://fr.web.img1.acsta.net/pictures/210/233/21023376_20130730121416649.jpg'),
