(170, 217676, 'Opium', '2013-10-02', '<p style="text-align: justify;">Les amours contrariées de Jean Cocteau et Raymond Radiguet, au début des années 20. La mort de Radiguet qui fait sombrer Cocteau dans l''opium. Un récit sous l''emprise de la drogue. Une narration dans l''esprit de Cocteau. Le tout est une comédie musicale.', '<p style="text-align: justify;">Les amours contrariées de Jean Cocteau et Raymond Radiguet, au début des années 20. La mort de Radiguet qui fait sombrer Cocteau dans l''opium. Un récit sous l''emprise de la drogue. Une narration dans l''esprit de Cocteau. Le tout est une comédie musicale.', '01:18:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19513651', 'http://fr.web.img6.acsta.net/pictures/210/419/21041954_20130920111753738.jpg'),
