(172, 206191, 'Blue Jasmine', '2013-09-25', '<p style="text-align: justify;">Alors qu''elle voit sa vie voler en éclat et son mariage avec Hal, un homme d''affaire fortuné, battre sérieusement de l''aile, Jasmine quitte son New York raffiné et mondain pour San Francisco et s''installe dans le modeste appartement de sa soeur Ginger afin de remettre de l''ordre dans sa vie.', '<p style="text-align: justify;">Alors qu''elle voit sa vie voler en éclat et son mariage avec Hal, un homme d''affaire fortuné, battre sérieusement de l''aile, Jasmine quitte son New York raffiné et mondain pour San Francisco et s''installe dans le modeste appartement de sa soeur Ginger afin de remettre de l''ordre dans sa vie.', '01:38:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536444', 'http://fr.web.img6.acsta.net/pictures/210/134/21013431_20130618152724286.jpg'),
(173, 220583, 'Miele', '2013-09-25', '<p style="text-align: justify;">Irène vit seule dans une maison au bord de la mer non loin de Rome. Son père et son amant la croient étudiante. En réalité, sous le nom de code MIELE, elle aide clandestinement des personnes en phase terminale à mourir dignement en leur administrant un barbiturique puissant.', '<p style="text-align: justify;">Irène vit seule dans une maison au bord de la mer non loin de Rome. Son père et son amant la croient étudiante. En réalité, sous le nom de code MIELE, elle aide clandestinement des personnes en phase terminale à mourir dignement en leur administrant un barbiturique puissant.', '01:36:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537240', 'http://fr.web.img3.acsta.net/pictures/210/237/21023741_20130731172823471.jpg'),
(174, 195370, 'Rush', '2013-09-25', '<p style="text-align: justify;">Situé durant l''âge d''or de la Formule 1, RUSH retrace le passionnant et haletant combat entre deux des plus grands rivaux que l''histoire du sport ait jamais connus, celui de James Hunt et Niki Lauda concourant pour les illustres écuries McLaren et Ferrari.', '<p style="text-align: justify;">Situé durant l''âge d''or de la Formule 1, RUSH retrace le passionnant et haletant combat entre deux des plus grands rivaux que l''histoire du sport ait jamais connus, celui de James Hunt et Niki Lauda concourant pour les illustres écuries McLaren et Ferrari.', '02:03:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536030', 'http://fr.web.img3.acsta.net/pictures/210/238/21023887_20130801123843604.jpg'),
(175, 193459, 'Les Miller, une famille en herbe', '2013-09-18', 'David Burke est un dealer à la petite semaine qui se contente de vendre sa marchandise à des chefs cuisiniers et des mamans accompagnant leurs fils au football, mais pas à des ados ? car, au fond, il a quand même des principes !', 'David Burke est un dealer à la petite semaine qui se contente de vendre sa marchandise à des chefs cuisiniers et des mamans accompagnant leurs fils au football, mais pas à des ados ? car, au fond, il a quand même des principes !', '01:50:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536564', 'http://fr.web.img1.acsta.net/pictures/210/095/21009570_20130530162836574.jpg'),
(176, 139160, 'Ma vie avec Liberace', '2013-09-18', '<p style="text-align: justify;">Avant Elvis, Elton John et Madonna, il y a eu Liberace : pianiste virtuose, artiste exubérant, bête de scène et des plateaux télévisés. Liberace affectionnait la démesure et cultivait l''excès, sur scène et hors scène.', '<p style="text-align: justify;">Avant Elvis, Elton John et Madonna, il y a eu Liberace : pianiste virtuose, artiste exubérant, bête de scène et des plateaux télévisés. Liberace affectionnait la démesure et cultivait l''excès, sur scène et hors scène.', '01:59:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19511961', 'http://fr.web.img4.acsta.net/pictures/210/139/21013963_20130619184351861.jpg'),
(177, 210032, 'Elle s''en va', '2013-09-18', '<p style="text-align: justify;">Bettie, la soixantaine, se voit soudain abandonnée par son amant et se trouve en péril financier avec le restaurant familial. Que faire de sa vie ? Elle prend sa voiture, croyant faire le tour du pâté de maison. Ce sera une échappée.', '<p style="text-align: justify;">Bettie, la soixantaine, se voit soudain abandonnée par son amant et se trouve en péril financier avec le restaurant familial. Que faire de sa vie ? Elle prend sa voiture, croyant faire le tour du pâté de maison. Ce sera une échappée.', '01:53:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536241', 'http://fr.web.img4.acsta.net/pictures/210/329/21032927_20130829103737803.jpg'),
(178, 209735, 'Les Invincibles', '2013-09-18', '<p style="text-align: justify;">L''annonce d''un tournoi international de pétanque organisé par le célèbre Darcy, va bouleverser la vie de Momo, et réveiller ses rêves enfouis par les aléas de la vie : devenir champion et vivre de sa passion.', '<p style="text-align: justify;">L''annonce d''un tournoi international de pétanque organisé par le célèbre Darcy, va bouleverser la vie de Momo, et réveiller ses rêves enfouis par les aléas de la vie : devenir champion et vivre de sa passion.', '01:39:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536923', 'http://fr.web.img5.acsta.net/pictures/13/12/19/17/37/237899.jpg'),
(179, 206994, 'Les Amants du Texas', '2013-09-18', '<p style="text-align: justify;">Bob et Ruth s''aiment, envers et contre tout. Et surtout contre la loi. Un jour, un braquage tourne mal et les deux amants sont pris dans une fusillade. Quand Bob est emmené par la police, Ruth a tout juste le temps de lui annoncer qu''elle est enceinte.\r\n<p style="text-align: justify;">', '<p style="text-align: justify;">Bob et Ruth s''aiment, envers et contre tout. Et surtout contre la loi. Un jour, un braquage tourne mal et les deux amants sont pris dans une fusillade. Quand Bob est emmené par la police, Ruth a tout juste le temps de lui annoncer qu''elle est enceinte.\r\n<p style="text-align: justify;">', '01:41:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536840', 'http://fr.web.img4.acsta.net/pictures/210/236/21023666_2013073114405281.jpg'),
(180, 188951, 'Le Majordome', '2013-09-11', '<p style="text-align: justify;">L''histoire vraie d''un majordome à la Maison-Blanche, qui fut le témoin privilégié des bouleversements politiques et des grands événements historiques, durant ses trente années de service auprès de sept présidents différents.', '<p style="text-align: justify;">L''histoire vraie d''un majordome à la Maison-Blanche, qui fut le témoin privilégié des bouleversements politiques et des grands événements historiques, durant ses trente années de service auprès de sept présidents différents.', '02:12:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19515848', 'http://fr.web.img2.acsta.net/pictures/210/179/21017975_20130705175456051.jpg'),
(181, 131253, 'Gibraltar', '2013-09-11', '<p style="text-align: justify;">L''histoire d''un indic des douanes françaises, qui a infiltré les plus puissantes organisations internationales de narco-trafiquants. Prenant des risques considérables pour ne pas être démasqué, il se retrouve un jour en prison...', '<p style="text-align: justify;">L''histoire d''un indic des douanes françaises, qui a infiltré les plus puissantes organisations internationales de narco-trafiquants. Prenant des risques considérables pour ne pas être démasqué, il se retrouve un jour en prison...', '01:50:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19535791', 'http://fr.web.img5.acsta.net/pictures/210/161/21016154_20130627154323412.jpg'),
(182, 208939, 'Jimmy P.', '2013-09-11', '<p style="text-align: justify;">Au lendemain de la seconde guerre mondiale, Jimmy Picard, un Indien blackfoot ayant combattu en France, est admis à l''hôpital militaire de Topeka, au Kansas, un établissement spécialisé dans les maladies du cerveau.', '<p style="text-align: justify;">Au lendemain de la seconde guerre mondiale, Jimmy Picard, un Indien blackfoot ayant combattu en France, est admis à l''hôpital militaire de Topeka, au Kansas, un établissement spécialisé dans les maladies du cerveau.', '02:02:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19511595', 'http://fr.web.img2.acsta.net/pictures/205/427/20542767_20130705182951232.jpg'),
(183, 215060, 'Ma belle gosse', '2013-09-11', '<p style="text-align: justify;">Maden, 17 ans. Vacances d''été sur l''île. Elle attend le courrier. Entre sa chambre et la plage, son père et ses cousins, la maison et, tout près, la prison.', '<p style="text-align: justify;">Maden, 17 ans. Vacances d''été sur l''île. Elle attend le courrier. Entre sa chambre et la plage, son père et ses cousins, la maison et, tout près, la prison.', '01:20:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19517396', 'http://fr.web.img5.acsta.net/pictures/210/216/21021622_20130722155518919.jpg'),
(184, 214532, 'Rock the Casbah', '2013-09-11', 'C''est l''été à Tanger. Une famille se réunit sur 3 jours dans la maison familiale suite au décès du père, pour se remémorer les souvenirs et partager sa perte, comme le veut la tradition musulmane.', 'C''est l''été à Tanger. Une famille se réunit sur 3 jours dans la maison familiale suite au décès du père, pour se remémorer les souvenirs et partager sa perte, comme le veut la tradition musulmane.', '01:40:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536091', 'http://fr.web.img6.acsta.net/pictures/210/207/21020779_20130718120418237.jpg'),
(185, 205806, 'White House Down', '2013-09-04', 'Un groupe paramilitaire lourdement armé prend le contrôle de la Maison Blanche...', 'Un groupe paramilitaire lourdement armé prend le contrôle de la Maison Blanche...', '02:12:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19518595', 'http://fr.web.img2.acsta.net/pictures/210/175/21017526_20130731153915065.jpg'),
(186, 213993, 'Gare du Nord', '2013-09-04', '', '', '01:59:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536309', 'http://fr.web.img6.acsta.net/pictures/210/234/21023407_20130730125536678.jpg'),
(187, 214370, 'Tirez la langue, mademoiselle', '2013-09-04', '<p style="text-align: justify;">Boris et Dimitri Pizarnik sont médecins dans le quartier chinois à Paris. Ils sont frères et c''est ensemble qu''ils pratiquent leur métier, consacrant tout leur temps à leurs patients. <br/>Une nuit, ils sont amenés à soigner une petite fille diabétique que sa mère, Judith, élève seule.', '<p style="text-align: justify;">Boris et Dimitri Pizarnik sont médecins dans le quartier chinois à Paris. Ils sont frères et c''est ensemble qu''ils pratiquent leur métier, consacrant tout leur temps à leurs patients. <br/>Une nuit, ils sont amenés à soigner une petite fille diabétique que sa mère, Judith, élève seule.', '01:42:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536862', 'http://fr.web.img5.acsta.net/pictures/210/216/21021627_20130722160816722.jpg'),
(188, 220942, 'Ilo Ilo', '2013-09-04', '<p style="text-align: justify;">A Singapour, Jiale, jeune garçon turbulent vit avec ses parents. Les rapports familiaux sont tendus et la mère, dépassée par son fils, décide d''embaucher Teresa, une jeune Philippine.', '<p style="text-align: justify;">A Singapour, Jiale, jeune garçon turbulent vit avec ses parents. Les rapports familiaux sont tendus et la mère, dépassée par son fils, décide d''embaucher Teresa, une jeune Philippine.', '01:39:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536318', 'http://fr.web.img2.acsta.net/pictures/210/198/21019805_20130716115805416.jpg'),
(189, 189924, 'Romeos', '2013-09-04', 'Lukas vient d''avoir 20 ans. Il commence son service civil en même temps que sa meilleure amie Ine. Face aux autres, il tente de préserver son secret ? Lukas est transgenre, une fille devenue garçon.', 'Lukas vient d''avoir 20 ans. Il commence son service civil en même temps que sa meilleure amie Ine. Face aux autres, il tente de préserver son secret ? Lukas est transgenre, une fille devenue garçon.', '01:34:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19537405', 'http://fr.web.img4.acsta.net/pictures/210/193/21019318_20130712173610982.jpg'),
(190, 189613, 'Red 2', '2013-08-28', '<p style="text-align: justify;">Lorsque l''agent retraité de la CIA Franck Moses apprend la mort de son ancien collègue Marvin, il se rend à son enterrement avec sa compagne Sarah, sans se douter qu''il va au-devant de gros problèmes?', '<p style="text-align: justify;">Lorsque l''agent retraité de la CIA Franck Moses apprend la mort de son ancien collègue Marvin, il se rend à son enterrement avec sa compagne Sarah, sans se douter qu''il va au-devant de gros problèmes?', '01:57:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19519380', 'http://fr.web.img3.acsta.net/pictures/210/146/21014630_20130621185839634.jpg'),
(191, 216955, 'Alabama Monroe', '2013-08-28', '<p style="text-align: justify;">Didier et Élise vivent une histoire d''amour passionnée et rythmée par la musique. Lui, joue du banjo dans un groupe de Bluegrass Country et vénère l''Amérique. Elle, tient un salon de tatouage et chante dans le groupe de Didier. De leur union fusionnelle naît une fille, Maybelle...', '<p style="text-align: justify;">Didier et Élise vivent une histoire d''amour passionnée et rythmée par la musique. Lui, joue du banjo dans un groupe de Bluegrass Country et vénère l''Amérique. Elle, tient un salon de tatouage et chante dans le groupe de Didier. De leur union fusionnelle naît une fille, Maybelle...', '01:49:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19506755', 'http://fr.web.img6.acsta.net/pictures/210/017/21001711_20130426125343183.jpg'),
(192, 49001, 'Une place sur la terre', '2013-08-28', '<p style="text-align: justify;">Antoine, photographe joyeusement désabusé, a pour seul ami Matéo, le jeune fils de sa voisine souvent absente, auquel il donne une éducation fantaisiste. Un matin, des notes de piano venues de l''immeuble d''en face captent son attention.', '<p style="text-align: justify;">Antoine, photographe joyeusement désabusé, a pour seul ami Matéo, le jeune fils de sa voisine souvent absente, auquel il donne une éducation fantaisiste. Un matin, des notes de piano venues de l''immeuble d''en face captent son attention.', '01:40:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536043', 'http://fr.web.img2.acsta.net/pictures/210/139/21013964_2013061918452671.jpg'),
(193, 206128, 'Grand Central', '2013-08-28', '<p style="text-align: justify;">De petits boulots en petits boulots, Gary est embauché dans une centrale nucléaire. Là, au plus près des réacteurs, où les doses radioactives sont les plus fortes, il tombe amoureux de Karole, la femme de Toni. L''amour interdit et les radiations contaminent lentement Gary.', '<p style="text-align: justify;">De petits boulots en petits boulots, Gary est embauché dans une centrale nucléaire. Là, au plus près des réacteurs, où les doses radioactives sont les plus fortes, il tombe amoureux de Karole, la femme de Toni. L''amour interdit et les radiations contaminent lentement Gary.', '01:34:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19535850', 'http://fr.web.img2.acsta.net/pictures/205/346/20534616_20130702111026946.jpg'),
(194, 205384, 'La Grande boucle', '2013-06-12', 'François est un passionné du Tour de France. Licencié par son patron et quitté par sa femme, il part faire la Grande Boucle avec un jour d''avance sur les pros. D''abord seul, il est vite rejoint par d''autres, inspirés par son défi.', 'François est un passionné du Tour de France. Licencié par son patron et quitté par sa femme, il part faire la Grande Boucle avec un jour d''avance sur les pros. D''abord seul, il est vite rejoint par d''autres, inspirés par son défi.', '01:38:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19502757', 'http://fr.web.img4.acsta.net/pictures/210/023/21002373_20130430122051035.jpg'),
(195, 204184, 'The Bling Ring', '2013-06-12', 'À Los Angeles, un groupe d''adolescents fascinés par le people et l''univers des marques traque via Internet l''agenda des célébrités pour cambrioler leurs résidences. Ils subtiliseront pour plus de 3 millions de dollars d''objets de luxe. Les médias ont surnommé ce gang, le "Bling Ring".', 'À Los Angeles, un groupe d''adolescents fascinés par le people et l''univers des marques traque via Internet l''agenda des célébrités pour cambrioler leurs résidences. Ils subtiliseront pour plus de 3 millions de dollars d''objets de luxe. Les médias ont surnommé ce gang, le "Bling Ring".', '01:30:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19511733', 'http://fr.web.img6.acsta.net/pictures/210/052/21005295_20130513125110571.jpg'),
(196, 145475, 'Star Trek Into Darkness', '2013-06-12', 'Alors qu''il rentre à sa base, l''équipage de l''Enterprise doit faire face à des forces terroristes implacables au sein même de son organisation. L''ennemi a fait exploser la flotte et tout ce qu''elle représentait, plongeant notre monde dans le chaos?', 'Alors qu''il rentre à sa base, l''équipage de l''Enterprise doit faire face à des forces terroristes implacables au sein même de son organisation. L''ennemi a fait exploser la flotte et tout ce qu''elle représentait, plongeant notre monde dans le chaos?', '02:10:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19494789', 'http://fr.web.img6.acsta.net/medias/nmedia/18/95/04/04/20535567.jpg'),
(197, 187601, 'The Iceman', '2013-06-05', 'Tiré de faits réels, voici l''histoire de Richard Kuklinski, surnommé « The Iceman », un tueur à gages qui fut condamné pour une centaine de meurtres commandités par différentes organisations criminelles new-yorkaises.', 'Tiré de faits réels, voici l''histoire de Richard Kuklinski, surnommé « The Iceman », un tueur à gages qui fut condamné pour une centaine de meurtres commandités par différentes organisations criminelles new-yorkaises.', '01:45:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19503631', 'http://fr.web.img4.acsta.net/medias/nmedia/18/89/81/20/20522008.jpg'),
(198, 213538, 'Pop Redemption', '2013-06-05', 'Chaque été, depuis leur adolescence, les Dead MaKabés se paient ce qu''ils appellent prétentieusement une "tournée d''été" - quelques concerts dans des festivals du fin fond de l''Europe.', 'Chaque été, depuis leur adolescence, les Dead MaKabés se paient ce qu''ils appellent prétentieusement une "tournée d''été" - quelques concerts dans des festivals du fin fond de l''Europe.', '01:35:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19505944', 'http://fr.web.img1.acsta.net/pictures/210/009/21000901_2013042317444331.jpg'),
(199, 207178, 'Demi-soeur', '2013-06-05', 'Nénette, est une femme simple et innocente. A la mort de sa mère elle décide de partir à la recherche de son père, pourtant mort depuis longtemps. Nénette découvre alors qu''elle a un demi-frère, un pharmacien quelque peu psychorigide...', 'Nénette, est une femme simple et innocente. A la mort de sa mère elle décide de partir à la recherche de son père, pourtant mort depuis longtemps. Nénette découvre alors qu''elle a un demi-frère, un pharmacien quelque peu psychorigide...', '01:30:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19509726', 'http://fr.web.img6.acsta.net/pictures/210/028/21002881_20130502171039489.jpg'),
(200, 186905, 'After Earth', '2013-06-05', 'Après un atterrissage forcé, Kitai Raige et son père, Cypher, se retrouvent sur Terre, mille ans après que l''humanité a été obligée d''évacuer la planète, chassée par des événements cataclysmiques.', 'Après un atterrissage forcé, Kitai Raige et son père, Cypher, se retrouvent sur Terre, mille ans après que l''humanité a été obligée d''évacuer la planète, chassée par des événements cataclysmiques.', '01:40:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19485922', 'http://fr.web.img2.acsta.net/medias/nmedia/18/92/13/97/20509208.jpg'),
(201, 201221, 'Ginger & Rosa', '2013-05-29', 'Londres dans les années 1960. Ginger et Rosa, deux ados inséparables vivent ce moment unique du passage de l''enfance à l''âge adulte.', 'Londres dans les années 1960. Ginger et Rosa, deux ados inséparables vivent ce moment unique du passage de l''enfance à l''âge adulte.', '01:30:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19508672', 'http://fr.web.img6.acsta.net/pictures/210/046/21004633_2013051011345659.jpg'),
(202, 194160, 'Very Bad Trip 3', '2013-05-29', 'Deux ans ont passé. Phil, Stu et Doug mènent des existences tranquilles et heureuses. Ils ont fait disparaître leurs tatouages et se sont rachetés une conduite. Seul Alan n''a pas trouvé son équilibre et laisse libre cours à ses impulsions.', 'Deux ans ont passé. Phil, Stu et Doug mènent des existences tranquilles et heureuses. Ils ont fait disparaître leurs tatouages et se sont rachetés une conduite. Seul Alan n''a pas trouvé son équilibre et laisse libre cours à ses impulsions.', '01:40:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19502208', 'http://fr.web.img6.acsta.net/pictures/210/080/21008070_20130524113929346.jpg'),
(203, 193235, 'The Call', '2013-05-29', 'Une adolescente est kidnappée par un tueur en série. Pour la sauver, une opératrice d''un centre d''appel d''urgences va affronter ses propres peurs liées à une tragédie de son passé.', 'Une adolescente est kidnappée par un tueur en série. Pour la sauver, une opératrice d''un centre d''appel d''urgences va affronter ses propres peurs liées à une tragédie de son passé.', '01:35:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19505188', 'http://fr.web.img2.acsta.net/pictures/210/004/21000451_20130422162145636.jpg'),
(204, 208066, 'Alata', '2013-05-22', 'Nimer, un étudiant palestinien réfugié clandestinement à Tel-Aviv, rêve d''une vie meilleure à l''étranger. Une nuit, il rencontre Roy, un jeune avocat israélien. Ils s''éprennent l''un de l''autre.', 'Nimer, un étudiant palestinien réfugié clandestinement à Tel-Aviv, rêve d''une vie meilleure à l''étranger. Une nuit, il rencontre Roy, un jeune avocat israélien. Ils s''éprennent l''un de l''autre.', '01:36:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19509466', 'http://fr.web.img4.acsta.net/medias/nmedia/18/96/29/17/20458411.jpg'),
(205, 210804, 'La Grande Bellezza', '2013-05-22', '<p style="text-align: justify;">Rome dans la splendeur de l''été. Les touristes se pressent sur le Janicule : un Japonais s''effondre foudroyé par tant de beauté. Jep Gambardella ? un bel homme au charme irrésistible malgré les premiers signes de la vieillesse ? jouit des mondanités de la ville.', '<p style="text-align: justify;">Rome dans la splendeur de l''été. Les touristes se pressent sur le Janicule : un Japonais s''effondre foudroyé par tant de beauté. Jep Gambardella ? un bel homme au charme irrésistible malgré les premiers signes de la vieillesse ? jouit des mondanités de la ville.', '02:21:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19507481', 'http://fr.web.img4.acsta.net/pictures/210/021/21002178_20130429173420254.jpg');
