(206, 196741, 'Epic : la bataille du royaume secret', '2013-05-22', 'L''histoire d''une guerre insoupçonnable qui fait rage autour de nous. Lorsqu''une adolescente se retrouve plongée par magie dans cet univers caché, elle doit s''allier à un groupe improbable de personnages singuliers et pleins d''humour afin de sauver leur monde... et le nôtre.', 'L''histoire d''une guerre insoupçonnable qui fait rage autour de nous. Lorsqu''une adolescente se retrouve plongée par magie dans cet univers caché, elle doit s''allier à un groupe improbable de personnages singuliers et pleins d''humour afin de sauver leur monde... et le nôtre.', '01:42:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19517478', 'http://fr.web.img6.acsta.net/medias/nmedia/18/91/58/29/20492868.jpg'),
(207, 172433, 'Only God Forgives', '2013-05-22', 'À Bangkok, Julian, qui a fui la justice américaine, dirige un club de boxe thaïlandaise servant de couverture à son trafic de drogue. Sa mère, chef d''une vaste organisation criminelle, débarque des États-Unis afin de rapatrier le corps de son fils préféré, Billy...', 'À Bangkok, Julian, qui a fui la justice américaine, dirige un club de boxe thaïlandaise servant de couverture à son trafic de drogue. Sa mère, chef d''une vaste organisation criminelle, débarque des États-Unis afin de rapatrier le corps de son fils préféré, Billy...', '01:30:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19504214', 'http://fr.web.img6.acsta.net/pictures/210/002/21000216_20130419192202667.jpg'),
(208, 189651, 'Fast & Furious 6', '2013-05-22', 'De passage en Europe pour un braquage, Dom Toretto, Brian O''Conner et leur groupe doivent faire face à une bande rivale, déjà sur le coup.', 'De passage en Europe pour un braquage, Dom Toretto, Brian O''Conner et leur groupe doivent faire face à une bande rivale, déjà sur le coup.', '02:10:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19507358', 'http://fr.web.img3.acsta.net/pictures/210/038/21003859_20130507110423451.jpg'),
(209, 204198, 'Le Passé', '2013-05-17', 'Après quatre années de séparation, Ahmad arrive à Paris depuis Téhéran, à la demande de Marie, son épouse française, pour procéder aux formalités de leur divorce. Lors de son bref séjour, Ahmad découvre la relation conflictuelle que Marie entretient avec sa fille, Lucie.', 'Après quatre années de séparation, Ahmad arrive à Paris depuis Téhéran, à la demande de Marie, son épouse française, pour procéder aux formalités de leur divorce. Lors de son bref séjour, Ahmad découvre la relation conflictuelle que Marie entretient avec sa fille, Lucie.', '02:10:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19497833', 'http://fr.web.img1.acsta.net/pictures/210/103/21010314_20130604174853439.jpg'),
(210, 197124, 'Song for Marion', '2013-05-15', 'Arthur et Marion, couple de retraités londoniens, sont profondément unis malgré leurs caractères dissemblables ; Marion est positive et sociable, Arthur est morose et fâché avec la terre entière.', 'Arthur et Marion, couple de retraités londoniens, sont profondément unis malgré leurs caractères dissemblables ; Marion est positive et sociable, Arthur est morose et fâché avec la terre entière.', '01:33:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19478796', 'http://fr.web.img6.acsta.net/medias/nmedia/18/94/47/46/20521722.jpg'),
(211, 141808, 'Gatsby le Magnifique', '2013-05-15', 'Printemps 1922. L''époque est propice au relâchement des m?urs, à l''essor du jazz et à l''enrichissement des contrebandiers d''alcool? Apprenti écrivain, Nick Carraway quitte la région du Middle-West pour s''installer à New York.', 'Printemps 1922. L''époque est propice au relâchement des m?urs, à l''essor du jazz et à l''enrichissement des contrebandiers d''alcool? Apprenti écrivain, Nick Carraway quitte la région du Middle-West pour s''installer à New York.', '02:22:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19452224', 'http://fr.web.img6.acsta.net/medias/nmedia/18/86/89/36/20531934.jpg'),
(212, 191300, 'L''Hypnotiseur', '2013-05-08', 'Une famille est retrouvée sauvagement assassinée dans une maison de la banlieue de Stockholm. Laissé pour mort, Josef, le fils aîné, devient le seul témoin du crime. Dans le coma, il ne peut être interrogé par l''inspecteur Joona en charge de l''enquête.', 'Une famille est retrouvée sauvagement assassinée dans une maison de la banlieue de Stockholm. Laissé pour mort, Josef, le fils aîné, devient le seul témoin du crime. Dans le coma, il ne peut être interrogé par l''inspecteur Joona en charge de l''enquête.', '02:02:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19491731', 'http://fr.web.img5.acsta.net/medias/nmedia/18/97/15/43/20533321.jpg'),
(213, 196266, 'Une vie simple', '2013-05-08', 'Ah Tao est né à Taishan en Chine. Elle est au service de la famille Leung depuis 60 ans, soit quatre générations. Aujourd''hui, elle vit seule avec Roger, le dernier membre de la famille Leung à Hong Kong.', 'Ah Tao est né à Taishan en Chine. Elle est au service de la famille Leung depuis 60 ans, soit quatre générations. Aujourd''hui, elle vit seule avec Roger, le dernier membre de la famille Leung à Hong Kong.', '02:03:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19495568', 'http://fr.web.img4.acsta.net/medias/nmedia/18/96/05/20/20531893.jpg'),
(214, 193485, 'Trance', '2013-05-08', 'Commissaire-priseur expert dans les ?uvres d''art, Simon se fait le complice d''un gang pour voler un tableau. Dans le feu de l''action, il reçoit un coup sur la tête. À son réveil, il n''a plus aucun souvenir de l''endroit où est caché le tableau.', 'Commissaire-priseur expert dans les ?uvres d''art, Simon se fait le complice d''un gang pour voler un tableau. Dans le feu de l''action, il reçoit un coup sur la tête. À son réveil, il n''a plus aucun souvenir de l''endroit où est caché le tableau.', '01:41:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19484853', 'http://fr.web.img5.acsta.net/medias/nmedia/18/95/49/26/20492152.jpg'),
(215, 199981, 'Hotel Normandy', '2013-05-08', 'Parce que, depuis la disparition prématurée de son mari, Alice refuse systématiquement de donner la moindre chance à tous les hommes que lui présentent ses deux meilleures amies, celles-ci lui offrent un séjour de rêve à l''hôtel Normandy de Deauville...', 'Parce que, depuis la disparition prématurée de son mari, Alice refuse systématiquement de donner la moindre chance à tous les hommes que lui présentent ses deux meilleures amies, celles-ci lui offrent un séjour de rêve à l''hôtel Normandy de Deauville...', '01:37:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19484085', 'http://fr.web.img6.acsta.net/medias/nmedia/18/90/09/22/20495760.jpg'),
(216, 183129, 'Stoker', '2013-05-01', 'A la mort de son père dans un étrange accident de voiture, India, une adolescente, assiste au retour de son oncle, un homme mystérieux dont elle ignorait l''existence, et qui s''installe avec elle et sa mère.', 'A la mort de son père dans un étrange accident de voiture, India, une adolescente, assiste au retour de son oncle, un homme mystérieux dont elle ignorait l''existence, et qui s''installe avec elle et sa mère.', '01:40:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19495788', 'http://fr.web.img3.acsta.net/medias/nmedia/18/93/80/77/20487654.jpg'),
(217, 201704, 'Denis', '2013-05-01', 'Par deux fois, Vincent a cru rencontrer la femme de sa vie. Par deux fois, elles l''ont quitté pour le même homme... Denis. Maintenant que Vincent file le parfait amour avec Anna, sa seule crainte est que l''histoire se répète.', 'Par deux fois, Vincent a cru rencontrer la femme de sa vie. Par deux fois, elles l''ont quitté pour le même homme... Denis. Maintenant que Vincent file le parfait amour avec Anna, sa seule crainte est que l''histoire se répète.', '01:25:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19490479', 'http://fr.web.img1.acsta.net/pictures/210/021/21002139_20130429164021569.jpg'),
(218, 196628, 'Mud - Sur les rives du Mississippi', '2013-05-01', 'Ellis et Neckbone, 14 ans, découvrent lors d''une de leurs escapades quotidiennes, un homme réfugié sur une île au milieu du Mississipi. C''est Mud : un serpent tatoué sur le bras, un flingue et une chemise porte-bonheur.', 'Ellis et Neckbone, 14 ans, découvrent lors d''une de leurs escapades quotidiennes, un homme réfugié sur une île au milieu du Mississipi. C''est Mud : un serpent tatoué sur le bras, un flingue et une chemise porte-bonheur.', '02:10:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19494878', 'http://fr.web.img2.acsta.net/pictures/210/002/21000219_20130419193021705.jpg'),
(219, 213833, 'Mohamed Dubois', '2013-05-01', 'Héritier de la banque Berthier, Arnaud Dubois a plutôt une tête à se prénommer... Mohamed. D''ailleurs ne serait-il pas plutôt le fils de Saïd, l''ex-prof de tennis de sa mère à Djerba ? Suite à une dispute avec son père, il décide de quitter le nid douillet du Vésinet.', 'Héritier de la banque Berthier, Arnaud Dubois a plutôt une tête à se prénommer... Mohamed. D''ailleurs ne serait-il pas plutôt le fils de Saïd, l''ex-prof de tennis de sa mère à Djerba ? Suite à une dispute avec son père, il décide de quitter le nid douillet du Vésinet.', '01:32:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19492696', 'http://fr.web.img5.acsta.net/medias/nmedia/18/96/96/14/20498965.jpg'),
(220, 206116, 'Survivre', '2013-04-24', 'Hiver 1984, un chalutier sombre au large des cotes islandaises. Les membres de l''équipage périssent tous en quelques minutes. Tous sauf un.  Dans l''eau glaciale, cette force de la nature parvient, au terme d''une nage héroïque de plus de 6 heures, à regagner la terre.', 'Hiver 1984, un chalutier sombre au large des cotes islandaises. Les membres de l''équipage périssent tous en quelques minutes. Tous sauf un.  Dans l''eau glaciale, cette force de la nature parvient, au terme d''une nage héroïque de plus de 6 heures, à regagner la terre.', '01:36:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19484835', 'http://fr.web.img3.acsta.net/medias/nmedia/18/96/85/49/20521238.jpg'),
(221, 198292, 'Hannah Arendt', '2013-04-24', '1961 - La philosophe juive allemande Hannah Arendt est envoyée à Jérusalem par le New Yorker pour couvrir le procès d''Adolf Eichmann, responsable de la déportation de millions de juifs.', '1961 - La philosophe juive allemande Hannah Arendt est envoyée à Jérusalem par le New Yorker pour couvrir le procès d''Adolf Eichmann, responsable de la déportation de millions de juifs.', '01:53:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19414974', 'http://fr.web.img2.acsta.net/medias/nmedia/18/93/93/88/20479928.jpg'),
(222, 109860, 'La Cage Dorée', '2013-04-24', 'Maria et José Ribeiro vivent depuis trente ans dans leur petite loge des beaux quartiers parisiens. Ce couple d''immigrés portugais fait l''unanimité dans le quartier, mais quand on leur propose de retourner au Portugal, personne ne veut les laisser partir. Et eux, que veulent-ils ?', 'Maria et José Ribeiro vivent depuis trente ans dans leur petite loge des beaux quartiers parisiens. Ce couple d''immigrés portugais fait l''unanimité dans le quartier, mais quand on leur propose de retourner au Portugal, personne ne veut les laisser partir. Et eux, que veulent-ils ?', '01:31:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19490619', 'http://fr.web.img1.acsta.net/medias/nmedia/18/95/50/99/20504068.jpg'),
(223, 139589, 'Iron Man 3', '2013-04-24', '<p style="text-align: justify;">Tony Stark, l''industriel flamboyant qui est aussi Iron Man, est confronté cette fois à un ennemi qui va attaquer sur tous les fronts. Lorsque son univers personnel est détruit, Stark se lance dans une quête acharnée pour retrouver les coupables.', '<p style="text-align: justify;">Tony Stark, l''industriel flamboyant qui est aussi Iron Man, est confronté cette fois à un ennemi qui va attaquer sur tous les fronts. Lorsque son univers personnel est détruit, Stark se lance dans une quête acharnée pour retrouver les coupables.', '02:11:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19484270', 'http://fr.web.img5.acsta.net/medias/nmedia/18/91/08/37/20508296.jpg'),
(224, 196832, 'L''Ecume des jours', '2013-04-24', 'L''histoire de Colin, joli garçon, riche, sympathique et dés?uvré. Jusqu''au jour où il rencontre Chloé, et dont il tombe follement amoureux. Dans leur bonheur, ils se marient. Mais un jour, Chloé se sent mal, et le médecin diagnostique la maladie...', 'L''histoire de Colin, joli garçon, riche, sympathique et dés?uvré. Jusqu''au jour où il rencontre Chloé, et dont il tombe follement amoureux. Dans leur bonheur, ils se marient. Mais un jour, Chloé se sent mal, et le médecin diagnostique la maladie...', '01:30:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19487939', 'http://fr.web.img2.acsta.net/pictures/14/01/24/11/49/372322.jpg'),
(225, 146716, 'The Grandmaster', '2013-04-17', 'Chine, 1936. Ip Man, maître légendaire de Wing Chun (un des divers styles de kung-fu) et futur mentor de Bruce Lee, mène une vie prospère à Foshan où il partage son temps entre sa famille et les arts-martiaux.', 'Chine, 1936. Ip Man, maître légendaire de Wing Chun (un des divers styles de kung-fu) et futur mentor de Bruce Lee, mène une vie prospère à Foshan où il partage son temps entre sa famille et les arts-martiaux.', '02:03:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19471308', 'http://fr.web.img1.acsta.net/medias/nmedia/18/95/57/15/20510037.jpg'),
(226, 173053, 'Les Âmes Vagabondes', '2013-04-17', 'La Terre est envahie. L''humanité est en danger. Nos corps restent les mêmes, mais nos esprits sont contrôlés. Melanie Stryder vient d''être capturée. Elle refuse cependant de laisser place à l''être qui tente de la posséder.', 'La Terre est envahie. L''humanité est en danger. Nos corps restent les mêmes, mais nos esprits sont contrôlés. Melanie Stryder vient d''être capturée. Elle refuse cependant de laisser place à l''être qui tente de la posséder.', '02:06:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19477651', 'http://fr.web.img4.acsta.net/medias/nmedia/18/89/71/61/20474073.jpg'),
(227, 193544, 'Promised Land', '2013-04-17', 'Steve Butler, représentant d''un grand groupe énergétique, se rend avec Sue Thomason dans une petite ville de campagne. Les deux collègues sont convaincus qu''à cause de la crise économique qui sévit, les habitants ne pourront pas refuser leur lucrative proposition...', 'Steve Butler, représentant d''un grand groupe énergétique, se rend avec Sue Thomason dans une petite ville de campagne. Les deux collègues sont convaincus qu''à cause de la crise économique qui sévit, les habitants ne pourront pas refuser leur lucrative proposition...', '01:46:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19440061', 'http://fr.web.img6.acsta.net/medias/nmedia/18/93/52/00/20360511.jpg'),
(228, 201181, 'Les Gamins', '2013-04-17', 'Tout juste fiancé, Thomas rencontre son futur beau-père Gilbert, marié depuis 30 ans à Suzanne et en pleine crise de la cinquantaine. Gilbert, persuadé d''avoir gâché sa vie à cause de son couple, dissuade Thomas d''épouser sa fille Lola et le pousse à tout plaquer à ses côtés.', 'Tout juste fiancé, Thomas rencontre son futur beau-père Gilbert, marié depuis 30 ans à Suzanne et en pleine crise de la cinquantaine. Gilbert, persuadé d''avoir gâché sa vie à cause de son couple, dissuade Thomas d''épouser sa fille Lola et le pousse à tout plaquer à ses côtés.', '01:38:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19479155', 'http://fr.web.img5.acsta.net/medias/nmedia/18/94/97/40/20512713.jpg'),
(229, 204301, 'Mariage à l''anglaise', '2013-04-10', 'Nat, ambitieuse cadre d''entreprise et Josh, romancier obstiné, sont prêts à tout pour que leur mariage tienne plus d''une année? Parviendront-ils à prouver à leurs proches la solidité de leur union ?', 'Nat, ambitieuse cadre d''entreprise et Josh, romancier obstiné, sont prêts à tout pour que leur mariage tienne plus d''une année? Parviendront-ils à prouver à leurs proches la solidité de leur union ?', '01:37:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19444918', 'http://fr.web.img3.acsta.net/medias/nmedia/18/96/06/91/20468838.jpg'),
(230, 203485, 'Des gens qui s''embrassent', '2013-04-10', 'Ça tombe mal l''enterrement de la femme de Zef pendant que Roni marie sa fille ! Cet événement inattendu aggrave les conflits entre les deux frères que tout sépare déjà : métiers, femmes, austérité religieuse de l''un, joie de vivre de l''autre...', 'Ça tombe mal l''enterrement de la femme de Zef pendant que Roni marie sa fille ! Cet événement inattendu aggrave les conflits entre les deux frères que tout sépare déjà : métiers, femmes, austérité religieuse de l''un, joie de vivre de l''autre...', '01:40:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19479190', 'http://fr.web.img4.acsta.net/pictures/13/12/27/12/35/171978.jpg'),
(231, 206812, 'Le temps de l''aventure', '2013-04-10', 'Une journée. Un train. Deux inconnus. Des échanges de regards, le c?ur qui bat. Le regarder partir, le perdre à tout jamais ou s''offrir au temps de l''aventure ? Et si la vie d''Alix basculait?', 'Une journée. Un train. Deux inconnus. Des échanges de regards, le c?ur qui bat. Le regarder partir, le perdre à tout jamais ou s''offrir au temps de l''aventure ? Et si la vie d''Alix basculait?', '01:45:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19483648', 'http://fr.web.img2.acsta.net/medias/nmedia/18/96/59/06/20493769.jpg'),
(232, 146916, 'Les Croods', '2013-04-10', 'Les Croods est l''histoire de la première famille moderne du monde. Elle se déroule à une époque jusqu''à présent inconnue, l''ère Croodéolithique ? lorsque Mère Nature en était aux premières étapes de ses expériences, dont le résultat était une flore et une faune bizarres.', 'Les Croods est l''histoire de la première famille moderne du monde. Elle se déroule à une époque jusqu''à présent inconnue, l''ère Croodéolithique ? lorsque Mère Nature en était aux premières étapes de ses expériences, dont le résultat était une flore et une faune bizarres.', '01:32:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19444310', 'http://fr.web.img4.acsta.net/medias/nmedia/18/95/10/55/20502139.jpg'),
(233, 200313, 'Effets secondaires', '2013-04-03', 'Jon Banks est un psychiatre ambitieux. Quand une jeune femme, Emilie, le consulte pour dépression, il lui prescrit un nouveau médicament. Lorsque la police trouve Emilie couverte de sang, un couteau à la main, le cadavre de son mari à ses pieds, sans aucun souvenir de ce qui s''est passé, la réputation du docteur Banks est compromise?', 'Jon Banks est un psychiatre ambitieux. Quand une jeune femme, Emilie, le consulte pour dépression, il lui prescrit un nouveau médicament. Lorsque la police trouve Emilie couverte de sang, un couteau à la main, le cadavre de son mari à ses pieds, sans aucun souvenir de ce qui s''est passé, la réputation du docteur Banks est compromise?', '01:46:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19477407', 'http://fr.web.img2.acsta.net/medias/nmedia/18/94/94/59/20455382.jpg'),
(234, 136524, 'Perfect Mothers', '2013-04-03', 'Une histoire mêlant l''amour, la luxure et le pouvoir de l''amitié, qui retrace les liaisons passionnées de Lil et Roz, deux amies d''enfance qui s''éprennent de leurs fils respectifs.', 'Une histoire mêlant l''amour, la luxure et le pouvoir de l''amitié, qui retrace les liaisons passionnées de Lil et Roz, deux amies d''enfance qui s''éprennent de leurs fils respectifs.', '01:52:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19476730', 'http://fr.web.img4.acsta.net/medias/nmedia/18/95/08/30/20474197.jpg'),
(235, 197486, 'Quartet', '2013-04-03', 'À Beecham House, paisible pension au c?ur de la campagne anglaise qui accueille des musiciens et chanteurs d''opéra à la retraite, le bruit court qu''une nouvelle pensionnaire arriverait sous peu.', 'À Beecham House, paisible pension au c?ur de la campagne anglaise qui accueille des musiciens et chanteurs d''opéra à la retraite, le bruit court qu''une nouvelle pensionnaire arriverait sous peu.', '01:38:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19476060', 'http://fr.web.img4.acsta.net/medias/nmedia/18/91/70/17/20492887.jpg'),
(236, 209664, 'Amour & turbulences', '2013-04-03', 'Alors qu''un avion la ramène de New York à Paris où elle s''apprête à se marier, la belle Julie se retrouve assise à côté d''Antoine, un séduisant débauché qu''elle a aimé 3 ans plus tôt. Elle va tout faire pour l''éviter alors qu''il compte sur ces 7 h de vol pour la reconquérir!', 'Alors qu''un avion la ramène de New York à Paris où elle s''apprête à se marier, la belle Julie se retrouve assise à côté d''Antoine, un séduisant débauché qu''elle a aimé 3 ans plus tôt. Elle va tout faire pour l''éviter alors qu''il compte sur ces 7 h de vol pour la reconquérir!', '01:36:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19480537', 'http://fr.web.img3.acsta.net/medias/nmedia/18/96/41/34/20465398.jpg'),
(237, 209859, '11.6', '2013-04-03', 'Toni Musulin est convoyeur de fonds depuis dix ans. Le 5 novembre 2009, à 10 heures du matin, il appuie doucement sur l''accélérateur de son fourgon blindé. À l''arrière de son véhicule, 11.6 millions d''euros?', 'Toni Musulin est convoyeur de fonds depuis dix ans. Le 5 novembre 2009, à 10 heures du matin, il appuie doucement sur l''accélérateur de son fourgon blindé. À l''arrière de son véhicule, 11.6 millions d''euros?', '01:42:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19481723', 'http://fr.web.img3.acsta.net/medias/nmedia/18/96/53/93/20474066.jpg'),
(238, 210763, 'Stories We Tell', '2013-03-27', 'Sarah Polley a une famille (presque) normale? Et presque comme toutes les familles, la sienne cache un secret. Quand Sarah le découvre, alors qu''elle est déjà une actrice nominée aux Oscars et une réalisatrice reconnue,  elle décide de se lancer à la recherche de la vérité.', 'Sarah Polley a une famille (presque) normale? Et presque comme toutes les familles, la sienne cache un secret. Quand Sarah le découvre, alors qu''elle est déjà une actrice nominée aux Oscars et une réalisatrice reconnue,  elle décide de se lancer à la recherche de la vérité.', '01:53:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19470246', 'http://fr.web.img4.acsta.net/medias/nmedia/18/96/15/22/20495671.jpg'),
(239, 143638, 'Le Premier homme', '2013-03-27', 'Août 1957. Un écrivain célèbre d''une quarantaine d''années, Jacques Cormery, rend visite à sa mère qui demeure à Alger. La ville est en état de guerre. Il se souvient de ses années d''écolier et de collège, de ses amis européens et algériens et de M. Bernard, son instituteur.', 'Août 1957. Un écrivain célèbre d''une quarantaine d''années, Jacques Cormery, rend visite à sa mère qui demeure à Alger. La ville est en état de guerre. Il se souvient de ses années d''écolier et de collège, de ses amis européens et algériens et de M. Bernard, son instituteur.', '01:41:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19483075', 'http://fr.web.img6.acsta.net/medias/nmedia/18/96/32/53/20459850.jpg'),
(240, 209821, 'Dead Man Talking', '2013-03-27', '20 h. Une prison quelque part. William Lamers est condamné à mort. La loi ne précisant pas la longueur de sa dernière déclaration, il va profiter de ce vide juridique pour dérouler le fil de sa vie afin d''échapper à la sentence.', '20 h. Une prison quelque part. William Lamers est condamné à mort. La loi ne précisant pas la longueur de sa dernière déclaration, il va profiter de ce vide juridique pour dérouler le fil de sa vie afin d''échapper à la sentence.', '01:41:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19475371', 'http://fr.web.img5.acsta.net/medias/nmedia/18/93/15/40/20469164.jpg'),
(241, 212192, 'Les Amants passagers', '2013-03-27', 'Des personnages hauts en couleurs pensent vivre leurs dernières heures à bord d''un avion à destination de Mexico. La vulnérabilité face au danger provoque une catharsis générale qui devient le meilleur moyen d''échapper à l''idée de la mort.', 'Des personnages hauts en couleurs pensent vivre leurs dernières heures à bord d''un avion à destination de Mexico. La vulnérabilité face au danger provoque une catharsis générale qui devient le meilleur moyen d''échapper à l''idée de la mort.', '01:31:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19476499', 'http://fr.web.img1.acsta.net/medias/nmedia/18/95/27/47/20467504.jpg'),
(242, 204761, 'Une chanson pour ma mère', '2013-03-27', 'Quelque part dans les Ardennes, aujourd''hui? C ?est parce qu''ils adorent leur maman qui est en train de disparaitre, que les membres de cette famille décomposée décident de lui offrir le plus incroyable des cadeaux d''adieu: Dave, le chanteur, son idole, en personne !', 'Quelque part dans les Ardennes, aujourd''hui? C ?est parce qu''ils adorent leur maman qui est en train de disparaitre, que les membres de cette famille décomposée décident de lui offrir le plus incroyable des cadeaux d''adieu: Dave, le chanteur, son idole, en personne !', '01:35:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19469786', 'http://fr.web.img2.acsta.net/medias/nmedia/18/95/31/04/20425220.jpg'),
(243, 185867, 'Guerrière', '2013-03-27', 'Marisa, 20 ans, fait partie d''un gang de néo-nazis au nord de l''Allemagne. Tatouée de swastikas, le crâne rasé, elle déteste les étrangers, les juifs, les noirs et flics, à ses yeux tous coupables du déclin de son pays et de la médiocrité de son existence.', 'Marisa, 20 ans, fait partie d''un gang de néo-nazis au nord de l''Allemagne. Tatouée de swastikas, le crâne rasé, elle déteste les étrangers, les juifs, les noirs et flics, à ses yeux tous coupables du déclin de son pays et de la médiocrité de son existence.', '01:40:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19482325', 'http://fr.web.img6.acsta.net/medias/nmedia/18/95/72/72/20471999.jpg'),
(244, 190969, 'Warm Bodies', '2013-03-20', 'Un mystérieux virus a détruit toute civilisation. Les rescapés vivent dans des bunkers fortifiés, redoutant leurs anciens semblables devenus des monstres dévoreurs de chair. R, un mort-vivant romantique, sauve contre toute attente Julie, une adorable survivante...', 'Un mystérieux virus a détruit toute civilisation. Les rescapés vivent dans des bunkers fortifiés, redoutant leurs anciens semblables devenus des monstres dévoreurs de chair. R, un mort-vivant romantique, sauve contre toute attente Julie, une adorable survivante...', '01:37:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19435408', 'http://fr.web.img6.acsta.net/medias/nmedia/18/88/68/60/20477287.jpg'),
(245, 206428, 'Mystery', '2013-03-20', 'Lu Jie est loin d''imaginer que son mari Yongzhao mène une double vie, jusqu''au jour où elle le voit entrer dans un hôtel avec une jeune femme. La vie de Lu Jie s''effondre alors, et ce n''est que le début...', 'Lu Jie est loin d''imaginer que son mari Yongzhao mène une double vie, jusqu''au jour où elle le voit entrer dans un hôtel avec une jeune femme. La vie de Lu Jie s''effondre alors, et ce n''est que le début...', '01:42:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19476796', 'http://fr.web.img3.acsta.net/medias/nmedia/18/90/22/13/20468810.jpg'),
(246, 194891, 'The Place Beyond the Pines', '2013-03-20', 'Un cascadeur braque des banques pour subvenir aux besoins de sa femme et de son fils. Un ancien policier devenu politicien se lance alors sur ses traces.', 'Un cascadeur braque des banques pour subvenir aux besoins de sa femme et de son fils. Un ancien policier devenu politicien se lance alors sur ses traces.', '02:20:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19465183', 'http://fr.web.img6.acsta.net/medias/nmedia/18/95/48/86/20503476.jpg'),
(247, 174677, 'La Religieuse', '2013-03-20', 'XVIIIe siècle. Suzanne, 16 ans, est contrainte par sa famille à rentrer dans les ordres, alors qu''elle aspire à vivre dans « le monde ». Au couvent, elle est confrontée à l''arbitraire de la hiérarchie ecclésiastique : mères supérieures tour à tour bienveillantes, cruelles ou un peu trop aimantes?', 'XVIIIe siècle. Suzanne, 16 ans, est contrainte par sa famille à rentrer dans les ordres, alors qu''elle aspire à vivre dans « le monde ». Au couvent, elle est confrontée à l''arbitraire de la hiérarchie ecclésiastique : mères supérieures tour à tour bienveillantes, cruelles ou un peu trop aimantes?', '01:47:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19470580', 'http://fr.web.img1.acsta.net/medias/nmedia/18/95/50/64/20437278.jpg'),
(248, 189379, '40 ans : mode d''emploi', '2013-03-13', 'Marié depuis des années, Pete est le seul homme de la maison : il vit entouré de sa femme Debbie et de leurs filles Charlotte et Sadie, âgées de 8 et 13 ans. Alors que sa maison de disques indépendante bat de l''aile, avec Debbie, ils doivent trouver les moyens de lâcher prise.', 'Marié depuis des années, Pete est le seul homme de la maison : il vit entouré de sa femme Debbie et de leurs filles Charlotte et Sadie, âgées de 8 et 13 ans. Alors que sa maison de disques indépendante bat de l''aile, avec Debbie, ils doivent trouver les moyens de lâcher prise.', '02:14:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19436648', 'http://fr.web.img2.acsta.net/medias/nmedia/18/95/44/87/20409737.jpg'),
(249, 180655, 'Le Monde fantastique d''Oz', '2013-03-13', 'Lorsque Oscar Diggs, un petit magicien de cirque sans envergure à la moralité douteuse, est emporté à bord de sa montgolfière depuis le Kansas poussiéreux jusqu''à l''extravagant Pays d''Oz, il y voit la chance de sa vie. Tout semble tellement possible dans cet endroit stupéfiant ...', 'Lorsque Oscar Diggs, un petit magicien de cirque sans envergure à la moralité douteuse, est emporté à bord de sa montgolfière depuis le Kansas poussiéreux jusqu''à l''extravagant Pays d''Oz, il y voit la chance de sa vie. Tout semble tellement possible dans cet endroit stupéfiant ...', '02:07:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19472823', 'http://fr.web.img2.acsta.net/medias/nmedia/18/91/98/08/20453482.jpg'),
(250, 196715, 'Camille Claudel, 1915', '2013-03-13', 'La vie recluse de Camille Claudel, internée par sa famille en 1914 dans un asile du sud de la France ? là où elle passera les trente dernières années de son existence et où elle ne sculptera jamais plus.', 'La vie recluse de Camille Claudel, internée par sa famille en 1914 dans un asile du sud de la France ? là où elle passera les trente dernières années de son existence et où elle ne sculptera jamais plus.', '01:35:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19458058', 'http://fr.web.img4.acsta.net/medias/nmedia/18/95/07/06/20427881.jpg'),
(251, 195621, 'L''Artiste et son modèle', '2013-03-13', 'Été 1943, dans la France occupée, non loin de la frontière espagnole. Marc Cros, célèbre sculpteur, vit une retraite paisible avec sa femme. Fatigué de la vie et de la folie des hommes, il est à la recherche d''une inspiration nouvelle. Il rencontre alors Mercé.', 'Été 1943, dans la France occupée, non loin de la frontière espagnole. Marc Cros, célèbre sculpteur, vit une retraite paisible avec sa femme. Fatigué de la vie et de la folie des hommes, il est à la recherche d''une inspiration nouvelle. Il rencontre alors Mercé.', '01:45:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19463249', 'http://fr.web.img6.acsta.net/medias/nmedia/18/95/10/35/20469197.jpg'),
(252, 175607, 'Jappeloup', '2013-03-13', 'Au début des années 80, abandonnant une carrière d''avocat prometteuse, Pierre Durand se consacre corps et âme à sa passion, le saut d''obstacle. Soutenu par son père, il mise tout sur un jeune cheval auquel personne ne croit vraiment : Jappeloup.', 'Au début des années 80, abandonnant une carrière d''avocat prometteuse, Pierre Durand se consacre corps et âme à sa passion, le saut d''obstacle. Soutenu par son père, il mise tout sur un jeune cheval auquel personne ne croit vraiment : Jappeloup.', '02:15:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19469764', 'http://fr.web.img2.acsta.net/medias/nmedia/18/93/83/72/20452765.jpg'),
(253, 209732, '20 ans d''écart', '2013-03-06', 'Alice Lantins a 38 ans. Elle est belle, ambitieuse et fait preuve d''une impeccable conscience professionnelle au point d''en oublier sa vie privée. Bref, elle a tout pour devenir la prochaine rédactrice en chef du magazine « Rebelle », tout sauf son image de femme coincée.', 'Alice Lantins a 38 ans. Elle est belle, ambitieuse et fait preuve d''une impeccable conscience professionnelle au point d''en oublier sa vie privée. Bref, elle a tout pour devenir la prochaine rédactrice en chef du magazine « Rebelle », tout sauf son image de femme coincée.', '01:36:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19448764', 'http://fr.web.img5.acsta.net/medias/nmedia/18/96/11/54/20446783.jpg'),
(254, 201455, 'Au bout du conte', '2013-03-06', 'Il était une fois une jeune fille qui croyait au grand amour, aux signes, et au destin ; une femme qui rêvait d''être comédienne et désespérait d''y arriver un jour ; un jeune homme qui croyait en son talent de compositeur mais ne croyait pas beaucoup en lui.', 'Il était une fois une jeune fille qui croyait au grand amour, aux signes, et au destin ; une femme qui rêvait d''être comédienne et désespérait d''y arriver un jour ; un jeune homme qui croyait en son talent de compositeur mais ne croyait pas beaucoup en lui.', '01:52:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19450943', 'http://fr.web.img3.acsta.net/medias/nmedia/18/95/36/54/20454038.jpg'),
(255, 178063, 'A la merveille', '2013-03-06', 'Même s''ils se sont connus sur le tard, la passion qu''ont vécue Neil et Marina à la Merveille - Le Mont-Saint-Michel - efface les années perdues. Neil est certain d''avoir trouvé la femme de sa vie. Belle, pleine d''humour, originaire d''Ukraine, Marina est divorcée et mère d''une fillette de 10 ans, Tatiana.', 'Même s''ils se sont connus sur le tard, la passion qu''ont vécue Neil et Marina à la Merveille - Le Mont-Saint-Michel - efface les années perdues. Neil est certain d''avoir trouvé la femme de sa vie. Belle, pleine d''humour, originaire d''Ukraine, Marina est divorcée et mère d''une fillette de 10 ans, Tatiana.', '01:53:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19452856', 'http://fr.web.img3.acsta.net/medias/nmedia/18/95/44/46/20416283.jpg'),
(256, 193256, 'The Sessions', '2013-03-06', 'L''histoire vraie et bouleversante d''un homme que la vie a privé de tout, et de sa rencontre avec une thérapeute qui va lui permettre d''aimer, "comme tout le monde".', 'L''histoire vraie et bouleversante d''un homme que la vie a privé de tout, et de sa rencontre avec une thérapeute qui va lui permettre d''aimer, "comme tout le monde".', '01:35:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19469288', 'http://fr.web.img1.acsta.net/medias/nmedia/18/93/53/64/20442572.jpg'),
(257, 134691, 'Boule & Bill', '2013-02-27', 'Tout commence à la SPA. Un jeune cocker se morfond dans sa cage. Il ne trouve pas les maîtres de ses rêves. Soudain, apparaît un petit garçon, aussi roux que lui. Qui se ressemble s''assemble : c''est le coup de foudre. Pour Boule et Bill, c''est le début d''une grande amitié.', 'Tout commence à la SPA. Un jeune cocker se morfond dans sa cage. Il ne trouve pas les maîtres de ses rêves. Soudain, apparaît un petit garçon, aussi roux que lui. Qui se ressemble s''assemble : c''est le coup de foudre. Pour Boule et Bill, c''est le début d''une grande amitié.', '01:22:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19476130', 'http://fr.web.img6.acsta.net/medias/nmedia/18/91/02/15/20376238.jpg'),
(258, 208568, 'Zaytoun', '2013-02-27', 'L''histoire d''une rencontre inattendue entre un réfugié palestinien de 12 ans et un pilote de chasse israélien dont l''avion se fait abattre au-dessus de Beyrouth en 1982. Leur méfiance initiale se transforme en amitié alors qu''ils traversent ensemble le Liban déchiré par la guerre...', 'L''histoire d''une rencontre inattendue entre un réfugié palestinien de 12 ans et un pilote de chasse israélien dont l''avion se fait abattre au-dessus de Beyrouth en 1982. Leur méfiance initiale se transforme en amitié alors qu''ils traversent ensemble le Liban déchiré par la guerre...', '01:50:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19459413', 'http://fr.web.img6.acsta.net/medias/nmedia/18/95/31/02/20416118.jpg'),
(259, 195038, 'Week-end Royal', '2013-02-27', 'Juin 1939, le Président Franklin D. Roosevelt attend la visite du roi George VI et de son épouse Elizabeth, invités à passer le week-end dans sa propriété à la campagne. C''est la première visite  d''un monarque britannique aux Etats-Unis.', 'Juin 1939, le Président Franklin D. Roosevelt attend la visite du roi George VI et de son épouse Elizabeth, invités à passer le week-end dans sa propriété à la campagne. C''est la première visite  d''un monarque britannique aux Etats-Unis.', '01:35:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19439726', 'http://fr.web.img6.acsta.net/medias/nmedia/18/94/79/63/20471795.jpg'),
(260, 197303, 'Möbius', '2013-02-27', 'Grégory Lioubov, un officier des services secrets russes est envoyé à Monaco afin de  surveiller les agissements d''un puissant homme d''affaires. Dans le cadre de cette mission, son équipe  recrute Alice, une surdouée de la finance.', 'Grégory Lioubov, un officier des services secrets russes est envoyé à Monaco afin de  surveiller les agissements d''un puissant homme d''affaires. Dans le cadre de cette mission, son équipe  recrute Alice, une surdouée de la finance.', '01:48:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19456671', 'http://fr.web.img2.acsta.net/medias/nmedia/18/94/68/40/20446781.jpg'),
(261, 206431, 'Les Chevaux de Dieu', '2013-02-20', 'Yassine a 10 ans lorsque le Maroc émerge à peine des années de plomb. Lui et son frère Hamid entament avec l''imam Abou Zoubeir une longue préparation physique et mentale. Un jour, on leur annonce qu''ils ont été choisis pour devenir des martyrs...', 'Yassine a 10 ans lorsque le Maroc émerge à peine des années de plomb. Lui et son frère Hamid entament avec l''imam Abou Zoubeir une longue préparation physique et mentale. Un jour, on leur annonce qu''ils ont été choisis pour devenir des martyrs...', '01:55:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19343650', 'http://fr.web.img6.acsta.net/medias/nmedia/18/90/57/47/20444528.jpg'),
(262, 209900, 'Des Abeilles et des Hommes', '2013-02-20', 'Entre 50 et 90% des abeilles ont disparu depuis quinze ans. Cette épidémie, d''une violence et d''une ampleur phénoménale, est en train de se propager de ruche en ruche sur toute la planète.', 'Entre 50 et 90% des abeilles ont disparu depuis quinze ans. Cette épidémie, d''une violence et d''une ampleur phénoménale, est en train de se propager de ruche en ruche sur toute la planète.', '01:31:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19464974', 'http://fr.web.img4.acsta.net/medias/nmedia/18/95/09/90/20437926.jpg'),
(263, 135781, 'Chimpanzés', '2013-02-20', 'A travers Oscar, un petit chimpanzé, nous découvrons l''apprentissage de la vie au c?ur de la forêt tropicale africaine et suivrons avec humour, émotion et angoisse ses premiers pas dans ce monde hostile.', 'A travers Oscar, un petit chimpanzé, nous découvrons l''apprentissage de la vie au c?ur de la forêt tropicale africaine et suivrons avec humour, émotion et angoisse ses premiers pas dans ce monde hostile.', '01:17:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19426074', 'http://fr.web.img4.acsta.net/medias/nmedia/18/86/40/49/20327758.jpg'),
(264, 202973, 'Elefante Blanco', '2013-02-20', 'Le "bidonville de la Vierge" dans la banlieue de Buenos Aires. Julian et Nicolas, deux prêtres et amis de longue date, ?uvrent pour aider la population. Julian se sert de ses relations politiques pour superviser la construction d''un hôpital.', 'Le "bidonville de la Vierge" dans la banlieue de Buenos Aires. Julian et Nicolas, deux prêtres et amis de longue date, ?uvrent pour aider la population. Julian se sert de ses relations politiques pour superviser la construction d''un hôpital.', '01:45:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19332820', 'http://fr.web.img5.acsta.net/medias/nmedia/18/90/22/16/20442466.jpg'),
(265, 209672, 'La Vraie vie des profs', '2013-02-20', 'L''insipide journal du collège Emile Zola, à Marseille, vaut à ses rédacteurs - une bande d''élèves de cinquième - une réputation de toutous et de bolos. Lorsqu''Albert et JM, deux lascars du collège, sont contraints par le directeur de rejoindre l''atelier journal en guise de punition et de leçon de civisme, c''est l''humiliation suprême.', 'L''insipide journal du collège Emile Zola, à Marseille, vaut à ses rédacteurs - une bande d''élèves de cinquième - une réputation de toutous et de bolos. Lorsqu''Albert et JM, deux lascars du collège, sont contraints par le directeur de rejoindre l''atelier journal en guise de punition et de leçon de civisme, c''est l''humiliation suprême.', '01:40:00', 1.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19452706', 'http://fr.web.img6.acsta.net/medias/nmedia/18/95/21/29/20388774.jpg'),
(266, 196958, 'Vive la France', '2013-02-20', 'Muzafar et Feruz sont deux gentils bergers du Taboulistan? Tout petit pays d''Asie centrale dont personne ne soupçonne l''existence. Afin de faire connaître son pays sur la scène internationale, le fils du président tabouli décide de se lancer dans le terrorisme «publicitaire»...', 'Muzafar et Feruz sont deux gentils bergers du Taboulistan? Tout petit pays d''Asie centrale dont personne ne soupçonne l''existence. Afin de faire connaître son pays sur la scène internationale, le fils du président tabouli décide de se lancer dans le terrorisme «publicitaire»...', '01:37:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19456174', 'http://fr.web.img5.acsta.net/medias/nmedia/18/90/88/24/20415566.jpg'),
(267, 181111, 'Die Hard : belle journée pour mourir', '2013-02-20', 'L''inspecteur John McClane se porte au secours de son fils Jack, retenu prisonnier en Russie. Tous deux devront également faire face à un puissant leader russe qui s''avère être un danger pour la paix mondiale...', 'L''inspecteur John McClane se porte au secours de son fils Jack, retenu prisonnier en Russie. Tous deux devront également faire face à un puissant leader russe qui s''avère être un danger pour la paix mondiale...', '01:36:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19455897', 'http://fr.web.img2.acsta.net/medias/nmedia/18/94/29/36/20417688.jpg'),
(268, 131950, 'La Poussière du temps', '2013-02-13', 'L''histoire d''un amour à travers le grand royaume de l''Histoire, des années 50 jusqu''à nos jours.<br/>Un réalisateur américain d''origine grecque réalise un film sur le destin tragique de ses parents et leurs amours contrariés par l''Histoire au temps de la guerre froide.', 'L''histoire d''un amour à travers le grand royaume de l''Histoire, des années 50 jusqu''à nos jours.<br/>Un réalisateur américain d''origine grecque réalise un film sur le destin tragique de ses parents et leurs amours contrariés par l''Histoire au temps de la guerre froide.', '02:05:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19451943', 'http://fr.web.img5.acsta.net/medias/nmedia/18/95/32/81/20414843.jpg'),
(269, 126079, 'Hôtel Transylvanie', '2013-02-13', 'Bienvenue à l''Hôtel Transylvanie, le somptueux hôtel de Dracula, où les monstres et leurs familles peuvent enfin vivre leur vie, se détendre et faire « monstrueusement » la fête comme ils en ont envie sans être embêtés par les humains.', 'Bienvenue à l''Hôtel Transylvanie, le somptueux hôtel de Dracula, où les monstres et leurs familles peuvent enfin vivre leur vie, se détendre et faire « monstrueusement » la fête comme ils en ont envie sans être embêtés par les humains.', '01:31:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19360995', 'http://fr.web.img1.acsta.net/medias/nmedia/18/90/37/26/20366411.jpg'),
(270, 193101, 'Flight', '2013-02-13', 'Whip Whitaker, pilote de ligne chevronné, réussit miraculeusement à faire atterrir son avion en catastrophe après un accident en plein ciel? L''enquête qui suit fait naître de nombreuses interrogations? Que s''est-il réellement passé à bord du vol 227 ?', 'Whip Whitaker, pilote de ligne chevronné, réussit miraculeusement à faire atterrir son avion en catastrophe après un accident en plein ciel? L''enquête qui suit fait naître de nombreuses interrogations? Que s''est-il réellement passé à bord du vol 227 ?', '02:18:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19352918', 'http://fr.web.img2.acsta.net/medias/nmedia/18/91/17/33/20315949.jpg'),
(271, 187395, 'Turf', '2013-02-13', 'C''est l''histoire de quatre parieurs qui fréquentent assidûment un PMU parisien, Le Balto. Le Grec, Fifi, Fortuné et Freddy en ont marre de perdre le peu qu''ils ont et veulent arrêter le Turf?', 'C''est l''histoire de quatre parieurs qui fréquentent assidûment un PMU parisien, Le Balto. Le Grec, Fifi, Fortuné et Freddy en ont marre de perdre le peu qu''ils ont et veulent arrêter le Turf?', '01:42:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19445936', 'http://fr.web.img6.acsta.net/medias/nmedia/18/93/38/48/20442455.jpg'),
(272, 196165, 'Scialla!', '2013-02-13', 'Bruno Beltrame a été un écrivain talentueux, mais aujourd''hui il vivote en donnant sans passion des cours particuliers. Un jour, la mère de l''un de ses élèves vient voir Bruno pour lui apprendre que cet élève en question est son fils...', 'Bruno Beltrame a été un écrivain talentueux, mais aujourd''hui il vivote en donnant sans passion des cours particuliers. Un jour, la mère de l''un de ses élèves vient voir Bruno pour lui apprendre que cet élève en question est son fils...', '01:35:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19468671', 'http://fr.web.img5.acsta.net/medias/nmedia/18/96/13/44/20448021.jpg'),
(273, 190788, 'Les Misérables', '2013-02-13', 'Dans la France du 19e siècle, une histoire poignante de rêves brisés, d''amour malheureux, de passion, de sacrifice et de rédemption : l''affirmation intemporelle de la force inépuisable de l''âme humaine.', 'Dans la France du 19e siècle, une histoire poignante de rêves brisés, d''amour malheureux, de passion, de sacrifice et de rédemption : l''affirmation intemporelle de la force inépuisable de l''âme humaine.', '02:30:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19431289', 'http://fr.web.img5.acsta.net/medias/nmedia/18/91/00/76/20364091.jpg'),
(274, 214140, 'La Bande des Jotas', '2013-02-06', 'Nils et Didier arrivent dans le sud de l''Espagne pour participer à un tournoi de badminton. Arrivés à l''hôtel, ils se rendent compte qu''ils se sont trompés de valise. La femme qui possède le même bagage leur donne rendez-vous pour procéder à l''échange. Bouleversée, elle leur explique avoir de gros problèmes avec la mafia.', 'Nils et Didier arrivent dans le sud de l''Espagne pour participer à un tournoi de badminton. Arrivés à l''hôtel, ils se rendent compte qu''ils se sont trompés de valise. La femme qui possède le même bagage leur donne rendez-vous pour procéder à l''échange. Bouleversée, elle leur explique avoir de gros problèmes avec la mafia.', '01:14:00', 1.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19441662', 'http://fr.web.img2.acsta.net/medias/nmedia/18/94/73/05/20352122.jpg'),
(275, 187750, 'Shadow Dancer', '2013-02-06', 'Collette est une républicaine vivant à Belfast, avec sa mère et ses frères, fervents activistes de l''IRA. Suite à son arrestation, Mac, un agent du MI5, lui offre le choix : passer 25 ans en prison ou espionner sa propre famille.', 'Collette est une républicaine vivant à Belfast, avec sa mère et ses frères, fervents activistes de l''IRA. Suite à son arrestation, Mac, un agent du MI5, lui offre le choix : passer 25 ans en prison ou espionner sa propre famille.', '01:42:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19393669', 'http://fr.web.img6.acsta.net/medias/nmedia/18/86/82/68/20400605.jpg');
INSERT INTO `film` (`id`, `code`, `titre`, `date`, `synopsis`, `synopsisCourt`, `duree`, `note`, `trailer`, `affiche`) VALUES
(276, 188147, 'Gambit, arnaque à l?anglaise', '2013-02-06', 'Pour voler Lionel Shabandar, l''un des hommes les plus riches d''Angleterre, Harry Deane monte une arnaque minutieusement pensée avec l''aide de son complice. Il espère lui vendre un faux Monet.', 'Pour voler Lionel Shabandar, l''un des hommes les plus riches d''Angleterre, Harry Deane monte une arnaque minutieusement pensée avec l''aide de son complice. Il espère lui vendre un faux Monet.', '01:40:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19439878', 'http://fr.web.img1.acsta.net/medias/nmedia/18/95/79/65/20427987.jpg'),
(277, 205740, 'Tu honoreras ta mère et ta mère', '2013-02-06', 'Les Dieux n''aiment pas que l''on force le destin. Quand Jo débarque en Grèce avec ses fils, alors qu''elle sait que le festival qu''elle a créé est annulé pour cause de crise. Quand elle squatte une maison parce qu''on ne la loge plus...', 'Les Dieux n''aiment pas que l''on force le destin. Quand Jo débarque en Grèce avec ses fils, alors qu''elle sait que le festival qu''elle a créé est annulé pour cause de crise. Quand elle squatte une maison parce qu''on ne la loge plus...', '01:32:00', 1.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19453078', 'http://fr.web.img6.acsta.net/medias/nmedia/18/95/44/85/20404619.jpg'),
(278, 189691, 'Hitchcock', '2013-02-06', 'Alfred Hitchcock, réalisateur reconnu et admiré, surnommé « le maître du suspense », est arrivé au sommet de sa carrière. A la recherche d''un nouveau projet risqué et différent, il s''intéresse à l''histoire d''un tueur en série.', 'Alfred Hitchcock, réalisateur reconnu et admiré, surnommé « le maître du suspense », est arrivé au sommet de sa carrière. A la recherche d''un nouveau projet risqué et différent, il s''intéresse à l''histoire d''un tueur en série.', '01:38:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19444753', 'http://fr.web.img5.acsta.net/medias/nmedia/18/90/34/86/20380203.jpg'),
(279, 186168, 'Gangster Squad', '2013-02-06', 'Los Angeles, 1949. Mickey Cohen, originaire de Brooklyn, est un parrain impitoyable de la mafia qui dirige la ville et récolte les biens mal acquis de la drogue, des armes, des prostituées et ? s''il arrive à ses fins ? de tous les paris à l''ouest de Chicago.', 'Los Angeles, 1949. Mickey Cohen, originaire de Brooklyn, est un parrain impitoyable de la mafia qui dirige la ville et récolte les biens mal acquis de la drogue, des armes, des prostituées et ? s''il arrive à ses fins ? de tous les paris à l''ouest de Chicago.', '01:53:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19415289', 'http://fr.web.img1.acsta.net/medias/nmedia/18/92/13/72/20446220.jpg'),
(280, 197427, 'Rendez-vous à Kiruna', '2013-01-30', 'Ernest, un architecte renommé, ne vit que pour son travail. Un jour, il reçoit un appel de la police suédoise qui le décide à entreprendre un long voyage jusqu''à Kiruna, en Laponie. Il doit y reconnaître le corps d''un parfait étranger, son fils qu''il n''a jamais connu.', 'Ernest, un architecte renommé, ne vit que pour son travail. Un jour, il reçoit un appel de la police suédoise qui le décide à entreprendre un long voyage jusqu''à Kiruna, en Laponie. Il doit y reconnaître le corps d''un parfait étranger, son fils qu''il n''a jamais connu.', '01:37:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19449225', 'http://fr.web.img6.acsta.net/medias/nmedia/18/93/99/05/20402978.jpg'),
(281, 207786, 'Pas très normales activités', '2013-01-30', 'Une maison isolée, un jeune couple, un vidéaste pervers, un muet. Le tout donnant lieu à des activités normales... mais pas très !', 'Une maison isolée, un jeune couple, un vidéaste pervers, un muet. Le tout donnant lieu à des activités normales... mais pas très !', '01:24:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19452635', 'http://fr.web.img3.acsta.net/medias/nmedia/18/95/43/27/20403847.jpg'),
(282, 197403, 'Amitiés sincères', '2013-01-30', 'Walter Orsini aime la pêche, un peu. Il aime la grande cuisine et les bons vins, beaucoup. Il aime aussi Paul et Jacques, ses amis d''une vie, passionnément. Il aime surtout Clémence, sa fille de 20 ans, à la folie. Mais il n''aime pas le mensonge. Pas du tout...', 'Walter Orsini aime la pêche, un peu. Il aime la grande cuisine et les bons vins, beaucoup. Il aime aussi Paul et Jacques, ses amis d''une vie, passionnément. Il aime surtout Clémence, sa fille de 20 ans, à la folie. Mais il n''aime pas le mensonge. Pas du tout...', '01:44:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19442917', 'http://fr.web.img3.acsta.net/medias/nmedia/18/86/76/42/20375215.jpg'),
(283, 145397, 'Happiness Therapy', '2013-01-30', 'Tout juste sorti d''un hôpital psychiatrique, après 8 mois d''internement, Pat, ancien professeur d''histoire au lycée, tente de renouer des liens avec son ex-femme.', 'Tout juste sorti d''un hôpital psychiatrique, après 8 mois d''internement, Pat, ancien professeur d''histoire au lycée, tente de renouer des liens avec son ex-femme.', '02:02:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19401816', 'http://fr.web.img1.acsta.net/medias/nmedia/18/94/09/83/20302958.jpg'),
(284, 61505, 'Lincoln', '2013-01-30', 'Les derniers mois du mandat du 16e Président des États-Unis. Dans une nation déchirée par la guerre civile et secouée par le vent du changement, Abraham Lincoln met tout en ?uvre pour résoudre le conflit, unifier le pays et abolir l''esclavage.', 'Les derniers mois du mandat du 16e Président des États-Unis. Dans une nation déchirée par la guerre civile et secouée par le vent du changement, Abraham Lincoln met tout en ?uvre pour résoudre le conflit, unifier le pays et abolir l''esclavage.', '02:29:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19428336', 'http://fr.web.img6.acsta.net/medias/nmedia/18/92/83/85/20244611.jpg'),
(285, 209796, 'Mariage à Mendoza', '2013-01-23', 'Deux frères débarquent en Argentine pour aller célébrer le mariage de leur cousin, à Mendoza, dans l''ouest du pays. La grande aventure, la vraie, voilà longtemps qu''ils en rêvaient? Mais à l''arrivée à Buenos-Aires, Antoine ne va pas bien du tout, comme un type que sa femme vient de plaquer.', 'Deux frères débarquent en Argentine pour aller célébrer le mariage de leur cousin, à Mendoza, dans l''ouest du pays. La grande aventure, la vraie, voilà longtemps qu''ils en rêvaient? Mais à l''arrivée à Buenos-Aires, Antoine ne va pas bien du tout, comme un type que sa femme vient de plaquer.', '01:34:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19451275', 'http://fr.web.img4.acsta.net/medias/nmedia/18/94/59/72/20341232.jpg'),
(286, 196004, 'Blancanieves', '2013-01-23', 'Sud de l''Espagne, dans les années 20. Carmen est une belle jeune fille dont l''enfance a été hantée par une belle-mère acariâtre. Fuyant un passé dont elle n''a plus mémoire, Carmen va faire une rencontre insolite : une troupe ambulante de nains toreros qui va l''adopter...', 'Sud de l''Espagne, dans les années 20. Carmen est une belle jeune fille dont l''enfance a été hantée par une belle-mère acariâtre. Fuyant un passé dont elle n''a plus mémoire, Carmen va faire une rencontre insolite : une troupe ambulante de nains toreros qui va l''adopter...', '01:49:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19454788', 'http://fr.web.img4.acsta.net/medias/nmedia/18/94/72/99/20410396.jpg'),
(287, 198949, 'Max', '2013-01-23', 'Une petite fille fait venir une prostituée chez elle afin qu''elle prenne soin de son père veuf...', 'Une petite fille fait venir une prostituée chez elle afin qu''elle prenne soin de son père veuf...', '01:23:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19442077', 'http://fr.web.img2.acsta.net/medias/nmedia/18/95/00/12/20376316.jpg'),
(288, 193444, 'Zero Dark Thirty', '2013-01-23', 'Le récit de la traque d''Oussama Ben Laden par une unité des forces spéciales américaines...', 'Le récit de la traque d''Oussama Ben Laden par une unité des forces spéciales américaines...', '02:29:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19433295', 'http://fr.web.img3.acsta.net/medias/nmedia/18/94/54/11/20365978.jpg'),
(289, 200607, 'Ultimo Elvis', '2013-01-16', 'A Buenos Aires, Carlos Gutiérrez est Elvis, à l''usine comme sur scène où il officie pour une agence de sosies. Plus qu''une passion, Elvis est pour lui un mode de vie. Voilà qu''un accident l''oblige à endosser un nouveau rôle, celui de père, quand sa fille, Lisa Marie, a besoin de lui?', 'A Buenos Aires, Carlos Gutiérrez est Elvis, à l''usine comme sur scène où il officie pour une agence de sosies. Plus qu''une passion, Elvis est pour lui un mode de vie. Voilà qu''un accident l''oblige à endosser un nouveau rôle, celui de père, quand sa fille, Lisa Marie, a besoin de lui?', '01:32:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19439837', 'http://fr.web.img6.acsta.net/medias/nmedia/18/94/99/77/20371375.JPG'),
(290, 201026, 'Paulette', '2013-01-16', 'Paulette vit seule dans une cité HLM de la banlieue parisienne. Avec sa maigre retraite, elle n''arrive plus à joindre les deux bouts. Lorsqu''un soir elle assiste à un curieux trafic en bas de son immeuble, Paulette y voit le signe du destin.', 'Paulette vit seule dans une cité HLM de la banlieue parisienne. Avec sa maigre retraite, elle n''arrive plus à joindre les deux bouts. Lorsqu''un soir elle assiste à un curieux trafic en bas de son immeuble, Paulette y voit le signe du destin.', '01:27:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19436837', 'http://fr.web.img1.acsta.net/medias/nmedia/18/91/27/63/20395900.jpg'),
(291, 201688, 'La Parade', '2013-01-16', 'En voulant sauver son pitbull chéri et contenter sa fiancée capricieuse, Lemon, parrain des gangsters de Belgrade, se voit obligé d''assurer la sécurité de la première GayPride de Serbie.  Pour l''aider dans cette mission impossible, il part à la recherche d''anciens mercenaires.', 'En voulant sauver son pitbull chéri et contenter sa fiancée capricieuse, Lemon, parrain des gangsters de Belgrade, se voit obligé d''assurer la sécurité de la première GayPride de Serbie.  Pour l''aider dans cette mission impossible, il part à la recherche d''anciens mercenaires.', '01:55:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19453623', 'http://fr.web.img1.acsta.net/medias/nmedia/18/91/14/20/20288775.jpg'),
(292, 204773, 'Alceste à bicyclette', '2013-01-16', 'Au sommet de sa carrière d''acteur, Serge Tanneur a quitté une fois pour toutes le monde du spectacle. Trop de colère, trop de lassitude. La fatigue d''un métier où tout le monde trahit tout le monde. Désormais, Serge vit en ermite dans une maison délabrée sur l''Île de Ré?', 'Au sommet de sa carrière d''acteur, Serge Tanneur a quitté une fois pour toutes le monde du spectacle. Trop de colère, trop de lassitude. La fatigue d''un métier où tout le monde trahit tout le monde. Désormais, Serge vit en ermite dans une maison délabrée sur l''Île de Ré?', '01:45:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19430310', 'http://fr.web.img4.acsta.net/medias/nmedia/18/93/83/71/20357209.jpg'),
(293, 190918, 'Django Unchained', '2013-01-16', 'Le parcours d''un chasseur de prime allemand et d''un homme noir pour retrouver la femme de ce dernier retenue en esclavage par le propriétaire d''une plantation...', 'Le parcours d''un chasseur de prime allemand et d''un homme noir pour retrouver la femme de ce dernier retenue en esclavage par le propriétaire d''une plantation...', '02:44:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19353314', 'http://fr.web.img6.acsta.net/medias/nmedia/18/90/08/59/20366454.jpg'),
(294, 197677, 'Une Histoire d''amour', '2013-01-09', 'Elle l''a rencontré un soir de printemps, elle est devenue sa maîtresse. Il lui a offert un revolver, elle une combinaison en latex. Imprudent, il lui a proposé un million de dollars. Insatiable, elle est venue lui rappeler ses promesses...', 'Elle l''a rencontré un soir de printemps, elle est devenue sa maîtresse. Il lui a offert un revolver, elle une combinaison en latex. Imprudent, il lui a proposé un million de dollars. Insatiable, elle est venue lui rappeler ses promesses...', '01:19:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19433266', 'http://fr.web.img5.acsta.net/medias/nmedia/18/94/64/53/20417153.jpg'),
(295, 176279, 'The Master', '2013-01-09', 'Freddie, un vétéran, revient en Californie après s''être battu dans le Pacifique. Alcoolique, il distille sa propre gnôle et contient difficilement la violence qu''il a en lui? Quand Freddie rencontre Lancaster Dodd, charismatique meneur d''un mouvement, il tombe  sous sa coupe...', 'Freddie, un vétéran, revient en Californie après s''être battu dans le Pacifique. Alcoolique, il distille sa propre gnôle et contient difficilement la violence qu''il a en lui? Quand Freddie rencontre Lancaster Dodd, charismatique meneur d''un mouvement, il tombe  sous sa coupe...', '02:17:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19407702', 'http://fr.web.img6.acsta.net/medias/nmedia/18/90/81/61/20408688.jpg'),
(296, 209726, 'Un Prince (presque) charmant', '2013-01-09', 'Jean-Marc, quadra carriériste et pressé ne cherchant qu''à satisfaire ses intérêts personnels, va croiser malgré lui la route de Marie. Tout oppose cet homme d''affaire et cette jeune femme éprise de liberté et de justice.', 'Jean-Marc, quadra carriériste et pressé ne cherchant qu''à satisfaire ses intérêts personnels, va croiser malgré lui la route de Marie. Tout oppose cet homme d''affaire et cette jeune femme éprise de liberté et de justice.', '01:28:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19425459', 'http://fr.web.img1.acsta.net/medias/nmedia/18/94/34/87/20321355.jpg'),
(297, 201823, 'Yossi', '2013-01-02', 'Yossi vit seul sa trentaine à Tel Aviv, assumant mal sa sexualité, trouvant dans son métier de cardiologue une échappatoire à ses déboires amoureux. Lors d''un voyage dans le sud du pays, il rencontre un jeune homme qui lui fait retrouver le goût de vivre.', 'Yossi vit seul sa trentaine à Tel Aviv, assumant mal sa sexualité, trouvant dans son métier de cardiologue une échappatoire à ses déboires amoureux. Lors d''un voyage dans le sud du pays, il rencontre un jeune homme qui lui fait retrouver le goût de vivre.', '01:23:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19442775', 'http://fr.web.img6.acsta.net/medias/nmedia/18/93/94/74/20288461.jpg'),
(298, 190442, 'Maniac', '2013-01-02', 'Dans les rues qu''on croyait tranquilles, un tueur en série en quête de scalps se remet en chasse. Frank est le timide propriétaire d''une boutique de mannequins. Sa vie prend un nouveau tournant quand Anna, une jeune artiste, vient lui demander de l''aide...', 'Dans les rues qu''on croyait tranquilles, un tueur en série en quête de scalps se remet en chasse. Frank est le timide propriétaire d''une boutique de mannequins. Sa vie prend un nouveau tournant quand Anna, une jeune artiste, vient lui demander de l''aide...', '01:29:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19442171', 'http://fr.web.img2.acsta.net/medias/nmedia/18/90/71/19/20323482.jpg'),
(299, 200055, 'La Stratégie de la poussette', '2013-01-02', 'Thomas a laissé partir Marie, à force de ne pas s''engager.<br/>Un an plus tard, toujours inconsolable, il se retrouve avec un bébé sur les bras.<br/>Il va se servir de cet enfant pour reconquérir la femme de sa vie...', 'Thomas a laissé partir Marie, à force de ne pas s''engager.<br/>Un an plus tard, toujours inconsolable, il se retrouve avec un bébé sur les bras.<br/>Il va se servir de cet enfant pour reconquérir la femme de sa vie...', '01:30:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19424174', 'http://fr.web.img6.acsta.net/medias/nmedia/18/93/83/42/20328083.jpg'),
(300, 203955, 'Renoir', '2013-01-02', '1915. Sur la Côte d''Azur. Au crépuscule de sa vie, Auguste Renoir est éprouvé par la perte de son épouse, les douleurs du grand âge, et les mauvaises nouvelles venues du front : son fils Jean est blessé? Mais une jeune fille, Andrée, apparue dans sa vie comme un miracle...', '1915. Sur la Côte d''Azur. Au crépuscule de sa vie, Auguste Renoir est éprouvé par la perte de son épouse, les douleurs du grand âge, et les mauvaises nouvelles venues du front : son fils Jean est blessé? Mais une jeune fille, Andrée, apparue dans sa vie comme un miracle...', '01:52:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19346757', 'http://fr.web.img6.acsta.net/medias/nmedia/18/90/57/17/20303396.jpg'),
(301, 194176, 'L''Homme qui rit', '2012-12-26', 'En pleine tourmente hivernale, Ursus, un forain haut en couleurs, recueille dans sa roulotte deux orphelins perdus dans la tempête : Gwynplaine, un jeune garçon marqué au visage par une cicatrice qui lui donne en permanence une sorte de rire, et Déa, une fillette aveugle.', 'En pleine tourmente hivernale, Ursus, un forain haut en couleurs, recueille dans sa roulotte deux orphelins perdus dans la tempête : Gwynplaine, un jeune garçon marqué au visage par une cicatrice qui lui donne en permanence une sorte de rire, et Déa, une fillette aveugle.', '01:33:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19432162', 'http://fr.web.img5.acsta.net/medias/nmedia/18/90/31/86/20258994.jpg'),
(302, 54343, 'L''Odyssée de Pi', '2012-12-19', 'Après une enfance passée à Pondichéry en Inde, Pi Patel, 17 ans, embarque avec sa famille pour le Canada où l''attend une nouvelle vie. Mais son destin est bouleversé par le naufrage spectaculaire du cargo en pleine mer.', 'Après une enfance passée à Pondichéry en Inde, Pi Patel, 17 ans, embarque avec sa famille pour le Canada où l''attend une nouvelle vie. Mais son destin est bouleversé par le naufrage spectaculaire du cargo en pleine mer.', '02:05:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19407006', 'http://fr.web.img1.acsta.net/medias/nmedia/18/93/60/26/20298702.jpg'),
(303, 197074, 'Main dans la main', '2012-12-19', 'Quand Hélène Marchal et Joachim Fox se rencontrent, ils ont chacun des vies bien différentes. Hélène dirige la prestigieuse école de danse de l''Opéra Garnier, Joachim, lui, est l''employé d''un miroitier de province. Mais une force étrange les unit.', 'Quand Hélène Marchal et Joachim Fox se rencontrent, ils ont chacun des vies bien différentes. Hélène dirige la prestigieuse école de danse de l''Opéra Garnier, Joachim, lui, est l''employé d''un miroitier de province. Mais une force étrange les unit.', '01:25:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19421348', 'http://fr.web.img5.acsta.net/medias/nmedia/18/94/18/92/20349906.jpg'),
(304, 192314, 'De l''autre côté du périph', '2012-12-19', 'Un matin à l''aube dans une cité de Bobigny, près d''un vieux tripot clandestin, est retrouvé le corps sans vie de Eponine Chaligny, femme du très influent Jean-Éric Chaligny, premier patron de France, au centre d''un climat social extrême qui secoue la France depuis quelques semaines.', 'Un matin à l''aube dans une cité de Bobigny, près d''un vieux tripot clandestin, est retrouvé le corps sans vie de Eponine Chaligny, femme du très influent Jean-Éric Chaligny, premier patron de France, au centre d''un climat social extrême qui secoue la France depuis quelques semaines.', '01:36:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19426635', 'http://fr.web.img1.acsta.net/medias/nmedia/18/93/62/44/20268136.jpg'),
(305, 119089, 'Le Hobbit : un voyage inattendu', '2012-12-12', 'Les aventures de Bilbon Sacquet, entraîné dans une quête héroïque pour reprendre le Royaume perdu des nains d''Erebor, conquis longtemps auparavant par le dragon Smaug.', 'Les aventures de Bilbon Sacquet, entraîné dans une quête héroïque pour reprendre le Royaume perdu des nains d''Erebor, conquis longtemps auparavant par le dragon Smaug.', '02:49:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19404061', 'http://fr.web.img1.acsta.net/medias/nmedia/18/93/43/35/20273834.jpg'),
(306, 200333, 'Les Bêtes du sud sauvage', '2012-12-12', 'Hushpuppy, 6 ans, vit dans le bayou avec son père. Brusquement, la nature s''emballe, la température monte, les glaciers fondent, libérant une armée d''aurochs. Avec la montée des eaux, l''irruption des aurochs et la santé de son père qui décline, Hushpuppy décide de partir à la recherche de sa mère disparue.', 'Hushpuppy, 6 ans, vit dans le bayou avec son père. Brusquement, la nature s''emballe, la température monte, les glaciers fondent, libérant une armée d''aurochs. Avec la montée des eaux, l''irruption des aurochs et la santé de son père qui décline, Hushpuppy décide de partir à la recherche de sa mère disparue.', '01:32:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19341821', 'http://fr.web.img3.acsta.net/medias/nmedia/18/90/22/18/20251251.jpg'),
(307, 190858, 'Télé Gaucho', '2012-12-12', 'Tout a commencé lorsque les caméscopes ont remplacé les caméras. Faire de la télé devenait alors à la portée de tous. Jean-Lou, Yasmina, Victor, Clara, Adonis et les autres ne voulaient pas seulement créer leur propre chaîne de télé, ils voulaient surtout faire la révolution.', 'Tout a commencé lorsque les caméscopes ont remplacé les caméras. Faire de la télé devenait alors à la portée de tous. Jean-Lou, Yasmina, Victor, Clara, Adonis et les autres ne voulaient pas seulement créer leur propre chaîne de télé, ils voulaient surtout faire la révolution.', '01:52:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19430307', 'http://fr.web.img3.acsta.net/medias/nmedia/18/93/76/71/20311066.jpg'),
