(311, 199398, 'Sur le chemin des dunes', '2012-12-05', 'Fin des années 60, une ville oubliée de la côte belge. Pim vit seul avec sa mère, une ancienne reine de beauté devenue chanteuse de cabaret. Pim égaie ses journées en dessinant et en rêvant à des vies imaginaires.', 'Fin des années 60, une ville oubliée de la côte belge. Pim vit seul avec sa mère, une ancienne reine de beauté devenue chanteuse de cabaret. Pim égaie ses journées en dessinant et en rêvant à des vies imaginaires.', '01:36:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19399823', 'http://fr.web.img4.acsta.net/medias/nmedia/18/93/29/22/20343725.jpg'),
(312, 191856, 'Anna Karenine', '2012-12-05', 'Russie, 1874, la belle et ardente Anna Karénine jouit de tout ce à quoi ses contemporains aspirent : mariée à Karénine, un haut fonctionnaire du gouvernement à qui elle a donné un fils, elle a atteint un éminent statut social à Saint-Pétersbourg.', 'Russie, 1874, la belle et ardente Anna Karénine jouit de tout ce à quoi ses contemporains aspirent : mariée à Karénine, un haut fonctionnaire du gouvernement à qui elle a donné un fils, elle a atteint un éminent statut social à Saint-Pétersbourg.', '02:11:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19416020', 'http://fr.web.img4.acsta.net/medias/nmedia/18/92/86/38/20271863.jpg'),
(313, 187420, 'Cogan : Killing Them Softly', '2012-12-05', 'Lorsqu''une partie de poker illégale est braquée, c''est tout le monde des bas-fonds de la pègre qui est menacé. Les caïds de la Mafia font appel à Jackie Cogan pour trouver les coupables.', 'Lorsqu''une partie de poker illégale est braquée, c''est tout le monde des bas-fonds de la pègre qui est menacé. Les caïds de la Mafia font appel à Jackie Cogan pour trouver les coupables.', '01:37:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19424245', 'http://fr.web.img2.acsta.net/medias/nmedia/18/93/25/14/20319420.jpg'),
(314, 190615, 'Trois Mondes', '2012-12-05', 'Al est un jeune homme d''origine modeste à qui tout réussit : il se marie dans huit jours avec la fille de son patron et doit prendre la tête de l''entreprise de son futur beau-père. Une nuit, après une soirée arrosée à fêter dignement tous ces projets d''avenir, il renverse un inconnu.', 'Al est un jeune homme d''origine modeste à qui tout réussit : il se marie dans huit jours avec la fille de son patron et doit prendre la tête de l''entreprise de son futur beau-père. Une nuit, après une soirée arrosée à fêter dignement tous ces projets d''avenir, il renverse un inconnu.', '01:41:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19412961', 'http://fr.web.img5.acsta.net/medias/nmedia/18/90/56/81/20317585.jpg'),
(315, 182990, 'Mais qui a re-tué Pamela Rose ?', '2012-12-05', 'Quand il reçoit un appel du shérif de Bornsville lui annonçant que le cercueil de Pamela Rose a été volé, l''agent Douglas Riper voit là une occasion de renouer les liens avec son ancien coéquipier Richard Bullit.', 'Quand il reçoit un appel du shérif de Bornsville lui annonçant que le cercueil de Pamela Rose a été volé, l''agent Douglas Riper voit là une occasion de renouer les liens avec son ancien coéquipier Richard Bullit.', '01:38:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19437367', 'http://fr.web.img2.acsta.net/medias/nmedia/18/93/56/88/20329158.jpg'),
