(317, 189909, 'Les Cinq légendes', '2012-11-28', 'L''aventure d''un groupe de héros, tous doués de pouvoirs extraordinaires. Emmenées par Jack Frost, un adolescent rebelle et ingénieux, ces cinq légendes vont devoir, pour la première fois, unir leurs forces pour protéger les espoirs, les rêves et l''imaginaire de tous les enfants.', 'L''aventure d''un groupe de héros, tous doués de pouvoirs extraordinaires. Emmenées par Jack Frost, un adolescent rebelle et ingénieux, ces cinq légendes vont devoir, pour la première fois, unir leurs forces pour protéger les espoirs, les rêves et l''imaginaire de tous les enfants.', '01:37:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19371690', 'http://fr.web.img1.acsta.net/medias/nmedia/18/89/92/04/20272137.jpg'),
