(319, 201420, 'Piazza Fontana', '2012-11-28', 'Milan, le 12 décembre 1969, une bombe explose à la Banque Nationale d''Agriculture sur la Piazza Fontana, faisant 17 morts et  88 blessés. Le commissaire Luigi Calabresi, chargé de l''enquête, s''oriente vers les milieux d''extrême gauche et d''extrême droite...', 'Milan, le 12 décembre 1969, une bombe explose à la Banque Nationale d''Agriculture sur la Piazza Fontana, faisant 17 morts et  88 blessés. Le commissaire Luigi Calabresi, chargé de l''enquête, s''oriente vers les milieux d''extrême gauche et d''extrême droite...', '02:00:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19405034', 'http://fr.web.img3.acsta.net/medias/nmedia/18/93/50/05/20288541.jpg'),
