(323, 196809, 'Comme des frères', '2012-11-21', 'Depuis que Charlie n''est plus là, la vie de Boris, Elie et Maxime a volé en éclats. Ces trois hommes que tout sépare avaient pour Charlie un amour singulier. Elle était leur soeur, la femme de leur vie ou leur pote, c''était selon.', 'Depuis que Charlie n''est plus là, la vie de Boris, Elie et Maxime a volé en éclats. Ces trois hommes que tout sépare avaient pour Charlie un amour singulier. Elle était leur soeur, la femme de leur vie ou leur pote, c''était selon.', '01:44:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19416386', 'http://fr.web.img6.acsta.net/medias/nmedia/18/86/09/55/20086909.jpg'),
