(326, 196315, 'End of Watch', '2012-11-14', 'Chaque jour, Brian Taylor et Mike Zavala, jeunes officiers de police, patrouillent dans les rues les plus dangereuses de Los Angeles. À travers les images filmées sur le vif, on découvre leur quotidien sous un angle jamais vu.', 'Chaque jour, Brian Taylor et Mike Zavala, jeunes officiers de police, patrouillent dans les rues les plus dangereuses de Los Angeles. À travers les images filmées sur le vif, on découvre leur quotidien sous un angle jamais vu.', '01:48:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19418847', 'http://fr.web.img5.acsta.net/medias/nmedia/18/91/18/19/20248867.jpg'),
(327, 194667, 'Le Capital', '2012-11-14', 'La résistible ascension d''un valet de banque dans le monde féroce du Capital.', 'La résistible ascension d''un valet de banque dans le monde féroce du Capital.', '01:53:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19420169', 'http://fr.web.img5.acsta.net/medias/nmedia/18/92/98/76/20229019.jpg'),
(328, 182749, 'Twilight - Chapitre 5 : Révélation 2e partie', '2012-11-14', 'Après la naissance de sa fille Renesmée, Bella s''adapte peu à peu à sa nouvelle vie de vampire avec le soutien d''Edward. Se sentant menacés par cette naissance d''un nouveau genre, les Volturi déclarent la guerre à la famille Cullen.', 'Après la naissance de sa fille Renesmée, Bella s''adapte peu à peu à sa nouvelle vie de vampire avec le soutien d''Edward. Se sentant menacés par cette naissance d''un nouveau genre, les Volturi déclarent la guerre à la famille Cullen.', '01:55:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19397976', 'http://fr.web.img5.acsta.net/medias/nmedia/18/89/43/69/20278941.jpg'),
(329, 186536, 'House of Boys', '2012-11-07', 'Amsterdam, 1984. Frank a 18 ans et décide de quitter le domicile familial pour s''émanciper et vivre sa vie comme il l''entend. Pour survivre, il devient alors danseur dans le club "House Of Boys".', 'Amsterdam, 1984. Frank a 18 ans et décide de quitter le domicile familial pour s''émanciper et vivre sa vie comme il l''entend. Pour survivre, il devient alors danseur dans le club "House Of Boys".', '01:57:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19381622', 'http://fr.web.img1.acsta.net/medias/nmedia/18/85/73/11/20181700.jpg'),
(330, 200962, 'Sinister', '2012-11-07', 'Ellison est un auteur de romans policiers inspirés de faits réels. Dans l''espoir d''écrire un nouveau livre à succès, il emménage avec sa famille dans une maison où les anciens propriétaires ont été retrouvés inexplicablement pendus.', 'Ellison est un auteur de romans policiers inspirés de faits réels. Dans l''espoir d''écrire un nouveau livre à succès, il emménage avec sa famille dans une maison où les anciens propriétaires ont été retrouvés inexplicablement pendus.', '01:50:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19402652', 'http://fr.web.img5.acsta.net/medias/nmedia/18/91/03/05/20267340.jpg'),
(331, 189411, 'Augustine', '2012-11-07', 'Paris, hiver 1885. A l''hôpital de la Pitié Salpêtrière, le professeur Charcot étudie une maladie mystérieuse : l''hystérie. Augustine, 19 ans, devient son cobaye favori, la vedette de ses démonstrations d''hypnose. D''objet d''étude, elle deviendra peu à peu objet de désir.', 'Paris, hiver 1885. A l''hôpital de la Pitié Salpêtrière, le professeur Charcot étudie une maladie mystérieuse : l''hystérie. Augustine, 19 ans, devient son cobaye favori, la vedette de ses démonstrations d''hypnose. D''objet d''étude, elle deviendra peu à peu objet de désir.', '01:42:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19401150', 'http://fr.web.img4.acsta.net/medias/nmedia/18/86/42/63/20251233.jpg'),
(332, 192086, 'Nous York', '2012-11-07', 'Michaël, Nabil et Sylvain, trois trentenaires, partent à New York et débarquent par surprise à l''anniversaire de Samia, avec la complicité de Gabrielle. Leurs deux copines d''enfance sont installées depuis deux ans à NYC pour y tenter leur chance.', 'Michaël, Nabil et Sylvain, trois trentenaires, partent à New York et débarquent par surprise à l''anniversaire de Samia, avec la complicité de Gabrielle. Leurs deux copines d''enfance sont installées depuis deux ans à NYC pour y tenter leur chance.', '01:38:00', 1.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19399912', 'http://fr.web.img1.acsta.net/medias/nmedia/18/88/95/95/20225676.jpg'),
(333, 190267, 'Argo', '2012-11-07', 'Le 4 novembre 1979, au summum de la révolution iranienne, des militants envahissent l''ambassade américaine de Téhéran, et prennent 52 Américains en otage. Mais au milieu du chaos, 6 Américains réussissent à s''échapper et à se réfugier au domicile de l''ambassadeur canadien.', 'Le 4 novembre 1979, au summum de la révolution iranienne, des militants envahissent l''ambassade américaine de Téhéran, et prennent 52 Américains en otage. Mais au milieu du chaos, 6 Américains réussissent à s''échapper et à se réfugier au domicile de l''ambassadeur canadien.', '01:59:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19402653', 'http://fr.web.img4.acsta.net/medias/nmedia/18/87/65/00/20273151.jpg'),
(334, 139291, 'Looper', '2012-10-31', 'Dans un futur proche, la Mafia a mis au point un système infaillible pour faire disparaître tous les témoins gênants. Elle expédie ses victimes dans le passé, à notre époque, où des tueurs d''un genre nouveau (les "Loopers") les éliminent...', 'Dans un futur proche, la Mafia a mis au point un système infaillible pour faire disparaître tous les témoins gênants. Elle expédie ses victimes dans le passé, à notre époque, où des tueurs d''un genre nouveau (les "Loopers") les éliminent...', '01:50:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19384410', 'http://fr.web.img2.acsta.net/medias/nmedia/18/89/98/30/20239211.jpg'),
(335, 197441, 'La Traversée', '2012-10-31', 'Lola Arendt, une petite fille de 8 ans disparaît dans une Ile d''Ecosse. Ses parents, Martin  et Sarah , brisés, ne résistent pas au drame et se séparent. Deux années plus tard, Lola est retrouvée à l''endroit exact où elle avait disparu.', 'Lola Arendt, une petite fille de 8 ans disparaît dans une Ile d''Ecosse. Ses parents, Martin  et Sarah , brisés, ne résistent pas au drame et se séparent. Deux années plus tard, Lola est retrouvée à l''endroit exact où elle avait disparu.', '01:37:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19388506', 'http://fr.web.img6.acsta.net/medias/nmedia/18/91/74/39/20238997.jpg'),
(336, 190459, 'J''enrage de son absence', '2012-10-31', 'Après dix ans d''absence, Jacques ressurgit dans la vie de Mado, aujourd''hui mariée et mère de Paul, un garçon de sept ans. La relation de l''ancien couple est entachée du deuil d''un enfant. Alors que Mado a refait sa vie, Jacques en paraît incapable...', 'Après dix ans d''absence, Jacques ressurgit dans la vie de Mado, aujourd''hui mariée et mère de Paul, un garçon de sept ans. La relation de l''ancien couple est entachée du deuil d''un enfant. Alors que Mado a refait sa vie, Jacques en paraît incapable...', '01:38:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19408862', 'http://fr.web.img6.acsta.net/medias/nmedia/18/90/27/82/20266977.jpg'),
(337, 193877, 'Un Plan Parfait', '2012-10-31', 'Une jeune femme dont la carrière est brillante vit heureuse avec son petit ami. Mais une malédiction semble régner sur sa famille : chaque premier mariage se termine par un divorce...', 'Une jeune femme dont la carrière est brillante vit heureuse avec son petit ami. Mais une malédiction semble régner sur sa famille : chaque premier mariage se termine par un divorce...', '01:44:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19423048', 'http://fr.web.img3.acsta.net/medias/nmedia/18/93/09/73/20250231.jpg'),
(338, 132661, 'Frankenweenie', '2012-10-31', 'Après la mort soudaine de Sparky, son chien adoré, le jeune Victor fait appel au pouvoir de la science afin de ramener à la vie celui qui était aussi son meilleur ami. Il lui apporte au passage quelques modifications de son cru?', 'Après la mort soudaine de Sparky, son chien adoré, le jeune Victor fait appel au pouvoir de la science afin de ramener à la vie celui qui était aussi son meilleur ami. Il lui apporte au passage quelques modifications de son cru?', '01:27:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19361629', 'http://fr.web.img5.acsta.net/medias/nmedia/18/85/69/55/20127907.jpg'),
(339, 180270, 'Stars 80', '2012-10-24', 'Deux fans des années 80 dirigent une société de spectacle qui fait tourner des sosies. A la veille du dépôt de bilan, ils retrouvent de vieux 45 tours. L''étincelle jaillit : pourquoi ne pas faire remonter sur scène les vraies Stars des années 80 ?', 'Deux fans des années 80 dirigent une société de spectacle qui fait tourner des sosies. A la veille du dépôt de bilan, ils retrouvent de vieux 45 tours. L''étincelle jaillit : pourquoi ne pas faire remonter sur scène les vraies Stars des années 80 ?', '01:50:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19429014', 'http://fr.web.img1.acsta.net/medias/nmedia/18/92/89/27/20223475.jpg'),
(340, 188067, 'Amour', '2012-10-24', 'Georges et Anne sont octogénaires, ce sont des gens cultivés, professeurs de musique à la retraite. Leur fille, également musicienne, vit à l''étranger avec sa famille. Un jour, Anne est victime d''une petite attaque cérébrale.', 'Georges et Anne sont octogénaires, ce sont des gens cultivés, professeurs de musique à la retraite. Leur fille, également musicienne, vit à l''étranger avec sa famille. Un jour, Anne est victime d''une petite attaque cérébrale.', '02:07:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19342606', 'http://fr.web.img3.acsta.net/medias/nmedia/18/90/20/58/20121556.jpg'),
(341, 145646, 'Skyfall', '2012-10-26', 'Lorsque la dernière mission de Bond tourne mal, plusieurs agents infiltrés se retrouvent exposés dans le monde entier. Le MI6 est attaqué, et M est obligée de relocaliser l''Agence. Ces événements ébranlent son autorité, et elle est remise en cause par Mallory...', 'Lorsque la dernière mission de Bond tourne mal, plusieurs agents infiltrés se retrouvent exposés dans le monde entier. Le MI6 est attaqué, et M est obligée de relocaliser l''Agence. Ces événements ébranlent son autorité, et elle est remise en cause par Mallory...', '02:23:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19378475', 'http://fr.web.img6.acsta.net/medias/nmedia/18/88/95/51/20264212.jpg'),
(342, 195809, 'Au galop', '2012-10-17', 'Ada avait construit sa vie, elle en était contente, en tout cas elle croyait l''être. Elle avait l''air heureuse en couple, avait eu un enfant, prévoyait même de se marier, et pof... elle était tombée sur Paul...', 'Ada avait construit sa vie, elle en était contente, en tout cas elle croyait l''être. Elle avait l''air heureuse en couple, avait eu un enfant, prévoyait même de se marier, et pof... elle était tombée sur Paul...', '01:33:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19401042', 'http://fr.web.img1.acsta.net/medias/nmedia/18/90/27/79/20244217.jpg'),
(343, 193901, 'Paperboy', '2012-10-17', '1969, Lately, Floride. Ward Jansen, reporter au Miami Times, revient dans sa ville natale, accompagné de son partenaire d''écriture Yardley Acheman. Venus à la demande de Charlotte, femme énigmatique qui entretient une correspondance avec des détenus...', '1969, Lately, Floride. Ward Jansen, reporter au Miami Times, revient dans sa ville natale, accompagné de son partenaire d''écriture Yardley Acheman. Venus à la demande de Charlotte, femme énigmatique qui entretient une correspondance avec des détenus...', '01:51:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19400197', 'http://fr.web.img4.acsta.net/medias/nmedia/18/92/38/64/20196843.jpg'),
(344, 193422, 'Bachelorette', '2012-10-17', 'Trois amies sont invitées à être demoiselles d''honneur au mariage d''une ancienne camarade de classe qu''elles ridiculisaient au lycée.', 'Trois amies sont invitées à être demoiselles d''honneur au mariage d''une ancienne camarade de classe qu''elles ridiculisaient au lycée.', '01:26:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19388402', 'http://fr.web.img4.acsta.net/medias/nmedia/18/86/82/74/20216610.jpg'),
(345, 206433, 'La Pirogue', '2012-10-17', 'Un village de pêcheurs dans la grande banlieue de Dakar, d''où partent de nombreuses pirogues. Au terme d''une traversée souvent meurtrière, elles vont rejoindre les îles Canaries en territoire espagnol.', 'Un village de pêcheurs dans la grande banlieue de Dakar, d''où partent de nombreuses pirogues. Au terme d''une traversée souvent meurtrière, elles vont rejoindre les îles Canaries en territoire espagnol.', '01:27:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19400338', 'http://fr.web.img4.acsta.net/medias/nmedia/18/90/22/15/20266495.jpg'),
(346, 177895, 'Astérix et Obélix : au service de Sa Majesté', '2012-10-17', '50 avant Jésus Christ. César a soif de conquêtes. A la tête de ses glorieuses légions il décide d''envahir cette île située aux limites du monde connu, ce pays mystérieux appelé Brittania, la Bretagne.', '50 avant Jésus Christ. César a soif de conquêtes. A la tête de ses glorieuses légions il décide d''envahir cette île située aux limites du monde connu, ce pays mystérieux appelé Brittania, la Bretagne.', '01:49:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19393640', 'http://fr.web.img5.acsta.net/medias/nmedia/18/89/32/13/20231929.jpg');
INSERT INTO `film` (`id`, `code`, `titre`, `date`, `synopsis`, `synopsisCourt`, `duree`, `note`, `trailer`, `affiche`) VALUES
(347, 185999, 'Tous les espoirs sont permis', '2012-10-10', 'Kay et Arnold forment un couple fidèle depuis de longues années, mais Kay rêve de pimenter un peu leur vie et de resserrer les liens avec son mari. Lorsqu''elle entend parler d''un thérapeute spécialisé dans les problèmes conjugaux qui exerce dans la ville de Great Hope Springs, elle fait tout pour persuader son mari de prendre l''avion pour une semaine intense de thérapie de couple? Tout recommencer n''est pas évident, mais c''est loin d''être triste !', 'Kay et Arnold forment un couple fidèle depuis de longues années, mais Kay rêve de pimenter un peu leur vie et de resserrer les liens avec son mari. Lorsqu''elle entend parler d''un thérapeute spécialisé dans les problèmes conjugaux qui exerce dans la ville de Great Hope Springs, elle fait tout pour persuader son mari de prendre l''avion pour une semaine intense de thérapie de couple? Tout recommencer n''est pas évident, mais c''est loin d''être triste !', '01:40:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19335283', 'http://fr.web.img5.acsta.net/medias/nmedia/18/91/71/75/20159760.jpg'),
(348, 192239, 'Insensibles', '2012-10-10', 'A la veille de la guerre civile espagnole, un groupe d''enfants insensibles à la douleur est interné dans un hôpital au c?ur des Pyrénées. De nos jours, David Martel, brillant neurochirurgien, doit retrouver ses parents biologiques pour procéder à une greffe...', 'A la veille de la guerre civile espagnole, un groupe d''enfants insensibles à la douleur est interné dans un hôpital au c?ur des Pyrénées. De nos jours, David Martel, brillant neurochirurgien, doit retrouver ses parents biologiques pour procéder à une greffe...', '01:45:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19388157', 'http://fr.web.img1.acsta.net/medias/nmedia/18/91/56/22/20152324.jpg'),
(349, 190423, 'Sous la ville', '2012-10-10', 'Le récit suit l''histoire du polonais Leopold Socha, qui passe de voleur à héros durant la Seconde Guerre mondiale en sauvant la vie d''un groupe de juifs de Lvov. Quand Socha rencontre le groupe pour la première fois, c''est uniquement par intérêt financier qu''il décide de lui trouver une cachette dans les canaux.', 'Le récit suit l''histoire du polonais Leopold Socha, qui passe de voleur à héros durant la Seconde Guerre mondiale en sauvant la vie d''un groupe de juifs de Lvov. Quand Socha rencontre le groupe pour la première fois, c''est uniquement par intérêt financier qu''il décide de lui trouver une cachette dans les canaux.', '02:25:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19409224', 'http://fr.web.img6.acsta.net/medias/nmedia/18/93/35/33/20251283.jpg'),
(350, 191623, 'God Bless America', '2012-10-10', 'Seul, sans boulot, gravement malade, Frank sombre dans la spirale infernale d''une Amérique déshumanisée et cruelle. N''ayant plus rien à perdre, il prend son flingue et assassine les personnes les plus viles et stupides qui croisent son chemin.', 'Seul, sans boulot, gravement malade, Frank sombre dans la spirale infernale d''une Amérique déshumanisée et cruelle. N''ayant plus rien à perdre, il prend son flingue et assassine les personnes les plus viles et stupides qui croisent son chemin.', '01:40:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19382993', 'http://fr.web.img6.acsta.net/medias/nmedia/18/86/03/52/20260405.jpg'),
(351, 193715, 'Dans la maison', '2012-10-10', 'Un garçon de 16 ans s''immisce dans la maison d''un élève de sa classe, et en fait le récit dans ses rédactions à son professeur de français. Mais cette intrusion va déclencher une série d''événements incontrôlables.', 'Un garçon de 16 ans s''immisce dans la maison d''un élève de sa classe, et en fait le récit dans ses rédactions à son professeur de français. Mais cette intrusion va déclencher une série d''événements incontrôlables.', '01:45:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19352899', 'http://fr.web.img6.acsta.net/medias/nmedia/18/91/17/25/20133111.jpg'),
(352, 180343, 'Ted', '2012-10-10', 'L''omniprésence de Ted aux côtés de John pèse lourdement sur sa relation amoureuse avec Lori.  Déchiré entre son amour pour Lori et sa loyauté envers Ted, John lutte pour devenir enfin un homme, un vrai !', 'L''omniprésence de Ted aux côtés de John pèse lourdement sur sa relation amoureuse avec Lori.  Déchiré entre son amour pour Lori et sa loyauté envers Ted, John lutte pour devenir enfin un homme, un vrai !', '01:47:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19398914', 'http://fr.web.img3.acsta.net/medias/nmedia/18/89/57/28/20196214.jpg'),
(353, 205375, 'Elle s''appelle Ruby', '2012-10-03', 'Calvin est un romancier à succès, qui peine à trouver un second souffle. Encouragé par son psychiatre à écrire sur la fille de ses rêves, Calvin voit son univers bouleversé par l''apparition littérale de Ruby dans sa vie, amoureuse de lui et exactement comme il l''a écrite et imaginée.', 'Calvin est un romancier à succès, qui peine à trouver un second souffle. Encouragé par son psychiatre à écrire sur la fille de ses rêves, Calvin voit son univers bouleversé par l''apparition littérale de Ruby dans sa vie, amoureuse de lui et exactement comme il l''a écrite et imaginée.', '01:43:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19386573', 'http://fr.web.img5.acsta.net/medias/nmedia/18/92/31/04/20217764.jpg'),
(354, 144809, 'Taken 2', '2012-10-03', 'Dans "Taken", Bryan Mills, ex-agent de la CIA aux compétences si particulières, a réussi à arracher sa fille des mains d''un gang mafieux. Un an plus tard, le chef du clan réclame vengeance. Cette fois-ci, c''est après lui qu''ils en ont.', 'Dans "Taken", Bryan Mills, ex-agent de la CIA aux compétences si particulières, a réussi à arracher sa fille des mains d''un gang mafieux. Un an plus tard, le chef du clan réclame vengeance. Cette fois-ci, c''est après lui qu''ils en ont.', '01:38:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19374857', 'http://fr.web.img4.acsta.net/medias/nmedia/18/90/63/92/20182074.jpg'),
(355, 197437, 'Do Not Disturb', '2012-10-03', 'Un soir, Jeff débarque sans prévenir chez Ben. Pour célébrer ces retrouvailles et distraire son vieux copain de sa vie rangée, Jeff l''entraîne dans une fête. Sur place, une discussion évoque un festival de porno amateur et l''idée prend vite l''allure d''un pari ...', 'Un soir, Jeff débarque sans prévenir chez Ben. Pour célébrer ces retrouvailles et distraire son vieux copain de sa vie rangée, Jeff l''entraîne dans une fête. Sur place, une discussion évoque un festival de porno amateur et l''idée prend vite l''allure d''un pari ...', '01:36:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19369423', 'http://fr.web.img3.acsta.net/medias/nmedia/18/91/97/05/20211546.jpg'),
(356, 174987, 'Pauline détective', '2012-10-03', 'Plaquée par son petit ami, Pauline se laisse entraîner par sa s?ur dans un palace de la riviera italienne. Au lieu de savourer les joies du farniente, elle se persuade qu''un crime a été commis dans l''hôtel et s''improvise détective, embarquant dans ses investigations un séduisant maître-nageur?', 'Plaquée par son petit ami, Pauline se laisse entraîner par sa s?ur dans un palace de la riviera italienne. Au lieu de savourer les joies du farniente, elle se persuade qu''un crime a été commis dans l''hôtel et s''improvise détective, embarquant dans ses investigations un séduisant maître-nageur?', '01:41:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19390710', 'http://fr.web.img4.acsta.net/medias/nmedia/18/88/70/18/20215461.jpg'),
(357, 196251, 'Gebo et l''ombre', '2012-09-26', 'Malgré l''âge et la fatigue, Gebo poursuit son activité de comptable pour nourrir sa famille. Il vit avec sa femme, Doroteia, et leur belle-fille, Sofia, mais c''est l''absence de leur fils, João, qui occupe les esprits.', 'Malgré l''âge et la fatigue, Gebo poursuit son activité de comptable pour nourrir sa famille. Il vit avec sa femme, Doroteia, et leur belle-fille, Sofia, mais c''est l''absence de leur fils, João, qui occupe les esprits.', '01:31:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19389744', 'http://fr.web.img6.acsta.net/medias/nmedia/18/90/56/92/20229399.jpg'),
(358, 178686, 'Savages', '2012-09-26', 'Ben, docteur en botanique et marketing, Chon, mercenaire féru d''armes, et Ophelia, une bimbo à l''intelligence brillante, produisent de l''hydro, un cannabis cultivé hors-sol, sans matière organique. Ils vivent de leur petit commerce jusqu''au jour où la reine du Cartel de Baja veut racheter leur business...', 'Ben, docteur en botanique et marketing, Chon, mercenaire féru d''armes, et Ophelia, une bimbo à l''intelligence brillante, produisent de l''hydro, un cannabis cultivé hors-sol, sans matière organique. Ils vivent de leur petit commerce jusqu''au jour où la reine du Cartel de Baja veut racheter leur business...', '02:10:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19327658', 'http://fr.web.img3.acsta.net/medias/nmedia/18/89/96/96/20184017.jpg'),
(359, 147453, 'Le Magasin des suicides', '2012-09-26', 'Imaginez une ville où les gens n''ont plus goût à rien, au point que la boutique la plus florissante est celle où on vend poisons et cordes pour se pendre. Mais la patronne vient d''accoucher d''un enfant qui est la joie de vivre incarnée. Au magasin des suicides, le ver est dans le fruit?', 'Imaginez une ville où les gens n''ont plus goût à rien, au point que la boutique la plus florissante est celle où on vend poisons et cordes pour se pendre. Mais la patronne vient d''accoucher d''un enfant qui est la joie de vivre incarnée. Au magasin des suicides, le ver est dans le fruit?', '01:25:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19251106', 'http://fr.web.img4.acsta.net/medias/nmedia/18/74/16/62/20104611.jpg'),
(360, 183422, 'Vous n''avez encore rien vu', '2012-09-26', 'Après sa mort, Antoine, homme de théâtre, fait convoquer chez lui tous ses amis comédiens ayant joué dans différentes versions de sa pièce Eurydice. Il a enregistré, avant de mourir, une déclaration dans laquelle il leur demande de visionner une captation des répétitions...', 'Après sa mort, Antoine, homme de théâtre, fait convoquer chez lui tous ses amis comédiens ayant joué dans différentes versions de sa pièce Eurydice. Il a enregistré, avant de mourir, une déclaration dans laquelle il leur demande de visionner une captation des répétitions...', '01:55:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19341782', 'http://fr.web.img3.acsta.net/medias/nmedia/18/88/64/60/20087447.jpg'),
(361, 190768, 'Les Seigneurs', '2012-09-26', 'Patrick Orbéra, la cinquantaine, est une ancienne gloire du football qui a totalement raté sa reconversion. Sans emploi, alcoolique et ruiné, il n''a même plus le droit de voir sa fille Laura. Contraint par un juge de retrouver un emploi stable, il n''a d''autre choix que de partir sur une petite île bretonne...', 'Patrick Orbéra, la cinquantaine, est une ancienne gloire du football qui a totalement raté sa reconversion. Sans emploi, alcoolique et ruiné, il n''a même plus le droit de voir sa fille Laura. Contraint par un juge de retrouver un emploi stable, il n''a d''autre choix que de partir sur une petite île bretonne...', '01:37:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19374779', 'http://fr.web.img3.acsta.net/medias/nmedia/18/85/36/32/20184118.jpg'),
(362, 183143, 'Captive', '2012-09-19', 'Thérèse Bourgoine est une citoyenne française qui travaille comme humanitaire bénévole pour une ONG sur l''île de Palawan aux Philippines. Alors qu''elle apporte des provisions au siège de l''ONG à Puerto Princesa en compagnie d''une autre bénévole, les deux femmes sont kidnappées.', 'Thérèse Bourgoine est une citoyenne française qui travaille comme humanitaire bénévole pour une ONG sur l''île de Palawan aux Philippines. Alors qu''elle apporte des provisions au siège de l''ONG à Puerto Princesa en compagnie d''une autre bénévole, les deux femmes sont kidnappées.', '02:02:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19375647', 'http://fr.web.img5.acsta.net/medias/nmedia/18/89/07/85/20181380.jpg'),
(363, 190956, 'Quelques heures de printemps', '2012-09-19', 'A 48 ans, Alain Evrard est obligé de retourner habiter chez sa mère. Cohabitation forcée qui fait ressurgir toute la violence de leur relation passée. Il découvre alors que sa mère est condamnée par la maladie.', 'A 48 ans, Alain Evrard est obligé de retourner habiter chez sa mère. Cohabitation forcée qui fait ressurgir toute la violence de leur relation passée. Il découvre alors que sa mère est condamnée par la maladie.', '01:48:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19377033', 'http://fr.web.img2.acsta.net/medias/nmedia/18/91/14/76/20193644.jpg'),
(364, 195967, 'Robot and Frank', '2012-09-19', 'Dans un futur proche? Frank, retraité cleptomane à la mémoire déclinante, mène une vie de solitaire grincheux et cynique, jusqu''au jour où son fils lui impose un nouveau colocataire : un robot. Chargé de veiller sur lui, ce dernier va bouleverser la vie du vieux bougon.', 'Dans un futur proche? Frank, retraité cleptomane à la mémoire déclinante, mène une vie de solitaire grincheux et cynique, jusqu''au jour où son fils lui impose un nouveau colocataire : un robot. Chargé de veiller sur lui, ce dernier va bouleverser la vie du vieux bougon.', '01:25:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19369211', 'http://fr.web.img3.acsta.net/medias/nmedia/18/93/27/46/20247000.jpg'),
