(367, 203981, 'Ombline', '2012-09-12', 'Ombline, une jeune femme de vingt ans, est condamnée à 3 ans de prison suite à une violente agression. Alors qu''elle a perdu tout espoir en l''avenir, un événement vient bouleverser sa vie : elle découvre qu''elle est enceinte et donne naissance à Lucas.', 'Ombline, une jeune femme de vingt ans, est condamnée à 3 ans de prison suite à une violente agression. Alors qu''elle a perdu tout espoir en l''avenir, un événement vient bouleverser sa vie : elle découvre qu''elle est enceinte et donne naissance à Lucas.', '01:35:00', 4.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19375218', 'http://fr.web.img1.acsta.net/medias/nmedia/18/91/93/87/20170597.jpg'),
(368, 179165, 'The We and The I', '2012-09-12', 'C''est la fin de l''année. Les élèves d''un lycée du Bronx grimpent dans le même bus pour un dernier trajet ensemble avant l''été. Le groupe d''adolescents bruyants et exubérants, évolue et se transforme au fur et à mesure que le bus se vide.', 'C''est la fin de l''année. Les élèves d''un lycée du Bronx grimpent dans le même bus pour un dernier trajet ensemble avant l''été. Le groupe d''adolescents bruyants et exubérants, évolue et se transforme au fur et à mesure que le bus se vide.', '01:43:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19342542', 'http://fr.web.img3.acsta.net/medias/nmedia/18/90/40/03/20200389.jpg'),
