(377, 188841, 'Confession d''un enfant du siècle', '2012-08-29', 'Paris 1830. Octave, trahie par sa maîtresse, tombe dans le désespoir et la débauche : le ?mal du siècle?. La mort de son père l''amène à la campagne où il rencontre Brigitte, une jeune veuve, de dix ans son aînée. Pour Octave, c''est à nouveau la passion. Mais aura-t-il le courage d''y croire ?', 'Paris 1830. Octave, trahie par sa maîtresse, tombe dans le désespoir et la débauche : le ?mal du siècle?. La mort de son père l''amène à la campagne où il rencontre Brigitte, une jeune veuve, de dix ans son aînée. Pour Octave, c''est à nouveau la passion. Mais aura-t-il le courage d''y croire ?', '02:00:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19343897', 'http://fr.web.img1.acsta.net/medias/nmedia/18/83/65/20/20171810.jpg'),
