(387, 181059, 'L''Âge de glace : La dérive des continents', '2012-06-27', 'Après un cataclysme qui a provoqué la dérive de tout un continent, Manny, Diego et Sid se retrouvent séparés du reste de la horde. Essayant de rejoindre leurs amis à tout prix, ils utilisent un iceberg comme bateau et se retrouvent dans un périple maritime épique !', 'Après un cataclysme qui a provoqué la dérive de tout un continent, Manny, Diego et Sid se retrouvent séparés du reste de la horde. Essayant de rejoindre leurs amis à tout prix, ils utilisent un iceberg comme bateau et se retrouvent dans un périple maritime épique !', '01:34:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19356800', 'http://fr.web.img6.acsta.net/medias/nmedia/18/86/68/30/20093574.jpg'),
(388, 193360, 'La Part des Anges', '2012-06-27', 'A Glasgow, Robbie, tout jeune père de famille, est constamment rattrapé par son passé de délinquant. Il croise la route de Rhino, Albert et la jeune Mo lorsque, comme eux, il échappe de justesse à la prison mais écope d''une peine de travaux d''intérêts généraux.', 'A Glasgow, Robbie, tout jeune père de famille, est constamment rattrapé par son passé de délinquant. Il croise la route de Rhino, Albert et la jeune Mo lorsque, comme eux, il échappe de justesse à la prison mais écope d''une peine de travaux d''intérêts généraux.', '01:41:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19332495', 'http://fr.web.img4.acsta.net/medias/nmedia/18/90/20/64/20139074.jpg'),
(389, 196589, 'The Raid', '2012-06-20', 'Au c?ur des quartiers pauvres de Jakarta, se trouve une citadelle imprenable dans laquelle se cache le plus dangereux trafiquant du pays. Une équipe de policiers d''élite est envoyée donner l''assaut lors d''un raid secret mené aux premières lueurs du jour.', 'Au c?ur des quartiers pauvres de Jakarta, se trouve une citadelle imprenable dans laquelle se cache le plus dangereux trafiquant du pays. Une équipe de policiers d''élite est envoyée donner l''assaut lors d''un raid secret mené aux premières lueurs du jour.', '01:41:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19334640', 'http://fr.web.img5.acsta.net/medias/nmedia/18/85/95/62/20057104.jpg'),
(390, 189168, 'The Deep Blue Sea', '2012-06-20', 'Dans les années 50, à Londres, une femme au foyer de milieu aisé décide de quitter son époux pour un ancien pilote de la Royal Air Force dont elle s''est éperdument éprise.', 'Dans les années 50, à Londres, une femme au foyer de milieu aisé décide de quitter son époux pour un ancien pilote de la Royal Air Force dont elle s''est éperdument éprise.', '01:35:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19341139', 'http://fr.web.img4.acsta.net/medias/nmedia/18/87/37/55/20078841.jpg'),
(391, 193517, 'Ce qui vous attend si vous attendez un enfant', '2012-06-20', 'Une série d''histoires croisées sur la grossesse, mettant en scène cinq couples très différents.', 'Une série d''histoires croisées sur la grossesse, mettant en scène cinq couples très différents.', '01:50:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19320868', 'http://fr.web.img3.acsta.net/medias/nmedia/18/90/28/60/20089587.jpg'),
(392, 197440, 'Adieu Berthe ou l''enterrement de mémé', '2012-06-20', 'Mémé is dead. Berthe n''est plus. Armand avait "un peu" oublié sa grand-mère? Pharmacien, il travaille avec sa femme Hélène à Chatou. Dans un tiroir de médicaments, Armand cache ses accessoires de magie car il prépare en secret un tour pour l''anniversaire de la fille?', 'Mémé is dead. Berthe n''est plus. Armand avait "un peu" oublié sa grand-mère? Pharmacien, il travaille avec sa femme Hélène à Chatou. Dans un tiroir de médicaments, Armand cache ses accessoires de magie car il prépare en secret un tour pour l''anniversaire de la fille?', '01:40:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19342938', 'http://fr.web.img2.acsta.net/medias/nmedia/18/90/68/23/20108174.jpg'),
(393, 188021, 'The Dictator', '2012-06-20', 'L''Amiral Général Aladeen, dictateur de Wadiya, débarque à New-York pour se rendre au Conseil des Nations Unies. Capturé par le gouvernement américain, il est relâché dans les rues de la ville tel un inconnu. Il va alors partir à la découverte de la patrie de la liberté...', 'L''Amiral Général Aladeen, dictateur de Wadiya, débarque à New-York pour se rendre au Conseil des Nations Unies. Capturé par le gouvernement américain, il est relâché dans les rues de la ville tel un inconnu. Il va alors partir à la découverte de la patrie de la liberté...', '01:23:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19350123', 'http://fr.web.img6.acsta.net/medias/nmedia/18/84/77/28/20096200.jpg'),
(394, 187396, 'Blanche-Neige et le chasseur', '2012-06-13', 'Dans une réécriture du conte des frères Grimm, le chasseur supposé tuer Blanche-Neige dans les bois devient son protecteur et son mentor afin de monter une armée pour reconquérir le royaume, et libérer le peuple du joug de l''impitoyable Reine Ravenna.', 'Dans une réécriture du conte des frères Grimm, le chasseur supposé tuer Blanche-Neige dans les bois devient son protecteur et son mentor afin de monter une armée pour reconquérir le royaume, et libérer le peuple du joug de l''impitoyable Reine Ravenna.', '02:06:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19320357', 'http://fr.web.img1.acsta.net/medias/nmedia/18/85/34/52/20089538.jpg'),
(395, 190515, 'Quand je serai petit', '2012-06-13', 'À l''occasion d''un voyage, Mathias, 40 ans, croise par hasard un enfant qui lui fait étrangement penser à lui au même âge. Profondément troublé, il se lance dans une quête insensée sur les traces du petit garçon qui risque bien de bouleverser son existence et son équilibre familial ?', 'À l''occasion d''un voyage, Mathias, 40 ans, croise par hasard un enfant qui lui fait étrangement penser à lui au même âge. Profondément troublé, il se lance dans une quête insensée sur les traces du petit garçon qui risque bien de bouleverser son existence et son équilibre familial ?', '01:35:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19327198', 'http://fr.web.img2.acsta.net/medias/nmedia/18/89/96/08/20074343.jpg'),
(396, 194591, 'Journal de France', '2012-06-13', 'C''est un journal, un voyage dans le temps, il photographie la France, elle retrouve des bouts de films inédits qu''il garde précieusement : ses débuts à la caméra, ses reportages autour du monde, des bribes de leur mémoire, de notre histoire.', 'C''est un journal, un voyage dans le temps, il photographie la France, elle retrouve des bouts de films inédits qu''il garde précieusement : ses débuts à la caméra, ses reportages autour du monde, des bribes de leur mémoire, de notre histoire.', '01:40:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19333088', 'http://fr.web.img4.acsta.net/medias/nmedia/18/90/19/21/20094505.jpg'),
(397, 194178, 'Trishna', '2012-06-13', 'Issue d''un milieu défavorisé, Trishna, une jeune paysanne Indienne, fait la rencontre de Jay, un séduisant jeune homme fortuné. Charmé, ce dernier lui propose de travailler en tant que serveuse dans son hôtel de luxe...', 'Issue d''un milieu défavorisé, Trishna, une jeune paysanne Indienne, fait la rencontre de Jay, un séduisant jeune homme fortuné. Charmé, ce dernier lui propose de travailler en tant que serveuse dans son hôtel de luxe...', '01:58:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19325182', 'http://fr.web.img5.acsta.net/medias/nmedia/18/89/86/83/20108391.jpg'),
(398, 195519, 'Bienvenue Parmi Nous', '2012-06-13', 'Malgré sa renommée, Taillandier, la soixantaine, a brusquement cessé de peindre. En pleine déprime, il décide de partir de chez lui, sans but précis et sans donner d''explication à ses proches. Au cours de son périple, il fait l''étrange rencontre d''une adolescente égarée, Marylou...', 'Malgré sa renommée, Taillandier, la soixantaine, a brusquement cessé de peindre. En pleine déprime, il décide de partir de chez lui, sans but précis et sans donner d''explication à ses proches. Au cours de son périple, il fait l''étrange rencontre d''une adolescente égarée, Marylou...', '01:30:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19336640', 'http://fr.web.img4.acsta.net/medias/nmedia/18/90/28/68/20090027.jpg'),
(399, 49775, '21 Jump Street', '2012-06-06', 'Les nouvelles aventures de la brigade de 21 Jump Street, un groupe de jeunes policiers pouvant aisément se faire passer pour des adolescents et ainsi infiltrer les réseaux des trafiquants de drogue qui sévissent dans les milieux universitaires californiens.', 'Les nouvelles aventures de la brigade de 21 Jump Street, un groupe de jeunes policiers pouvant aisément se faire passer pour des adolescents et ainsi infiltrer les réseaux des trafiquants de drogue qui sévissent dans les milieux universitaires californiens.', '01:49:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19304602', 'http://fr.web.img2.acsta.net/medias/nmedia/18/73/46/24/20086654.jpg'),
(400, 190926, 'Couleur de peau : miel', '2012-06-06', 'Mélangeant animation et prises de vues réelles, ce film documentaire raconte le destin d''un déraciné et sa quête pour se réconcilier avec ses origines.', 'Mélangeant animation et prises de vues réelles, ce film documentaire raconte le destin d''un déraciné et sa quête pour se réconcilier avec ses origines.', '01:15:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19342182', 'http://fr.web.img1.acsta.net/medias/nmedia/18/90/05/63/20102664.jpg'),
(401, 183136, 'Des saumons dans le désert', '2012-06-06', 'L''histoire du Docteur Alfred Jones, un scientifique spécialisé dans la pisciculture, qui se trouve impliqué dans un projet atypique qui changera le cours de sa vie : amener du saumon au Yémen.', 'L''histoire du Docteur Alfred Jones, un scientifique spécialisé dans la pisciculture, qui se trouve impliqué dans un projet atypique qui changera le cours de sa vie : amener du saumon au Yémen.', '01:47:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19331359', 'http://fr.web.img6.acsta.net/medias/nmedia/18/90/17/73/20084455.jpg'),
(402, 195334, 'Le Grand soir', '2012-06-06', 'Les Bonzini tiennent le restaurant ''la Pataterie'' dans une zone commerciale. Leur fils ainé, Not, est le plus vieux punk à chien d''Europe.  Son frère, Jean Pierre, est vendeur dans un magasin de literie...', 'Les Bonzini tiennent le restaurant ''la Pataterie'' dans une zone commerciale. Leur fils ainé, Not, est le plus vieux punk à chien d''Europe.  Son frère, Jean Pierre, est vendeur dans un magasin de literie...', '01:32:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19340521', 'http://fr.web.img5.acsta.net/medias/nmedia/18/90/17/40/20086704.jpg'),
(403, 146915, 'Madagascar 3, Bons Baisers D?Europe', '2012-06-06', 'Alex le lion, Marty le zèbre, Gloria l''hippopotame et Melman la girafe cherchent toujours désespérément à rentrer chez eux ! Évidemment, King Julian, Maurice et les pingouins les suivent dans leurs péripéties?', 'Alex le lion, Marty le zèbre, Gloria l''hippopotame et Melman la girafe cherchent toujours désespérément à rentrer chez eux ! Évidemment, King Julian, Maurice et les pingouins les suivent dans leurs péripéties?', '01:33:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19321313', 'http://fr.web.img3.acsta.net/medias/nmedia/18/89/65/55/20063546.jpg'),
(404, 188106, 'Almanya', '2012-05-30', '"Suis-je allemand ou turc ?" C''est la question que se pose Cenk Yilmaz, lors d''un match de football, alors que ni ses camarades allemands ni ses camarades turcs ne veulent de lui dans leur équipe. Sa cousine lui raconte l''histoire de leur grand-père turc, émigré en Allemagne.', '"Suis-je allemand ou turc ?" C''est la question que se pose Cenk Yilmaz, lors d''un match de football, alors que ni ses camarades allemands ni ses camarades turcs ne veulent de lui dans leur équipe. Sa cousine lui raconte l''histoire de leur grand-père turc, émigré en Allemagne.', '01:41:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19332431', 'http://fr.web.img4.acsta.net/medias/nmedia/18/89/52/46/20086678.jpg'),
(405, 193512, 'Les Femmes du Bus 678', '2012-05-30', 'Fayza, Seba et Nelly, trois femmes d''aujourd''hui, aux vies totalement différentes, s''unissent pour combattre le machisme impuni qui sévit au Caire...', 'Fayza, Seba et Nelly, trois femmes d''aujourd''hui, aux vies totalement différentes, s''unissent pour combattre le machisme impuni qui sévit au Caire...', '01:40:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19335595', 'http://fr.web.img1.acsta.net/medias/nmedia/18/89/84/19/20086229.jpg'),
(406, 141564, 'Prometheus', '2012-05-30', 'Une équipe d''explorateurs découvre un indice sur l''origine de l''humanité sur Terre. Cette découverte les entraîne dans un voyage fascinant jusqu''aux recoins les plus sombres de l''univers. Là-bas, un affrontement terrifiant qui décidera de l''avenir de l''humanité les attend.', 'Une équipe d''explorateurs découvre un indice sur l''origine de l''humanité sur Terre. Cette découverte les entraîne dans un voyage fascinant jusqu''aux recoins les plus sombres de l''univers. Là-bas, un affrontement terrifiant qui décidera de l''avenir de l''humanité les attend.', '02:03:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19338260', 'http://fr.web.img4.acsta.net/medias/nmedia/18/85/32/85/20022460.jpg'),
(407, 139622, 'Men In Black III', '2012-05-23', 'Lorsque la vie de K et le destin de la Terre sont menacés, l''agent J décide de remonter le temps pour remettre les choses en ordre. Il est cette fois obligé de faire équipe avec l''agent K, plus jeune, pour sauver la vie de son partenaire, l''agence, et l''avenir même de l''humanité?', 'Lorsque la vie de K et le destin de la Terre sont menacés, l''agent J décide de remonter le temps pour remettre les choses en ordre. Il est cette fois obligé de faire équipe avec l''agent K, plus jeune, pour sauver la vie de son partenaire, l''agence, et l''avenir même de l''humanité?', '01:44:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19316701', 'http://fr.web.img2.acsta.net/medias/nmedia/18/89/36/03/20072335.jpg'),
(408, 181593, 'Sur la route', '2012-05-23', 'Sal Paradise, apprenti écrivain new-yorkais, rencontre Dean Moriarty, jeune ex-taulard au charme ravageur. Ils décident de partir à la rencontre du monde, des autres et d''eux-mêmes en compagnie de Marylou, la très libre femme de Dean.', 'Sal Paradise, apprenti écrivain new-yorkais, rencontre Dean Moriarty, jeune ex-taulard au charme ravageur. Ils décident de partir à la rencontre du monde, des autres et d''eux-mêmes en compagnie de Marylou, la très libre femme de Dean.', '02:20:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19337080', 'http://fr.web.img4.acsta.net/medias/nmedia/18/83/04/97/20092801.jpg'),
(409, 143756, 'Cosmopolis', '2012-05-25', 'Dans un New York en ébullition, l''ère du capitalisme touche à sa fin. Eric Packer, golden boy de la haute finance, s''engouffre dans sa limousine. Alors que la visite du président des États-Unis paralyse Manhattan, Eric Packer n''a qu''une seule obsession : une coupe de cheveux...', 'Dans un New York en ébullition, l''ère du capitalisme touche à sa fin. Eric Packer, golden boy de la haute finance, s''engouffre dans sa limousine. Alors que la visite du président des États-Unis paralyse Manhattan, Eric Packer n''a qu''une seule obsession : une coupe de cheveux...', '01:48:00', 1.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19332064', 'http://fr.web.img6.acsta.net/medias/nmedia/18/84/59/53/20080335.jpg'),
(410, 188159, 'Contrebande', '2012-05-16', 'Ancien contrebandier, Chris Farraday s''est construit une vie paisible avec sa femme et leurs deux fils, jusqu''au jour où son jeune et naïf beau-frère Andy manque à ses engagements dans une opération de trafic de drogues. Pour aider Andy, Chris reprend du service en tant que contrebandier...', 'Ancien contrebandier, Chris Farraday s''est construit une vie paisible avec sa femme et leurs deux fils, jusqu''au jour où son jeune et naïf beau-frère Andy manque à ses engagements dans une opération de trafic de drogues. Pour aider Andy, Chris reprend du service en tant que contrebandier...', '01:51:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19313307', 'http://fr.web.img2.acsta.net/medias/nmedia/18/89/06/09/20022472.jpg'),
(411, 184864, 'Je te promets - The Vow', '2012-05-16', 'A la suite d''un accident de voiture, une jeune mariée sombre dans le coma pendant que son mari veille sur elle. Lorsqu''elle émerge et ne se souvient ni de lui, ni de leur mariage, il tente de conquérir son c?ur à nouveau.', 'A la suite d''un accident de voiture, une jeune mariée sombre dans le coma pendant que son mari veille sur elle. Lorsqu''elle émerge et ne se souvient ni de lui, ni de leur mariage, il tente de conquérir son c?ur à nouveau.', '01:44:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19267891', 'http://fr.web.img6.acsta.net/medias/nmedia/18/88/74/19/20003535.jpg'),
(412, 187864, 'Moonrise Kingdom', '2012-05-16', 'Sur une île au large de la Nouvelle-Angleterre, au c?ur de l''été 1965, Suzy et Sam, douze ans, tombent amoureux, concluent un pacte secret et s''enfuient ensemble. Alors que chacun se mobilise pour les retrouver, une violente tempête s''approche des côtes et va bouleverser davantage encore la vie de la communauté.', 'Sur une île au large de la Nouvelle-Angleterre, au c?ur de l''été 1965, Suzy et Sam, douze ans, tombent amoureux, concluent un pacte secret et s''enfuient ensemble. Alors que chacun se mobilise pour les retrouver, une violente tempête s''approche des côtes et va bouleverser davantage encore la vie de la communauté.', '01:34:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19317290', 'http://fr.web.img5.acsta.net/medias/nmedia/18/88/64/21/20079610.jpg'),
(413, 172976, 'De rouille et d''os', '2012-05-17', 'A la suite d''une bagarre dans une boîte de nuit, le destin d''Ali croise celui de Stéphanie. Il la ramène chez elle et lui laisse son téléphone. Il est pauvre, elle est belle et pleine d''assurance. C''est une princesse. Tout les oppose. Mais un accident va changer la donne.', 'A la suite d''une bagarre dans une boîte de nuit, le destin d''Ali croise celui de Stéphanie. Il la ramène chez elle et lui laisse son téléphone. Il est pauvre, elle est belle et pleine d''assurance. C''est une princesse. Tout les oppose. Mais un accident va changer la donne.', '02:00:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19329165', 'http://fr.web.img5.acsta.net/medias/nmedia/18/89/84/98/20087993.jpg'),
(414, 178189, 'W.E.', '2012-05-09', 'Londres, décembre 1936. Pour pouvoir épouser l''américaine Wallis Simpson, déjà deux fois divorcée, le roi Edouard VIII est contraint d''abdiquer, quelques mois seulement après le début de son règne...', 'Londres, décembre 1936. Pour pouvoir épouser l''américaine Wallis Simpson, déjà deux fois divorcée, le roi Edouard VIII est contraint d''abdiquer, quelques mois seulement après le début de son règne...', '01:59:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19305173', 'http://fr.web.img6.acsta.net/medias/nmedia/18/86/32/49/20017241.jpg'),
(415, 196577, 'Sea, No Sex and Sun', '2012-05-09', 'Ce film évoque les déboires de trois hommes de générations différentes, confrontés à leurs désirs et à la difficulté de les assouvir. Une comédie qui se moque gentiment des hommes, éternels insatisfaits. L''été sera chaud? mais pas trop !', 'Ce film évoque les déboires de trois hommes de générations différentes, confrontés à leurs désirs et à la difficulté de les assouvir. Une comédie qui se moque gentiment des hommes, éternels insatisfaits. L''été sera chaud? mais pas trop !', '01:29:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19323750', 'http://fr.web.img2.acsta.net/medias/nmedia/18/86/82/60/20033025.jpg'),
(416, 195034, 'Street Dance 2 [3D]', '2012-05-09', 'Pour battre la meilleure équipe du monde, Ash, un street dancer exceptionnel, et son nouvel ami Eddie se lancent à la recherche des meilleurs danseurs d''Europe. Parcourant les pays, l''équipe s''enrichit de personnalités et de styles tous plus surprenants les uns que les autres.', 'Pour battre la meilleure équipe du monde, Ash, un street dancer exceptionnel, et son nouvel ami Eddie se lancent à la recherche des meilleurs danseurs d''Europe. Parcourant les pays, l''équipe s''enrichit de personnalités et de styles tous plus surprenants les uns que les autres.', '01:25:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19322601', 'http://fr.web.img3.acsta.net/medias/nmedia/18/89/90/93/20072090.jpg'),
(417, 190229, 'Maman', '2012-05-09', 'Deux s?urs vont kidnapper leur mère pour l''obliger à les aimer.', 'Deux s?urs vont kidnapper leur mère pour l''obliger à les aimer.', '01:28:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19322324', 'http://fr.web.img6.acsta.net/medias/nmedia/18/89/64/77/20059952.jpg');
