(418, 186338, 'Indian Palace', '2012-05-09', 'Plusieurs retraités britanniques coupent toutes leurs attaches et partent s''établir en Inde, dans ce qu''ils croient être un palace au meilleur prix. Bien moins luxueux que la publicité ne le laissait entendre, cet hôtel délabré au charme indéfinissable va bouleverser leurs vies...', 'Plusieurs retraités britanniques coupent toutes leurs attaches et partent s''établir en Inde, dans ce qu''ils croient être un palace au meilleur prix. Bien moins luxueux que la publicité ne le laissait entendre, cet hôtel délabré au charme indéfinissable va bouleverser leurs vies...', '02:05:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19306775', 'http://fr.web.img1.acsta.net/medias/nmedia/18/88/85/14/20027434.jpg'),
(419, 130298, 'Dark Shadows', '2012-05-09', 'Au XVIIIème siècle, Barnabas Collins est maudit par une sorcière. Il est  alors transformé en vampire et enterré vivant. Deux siècles plus tard, Barnabas est libéré de sa tombe par inadvertance et débarque en 1972 dans un monde totalement transformé?', 'Au XVIIIème siècle, Barnabas Collins est maudit par une sorcière. Il est  alors transformé en vampire et enterré vivant. Deux siècles plus tard, Barnabas est libéré de sa tombe par inadvertance et débarque en 1972 dans un monde totalement transformé?', '01:52:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19319781', 'http://fr.web.img1.acsta.net/medias/nmedia/18/86/05/49/20078610.jpg'),
