(422, 197678, 'Dépression et des Potes', '2012-05-02', 'Franck a tout pour être heureux. Une jolie fiancée brésilienne, un boulot intéressant et pourtant? En vacances sur une plage de rêve à l''île Maurice, il déprime. De retour à Paris, le diagnostic du médecin tombe : il est en dépression.', 'Franck a tout pour être heureux. Une jolie fiancée brésilienne, un boulot intéressant et pourtant? En vacances sur une plage de rêve à l''île Maurice, il déprime. De retour à Paris, le diagnostic du médecin tombe : il est en dépression.', '01:35:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19324504', 'http://fr.web.img5.acsta.net/medias/nmedia/18/89/69/08/20062262.jpg'),
(423, 181773, 'Margin Call', '2012-05-02', 'Pour survivre à Wall Street, sois le premier, le meilleur ou triche. La dernière nuit d''une équipe de traders, avant le crash. Pour sauver leur peau, un seul moyen : ruiner les autres?', 'Pour survivre à Wall Street, sois le premier, le meilleur ou triche. La dernière nuit d''une équipe de traders, avant le crash. Pour sauver leur peau, un seul moyen : ruiner les autres?', '01:47:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19309520', 'http://fr.web.img5.acsta.net/medias/nmedia/18/82/76/31/19860753.jpg'),
