(440, 176326, 'My Week with Marilyn', '2012-04-04', 'Au début de l''été 1956, Marilyn Monroe se rend en Angleterre pour la première fois. En pleine lune de miel avec le célèbre dramaturge Arthur Miller, elle est venue tourner "Le prince et la danseuse", le film qui restera célèbre pour l''avoir réunie à l''écran avec Sir Laurence Olivier...', 'Au début de l''été 1956, Marilyn Monroe se rend en Angleterre pour la première fois. En pleine lune de miel avec le célèbre dramaturge Arthur Miller, elle est venue tourner "Le prince et la danseuse", le film qui restera célèbre pour l''avoir réunie à l''écran avec Sir Laurence Olivier...', '01:42:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19279844', 'http://fr.web.img5.acsta.net/medias/nmedia/18/79/89/42/19955079.jpg'),
