(482, 174018, 'Zarafa', '2012-02-08', 'Sous un baobab, un vieil homme raconte aux enfants qui l''entourent, une histoire : celle de l''amitié indéfectible entre Maki, un enfant de 10 ans, et Zarafa, une girafe orpheline, cadeau du Pacha d''Egypte au Roi de France Charles X.', 'Sous un baobab, un vieil homme raconte aux enfants qui l''entourent, une histoire : celle de l''amitié indéfectible entre Maki, un enfant de 10 ans, et Zarafa, une girafe orpheline, cadeau du Pacha d''Egypte au Roi de France Charles X.', '01:18:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19266105', 'http://fr.web.img1.acsta.net/medias/nmedia/18/83/10/32/19849200.jpg'),
(483, 135779, 'Félins', '2012-02-01', 'En Afrique, au Kenya, dans l''une des régions les plus sauvages du monde, les animaux vivent libres et loin des hommes. Au sud du fleuve qui divise ces magnifiques terres, règne le clan des lions mené par Fang. La lionne Layla y élève la jeune Mara...', 'En Afrique, au Kenya, dans l''une des régions les plus sauvages du monde, les animaux vivent libres et loin des hommes. Au sud du fleuve qui divise ces magnifiques terres, règne le clan des lions mené par Fang. La lionne Layla y élève la jeune Mara...', '01:27:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19260164', 'http://fr.web.img4.acsta.net/medias/nmedia/18/84/72/79/19832425.jpg'),
(484, 193427, 'Detachment', '2012-02-01', 'Un portrait du système d''éducation américain à travers les yeux d''un professeur remplaçant, Henry Barthes.', 'Un portrait du système d''éducation américain à travers les yeux d''un professeur remplaçant, Henry Barthes.', '01:37:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19281885', 'http://fr.web.img4.acsta.net/medias/nmedia/18/85/32/06/19965023.jpg'),
(485, 176961, 'Tucker & Dale fightent le mal', '2012-02-01', 'Tucker et Dale sont deux gentils péquenauds venus se ressourcer en forêt. Ils y rencontrent des étudiants venus faire la fête. Suite à un quiproquo entraînant la mort d''un des jeunes, ces derniers pensent que Tucker et Dale sont des serial killers qui veulent leur peau...', 'Tucker et Dale sont deux gentils péquenauds venus se ressourcer en forêt. Ils y rencontrent des étudiants venus faire la fête. Suite à un quiproquo entraînant la mort d''un des jeunes, ces derniers pensent que Tucker et Dale sont des serial killers qui veulent leur peau...', '01:28:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19249068', 'http://fr.web.img2.acsta.net/medias/nmedia/18/85/92/75/19850268.jpg'),
(486, 134545, 'La Vérité si je mens ! 3', '2012-02-01', 'Eddie, Dov, Yvan et les autres? Nos chaleureux amis ont migré du Sentier moribond à la banlieue florissante d''Aubervilliers? Là où les vieux entrepreneurs juifs ont laissé le terrain à de jeunes grossistes chinois courageux et dynamiques?', 'Eddie, Dov, Yvan et les autres? Nos chaleureux amis ont migré du Sentier moribond à la banlieue florissante d''Aubervilliers? Là où les vieux entrepreneurs juifs ont laissé le terrain à de jeunes grossistes chinois courageux et dynamiques?', '01:59:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19263396', 'http://fr.web.img2.acsta.net/medias/nmedia/18/84/17/68/19818398.jpg'),
(487, 189360, 'Another Happy Day', '2012-02-01', 'Une comédie sur des adultes en guerre, des ados en crise et le mariage qui les rassemble tous... pour meilleur et pour le pire.', 'Une comédie sur des adultes en guerre, des ados en crise et le mariage qui les rassemble tous... pour meilleur et pour le pire.', '01:55:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19284837', 'http://fr.web.img2.acsta.net/medias/nmedia/18/83/00/80/19998284.jpg'),
(488, 182888, 'L''Oiseau', '2012-01-25', 'Anne n''a pas d''amis, pas d''enfants, pas d''amants. Elle fait semblant de vivre. Un jour, un oiseau entre dans son appartement?', 'Anne n''a pas d''amis, pas d''enfants, pas d''amants. Elle fait semblant de vivre. Un jour, un oiseau entre dans son appartement?', '01:33:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19271820', 'http://fr.web.img5.acsta.net/medias/nmedia/18/82/68/68/19945255.jpg'),
(489, 189292, 'Les Papas du dimanche', '2012-01-25', 'Histoire tendre d''un père, Antoine, séparé de sa femme, qui retrouve ses enfants le week-end. Un apprentissage difficile puis joyeux de cette nouvelle vie.', 'Histoire tendre d''un père, Antoine, séparé de sa femme, qui retrouve ses enfants le week-end. Un apprentissage difficile puis joyeux de cette nouvelle vie.', '01:30:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19264185', 'http://fr.web.img1.acsta.net/medias/nmedia/18/86/32/65/19853369.jpg'),
(490, 171157, 'The Descendants', '2012-01-25', 'Un riche propriétaire foncier recherche, avec ses deux filles, l''amant de sa femme dans l''espoir de garder sa famille unie.', 'Un riche propriétaire foncier recherche, avec ses deux filles, l''amant de sa femme dans l''espoir de garder sa famille unie.', '01:50:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19298230', 'http://fr.web.img4.acsta.net/medias/nmedia/18/84/55/42/19961614.jpg'),
(491, 173048, 'Sherlock Holmes 2 : Jeu d''ombres', '2012-01-25', 'Sherlock Holmes et son fidèle acolyte, le Docteur Watson, unissent leurs forces pour déjouer le plan machiavélique de l''un de leurs pires ennemis, le professeur Moriarty.', 'Sherlock Holmes et son fidèle acolyte, le Docteur Watson, unissent leurs forces pour déjouer le plan machiavélique de l''un de leurs pires ennemis, le professeur Moriarty.', '02:07:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19234814', 'http://fr.web.img6.acsta.net/medias/nmedia/18/86/23/92/19849297.jpg'),
(492, 182049, 'Café de Flore', '2012-01-25', 'Café de Flore raconte les destins croisés d''une jeune Parisienne mère d''un enfant unique, d''un DJ montréalais ainsi que des femmes qui l''entourent. Ce qui les relie : l''amour, troublant, maladroit, imparfait et inachevé, humain.', 'Café de Flore raconte les destins croisés d''une jeune Parisienne mère d''un enfant unique, d''un DJ montréalais ainsi que des femmes qui l''entourent. Ce qui les relie : l''amour, troublant, maladroit, imparfait et inachevé, humain.', '02:00:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19269820', 'http://fr.web.img4.acsta.net/medias/nmedia/18/82/82/48/19864449.jpg');
