(493, 191173, 'Duch, le maître des forges de l''enfer', '2012-01-18', 'En 2009, Kaing Guek Eav dit Duch a été le premier responsable khmer rouge présenté devant les Chambres Extraordinaires au sein des Tribunaux Cambodgiens (CETC). A la fin de son procès, Duch a demandé la relaxe. Néanmoins, il a été condamné à 35 années d''emprisonnement. Duch a fait appel.', 'En 2009, Kaing Guek Eav dit Duch a été le premier responsable khmer rouge présenté devant les Chambres Extraordinaires au sein des Tribunaux Cambodgiens (CETC). A la fin de son procès, Duch a demandé la relaxe. Néanmoins, il a été condamné à 35 années d''emprisonnement. Duch a fait appel.', '01:43:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19268547', 'http://fr.web.img6.acsta.net/medias/nmedia/18/87/70/61/19958945.jpg'),
(494, 174066, 'Trust', '2012-01-18', 'Une famille se retrouve démunie quand leur fille adolescente devient la victime d''un prédateur sexuel sur internet.', 'Une famille se retrouve démunie quand leur fille adolescente devient la victime d''un prédateur sexuel sur internet.', '01:46:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19256468', 'http://fr.web.img3.acsta.net/medias/nmedia/18/79/59/56/19955954.jpg'),
(495, 178974, 'Millenium : Les hommes qui n?aimaient pas les femmes', '2012-01-18', 'Mikael Blomkvist, journaliste au mensuel Millénium, enquête à la demande de l''ancien industriel Henrik Vanger sur la disparition d''Harriet, sa petite fille. Lisbeth Salander, une jeune virtuose de l''informatique, l''aide à mener à bien son enquête...', 'Mikael Blomkvist, journaliste au mensuel Millénium, enquête à la demande de l''ancien industriel Henrik Vanger sur la disparition d''Harriet, sa petite fille. Lisbeth Salander, une jeune virtuose de l''informatique, l''aide à mener à bien son enquête...', '02:38:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19225354', 'http://fr.web.img5.acsta.net/medias/nmedia/18/84/61/15/19845839.jpg'),
(496, 132243, 'L''Amour dure trois ans', '2012-01-18', 'Marc Marronnier, critique littéraire le jour et chroniqueur mondain la nuit, vient de divorcer d''Anne. Il est sûr à présent que l''amour ne dure que 3 ans. Il a même écrit un pamphlet pour le démontrer mais sa rencontre avec Alice va ébranler toutes ses certitudes.', 'Marc Marronnier, critique littéraire le jour et chroniqueur mondain la nuit, vient de divorcer d''Anne. Il est sûr à présent que l''amour ne dure que 3 ans. Il a même écrit un pamphlet pour le démontrer mais sa rencontre avec Alice va ébranler toutes ses certitudes.', '01:38:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19267735', 'http://fr.web.img4.acsta.net/medias/nmedia/18/86/65/85/19853142.jpg'),
(497, 192121, 'Parlez-moi de vous', '2012-01-11', 'À 40 ans, Mélina est la voix la plus célèbre de France. Animatrice à la radio, la nuit à l''antenne elle résout les problèmes affectifs et sexuels des auditeurs avec impertinence, humour et sans tabou. Tout le monde connaît sa voix, mais personne ne connaît son visage.', 'À 40 ans, Mélina est la voix la plus célèbre de France. Animatrice à la radio, la nuit à l''antenne elle résout les problèmes affectifs et sexuels des auditeurs avec impertinence, humour et sans tabou. Tout le monde connaît sa voix, mais personne ne connaît son visage.', '01:29:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19268143', 'http://fr.web.img4.acsta.net/medias/nmedia/18/86/40/03/19859240.jpg'),
(498, 133705, 'Dans la tourmente', '2012-01-11', 'Un patron prépare la délocalisation de son usine, couplée d''un détournement de 2 millions d''euros. Franck, l''un de ses salariés l''apprend et décide avec Max, son ami de toujours, de passer à l''action...', 'Un patron prépare la délocalisation de son usine, couplée d''un détournement de 2 millions d''euros. Franck, l''un de ses salariés l''apprend et décide avec Max, son ami de toujours, de passer à l''action...', '01:47:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19258061', 'http://fr.web.img4.acsta.net/medias/nmedia/18/83/49/39/19862225.jpg'),
(499, 183332, '10 jours en or', '2012-01-11', 'Marc Bajau sillonne le pays pour le compte d''une marque de vêtements. Il aime cette vie sur la route, faite de rencontres d''un soir. Mais alors qu''il démarre une nouvelle tournée de promotion, sa dernière conquête s''en va en lui laissant son fils de six ans?', 'Marc Bajau sillonne le pays pour le compte d''une marque de vêtements. Il aime cette vie sur la route, faite de rencontres d''un soir. Mais alors qu''il démarre une nouvelle tournée de promotion, sa dernière conquête s''en va en lui laissant son fils de six ans?', '01:35:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19265040', 'http://fr.web.img5.acsta.net/medias/nmedia/18/85/96/24/19855349.jpg'),
(500, 195834, 'La Colline aux Coquelicots', '2012-01-11', '<p style="text-align: justify;">Umi est une jeune lycéenne qui vit dans une vieille bâtisse perchée au sommet d''une colline surplombant le port de Yokohama. Chaque matin, depuis que son père a disparu en mer, elle hisse face à la baie deux pavillons, comme un message lancé à l''horizon.', '<p style="text-align: justify;">Umi est une jeune lycéenne qui vit dans une vieille bâtisse perchée au sommet d''une colline surplombant le port de Yokohama. Chaque matin, depuis que son père a disparu en mer, elle hisse face à la baie deux pavillons, comme un message lancé à l''horizon.', '01:32:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19263814', 'http://fr.web.img5.acsta.net/medias/nmedia/18/86/32/75/19846340.jpg'),
(501, 178870, 'J. Edgar', '2012-01-11', 'Le film explore la vie publique et privée de l''une des figures les plus puissantes, les plus controversées et les plus énigmatiques du 20e siècle, J. Edgar Hoover.', 'Le film explore la vie publique et privée de l''une des figures les plus puissantes, les plus controversées et les plus énigmatiques du 20e siècle, J. Edgar Hoover.', '02:15:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19257916', 'http://fr.web.img5.acsta.net/medias/nmedia/18/83/12/86/19974914.jpg'),
(502, 135419, 'Le Pacte', '2012-01-04', 'Après que sa femme se soit fait violemment agresser, Will Gerard est contacté par une mystérieuse organisation. Face à une police inefficace et incompétente, un groupe de citoyens s''est réuni pour faire respecter la justice. Ils proposent à Will de venger sa femme...', 'Après que sa femme se soit fait violemment agresser, Will Gerard est contacté par une mystérieuse organisation. Face à une police inefficace et incompétente, un groupe de citoyens s''est réuni pour faire respecter la justice. Ils proposent à Will de venger sa femme...', '01:45:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19264720', 'http://fr.web.img5.acsta.net/medias/nmedia/18/86/03/57/19853128.jpg'),
(503, 179183, 'Louise Wimmer', '2012-01-04', 'Insoumise et révoltée, Louise Wimmer a tout perdu. Armée de sa voiture et de la voix de Nina Simone, elle va tout faire pour reconquérir sa vie.', 'Insoumise et révoltée, Louise Wimmer a tout perdu. Armée de sa voiture et de la voix de Nina Simone, elle va tout faire pour reconquérir sa vie.', '01:20:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19266883', 'http://fr.web.img1.acsta.net/medias/nmedia/18/85/89/77/19956789.jpg'),
(504, 189944, 'Take Shelter', '2012-01-04', 'Curtis LaForche mène une vie paisible avec sa femme et sa fille quand il devient sujet à de violents cauchemars. La menace d''une tornade l''obsède. Des visions apocalyptiques envahissent peu à peu son esprit.', 'Curtis LaForche mène une vie paisible avec sa femme et sa fille quand il devient sujet à de violents cauchemars. La menace d''une tornade l''obsède. Des visions apocalyptiques envahissent peu à peu son esprit.', '02:01:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19258242', 'http://fr.web.img1.acsta.net/medias/nmedia/18/83/00/93/19856895.jpg'),
(505, 178493, 'Anonymous', '2012-01-04', 'L''histoire d''Edward de Vere, 17ème Comte d''Oxford, dont la théorie voudrait qu''il soit l''auteur de l''?uvre de Shakespeare...', 'L''histoire d''Edward de Vere, 17ème Comte d''Oxford, dont la théorie voudrait qu''il soit l''auteur de l''?uvre de Shakespeare...', '02:18:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19245743', 'http://fr.web.img5.acsta.net/pictures/210/621/21062181_20131129152331871.jpg'),
(506, 190093, 'Une nuit', '2012-01-04', 'A Paris, Simon Weiss, commandant à la Brigade Mondaine, entreprend sa tournée des établissements de nuit,  comme chaque soir. Son métier. Une nuit, pas comme les autres? Weiss comprend qu''on veut le piéger...', 'A Paris, Simon Weiss, commandant à la Brigade Mondaine, entreprend sa tournée des établissements de nuit,  comme chaque soir. Son métier. Une nuit, pas comme les autres? Weiss comprend qu''on veut le piéger...', '01:40:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19263580', 'http://fr.web.img3.acsta.net/medias/nmedia/18/86/61/47/19850630.jpg'),
(507, 187890, 'Une vie meilleure', '2012-01-04', 'Yann et Nadia, amoureux, se lancent dans un projet de restaurant au bord d''un lac. Leur rêve d''entrepreneur se brise rapidement. Nadia, contrainte d''accepter un travail à l''étranger, confie provisoirement son fils à Yann. Elle disparaît...', 'Yann et Nadia, amoureux, se lancent dans un projet de restaurant au bord d''un lac. Leur rêve d''entrepreneur se brise rapidement. Nadia, contrainte d''accepter un travail à l''étranger, confie provisoirement son fils à Yann. Elle disparaît...', '01:51:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19255420', 'http://fr.web.img5.acsta.net/medias/nmedia/18/84/55/88/19865515.jpg'),
(508, 178909, 'Echange standard', '2011-12-28', 'A l''école primaire, Mitch et Dave étaient deux copains inséparables. Mais au fil des années, leurs chemins se sont petit à petit éloignés. Dave est maintenant un brillant avocat dévoué à sa femme et à leurs enfants, alors que Mitch est toujours célibataire et fuit la moindre responsabilité comme la peste.', 'A l''école primaire, Mitch et Dave étaient deux copains inséparables. Mais au fil des années, leurs chemins se sont petit à petit éloignés. Dave est maintenant un brillant avocat dévoué à sa femme et à leurs enfants, alors que Mitch est toujours célibataire et fuit la moindre responsabilité comme la peste.', '01:52:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19240570', 'http://fr.web.img1.acsta.net/medias/nmedia/18/85/37/24/19854642.jpg'),
(509, 132376, 'A Dangerous Method', '2011-12-21', 'Sabina Spielrein, une jeune femme souffrant d''hystérie, est soignée par le psychanalyste Carl Jung. Elle devient bientôt sa maîtresse en même temps que sa patiente. Leur relation est révélée lorsque Sabina rentre en contact avec Sigmund Freud...', 'Sabina Spielrein, une jeune femme souffrant d''hystérie, est soignée par le psychanalyste Carl Jung. Elle devient bientôt sa maîtresse en même temps que sa patiente. Leur relation est révélée lorsque Sabina rentre en contact avec Sigmund Freud...', '01:39:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19238730', 'http://fr.web.img6.acsta.net/medias/nmedia/18/79/98/48/19840048.jpg'),
(510, 173542, 'Le Havre', '2011-12-21', 'Marcel Marx, bientôt soixante ans, est cireur de chaussures au Havre. Il vit pauvrement mais dignement avec son épouse, qui lui cache une inquiétante maladie. Sur le port, Marcel rencontre par hasard un enfant, survivant clandestin d''un container arrivé d''Afrique.', 'Marcel Marx, bientôt soixante ans, est cireur de chaussures au Havre. Il vit pauvrement mais dignement avec son épouse, qui lui cache une inquiétante maladie. Sur le port, Marcel rencontre par hasard un enfant, survivant clandestin d''un container arrivé d''Afrique.', '01:33:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19263498', 'http://fr.web.img3.acsta.net/medias/nmedia/18/83/96/06/19812542.jpg'),
(511, 118740, 'Oh My God !', '2011-12-14', 'Dans l''Angleterre Victorienne, Mortimer Granville, jeune et séduisant médecin entre au service du Dr. Dalrymple, spécialiste de l''hystérie féminine.  Le traitement préconisé est simple mais d''une redoutable efficacité : donner du plaisir pour soulager les troubles !', 'Dans l''Angleterre Victorienne, Mortimer Granville, jeune et séduisant médecin entre au service du Dr. Dalrymple, spécialiste de l''hystérie féminine.  Le traitement préconisé est simple mais d''une redoutable efficacité : donner du plaisir pour soulager les troubles !', '01:39:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19259282', 'http://fr.web.img4.acsta.net/medias/nmedia/18/85/91/14/19840999.jpg'),
(512, 136181, 'Hugo Cabret', '2011-12-14', '<p style="text-align: justify;">Dans le Paris des années 30, le jeune Hugo est un orphelin de douze ans qui vit dans une gare. Son passé est un mystère et son destin une énigme. De son père, il ne lui reste qu''un étrange automate dont il cherche la clé - en forme de c?ur - qui pourrait le faire fonctionner.', '<p style="text-align: justify;">Dans le Paris des années 30, le jeune Hugo est un orphelin de douze ans qui vit dans une gare. Son passé est un mystère et son destin une énigme. De son père, il ne lui reste qu''un étrange automate dont il cherche la clé - en forme de c?ur - qui pourrait le faire fonctionner.', '02:08:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19261766', 'http://fr.web.img2.acsta.net/medias/nmedia/18/85/64/27/19846315.jpg'),
(513, 186185, 'Des vents contraires', '2011-12-14', 'La vie de Paul bascule le jour où sa femme Sarah disparait subitement. Après une année de recherches infructueuses, Paul est un homme brisé, rongé par le doute et la culpabilité. Sa dernière chance est peut être de tout reprendre à zéro.', 'La vie de Paul bascule le jour où sa femme Sarah disparait subitement. Après une année de recherches infructueuses, Paul est un homme brisé, rongé par le doute et la culpabilité. Sa dernière chance est peut être de tout reprendre à zéro.', '01:31:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19250124', 'http://fr.web.img5.acsta.net/medias/nmedia/18/83/78/36/19791574.jpg'),
(514, 187293, 'Les tribulations d''une caissière', '2011-12-14', 'La vie n''est pas rose tous les jours pour Solweig, caissière dans un supermarché. Mais elle garde le sourire, malgré les remarques souvent déplaisantes des clients et un chef teigneux. Peut-être grâce au blog qu''elle tient en secret, où elle s''épanche avec humour sur son quotidien difficile?', 'La vie n''est pas rose tous les jours pour Solweig, caissière dans un supermarché. Mais elle garde le sourire, malgré les remarques souvent déplaisantes des clients et un chef teigneux. Peut-être grâce au blog qu''elle tient en secret, où elle s''épanche avec humour sur son quotidien difficile?', '01:42:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19261603', 'http://fr.web.img4.acsta.net/medias/nmedia/18/86/40/12/19838816.jpg'),
(515, 147454, 'Mission : Impossible - Protocole fantôme', '2011-12-14', 'Après avoir été impliquée dans un complot terroriste mondial, l''agence Mission Impossible est contrainte de cesser ses activités. Le Protocole Fantôme est mis en place : Ethan Hunt et sa nouvelle équipe doivent opérer dans le secret pour blanchir le nom de leur organisation.', 'Après avoir été impliquée dans un complot terroriste mondial, l''agence Mission Impossible est contrainte de cesser ses activités. Le Protocole Fantôme est mis en place : Ethan Hunt et sa nouvelle équipe doivent opérer dans le secret pour blanchir le nom de leur organisation.', '02:13:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19260260', 'http://fr.web.img3.acsta.net/medias/nmedia/18/85/51/98/19843153.jpg'),
