(517, 140675, 'Happy Feet 2', '2011-12-07', 'Mumble et Gloria ont désormais un fils, Erik, qui se bat pour découvrir ses propres talents dans le monde des manchots empereurs. Mais de nouveaux dangers menacent la nation des manchots, et tous vont se rassembler - et danser - pour les sauver.', 'Mumble et Gloria ont désormais un fils, Erik, qui se bat pour découvrir ses propres talents dans le monde des manchots empereurs. Mais de nouveaux dangers menacent la nation des manchots, et tous vont se rassembler - et danser - pour les sauver.', '01:39:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19260987', 'http://fr.web.img1.acsta.net/medias/nmedia/18/84/85/39/19861840.jpg'),
(518, 183445, 'Carnage', '2011-12-07', 'Dans un jardin public, deux enfants de 11 ans se bagarrent et se blessent. Les parents de la "victime" demandent à s''expliquer avec les parents du "coupable". Rapidement, les échanges cordiaux cèdent le pas à l''affrontement. Où s''arrêtera le carnage ?', 'Dans un jardin public, deux enfants de 11 ans se bagarrent et se blessent. Les parents de la "victime" demandent à s''expliquer avec les parents du "coupable". Rapidement, les échanges cordiaux cèdent le pas à l''affrontement. Où s''arrêtera le carnage ?', '01:20:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19245502', 'http://fr.web.img5.acsta.net/medias/nmedia/18/85/59/20/19804702.jpg'),
(519, 183489, 'Hollywoo', '2011-12-07', 'Jeanne est la doubleuse française d''une actrice américaine qui joue dans une série télé à succès. Mais le jour où l''actrice américaine pète les plombs et annonce la fin de sa carrière, la vie de Jeanne bascule à son tour? A moins que...', 'Jeanne est la doubleuse française d''une actrice américaine qui joue dans une série télé à succès. Mais le jour où l''actrice américaine pète les plombs et annonce la fin de sa carrière, la vie de Jeanne bascule à son tour? A moins que...', '01:47:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19258518', 'http://fr.web.img4.acsta.net/medias/nmedia/18/86/25/05/19830510.jpg'),
