(527, 187541, 'The Last Son, la malédiction', '2011-11-23', 'James Furlong se découvre un don extraordinaire à la suite d''un accident qui cause la mort de son père et de sa grand-mère. Bouleversé par le mystérieux pouvoir qu''il s''est découvert, James s''isole dans une forêt pour éviter de faire du mal à ses proches jusqu''à ce qu''il rencontre Mae...', 'James Furlong se découvre un don extraordinaire à la suite d''un accident qui cause la mort de son père et de sa grand-mère. Bouleversé par le mystérieux pouvoir qu''il s''est découvert, James s''isole dans une forêt pour éviter de faire du mal à ses proches jusqu''à ce qu''il rencontre Mae...', '01:35:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19255552', 'http://fr.web.img6.acsta.net/medias/nmedia/18/90/17/63/20084360.jpg'),
