(547, 131737, 'Les Marches du Pouvoir', '2011-10-26', 'Un idéaliste doit faire face aux manipulations et aux coups tordus du camp rival du sien dans la course aux présidentielles.', 'Un idéaliste doit faire face aux manipulations et aux coups tordus du camp rival du sien dans la course aux présidentielles.', '01:35:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19245788', 'http://fr.web.img6.acsta.net/medias/nmedia/18/85/45/03/19806486.jpg'),
(548, 174671, 'L''Exercice de l''Etat', '2011-10-26', 'Le ministre des Transports Bertrand Saint-Jean est réveillé en pleine nuit par son directeur de cabinet. Un car a basculé dans un ravin. Il y va, il n''a pas le choix...', 'Le ministre des Transports Bertrand Saint-Jean est réveillé en pleine nuit par son directeur de cabinet. Un car a basculé dans un ravin. Il y va, il n''a pas le choix...', '01:52:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19249067', 'http://fr.web.img6.acsta.net/medias/nmedia/18/83/94/21/19796503.jpg'),
(549, 49757, 'Les Aventures de Tintin : Le Secret de la Licorne', '2011-10-26', 'Parce qu''il achète la maquette d''un bateau appelé la Licorne, Tintin, un jeune reporter, se retrouve entraîné dans une fantastique aventure à la recherche d''un fabuleux secret...', 'Parce qu''il achète la maquette d''un bateau appelé la Licorne, Tintin, un jeune reporter, se retrouve entraîné dans une fantastique aventure à la recherche d''un fabuleux secret...', '01:47:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19255095', 'http://fr.web.img3.acsta.net/medias/nmedia/18/64/08/55/19798422.jpg'),
(550, 136634, 'Poulet aux Prunes', '2011-10-26', 'Téhéran, 1958. Depuis que son violon tant aimé a été brisé, Nasser Ali Khan, un des plus célèbres musiciens de son époque, a perdu le goût de vivre. Ne trouvant aucun instrument digne de le remplacer, il décide de se mettre au lit et d''attendre la mort', 'Téhéran, 1958. Depuis que son violon tant aimé a été brisé, Nasser Ali Khan, un des plus célèbres musiciens de son époque, a perdu le goût de vivre. Ne trouvant aucun instrument digne de le remplacer, il décide de se mettre au lit et d''attendre la mort', '01:33:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19244461', 'http://fr.web.img5.acsta.net/medias/nmedia/18/78/18/75/19801902.jpg'),
(551, 188146, 'Another Silence', '2011-10-19', 'Marie est officier de police à Toronto. Un soir, Joshua, son mari, et leur fils, Nicky, sont brutalement assassinés dans leur voiture. Assez vite, Marie fait le lien avec Pablo Molina, un trafiquant de drogue argentin qu''elle a arrêté quelques mois plus tôt.', 'Marie est officier de police à Toronto. Un soir, Joshua, son mari, et leur fils, Nicky, sont brutalement assassinés dans leur voiture. Assez vite, Marie fait le lien avec Pablo Molina, un trafiquant de drogue argentin qu''elle a arrêté quelques mois plus tôt.', '01:30:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19246458', 'http://fr.web.img6.acsta.net/medias/nmedia/18/85/57/82/19808051.jpg'),
(552, 189968, 'L''Ours Montagne', '2011-10-19', 'Jonathan et Sophie passent les grandes vacances chez leur grand-père à la montagne. Alors que Jonathan se dispute avec sa petite s?ur, celle-ci franchit la porte du jardin, malgré les avertissements du grand-père : soudain enlevée par un ours gigantesque...', 'Jonathan et Sophie passent les grandes vacances chez leur grand-père à la montagne. Alors que Jonathan se dispute avec sa petite s?ur, celle-ci franchit la porte du jardin, malgré les avertissements du grand-père : soudain enlevée par un ours gigantesque...', '01:14:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19247778', 'http://fr.web.img5.acsta.net/medias/nmedia/18/85/63/31/19820521.jpg'),
(553, 172808, 'Real Steel', '2011-10-19', 'Un ancien boxeur se voit offrir une ultime chance de faire son grand retour en faisant équipe avec son fils avec qui il n''avait plus de contacts afin de construire et entraîner le robot idéal pour la boxe high-tech...', 'Un ancien boxeur se voit offrir une ultime chance de faire son grand retour en faisant équipe avec son fils avec qui il n''avait plus de contacts afin de construire et entraîner le robot idéal pour la boxe high-tech...', '02:07:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19218340', 'http://fr.web.img3.acsta.net/medias/nmedia/18/78/46/71/19814437.jpg'),
(554, 180179, 'Johnny English, le retour', '2011-10-19', 'Ayant pris quelques années pour vivre retiré dans une région reculée d''Asie, Johnny English, le meilleur agent du MI7, en a profité pour perfectionner ses compétences uniques. Ses supérieurs décident de le rappeler pour déjouer un complot...', 'Ayant pris quelques années pour vivre retiré dans une région reculée d''Asie, Johnny English, le meilleur agent du MI7, en a profité pour perfectionner ses compétences uniques. Ses supérieurs décident de le rappeler pour déjouer un complot...', '01:36:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19210448', 'http://fr.web.img3.acsta.net/medias/nmedia/18/84/72/78/19806628.jpg'),
(555, 181893, 'Polisse', '2011-10-19', 'Le quotidien des policiers de la BPM ce sont les gardes à vue de pédophiles, les arrestations de pickpockets mineurs mais aussi la pause déjeuner où l''on se raconte ses problèmes de couple, la solidarité entre collègues, les fous rires incontrôlables...', 'Le quotidien des policiers de la BPM ce sont les gardes à vue de pédophiles, les arrestations de pickpockets mineurs mais aussi la pause déjeuner où l''on se raconte ses problèmes de couple, la solidarité entre collègues, les fous rires incontrôlables...', '02:07:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19247568', 'http://fr.web.img6.acsta.net/medias/nmedia/18/83/94/23/19787873.jpg'),
(556, 182645, 'The Thing', '2011-10-12', 'Dans un centre de recherche en Antarctique, la découverte d''un vaisseau spatial extraterrestre met en conflit Kate Lloyd, jeune diplômée, et le Dr. Sander Halvorson. Tandis que celui-ci décide de poursuivre ses recherches, Kate engage Sam Carter...', 'Dans un centre de recherche en Antarctique, la découverte d''un vaisseau spatial extraterrestre met en conflit Kate Lloyd, jeune diplômée, et le Dr. Sander Halvorson. Tandis que celui-ci décide de poursuivre ses recherches, Kate engage Sam Carter...', '01:43:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19245875', 'http://fr.web.img5.acsta.net/medias/nmedia/18/79/83/49/19825652.jpg'),
(557, 112337, 'Un monstre à Paris', '2011-10-12', 'Dans le Paris inondé de 1910, un monstre sème la panique. Traqué sans relâche par le redoutable préfet Maynott, il demeure introuvable... Et si la meilleure cachette était sous les feux de "L''Oiseau Rare", un cabaret où chante Lucille ?', 'Dans le Paris inondé de 1910, un monstre sème la panique. Traqué sans relâche par le redoutable préfet Maynott, il demeure introuvable... Et si la meilleure cachette était sous les feux de "L''Oiseau Rare", un cabaret où chante Lucille ?', '01:22:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19229315', 'http://fr.web.img1.acsta.net/medias/nmedia/18/72/45/39/19759319.jpg'),
(558, 188871, 'Beur sur la ville', '2011-10-12', 'A 25 ans, Khalid Belkacem avait tout raté : son BEPC, son code de la route, son BAFA, et même son BCG. Il ne s''attendait pas à devenir le premier "discriminé positif" de la police...', 'A 25 ans, Khalid Belkacem avait tout raté : son BEPC, son code de la route, son BAFA, et même son BCG. Il ne s''attendait pas à devenir le premier "discriminé positif" de la police...', '01:39:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19248585', 'http://fr.web.img4.acsta.net/medias/nmedia/18/82/77/93/19806551.jpg'),
(559, 183070, 'The Artist', '2011-10-12', 'Une histoire d''amour entre une vedette du cinéma muet et un figurant dans l''Amérique des années 20...', 'Une histoire d''amour entre une vedette du cinéma muet et un figurant dans l''Amérique des années 20...', '01:40:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19318651', 'http://fr.web.img6.acsta.net/medias/nmedia/18/83/95/46/20024873.jpg'),
(560, 195785, 'Crazy Horse', '2011-10-05', 'Entrez dans les coulisses du temple mondial de la sensualité, le Crazy Horse de Paris...<br/>Pour son 39ème film, Frederick Wiseman lève le rideau d''une troisième institution française après la Comédie Française et le Ballet de l''Opéra de Paris.', 'Entrez dans les coulisses du temple mondial de la sensualité, le Crazy Horse de Paris...<br/>Pour son 39ème film, Frederick Wiseman lève le rideau d''une troisième institution française après la Comédie Française et le Ballet de l''Opéra de Paris.', '02:14:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19242427', 'http://fr.web.img2.acsta.net/medias/nmedia/18/85/64/65/19810877.jpg'),
(561, 145616, 'Dream House', '2011-10-05', 'Editeur à succès, Will Atenton quitte son emploi à New York pour déménager avec sa femme et ses enfants dans une ville pittoresque de Nouvelle Angleterre.', 'Editeur à succès, Will Atenton quitte son emploi à New York pour déménager avec sa femme et ses enfants dans une ville pittoresque de Nouvelle Angleterre.', '01:31:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19243163', 'http://fr.web.img5.acsta.net/medias/nmedia/18/83/04/76/19797461.jpg'),
(562, 135082, 'Drive', '2011-10-05', 'Un cascadeur tranquille et anonyme se métamorphose dès que la nuit tombe : il devient pilote de voitures pour le compte de la mafia. La combine est bien rodée jusqu''au jour où l''un des casses tourne mal et l''entraîne dans une course-poursuite infernale.', 'Un cascadeur tranquille et anonyme se métamorphose dès que la nuit tombe : il devient pilote de voitures pour le compte de la mafia. La combine est bien rodée jusqu''au jour où l''un des casses tourne mal et l''entraîne dans une course-poursuite infernale.', '01:40:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19243477', 'http://fr.web.img1.acsta.net/medias/nmedia/18/83/93/95/19803697.jpg'),
(563, 180414, 'Le Skylab', '2011-10-05', 'Juillet 1979, pendant les vacances d''été dans une maison en Bretagne. A l''occasion de l''anniversaire de la grand-mère, oncles, tantes, cousins et cousines sont réunis le temps d''un week-end animé.', 'Juillet 1979, pendant les vacances d''été dans une maison en Bretagne. A l''occasion de l''anniversaire de la grand-mère, oncles, tantes, cousins et cousines sont réunis le temps d''un week-end animé.', '01:53:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19233607', 'http://fr.web.img4.acsta.net/medias/nmedia/18/82/95/84/19735985.jpg'),
(564, 179515, 'Bienvenue à bord', '2011-10-05', 'Isabelle, DRH d''une grande compagnie maritime, a commis l''erreur de choisir pour amant son patron. Avant d''embarquer pour la croisière inaugurale du fleuron de la flotte, il décide de la débarquer de sa vie et de son boulot...', 'Isabelle, DRH d''une grande compagnie maritime, a commis l''erreur de choisir pour amant son patron. Avant d''embarquer pour la croisière inaugurale du fleuron de la flotte, il décide de la débarquer de sa vie et de son boulot...', '01:30:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19238885', 'http://fr.web.img1.acsta.net/medias/nmedia/18/83/51/52/19813211.jpg'),
(565, 178980, 'Les hommes libres', '2011-09-28', '1942, Paris est occupée par les Allemands. Younes, un jeune émigré algérien, vit du marché noir. Arrêté par la police française, Younes accepte d''espionner pour leur compte à la Mosquée de Paris.', '1942, Paris est occupée par les Allemands. Younes, un jeune émigré algérien, vit du marché noir. Arrêté par la police française, Younes accepte d''espionner pour leur compte à la Mosquée de Paris.', '01:39:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19238603', 'http://fr.web.img5.acsta.net/medias/nmedia/18/84/36/97/19802069.jpg'),
(566, 147402, 'Un été brûlant', '2011-09-28', '<p style="text-align: justify;">Paul rencontre Frédéric par un ami commun. Frédéric est peintre. Il vit avec Angèle, une actrice qui fait du cinéma en Italie. Pour vivre en attendant d''être acteur, Paul fait de la figuration. Sur un plateau, Paul rencontre Elisabeth qui est aussi figurante. Ils tombent amoureux...', '<p style="text-align: justify;">Paul rencontre Frédéric par un ami commun. Frédéric est peintre. Il vit avec Angèle, une actrice qui fait du cinéma en Italie. Pour vivre en attendant d''être acteur, Paul fait de la figuration. Sur un plateau, Paul rencontre Elisabeth qui est aussi figurante. Ils tombent amoureux...', '01:35:00', 1.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19242505', 'http://fr.web.img2.acsta.net/medias/nmedia/18/85/37/23/19795787.jpg');
INSERT INTO `film` (`id`, `code`, `titre`, `date`, `synopsis`, `synopsisCourt`, `duree`, `note`, `trailer`, `affiche`) VALUES
(567, 146626, 'We Need to Talk About Kevin', '2011-09-28', 'Eva a mis sa vie professionnelle et ses ambitions personnelles entre parenthèses pour donner naissance à Kevin. La communication entre mère et fils s''avère d''emblée très compliquée. A l''aube de ses 16 ans, il commet l''irréparable. Eva s''interroge alors sur sa responsabilité.', 'Eva a mis sa vie professionnelle et ses ambitions personnelles entre parenthèses pour donner naissance à Kevin. La communication entre mère et fils s''avère d''emblée très compliquée. A l''aube de ses 16 ans, il commet l''irréparable. Eva s''interroge alors sur sa responsabilité.', '01:50:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19545700', 'http://fr.web.img3.acsta.net/medias/nmedia/18/83/94/48/19793566.jpg'),
(568, 138273, 'Un Heureux Événement', '2011-09-28', 'Adapté du livre d''Eliette Abecassis, "Un heureux événement" brise les tabous de la maternité via le journal intime tragi-comique d''une jeune femme qui devient mère.', 'Adapté du livre d''Eliette Abecassis, "Un heureux événement" brise les tabous de la maternité via le journal intime tragi-comique d''une jeune femme qui devient mère.', '01:50:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19235386', 'http://fr.web.img1.acsta.net/medias/nmedia/18/84/82/69/19792498.jpg'),
(569, 178184, 'Identité Secrète', '2011-09-28', 'Un jeune homme découvre que ses parents ne sont pas réellement ceux qu''ils prétendent. Une révélation qui l''entraînera dans une aventure où les pièges se succèdent et où il devra lutter pour sauver sa vie.', 'Un jeune homme découvre que ses parents ne sont pas réellement ceux qu''ils prétendent. Une révélation qui l''entraînera dans une aventure où les pièges se succèdent et où il devra lutter pour sauver sa vie.', '01:40:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19234126', 'http://fr.web.img6.acsta.net/medias/nmedia/18/84/94/38/19789234.jpg'),
(570, 191004, 'L''Apollonide - souvenirs de la maison close', '2011-09-21', 'À l''aube du XXème siècle, dans une maison close à Paris, une prostituée a le visage marqué d''une cicatrice qui lui dessine un sourire tragique. Autour de la femme qui rit, la vie des autres filles s''organise, leurs rivalités, leurs craintes, leurs joies, leurs douleurs...', 'À l''aube du XXème siècle, dans une maison close à Paris, une prostituée a le visage marqué d''une cicatrice qui lui dessine un sourire tragique. Autour de la femme qui rit, la vie des autres filles s''organise, leurs rivalités, leurs craintes, leurs joies, leurs douleurs...', '02:02:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19244139', 'http://fr.web.img4.acsta.net/medias/nmedia/18/83/94/26/19729056.jpg'),
(571, 187194, 'Le cochon de Gaza', '2011-09-21', 'Après une tempête, Jafaar, un pêcheur palestinien de Gaza, remonte par hasard dans ses filets un cochon tombé d''un cargo. Bien décidé a se débarrasser de cet animal impur, il décide toutefois d''essayer de le vendre afin d''améliorer son existence misérable.', 'Après une tempête, Jafaar, un pêcheur palestinien de Gaza, remonte par hasard dans ses filets un cochon tombé d''un cargo. Bien décidé a se débarrasser de cet animal impur, il décide toutefois d''essayer de le vendre afin d''améliorer son existence misérable.', '01:39:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19241408', 'http://fr.web.img6.acsta.net/medias/nmedia/18/83/78/66/19751402.jpg'),
(572, 188340, 'La Nouvelle guerre des boutons', '2011-09-21', 'Mars 1944. Alors que la planète est secouée par les soubresauts de la guerre, dans un petit coin d''une campagne française se joue une guerre de gosses? Car, depuis toujours, les gamins des villages de Longeverne et Velrans s''affrontent sans merci.', 'Mars 1944. Alors que la planète est secouée par les soubresauts de la guerre, dans un petit coin d''une campagne française se joue une guerre de gosses? Car, depuis toujours, les gamins des villages de Longeverne et Velrans s''affrontent sans merci.', '01:40:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19243269', 'http://fr.web.img5.acsta.net/medias/nmedia/18/85/48/31/19797466.jpg'),
(573, 171731, 'Restless', '2011-09-21', 'Le parcours initiatique de deux adolescents fascinés par la mort...', 'Le parcours initiatique de deux adolescents fascinés par la mort...', '01:35:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19174291', 'http://fr.web.img2.acsta.net/medias/nmedia/18/81/53/04/19791384.jpg'),
(574, 180157, 'Crazy, Stupid, Love', '2011-09-14', 'A tout juste quarante ans, Cal Weaver mène une vie de rêve - bonne situation, belle maison, enfants formidables et mariage parfait avec sa petite amie du lycée. Mais lorsqu''il apprend que sa femme, Emily, le trompe et demande le divorce, sa vie « parfaite » s''écroule.', 'A tout juste quarante ans, Cal Weaver mène une vie de rêve - bonne situation, belle maison, enfants formidables et mariage parfait avec sa petite amie du lycée. Mais lorsqu''il apprend que sa femme, Emily, le trompe et demande le divorce, sa vie « parfaite » s''écroule.', '01:58:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19228368', 'http://fr.web.img4.acsta.net/medias/nmedia/18/85/84/05/19808153.jpg'),
(575, 130996, 'Fright Night', '2011-09-14', 'Charlie Brewster est au top : élève de terminale parmi les plus populaires, il sort en plus avec la plus jolie fille du lycée. Il est tellement cool qu''il méprise même son meilleur pote, Ed. Mais les problèmes vont arriver avec son nouveau voisin, Jerry...', 'Charlie Brewster est au top : élève de terminale parmi les plus populaires, il sort en plus avec la plus jolie fille du lycée. Il est tellement cool qu''il méprise même son meilleur pote, Ed. Mais les problèmes vont arriver avec son nouveau voisin, Jerry...', '02:00:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19219561', 'http://fr.web.img3.acsta.net/medias/nmedia/18/83/85/75/19788043.jpg'),
(576, 188649, 'La Guerre des Boutons', '2011-09-14', '1960, un village dans le sud de la France. Une bande de garçons, âgés de 7 à 14 ans, menée par l''intrépide Lebrac, est en guerre contre les enfants du village voisin, leurs ennemis jurés. Une guerre sans merci, qui dure depuis des générations.', '1960, un village dans le sud de la France. Une bande de garçons, âgés de 7 à 14 ans, menée par l''intrépide Lebrac, est en guerre contre les enfants du village voisin, leurs ennemis jurés. Une guerre sans merci, qui dure depuis des générations.', '01:49:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19241614', 'http://fr.web.img3.acsta.net/medias/nmedia/18/84/78/60/19775518.jpg'),
(577, 138673, 'Warrior', '2011-09-14', 'Pour remporter un tournoi de free fight qui lui permettrait de payer l''opération de sa femme, le benjamin d''une famille de boxeurs accepte d''être coaché par son père, un ancien boxeur alcoolique auquel il ne parle plus depuis des années.', 'Pour remporter un tournoi de free fight qui lui permettrait de payer l''opération de sa femme, le benjamin d''une famille de boxeurs accepte d''être coaché par son père, un ancien boxeur alcoolique auquel il ne parle plus depuis des années.', '02:20:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19236612', 'http://fr.web.img2.acsta.net/medias/nmedia/18/83/50/33/19794371.jpg'),
(578, 189935, 'Et maintenant on va où ?', '2011-09-14', 'Au Liban, dans un village isolé, cerné par des mines, les femmes chrétiennes et musulmanes complotent pour empêcher les hommes de se battre. Jusqu''au jour où un drame surgit?', 'Au Liban, dans un village isolé, cerné par des mines, les femmes chrétiennes et musulmanes complotent pour empêcher les hommes de se battre. Jusqu''au jour où un drame surgit?', '01:50:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19236225', 'http://fr.web.img1.acsta.net/medias/nmedia/18/84/43/34/19783842.jpg'),
(579, 169916, 'Le Monde de Barney', '2011-09-07', 'Barney Panofsky, un homme apparemment ordinaire mène une existence extraordinaire. Sa 1ère femme est  infidèle et libre d''esprit. La 2nde est une riche princesse juive préoccupée par son paraître. Sa 3ème épouse, deviendra la mère de ses deux enfants et l''amour de sa vie.', 'Barney Panofsky, un homme apparemment ordinaire mène une existence extraordinaire. Sa 1ère femme est  infidèle et libre d''esprit. La 2nde est une riche princesse juive préoccupée par son paraître. Sa 3ème épouse, deviendra la mère de ses deux enfants et l''amour de sa vie.', '02:12:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19240410', 'http://fr.web.img1.acsta.net/medias/nmedia/18/85/44/99/19793381.jpg'),
(580, 193542, 'Au revoir', '2011-09-07', 'Dans la situation désespérée de l''Iran d''aujourd''hui, une jeune femme avocate à qui on a retiré sa licence d''exercer, est enceinte de quelques mois. Elle vit seule car son mari journaliste vit dans la clandestinité.', 'Dans la situation désespérée de l''Iran d''aujourd''hui, une jeune femme avocate à qui on a retiré sa licence d''exercer, est enceinte de quelques mois. Elle vit seule car son mari journaliste vit dans la clandestinité.', '01:40:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19237516', 'http://fr.web.img2.acsta.net/medias/nmedia/18/84/43/24/19789211.jpg'),
