(611, 185082, 'La Défense Lincoln', '2011-05-25', 'Michael Haller est avocat à Los Angeles. Habile, il est prêt à tout pour faire gagner les criminels de bas étage qu''il défend. Toujours entre deux tribunaux, il travaille à l''arrière de sa voiture, une Lincoln Continental.', 'Michael Haller est avocat à Los Angeles. Habile, il est prêt à tout pour faire gagner les criminels de bas étage qu''il défend. Toujours entre deux tribunaux, il travaille à l''arrière de sa voiture, une Lincoln Continental.', '01:58:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19205288', 'http://fr.web.img3.acsta.net/medias/nmedia/18/82/97/90/19665305.jpg'),
(612, 147508, 'Very Bad Trip 2', '2011-05-25', 'Phil, Stu, Alan et Doug s''offrent un voyage exotique en Thaïlande, à l''occasion du mariage de Stu. Après l''inoubliable soirée d''enterrement de sa vie de garçon à Las Vegas, Stu ne veut rien laisser au hasard et opte pour un brunch léger, sans risque, avant la cérémonie.', 'Phil, Stu, Alan et Doug s''offrent un voyage exotique en Thaïlande, à l''occasion du mariage de Stu. Après l''inoubliable soirée d''enterrement de sa vie de garçon à Las Vegas, Stu ne veut rien laisser au hasard et opte pour un brunch léger, sans risque, avant la cérémonie.', '01:42:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19210722', 'http://fr.web.img6.acsta.net/medias/nmedia/18/82/09/89/19715770.jpg'),
(613, 140487, 'Le Complexe du Castor', '2011-05-25', 'La vie de Walter n''est plus ce qu''elle était. Déprimé, vivant au ralenti, il s''éloigne de sa famille. Sa femme finit par le chasser de la maison pour le bien de leurs enfants. Touchant le fond, il s''accroche malgré lui à une marionnette de castor trouvée un soir par hasard.', 'La vie de Walter n''est plus ce qu''elle était. Déprimé, vivant au ralenti, il s''éloigne de sa famille. Sa femme finit par le chasser de la maison pour le bien de leurs enfants. Touchant le fond, il s''accroche malgré lui à une marionnette de castor trouvée un soir par hasard.', '01:31:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19215436', 'http://fr.web.img1.acsta.net/medias/nmedia/18/83/67/46/19723462.jpg'),
(614, 183520, 'La Conquête', '2011-05-18', '6 mai 2007, second tour de l''élection présidentielle. Alors que les Français s''apprêtent à élire leur nouveau Président, Nicolas Sarkozy, sûr de sa victoire, reste cloîtré chez lui, en peignoir, sombre et abattu. Toute la journée, il cherche à joindre Cécilia qui le fuit.', '6 mai 2007, second tour de l''élection présidentielle. Alors que les Français s''apprêtent à élire leur nouveau Président, Nicolas Sarkozy, sûr de sa victoire, reste cloîtré chez lui, en peignoir, sombre et abattu. Toute la journée, il cherche à joindre Cécilia qui le fuit.', '01:45:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19208250', 'http://fr.web.img3.acsta.net/medias/nmedia/18/82/74/16/19725453.jpg'),
(615, 132244, 'The Tree of Life', '2011-05-17', 'Jack grandit entre un père autoritaire et une mère aimante, qui lui donne foi en la vie. La naissance de ses deux frères l''oblige bientôt à partager cet amour inconditionnel, alors qu''il affronte l''individualisme forcené d''un père obsédé par la réussite de ses enfants.', 'Jack grandit entre un père autoritaire et une mère aimante, qui lui donne foi en la vie. La naissance de ses deux frères l''oblige bientôt à partager cet amour inconditionnel, alors qu''il affronte l''individualisme forcené d''un père obsédé par la réussite de ses enfants.', '02:18:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19203028', 'http://fr.web.img1.acsta.net/medias/nmedia/18/83/22/48/19704053.jpg'),
(616, 139812, 'Pirates des Caraïbes : la Fontaine de Jouvence', '2011-05-18', 'Le capitaine Jack Sparrow retrouve une femme qu''il a connue autrefois. Leurs liens sont-ils faits d''amour ou cette femme n''est-elle qu''une aventurière sans scrupule qui cherche à l''utiliser pour découvrir la légendaire Fontaine de Jouvence ?', 'Le capitaine Jack Sparrow retrouve une femme qu''il a connue autrefois. Leurs liens sont-ils faits d''amour ou cette femme n''est-elle qu''une aventurière sans scrupule qui cherche à l''utiliser pour découvrir la légendaire Fontaine de Jouvence ?', '02:20:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19205644', 'http://fr.web.img3.acsta.net/medias/nmedia/18/79/98/60/19713505.jpg'),
(617, 144461, 'Priest', '2011-05-11', 'Dans un monde ravagé par des siècles de guerre entre l''homme et les vampires, un prêtre guerrier se retourne contre l''église afin de traquer une bande de vampires meurtriers qui ont kidnappé sa nièce.', 'Dans un monde ravagé par des siècles de guerre entre l''homme et les vampires, un prêtre guerrier se retourne contre l''église afin de traquer une bande de vampires meurtriers qui ont kidnappé sa nièce.', '01:27:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19206674', 'http://fr.web.img2.acsta.net/medias/nmedia/18/78/60/34/19697027.jpg'),
(618, 188851, 'Juste entre nous', '2011-05-11', 'Doubles vies et relations amoureuses parallèles sont mêlées dans cette histoire douce-amère<br/>sur la quête incessante de l''amour et du bonheur, sur la passion qui ne cesse d''exister, et sur les terribles conséquences qui en émanent.', 'Doubles vies et relations amoureuses parallèles sont mêlées dans cette histoire douce-amère<br/>sur la quête incessante de l''amour et du bonheur, sur la passion qui ne cesse d''exister, et sur les terribles conséquences qui en émanent.', '01:29:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19216301', 'http://fr.web.img6.acsta.net/medias/nmedia/18/83/63/58/19723480.jpg'),
(619, 145920, 'Stone', '2011-05-11', 'A la veille de prendre sa retraite, Jack Mabry est chargé de revoir le cas de Gerald Creeson dit "Stone", emprisonné pour le meurtre de ses grands-parents. Mais Jack n''est pas convaincu par la défense de Stone...', 'A la veille de prendre sa retraite, Jack Mabry est chargé de revoir le cas de Gerald Creeson dit "Stone", emprisonné pour le meurtre de ses grands-parents. Mais Jack n''est pas convaincu par la défense de Stone...', '01:45:00', 1.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19208015', 'http://fr.web.img2.acsta.net/medias/nmedia/18/73/62/60/19704945.jpg'),
(620, 178300, 'Minuit à Paris', '2011-05-11', 'Un jeune couple d''américains dont le mariage est prévu à l''automne se rend pour quelques jours à Paris. La magie de la capitale ne tarde pas à opérer, tout particulièrement sur le jeune homme amoureux de la Ville-lumière et qui aspire à une autre vie que la sienne.', 'Un jeune couple d''américains dont le mariage est prévu à l''automne se rend pour quelques jours à Paris. La magie de la capitale ne tarde pas à opérer, tout particulièrement sur le jeune homme amoureux de la Ville-lumière et qui aspire à une autre vie que la sienne.', '01:34:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19209502', 'http://fr.web.img4.acsta.net/medias/nmedia/18/83/07/18/19702766.jpg'),
(621, 187258, 'HH, Hitler à Hollywood', '2011-05-04', 'Lorsque Marie de Medeiros entreprend le tournage de son documentaire consacré à l''actrice Micheline Presle, elle retrouve la trace d''un cinéaste mystérieusement disparu en 1946, Luis Aramcheck.', 'Lorsque Marie de Medeiros entreprend le tournage de son documentaire consacré à l''actrice Micheline Presle, elle retrouve la trace d''un cinéaste mystérieusement disparu en 1946, Luis Aramcheck.', '01:27:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19210708', 'http://fr.web.img3.acsta.net/medias/nmedia/18/83/65/56/19726150.jpg'),
(622, 147468, 'La Ballade de l''Impossible - Norwegian Wood', '2011-05-04', 'Tokyo, fin des années 60. Kizuki, le meilleur ami de Watanabe, s''est suicidé. Watanabe quitte alors Kobe et s''installe à Tokyo pour commencer ses études universitaires. Alors qu''un peu partout, les étudiants se révoltent, la vie de Watanabe est bouleversée...', 'Tokyo, fin des années 60. Kizuki, le meilleur ami de Watanabe, s''est suicidé. Watanabe quitte alors Kobe et s''installe à Tokyo pour commencer ses études universitaires. Alors qu''un peu partout, les étudiants se révoltent, la vie de Watanabe est bouleversée...', '02:13:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19203568', 'http://fr.web.img5.acsta.net/medias/nmedia/18/83/33/45/19694032.jpg'),
(623, 111002, 'Où va la nuit', '2011-05-04', 'Parce qu''elle a été trop longtemps victime, Rose Mayer décide de prendre son destin en main et assassine son mari. Elle part alors retrouver son fils à Bruxelles, qui a fui l''enfer familial depuis des années.', 'Parce qu''elle a été trop longtemps victime, Rose Mayer décide de prendre son destin en main et assassine son mari. Elle part alors retrouver son fils à Bruxelles, qui a fui l''enfer familial depuis des années.', '01:45:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19211326', 'http://fr.web.img2.acsta.net/medias/nmedia/18/83/17/95/19698636.jpg'),
(624, 186792, 'Voir la mer', '2011-05-04', 'C''est 2 frères. Qui habitent Montbard, en Bourgogne. Et qui, pour les vacances d''été, ont décidé d''aller voir leur mère à Saint Jean de Luz. Parce que ça fait longtemps. Parce que ça lui fera plaisir. Ce ne sont pas les parce que qui manquent.', 'C''est 2 frères. Qui habitent Montbard, en Bourgogne. Et qui, pour les vacances d''été, ont décidé d''aller voir leur mère à Saint Jean de Luz. Parce que ça fait longtemps. Parce que ça lui fera plaisir. Ce ne sont pas les parce que qui manquent.', '01:31:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19205239', 'http://fr.web.img1.acsta.net/medias/nmedia/18/83/59/57/19698055.jpg'),
(625, 129955, 'De l''eau pour les éléphants', '2011-05-04', 'Alors qu''il est sur le point de passer son examen final à l''école vétérinaire de Cornell, Jacob Jankowski perd ses parents dans un accident de voiture. A la suite de cette tragédie, il laisse tout tomber et rejoint les Frères Benzini...', 'Alors qu''il est sur le point de passer son examen final à l''école vétérinaire de Cornell, Jacob Jankowski perd ses parents dans un accident de voiture. A la suite de cette tragédie, il laisse tout tomber et rejoint les Frères Benzini...', '01:55:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19207864', 'http://fr.web.img3.acsta.net/medias/nmedia/18/82/84/03/19699779.jpg'),
(626, 128855, 'L''Aigle de la Neuvième Légion', '2011-05-04', 'Un officier romain enquête sur la mystérieuse disparition de la Neuvième Légion, qui stationnait à la frontière de l''Écosse.', 'Un officier romain enquête sur la mystérieuse disparition de la Neuvième Légion, qui stationnait à la frontière de l''Écosse.', '01:51:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19198316', 'http://fr.web.img2.acsta.net/medias/nmedia/18/82/97/89/19652573.jpg'),
(627, 178061, 'Fast and Furious 5', '2011-05-04', 'L''ex-agent Brian O''Conner fait à nouveau équipe avec l''ancien taulard Dom Toretto, mais pour la première fois, ils se retrouvent tous deux du mauvais côté de la loi dans cette ultime course-poursuite à hauts risques.', 'L''ex-agent Brian O''Conner fait à nouveau équipe avec l''ancien taulard Dom Toretto, mais pour la première fois, ils se retrouvent tous deux du mauvais côté de la loi dans cette ultime course-poursuite à hauts risques.', '02:10:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19202087', 'http://fr.web.img5.acsta.net/medias/nmedia/18/82/46/71/19690319.jpg'),
(628, 132044, 'John Rabe', '2011-04-27', 'L''histoire vraie d''un homme d''affaires allemand, John Rabe, membre du parti nazi et cadre de la compagnie Siemens, qui a sauvé 200 000 chinois des persécutions japonaises lors des massacres de Nankin de décembre 1937 à janvier 1938.', 'L''histoire vraie d''un homme d''affaires allemand, John Rabe, membre du parti nazi et cadre de la compagnie Siemens, qui a sauvé 200 000 chinois des persécutions japonaises lors des massacres de Nankin de décembre 1937 à janvier 1938.', '02:15:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19189657', 'http://fr.web.img1.acsta.net/medias/nmedia/18/82/79/18/19658190.jpg'),
(629, 140140, 'Animal Kingdom', '2011-04-27', 'Une rue anonyme dans la banlieue de Melbourne. C''est là que vit la famille Cody. Profession : criminels. L''irruption parmi eux de Joshua, un neveu éloigné, offre à la police le moyen de les infiltrer. Il ne reste plus à Joshua qu''à choisir son camp...', 'Une rue anonyme dans la banlieue de Melbourne. C''est là que vit la famille Cody. Profession : criminels. L''irruption parmi eux de Joshua, un neveu éloigné, offre à la police le moyen de les infiltrer. Il ne reste plus à Joshua qu''à choisir son camp...', '01:52:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19208473', 'http://fr.web.img4.acsta.net/medias/nmedia/18/73/96/94/19638756.jpg'),
(630, 184451, 'Moi, Michel G, Milliardaire, Maître du monde', '2011-04-27', 'Homme d''affaires à succès, symbole d''un capitalisme moderne et décomplexé, Michel Ganiant a tout : l''argent, le pouvoir, l''amour. Et il veut que ça se sache.', 'Homme d''affaires à succès, symbole d''un capitalisme moderne et décomplexé, Michel Ganiant a tout : l''argent, le pouvoir, l''amour. Et il veut que ça se sache.', '01:27:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19205748', 'http://fr.web.img1.acsta.net/medias/nmedia/18/83/49/82/19694287.jpg'),
(631, 177205, 'Bon à Tirer (B.A.T.)', '2011-04-27', 'Meilleurs amis, Rick et Fred sont mariés depuis longtemps. Lorsqu''ils commencent à montrer des signes de lassitude à la maison, leurs femmes leurs donnent"carte blanche", une semaine de liberté où ils pourront tout faire. Sans aucune question.', 'Meilleurs amis, Rick et Fred sont mariés depuis longtemps. Lorsqu''ils commencent à montrer des signes de lassitude à la maison, leurs femmes leurs donnent"carte blanche", une semaine de liberté où ils pourront tout faire. Sans aucune question.', '01:45:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19184768', 'http://fr.web.img6.acsta.net/medias/nmedia/18/83/44/50/19691443.jpg'),
(632, 129477, 'Thor', '2011-04-27', 'Thor est un guerrier Marvel tout-puissant et arrogant, banni du Royaume mythique d''Asgard et condamné à vivre parmi les humains. Lorsque les forces du mal s''apprêtent à se déchaîner sur la Terre, Thor va apprendre à se comporter en véritable héros?', 'Thor est un guerrier Marvel tout-puissant et arrogant, banni du Royaume mythique d''Asgard et condamné à vivre parmi les humains. Lorsque les forces du mal s''apprêtent à se déchaîner sur la Terre, Thor va apprendre à se comporter en véritable héros?', '01:54:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19199734', 'http://fr.web.img3.acsta.net/medias/nmedia/18/77/96/35/19701393.jpg'),
(633, 188840, 'Tomboy', '2011-04-20', 'Laure a 10 ans. Laure est un garçon manqué. Arrivée dans un nouveau  quartier, elle fait croire à Lisa et sa bande qu''elle est un garçon.', 'Laure a 10 ans. Laure est un garçon manqué. Arrivée dans un nouveau  quartier, elle fait croire à Lisa et sa bande qu''elle est un garçon.', '01:22:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19204466', 'http://fr.web.img5.acsta.net/medias/nmedia/18/82/89/56/19697284.jpg'),
(634, 184006, 'Detective Dee : Le mystère de la flamme fantôme', '2011-04-20', 'L''histoire se déroule en Chine, en l''an 690, durant la période trouble correspondant à l''ascension de l''impératrice Wu Ze Tian. Tout est prêt pour la cérémonie du couronnement et la petite ville de Chang-An est dans ses habits de fête.', 'L''histoire se déroule en Chine, en l''an 690, durant la période trouble correspondant à l''ascension de l''impératrice Wu Ze Tian. Tout est prêt pour la cérémonie du couronnement et la petite ville de Chang-An est dans ses habits de fête.', '02:03:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19197476', 'http://fr.web.img4.acsta.net/medias/nmedia/18/83/06/22/19670948.jpg'),
(635, 182894, 'Et soudain, tout le monde me manque', '2011-04-20', 'A 60 ans passés, Eli va être père pour la 3ème fois. Le problème, c est qu''Eli a toujours été plus fort en golf qu''en paternité...  A 27 ans, Justine, sa fille cadette, a bien du mal à trouver sa place.', 'A 60 ans passés, Eli va être père pour la 3ème fois. Le problème, c est qu''Eli a toujours été plus fort en golf qu''en paternité...  A 27 ans, Justine, sa fille cadette, a bien du mal à trouver sa place.', '01:38:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19203005', 'http://fr.web.img3.acsta.net/medias/nmedia/18/83/40/57/19722961.jpg'),
(636, 170918, 'Le Chaperon Rouge', '2011-04-20', 'Une version gothique du "Petit Chaperon Rouge".', 'Une version gothique du "Petit Chaperon Rouge".', '01:40:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19204887', 'http://fr.web.img4.acsta.net/medias/nmedia/18/82/78/61/19679067.jpg'),
(637, 175053, 'Source Code', '2011-04-20', 'Colter Stevens se réveille en sursaut dans un train à destination de Chicago. Amnésique, il n''a aucun souvenir d''être monté dedans. Pire encore, les passagers du train se comportent avec lui avec familiarité alors qu''il ne les a jamais vus.', 'Colter Stevens se réveille en sursaut dans un train à destination de Chicago. Amnésique, il n''a aucun souvenir d''être monté dedans. Pire encore, les passagers du train se comportent avec lui avec familiarité alors qu''il ne les a jamais vus.', '01:33:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19192930', 'http://fr.web.img6.acsta.net/medias/nmedia/18/81/94/80/19693276.jpg'),
(638, 146276, 'La Fille du puisatier', '2011-04-20', 'Fille aînée d''un puisatier, Patricia s''éprend d''un aviateur. Lorsque la guerre éclate, celui-ci part au front, ignorant que Patricia attend un enfant de lui. La jeune fille se sentira rejetée par son père...', 'Fille aînée d''un puisatier, Patricia s''éprend d''un aviateur. Lorsque la guerre éclate, celui-ci part au front, ignorant que Patricia attend un enfant de lui. La jeune fille se sentira rejetée par son père...', '01:47:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19194435', 'http://fr.web.img6.acsta.net/medias/nmedia/18/79/51/21/19671240.jpg'),
(639, 125315, 'Rabbit Hole', '2011-04-13', 'Huit mois après la disparition de leur fils, Howie tente de nouvelles expériences tandis que Becca préfère couper les ponts avec une famille trop envahissante. Contre toute attente, elle se rapproche du jeune homme responsable de la mort de leur enfant.', 'Huit mois après la disparition de leur fils, Howie tente de nouvelles expériences tandis que Becca préfère couper les ponts avec une famille trop envahissante. Contre toute attente, elle se rapproche du jeune homme responsable de la mort de leur enfant.', '01:32:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19202465', 'http://fr.web.img2.acsta.net/medias/nmedia/18/81/90/71/19684090.jpg'),
(640, 138196, 'Scream 4', '2011-04-13', '10 ans se sont écoulés depuis les terribles meurtres commis par Ghostface. Sidney Prescott est parvenue à tourner la page mais c''est tout de même avec appréhension qu''elle retourne à Woodsboro pour le lancement de son premier roman.', '10 ans se sont écoulés depuis les terribles meurtres commis par Ghostface. Sidney Prescott est parvenue à tourner la page mais c''est tout de même avec appréhension qu''elle retourne à Woodsboro pour le lancement de son premier roman.', '01:50:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19201251', 'http://fr.web.img5.acsta.net/medias/nmedia/18/77/98/77/19692981.jpg'),
(641, 175909, 'La Proie', '2011-04-13', 'Un braqueur s''évade de prison pour traquer son ancien codétenu, un tueur en série qui a entrepris de lui coller ses crimes sur le dos. Une policière de la Brigade des Fugitifs se lance à la poursuite du braqueur, devenu bien malgré lui l''ennemi public numéro 1.', 'Un braqueur s''évade de prison pour traquer son ancien codétenu, un tueur en série qui a entrepris de lui coller ses crimes sur le dos. Une policière de la Brigade des Fugitifs se lance à la poursuite du braqueur, devenu bien malgré lui l''ennemi public numéro 1.', '01:42:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19197402', 'http://fr.web.img5.acsta.net/medias/nmedia/18/78/75/97/19682069.jpg');
