(642, 182713, 'Mon père est femme de ménage', '2011-04-13', 'Polo a 16 ans et les complexes d''un ado de son âge. Entre une mère alitée et une soeur qui rêve d''être miss, le seul qui s''en sorte à ses yeux , c''est son père. Hélas, il est femme de ménage...', 'Polo a 16 ans et les complexes d''un ado de son âge. Entre une mère alitée et une soeur qui rêve d''être miss, le seul qui s''en sorte à ses yeux , c''est son père. Hélas, il est femme de ménage...', '01:20:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19192624', 'http://fr.web.img5.acsta.net/medias/nmedia/18/82/79/28/19697130.jpg'),
(643, 146550, 'Rio', '2011-04-13', 'Blu, un perroquet bleu d''une espèce très rare, quitte sa petite ville sous la neige et le confort de sa cage pour s''aventurer au c?ur des merveilles exotiques de Rio de Janeiro.', 'Blu, un perroquet bleu d''une espèce très rare, quitte sa petite ville sous la neige et le confort de sa cage pour s''aventurer au c?ur des merveilles exotiques de Rio de Janeiro.', '01:30:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19197926', 'http://fr.web.img1.acsta.net/medias/nmedia/18/78/25/22/19699752.jpg'),
(644, 134108, 'Le Flingueur', '2011-04-06', 'Un tueur à gages sur le déclin se lie d''amitié avec un jeune homme voulant devenir tueur professionnel. Il se pourrait bien qu''il ait trouvé son successeur...', 'Un tueur à gages sur le déclin se lie d''amitié avec un jeune homme voulant devenir tueur professionnel. Il se pourrait bien qu''il ait trouvé son successeur...', '01:32:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19203041', 'http://fr.web.img6.acsta.net/medias/nmedia/18/82/95/77/19678958.jpg'),
