(649, 126882, 'Sucker Punch', '2011-03-30', 'Les méandres de l''imagination débordante d''une jeune fille, dont les rêves sont la seule échappatoire à sa vie cauchemardesque. Délivrée des limites de l''espace et du temps, elle est libre d''aller là où l''entraîne son imagination...', 'Les méandres de l''imagination débordante d''une jeune fille, dont les rêves sont la seule échappatoire à sa vie cauchemardesque. Délivrée des limites de l''espace et du temps, elle est libre d''aller là où l''entraîne son imagination...', '01:50:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19174030', 'http://fr.web.img2.acsta.net/medias/nmedia/18/71/78/45/19678945.jpg'),
(650, 139453, 'The Company Men', '2011-03-30', 'Bobby est l''incarnation même du rêve américain : il a un très bon travail, une merveilleuse famille et une Porsche toute neuve dans son garage. Mais lorsque la société qui l''emploie réduit ses effectifs, Bobby se retrouve au chômage...', 'Bobby est l''incarnation même du rêve américain : il a un très bon travail, une merveilleuse famille et une Porsche toute neuve dans son garage. Mais lorsque la société qui l''emploie réduit ses effectifs, Bobby se retrouve au chômage...', '01:52:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19200271', 'http://fr.web.img6.acsta.net/medias/nmedia/18/73/99/30/19625865.jpg'),
