(652, 178550, 'Je n''ai rien oublié', '2011-03-30', 'Conrad Lang est atteint de la maladie d''Alzheimer. Il renoue avec des souvenirs de plus en plus lointains qui le ramènent vers sa petite enfance. Cette enquête involontaire dans les tréfonds de sa mémoire menace de mettre à jour un secret de famille.', 'Conrad Lang est atteint de la maladie d''Alzheimer. Il renoue avec des souvenirs de plus en plus lointains qui le ramènent vers sa petite enfance. Cette enquête involontaire dans les tréfonds de sa mémoire menace de mettre à jour un secret de famille.', '01:33:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19196847', 'http://fr.web.img6.acsta.net/medias/nmedia/18/83/17/22/19669892.jpg'),
(653, 137419, 'Chez Gino', '2011-03-30', 'Gino, installé depuis 30 ans à Bruxelles, tient une pizzeria de 3ème zone achetée avec les économies de son épouse Simone. Son morne quotidien, fait de disputes avec ses enfants, est bouleversé par la nouvelle de la mort prochaine de son oncle...', 'Gino, installé depuis 30 ans à Bruxelles, tient une pizzeria de 3ème zone achetée avec les économies de son épouse Simone. Son morne quotidien, fait de disputes avec ses enfants, est bouleversé par la nouvelle de la mort prochaine de son oncle...', '01:40:00', 1.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19198642', 'http://fr.web.img3.acsta.net/medias/nmedia/18/83/00/43/19655776.jpg'),
(654, 178852, 'Tous les soleils', '2011-03-30', 'Alessandro est un professeur italien de musique baroque qui vit à Strasbourg avec Irina, sa fille en pleine crise, et son frère, un fou anarchiste qui ne cesse de demander le statut de réfugié politique depuis que Berlusconi est au pouvoir...', 'Alessandro est un professeur italien de musique baroque qui vit à Strasbourg avec Irina, sa fille en pleine crise, et son frère, un fou anarchiste qui ne cesse de demander le statut de réfugié politique depuis que Berlusconi est au pouvoir...', '01:45:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19193150', 'http://fr.web.img5.acsta.net/medias/nmedia/18/82/78/87/19670528.jpg'),
