(714, 176013, 'Holiday', '2010-12-08', 'Michel Trémois, un dentiste raté d''une petite ville de province dont la femme a disparu, est accusé du meurtre d''une propriétaire d''hôtel...', 'Michel Trémois, un dentiste raté d''une petite ville de province dont la femme a disparu, est accusé du meurtre d''une propriétaire d''hôtel...', '01:30:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19173976', 'http://fr.web.img6.acsta.net/medias/nmedia/18/79/96/03/19590126.jpg'),
(715, 147914, 'Bébé mode d''emploi', '2010-12-08', 'Holly est un traiteur de plus en plus en vue et Eric Messer, un directeur de chaîne sportive plein d''avenir. Après un premier rencart désastreux, ils n''ont plus en commun que leur antipathie réciproque et l''amour qu''ils portent à leur filleule...', 'Holly est un traiteur de plus en plus en vue et Eric Messer, un directeur de chaîne sportive plein d''avenir. Après un premier rencart désastreux, ils n''ont plus en commun que leur antipathie réciproque et l''amour qu''ils portent à leur filleule...', '01:54:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19145005', 'http://fr.web.img3.acsta.net/medias/nmedia/18/79/88/23/19539558.jpg'),
(716, 145765, 'De vrais mensonges', '2010-12-08', 'Un beau matin de printemps, Émilie reçoit une lettre d''amour, belle, inspirée mais anonyme. Elle la jette d''abord à la poubelle, avant d''y voir le moyen de sauver sa mère, isolée et triste depuis le départ de son mari...', 'Un beau matin de printemps, Émilie reçoit une lettre d''amour, belle, inspirée mais anonyme. Elle la jette d''abord à la poubelle, avant d''y voir le moyen de sauver sa mère, isolée et triste depuis le départ de son mari...', '01:45:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19150868', 'http://fr.web.img6.acsta.net/medias/nmedia/18/79/51/20/19539886.jpg'),
(717, 135523, 'Raiponce', '2010-12-01', 'Une adaptation du célèbre conte, autour des aventures de Raiponce, une princesse à la longue chevelure blonde...', 'Une adaptation du célèbre conte, autour des aventures de Raiponce, une princesse à la longue chevelure blonde...', '01:41:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19145946', 'http://fr.web.img6.acsta.net/medias/nmedia/18/78/47/32/19539636.jpg'),
(718, 183325, 'Monsters', '2010-12-01', 'Quand la NASA découvre l''éventualité d''une vie extra-terrestre dans notre système solaire, une sonde est envoyée afin de prélever des échantillons. Malheureusement, elle s''écrase au-dessus de l''Amérique centrale lors de son voyage de retour...', 'Quand la NASA découvre l''éventualité d''une vie extra-terrestre dans notre système solaire, une sonde est envoyée afin de prélever des échantillons. Malheureusement, elle s''écrase au-dessus de l''Amérique centrale lors de son voyage de retour...', '01:33:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19174026', 'http://fr.web.img1.acsta.net/medias/nmedia/18/79/56/45/19543121.jpg'),
(719, 129815, 'Machete', '2010-12-01', 'Les aventures de Machete, le justicier mexicain...', 'Les aventures de Machete, le justicier mexicain...', '01:45:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19139040', 'http://fr.web.img3.acsta.net/medias/nmedia/18/66/33/93/19559737.jpg'),
(720, 177854, 'A bout portant', '2010-12-01', 'Tout va pour le mieux pour Samuel et Nadia : lui est bientôt infirmier et elle, attend son premier enfant. Mais tout bascule lorsque Nadia se fait kidnapper sous l''oeil impuissant de Samuel. A son réveil, son portable retentit...', 'Tout va pour le mieux pour Samuel et Nadia : lui est bientôt infirmier et elle, attend son premier enfant. Mais tout bascule lorsque Nadia se fait kidnapper sous l''oeil impuissant de Samuel. A son réveil, son portable retentit...', '01:25:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19165941', 'http://fr.web.img1.acsta.net/medias/nmedia/18/74/15/66/19537329.jpg'),
(721, 176562, 'Mon pote', '2010-12-01', 'Victor est le patron d''un magazine automobile. Un jour, il va parler de son travail dans une prison. Il y rencontre un ancien braqueur, Bruno, fan de son magazine, qui lui demande de l''embaucher. Victor accepte. Une amitié naît entre les deux hommes?', 'Victor est le patron d''un magazine automobile. Un jour, il va parler de son travail dans une prison. Il y rencontre un ancien braqueur, Bruno, fan de son magazine, qui lui demande de l''embaucher. Victor accepte. Une amitié naît entre les deux hommes?', '01:45:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19152075', 'http://fr.web.img4.acsta.net/medias/nmedia/18/78/33/59/19528632.jpg');
