(722, 126693, 'Harry Potter et les reliques de la mort - partie 1', '2010-11-24', 'La première partie du septième et ultime volet des aventures du célèbre sorcier de Poudlard.', 'La première partie du septième et ultime volet des aventures du célèbre sorcier de Poudlard.', '02:25:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19149856', 'http://fr.web.img5.acsta.net/medias/nmedia/18/69/69/81/19590744.jpg'),
(723, 130427, 'Quartier lointain', '2010-11-24', 'Thomas a la cinquantaine, marié, père de famille. L''ennui flottant de son existence lui pèse. Rentrant d''un voyage professionnel en province, il se trompe de train et prend la direction opposée...', 'Thomas a la cinquantaine, marié, père de famille. L''ennui flottant de son existence lui pèse. Rentrant d''un voyage professionnel en province, il se trompe de train et prend la direction opposée...', '01:38:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19146796', 'http://fr.web.img6.acsta.net/medias/nmedia/18/79/75/58/19571450.jpg'),
(724, 180375, 'Outrage', '2010-11-24', 'Dans une lutte impitoyable pour le pouvoir, plusieurs clans yakuzas se disputent la bienveillance du parrain...', 'Dans une lutte impitoyable pour le pouvoir, plusieurs clans yakuzas se disputent la bienveillance du parrain...', '01:49:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19167677', 'http://fr.web.img3.acsta.net/medias/nmedia/18/77/72/18/19511180.jpg'),
(725, 138593, 'L''Empire du milieu du sud', '2010-11-24', 'Sur des images d''archives inédites du monde entier qu''accompagnent des textes de la littérature vietnamienne, française et américaine, Jacques Perrin et Eric Deroo retracent l''histoire fascinante et douloureuse du Viêt-nam...', 'Sur des images d''archives inédites du monde entier qu''accompagnent des textes de la littérature vietnamienne, française et américaine, Jacques Perrin et Eric Deroo retracent l''histoire fascinante et douloureuse du Viêt-nam...', '01:26:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19143477', 'http://fr.web.img6.acsta.net/medias/nmedia/18/78/89/97/19534036.jpg'),
(726, 179442, 'L''Apprenti Père Noël', '2010-11-24', 'Nicolas Barnsworth, un jeune orphelin originaire d''Australie, est choisi par le Père Noël pour le remplacer lorsque ce dernier prendra sa retraite à l''âge de 168 ans. Il a donc quinze ans devant lui pour tout apprendre du métier de Père Noël?', 'Nicolas Barnsworth, un jeune orphelin originaire d''Australie, est choisi par le Père Noël pour le remplacer lorsque ce dernier prendra sa retraite à l''âge de 168 ans. Il a donc quinze ans devant lui pour tout apprendre du métier de Père Noël?', '01:18:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19162769', 'http://fr.web.img6.acsta.net/medias/nmedia/18/78/58/20/19518469.jpg'),
(727, 172167, 'Le Nom des gens', '2010-11-24', 'Bahia Benmahmoud, jeune femme extravertie, se fait une haute idée de l''engagement politique puisqu''elle n''hésite pas à coucher avec ses ennemis pour les convertir à sa cause. En règle générale, elle obtient de bons résultats...', 'Bahia Benmahmoud, jeune femme extravertie, se fait une haute idée de l''engagement politique puisqu''elle n''hésite pas à coucher avec ses ennemis pour les convertir à sa cause. En règle générale, elle obtient de bons résultats...', '01:44:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19148984', 'http://fr.web.img1.acsta.net/medias/nmedia/18/77/79/17/19538598.jpg'),
(728, 183051, 'Dernier étage, gauche, gauche', '2010-11-17', 'C''est pas comme ça que ça aurait dû se passer? Comme tous les matins, François Echeveria - huissier de son état - aurait dû pouvoir opérer sa saisie du jour dans cette cité de banlieue, puis tranquillement rentrer dans son nid douillet...', 'C''est pas comme ça que ça aurait dû se passer? Comme tous les matins, François Echeveria - huissier de son état - aurait dû pouvoir opérer sa saisie du jour dans cette cité de banlieue, puis tranquillement rentrer dans son nid douillet...', '01:33:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19143963', 'http://fr.web.img3.acsta.net/medias/nmedia/18/78/68/81/19587260.jpg'),
(729, 140471, 'Mother & Child', '2010-11-17', 'L''histoire suit une femme qui a abandonné sa fille 35 ans auparavant, ainsi qu''une autre femme qui cherche à adopter...', 'L''histoire suit une femme qui a abandonné sa fille 35 ans auparavant, ainsi qu''une autre femme qui cherche à adopter...', '02:05:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19148875', 'http://fr.web.img3.acsta.net/medias/nmedia/18/73/22/99/19590017.jpg'),
(730, 135098, 'Mon babysitter', '2010-11-17', 'Une mère célibataire new-yorkaise devient l''objet de convoitise de son nouveau voisin de 25 ans...', 'Une mère célibataire new-yorkaise devient l''objet de convoitise de son nouveau voisin de 25 ans...', '01:34:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19151847', 'http://fr.web.img6.acsta.net/medias/nmedia/18/79/59/70/19580658.jpg'),
(731, 146229, 'Red', '2010-11-17', 'L''heure de la retraite a sonné ! Dans certaines professions, la transition peut s''avérer difficile : Franck ne supporte pas l''inactivité, son collègue Joe végète en maison de retraite, Marvin use d''amphétamines et Victoria fait des petits boulots...', 'L''heure de la retraite a sonné ! Dans certaines professions, la transition peut s''avérer difficile : Franck ne supporte pas l''inactivité, son collègue Joe végète en maison de retraite, Marvin use d''amphétamines et Victoria fait des petits boulots...', '01:51:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19145512', 'http://fr.web.img4.acsta.net/medias/nmedia/18/78/61/18/19518457.jpg'),
(732, 148102, 'No et moi', '2010-11-17', 'En souhaitant interviewer une jeune femme SDF pour un exposé, Lou, une adolescente qui se sent délaissée par ses parents, se met en tête de lui porter secours...', 'En souhaitant interviewer une jeune femme SDF pour un exposé, Lou, une adolescente qui se sent délaissée par ses parents, se met en tête de lui porter secours...', '01:45:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19147590', 'http://fr.web.img5.acsta.net/medias/nmedia/18/79/79/88/19540797.jpg'),
(733, 145329, 'Le Secret de Charlie', '2010-11-10', 'Se sentant coupable de la mort accidentelle de son frère, un gardien de cimetière se retrouve régulièrement face au fantôme de celui-ci. Il rencontre une jeune femme disparue en mer et se demande s''il s''agit aussi d''une apparition ou si elle est réelle.', 'Se sentant coupable de la mort accidentelle de son frère, un gardien de cimetière se retrouve régulièrement face au fantôme de celui-ci. Il rencontre une jeune femme disparue en mer et se demande s''il s''agit aussi d''une apparition ou si elle est réelle.', '01:39:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19137250', 'http://fr.web.img3.acsta.net/medias/nmedia/18/79/39/46/19510457.jpg'),
(734, 141576, 'Welcome to the Rileys', '2010-11-10', 'Un couple, dont la fille a disparu dans un tragique accident, se prend d''affection pour une jeune stripteaseuse...', 'Un couple, dont la fille a disparu dans un tragique accident, se prend d''affection pour une jeune stripteaseuse...', '01:50:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19150684', 'http://fr.web.img2.acsta.net/medias/nmedia/18/73/90/30/19534496.jpg'),
(735, 129345, 'Unstoppable', '2010-11-10', 'Un ingénieur et un chauffeur vivent une véritable course contre la montre. Les deux hommes tentent de stopper un train qui transporte des produits toxiques avant que celui-ci ne déraille et répande une flaque toxique qui décimera la ville complète.', 'Un ingénieur et un chauffeur vivent une véritable course contre la montre. Les deux hommes tentent de stopper un train qui transporte des produits toxiques avant que celui-ci ne déraille et répande une flaque toxique qui décimera la ville complète.', '01:35:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19146121', 'http://fr.web.img2.acsta.net/medias/nmedia/18/79/72/83/19535862.jpg'),
(736, 169922, 'Date limite', '2010-11-10', 'Un homme sur le point de devenir père et son ami peu fréquentable, traversent le pays dans l''espoir d''arriver à temps pour la naissance de l''enfant...', 'Un homme sur le point de devenir père et son ami peu fréquentable, traversent le pays dans l''espoir d''arriver à temps pour la naissance de l''enfant...', '01:35:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19146713', 'http://fr.web.img3.acsta.net/medias/nmedia/18/79/16/65/19539681.jpg'),
(737, 179625, 'Rubber', '2010-11-10', 'Dans le désert californien, des spectateurs incrédules assistent aux aventures d''un pneu tueur et télépathe, mystérieusement attiré par une jolie jeune fille. Une enquête commence.', 'Dans le désert californien, des spectateurs incrédules assistent aux aventures d''un pneu tueur et télépathe, mystérieusement attiré par une jolie jeune fille. Une enquête commence.', '01:25:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19149220', 'http://fr.web.img6.acsta.net/medias/nmedia/18/77/73/02/19534928.jpg'),
(738, 172873, 'Potiche', '2010-11-10', 'Suite à un mouvement de grève, un patron demande à son épouse de le remplacer à la tête de son entreprise... Adaptation de la pièce de théâtre de Barillet et Gredy.', 'Suite à un mouvement de grève, un patron demande à son épouse de le remplacer à la tête de son entreprise... Adaptation de la pièce de théâtre de Barillet et Gredy.', '01:43:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19139839', 'http://fr.web.img2.acsta.net/medias/nmedia/18/78/33/57/19502913.jpg'),
(739, 144111, 'Fair Game', '2010-11-03', 'Wilson est envoyé au Niger par la CIA pour enquêter sur un éventuel trafic d''armes de destructions massives avec l''Irak. Mais celui-ci ne trouve rien et prouve même que les documents sur lesquels s''appuyait l''Administration Bush étaient faux...', 'Wilson est envoyé au Niger par la CIA pour enquêter sur un éventuel trafic d''armes de destructions massives avec l''Irak. Mais celui-ci ne trouve rien et prouve même que les documents sur lesquels s''appuyait l''Administration Bush étaient faux...', '01:46:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19149481', 'http://fr.web.img6.acsta.net/medias/nmedia/18/78/15/19/19534143.jpg'),
(740, 136359, 'La Princesse de Montpensier', '2010-11-03', 'La romance entre le Duc de Guise et Melle de Mézières, contrainte d''épouser le Prince de Montpensier...', 'La romance entre le Duc de Guise et Melle de Mézières, contrainte d''épouser le Prince de Montpensier...', '02:19:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19141475', 'http://fr.web.img5.acsta.net/medias/nmedia/18/77/80/46/19448509.jpg'),
(741, 144472, 'Kill Me Please', '2010-11-03', 'Dans la montagne, la clinique Dignitas, dirigée par l''impeccable docteur Kruger, offre à ses patients le suicide médical assisté. Une faune riche et diversement malade hante ce no man''s land pour y vivre ses derniers jours en toute quiétude...', 'Dans la montagne, la clinique Dignitas, dirigée par l''impeccable docteur Kruger, offre à ses patients le suicide médical assisté. Une faune riche et diversement malade hante ce no man''s land pour y vivre ses derniers jours en toute quiétude...', '01:35:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19146706', 'http://fr.web.img3.acsta.net/medias/nmedia/18/79/37/81/19528460.jpg'),
(742, 172762, 'L''Homme qui voulait vivre sa vie', '2010-11-03', 'Paul Exben a tout pour être heureux: une belle situation professionnelle, une femme et deux enfants magnifiques. Sauf que cette vie n''est pas celle dont il rêvait. Un coup de folie va faire basculer son existence...', 'Paul Exben a tout pour être heureux: une belle situation professionnelle, une femme et deux enfants magnifiques. Sauf que cette vie n''est pas celle dont il rêvait. Un coup de folie va faire basculer son existence...', '01:55:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19137975', 'http://fr.web.img6.acsta.net/medias/nmedia/18/78/25/24/19497384.jpg'),
(743, 147940, 'Buried', '2010-11-03', 'Un entrepreneur est enlevé en Irak et se réveille enfermé dans une boîte en plein désert. Les seules choses qu''il a sur lui sont un téléphone portable, une bougie et un couteau...', 'Un entrepreneur est enlevé en Irak et se réveille enfermé dans une boîte en plein désert. Les seules choses qu''il a sur lui sont un téléphone portable, une bougie et un couteau...', '01:35:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19150698', 'http://fr.web.img2.acsta.net/medias/nmedia/18/72/18/31/19535837.jpg'),
(744, 173828, 'Nostalgie de la lumière', '2010-10-27', 'Au Chili, à trois mille mètres d''altitude, les astronomes venus du monde entier se rassemblent dans le désert d''Atacama pour observer les étoiles. Car la transparence du ciel est telle qu''elle permet de regarder jusqu''aux confins de l''univers.', 'Au Chili, à trois mille mètres d''altitude, les astronomes venus du monde entier se rassemblent dans le désert d''Atacama pour observer les étoiles. Car la transparence du ciel est telle qu''elle permet de regarder jusqu''aux confins de l''univers.', '01:30:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19146643', 'http://fr.web.img5.acsta.net/medias/nmedia/18/78/13/39/19518452.jpg'),
(745, 137366, 'Vénus noire', '2010-10-27', 'Paris, 1817, enceinte de l''Académie Royale de Médecine. « Je n''ai jamais vu de tête humaine plus semblable à celle des singes ». Face au moulage du corps de Saartjie Baartman, l''anatomiste Georges Cuvier est catégorique...', 'Paris, 1817, enceinte de l''Académie Royale de Médecine. « Je n''ai jamais vu de tête humaine plus semblable à celle des singes ». Face au moulage du corps de Saartjie Baartman, l''anatomiste Georges Cuvier est catégorique...', '02:44:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19146772', 'http://fr.web.img3.acsta.net/medias/nmedia/18/79/07/98/19504245.jpg'),
(746, 144195, 'Very Bad Cops', '2010-10-27', 'Allen Gamble et Terry Hoitz, deux policiers de second ordre, se plaignent d''être dans l''ombre des deux supers flics Danson et Manzetti...', 'Allen Gamble et Terry Hoitz, deux policiers de second ordre, se plaignent d''être dans l''ombre des deux supers flics Danson et Manzetti...', '01:47:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19121813', 'http://fr.web.img5.acsta.net/medias/nmedia/18/78/58/16/19499827.jpg'),
