(748, 140139, 'Biutiful', '2010-10-20', 'C''est l''histoire d''un homme en chute libre. Sensible aux esprits, Uxbal, père de deux enfants, sent que la mort rôde. Confronté à un quotidien corrompu et à un destin contraire, il se bat pour pardonner, pour aimer, pour toujours?', 'C''est l''histoire d''un homme en chute libre. Sensible aux esprits, Uxbal, père de deux enfants, sent que la mort rôde. Confronté à un quotidien corrompu et à un destin contraire, il se bat pour pardonner, pour aimer, pour toujours?', '02:18:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19127715', 'http://fr.web.img5.acsta.net/medias/nmedia/18/77/70/09/19478388.jpg'),
