(784, 109173, 'Piranha 3D', '2010-09-01', 'A Lake Victoria, ville pittoresque de l''Arizona et destination préférée des étudiants pendant les vacances de printemps. Lorsqu''un tremblement de terre fissure le fond du lac et qu''une brèche s''ouvre, des piranhas affamés s''y engouffrent...', 'A Lake Victoria, ville pittoresque de l''Arizona et destination préférée des étudiants pendant les vacances de printemps. Lorsqu''un tremblement de terre fissure le fond du lac et qu''une brèche s''ouvre, des piranhas affamés s''y engouffrent...', '01:29:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19118765', 'http://fr.web.img6.acsta.net/medias/nmedia/18/65/59/98/19472488.jpg'),
(785, 123257, 'Une famille très moderne', '2010-08-25', 'Kassie, la trentaine, souhaite par-dessus tout tomber enceinte. Elle souhaite passer par l''insémination artificielle et fait part de son envie à son meilleur ami. Celui-ci décide alors de tout faire pour la convaincre d''être le père...', 'Kassie, la trentaine, souhaite par-dessus tout tomber enceinte. Elle souhaite passer par l''insémination artificielle et fait part de son envie à son meilleur ami. Celui-ci décide alors de tout faire pour la convaincre d''être le père...', '01:42:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19130095', 'http://fr.web.img2.acsta.net/medias/nmedia/18/78/88/93/19485146.jpg'),
(786, 145150, 'Poetry', '2010-08-25', 'Une sexagénaire vit dans des conditions modestes avec son petit-fils adolescent. Pour lui, elle écrit un poème.', 'Une sexagénaire vit dans des conditions modestes avec son petit-fils adolescent. Pour lui, elle écrit un poème.', '02:19:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19130031', 'http://fr.web.img2.acsta.net/medias/nmedia/18/77/69/98/19482755.jpg'),
(787, 145490, '600 kilos d''or pur', '2010-08-25', 'Un groupe d''aventuriers entreprend de faire le casse d''une mine d''or au coeur de la Guyane. Mais l''opération ne se passe pas comme prévu, et, lors de leur fuite, leur hélicoptère doit se poser en catastrophe au milieu de la jungle...', 'Un groupe d''aventuriers entreprend de faire le casse d''une mine d''or au coeur de la Guyane. Mais l''opération ne se passe pas comme prévu, et, lors de leur fuite, leur hélicoptère doit se poser en catastrophe au milieu de la jungle...', '01:40:00', 1.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19126824', 'http://fr.web.img3.acsta.net/medias/nmedia/18/78/47/51/19470290.jpg'),
(788, 130203, 'Salt', '2010-08-25', 'Evelyn Salt, un agent de la CIA, est dénoncée par un déserteur comme étant une "taupe" russe. Salt doit alors échapper à la capture de ses supérieurs afin de prouver son innocence.', 'Evelyn Salt, un agent de la CIA, est dénoncée par un déserteur comme étant une "taupe" russe. Salt doit alors échapper à la capture de ses supérieurs afin de prouver son innocence.', '01:41:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19117783', 'http://fr.web.img4.acsta.net/medias/nmedia/18/69/61/88/19467642.jpg'),
(789, 173056, 'Le Bruit des glaçons', '2010-08-25', 'C''est l''histoire d''un homme qui reçoit la visite de son cancer. " Bonjour, lui dit le cancer, je suis votre cancer. Je me suis dit que ça serait peut-être pas mal de faire un petit peu connaissance... "', 'C''est l''histoire d''un homme qui reçoit la visite de son cancer. " Bonjour, lui dit le cancer, je suis votre cancer. Je me suis dit que ça serait peut-être pas mal de faire un petit peu connaissance... "', '01:27:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19125434', 'http://fr.web.img1.acsta.net/medias/nmedia/18/78/33/84/19470884.jpg'),
(790, 112167, 'Le Caméléon', '2010-06-23', 'L''histoire de Frédéric Bourdin, un mythomane qui se rendit célèbre en étant faussement reconnu et accueilli dans une famille américaine après avoir pris l''identité de leur fils, disparu trois ans plus tôt...', 'L''histoire de Frédéric Bourdin, un mythomane qui se rendit célèbre en étant faussement reconnu et accueilli dans une famille américaine après avoir pris l''identité de leur fils, disparu trois ans plus tôt...', '01:46:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19114604', 'http://fr.web.img4.acsta.net/medias/nmedia/18/70/91/41/19438879.jpg'),
(791, 144180, 'Top Cops', '2010-06-23', 'L''histoire de deux flics de la NYPD à la recherche d''une carte de baseball volée, rare mais en  parfait état, et qui se retrouvent vite face à un impitoyable gangster obsédé par les objets souvenirs !', 'L''histoire de deux flics de la NYPD à la recherche d''une carte de baseball volée, rare mais en  parfait état, et qui se retrouvent vite face à un impitoyable gangster obsédé par les objets souvenirs !', '01:40:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19106812', 'http://fr.web.img6.acsta.net/medias/nmedia/18/74/00/88/19458919.jpg'),
(792, 140136, 'Kiss & Kill', '2010-06-23', 'Deux jeunes mariés découvrent que leurs voisins sont des tueurs à gages chargés de les éliminer...', 'Deux jeunes mariés découvrent que leurs voisins sont des tueurs à gages chargés de les éliminer...', '01:40:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19110297', 'http://fr.web.img4.acsta.net/medias/nmedia/18/77/63/74/19458019.jpg'),
(793, 137312, 'Dog Pound', '2010-06-23', 'Davis, 16 ans, trafic de stupéfiants. Angel, 15 ans, vol de voiture avec violence. Butch, 17 ans, agression sur un officier de probation. Une même sentence : la prison pour délinquants juvéniles d''Enola Vale...', 'Davis, 16 ans, trafic de stupéfiants. Angel, 15 ans, vol de voiture avec violence. Butch, 17 ans, agression sur un officier de probation. Une même sentence : la prison pour délinquants juvéniles d''Enola Vale...', '01:31:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18945105', 'http://fr.web.img2.acsta.net/medias/nmedia/18/70/90/50/19469229.jpg'),
(794, 170405, 'Les Petits ruisseaux', '2010-06-23', 'Emile, un septuagénaire veuf, mène une retraite paisible jusqu''au jour où un ami à lui, Edmond, décède subitement après lui avoir révélé qu''il avait une vie amoureuse et sexuelle cachée. Emile va alors tenter de reprendre goût aux choses de l''amour.', 'Emile, un septuagénaire veuf, mène une retraite paisible jusqu''au jour où un ami à lui, Edmond, décède subitement après lui avoir révélé qu''il avait une vie amoureuse et sexuelle cachée. Emile va alors tenter de reprendre goût aux choses de l''amour.', '01:34:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19116050', 'http://fr.web.img5.acsta.net/medias/nmedia/18/78/27/12/19453971.jpg'),
(795, 120782, 'L''Illusionniste', '2010-06-16', 'Un vieil illusionniste sur le déclin, rencontre une jeune fille qui va changer sa vie...', 'Un vieil illusionniste sur le déclin, rencontre une jeune fille qui va changer sa vie...', '01:20:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19113021', 'http://fr.web.img1.acsta.net/medias/nmedia/18/77/64/95/19452951.jpg'),
