(798, 134542, 'Fatal', '2010-06-16', 'Fatal Bazooka, c''est un rappeur créé par Michaël Youn dans son "Morning Live", puis développé dans l''album "T''as vu" vendu à plus de 500 000 exemplaires. Ce film raconte ce que serait devenu ce rappeur s''il en avait vendu... 15 millions !', 'Fatal Bazooka, c''est un rappeur créé par Michaël Youn dans son "Morning Live", puis développé dans l''album "T''as vu" vendu à plus de 500 000 exemplaires. Ce film raconte ce que serait devenu ce rappeur s''il en avait vendu... 15 millions !', '01:35:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19112415', 'http://fr.web.img2.acsta.net/medias/nmedia/18/73/87/35/19446486.jpg'),
(799, 111720, 'Bébés', '2010-06-16', 'Une année dans la vie de quatre bébés. Du jour de leur naissance à leurs premiers pas. Suivre quatre bébés dans quatre pays différents, simultanément, jour après jour, les voir grandir, se développer et découvrir le monde qui les entoure.', 'Une année dans la vie de quatre bébés. Du jour de leur naissance à leurs premiers pas. Suivre quatre bébés dans quatre pays différents, simultanément, jour après jour, les voir grandir, se développer et découvrir le monde qui les entoure.', '01:16:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19099184', 'http://fr.web.img2.acsta.net/medias/nmedia/18/76/82/30/19417441.jpg'),
(800, 179451, 'Les amours secrètes', '2010-06-09', 'Un vieil homme relit le journal intime d''une jeune fille juive écrit sous l''Occupation 60 ans plus tôt? Sarah Rosemblum avait 25 ans. Elle était jeune, belle, amoureuse?', 'Un vieil homme relit le journal intime d''une jeune fille juive écrit sous l''Occupation 60 ans plus tôt? Sarah Rosemblum avait 25 ans. Elle était jeune, belle, amoureuse?', '01:25:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19086854', 'http://fr.web.img1.acsta.net/medias/nmedia/18/77/37/55/19463557.jpg'),
(801, 146763, 'Les Meilleurs amis du Monde', '2010-06-09', 'Un week-end au vert avec vos meilleurs amis, les vrais, les purs ! Ceux qui vous aiment vraiment. Ceux en qui vous avez confiance. Et surtout, ceux qui vous pourrissent la gueule sans savoir qu''ils ont appuyé sur la touche rappel de leur téléphone.', 'Un week-end au vert avec vos meilleurs amis, les vrais, les purs ! Ceux qui vous aiment vraiment. Ceux en qui vous avez confiance. Et surtout, ceux qui vous pourrissent la gueule sans savoir qu''ils ont appuyé sur la touche rappel de leur téléphone.', '01:31:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19112174', 'http://fr.web.img5.acsta.net/medias/nmedia/18/73/80/30/19446858.jpg'),
(802, 170825, 'Les mains en l''air', '2010-06-09', 'En 2067, une vieille dame se souvient d''événements survenus soixante ans plus tôt : la famille d''un de ses amis était alors menacée d''expulsion. La fillette et son groupe de copains s''étaient mobilisés pour lui venir en aide...', 'En 2067, une vieille dame se souvient d''événements survenus soixante ans plus tôt : la famille d''un de ses amis était alors menacée d''expulsion. La fillette et son groupe de copains s''étaient mobilisés pour lui venir en aide...', '01:30:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19110220', 'http://fr.web.img5.acsta.net/medias/nmedia/18/77/77/87/19446041.jpg'),
(803, 128959, 'Hatchi', '2010-06-09', 'Un professeur trouve un chien abandonné et le recueille. Sa vie s''en trouve transformée, un lien inaltérable les unissant très vite...', 'Un professeur trouve un chien abandonné et le recueille. Sa vie s''en trouve transformée, un lien inaltérable les unissant très vite...', '01:33:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18950913', 'http://fr.web.img5.acsta.net/medias/nmedia/18/70/57/79/19282162.jpg'),
(804, 144605, 'Rabia', '2010-06-02', 'Madrid. Rosa et José-Maria, immigrés sud-américains viennent de se rencontrer lorsque ce dernier provoque la mort de son chef de chantier. Il doit alors se cacher et trouve refuge à l''insu de tous dans une grande maison bourgeoise...', 'Madrid. Rosa et José-Maria, immigrés sud-américains viennent de se rencontrer lorsque ce dernier provoque la mort de son chef de chantier. Il doit alors se cacher et trouve refuge à l''insu de tous dans une grande maison bourgeoise...', '01:35:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19105572', 'http://fr.web.img6.acsta.net/medias/nmedia/18/76/88/48/19427168.jpg');
INSERT INTO `film` (`id`, `code`, `titre`, `date`, `synopsis`, `synopsisCourt`, `duree`, `note`, `trailer`, `affiche`) VALUES
(805, 142555, 'Sex and the City 2', '2010-06-02', 'Que passe-t-il après avoir dit « Oui » ? La vie est telle que ces dames l''ont toujours rêvée, mais ce ne serait pas ?Sex and the City? si elle ne leur réservait pas quelques surprises? cette fois, sous la forme d''une aventure glamour, baignée de soleil, les entraînant loin de New York dans l''un des endroits les plus luxuriants, exotiques et vivifiants de la planète...', 'Que passe-t-il après avoir dit « Oui » ? La vie est telle que ces dames l''ont toujours rêvée, mais ce ne serait pas ?Sex and the City? si elle ne leur réservait pas quelques surprises? cette fois, sous la forme d''une aventure glamour, baignée de soleil, les entraînant loin de New York dans l''un des endroits les plus luxuriants, exotiques et vivifiants de la planète...', '02:26:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18948820', 'http://fr.web.img1.acsta.net/medias/nmedia/18/73/58/19/19439441.jpg'),
(806, 170300, 'La Tête en friche', '2010-06-02', 'Germain, quasi analphabète, vit sa petite vie tranquille. Sa mère s''est retrouvée enceinte de lui sans l''avoir voulu, il n''est pas cultivé, il est resté "en friche". Un jour, il fait la connaissance d''une très vieille dame...', 'Germain, quasi analphabète, vit sa petite vie tranquille. Sa mère s''est retrouvée enceinte de lui sans l''avoir voulu, il n''est pas cultivé, il est resté "en friche". Un jour, il fait la connaissance d''une très vieille dame...', '01:22:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19108806', 'http://fr.web.img5.acsta.net/medias/nmedia/18/77/47/18/19445636.jpg'),
(807, 177038, 'La Fête des voisins', '2010-05-26', 'A l''occasion de la Fête des Voisins, Pierrot un jeune gardien d''immeuble, concocte dans la cour un apéro de dernière minute avec buffet, ballons et banderole...', 'A l''occasion de la Fête des Voisins, Pierrot un jeune gardien d''immeuble, concocte dans la cour un apéro de dernière minute avec buffet, ballons et banderole...', '01:25:00', 1.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19069342', 'http://fr.web.img5.acsta.net/medias/nmedia/18/76/84/97/19447444.jpg'),
