(809, 126678, 'Prince of Persia : les sables du temps', '2010-05-26', 'Dastan, un jeune prince de la Perse du VIe siècle va devoir unir ses forces à celles de la belle et courageuse princesse Tamina pour empêcher un redoutable noble de s''emparer des Sables du Temps...', 'Dastan, un jeune prince de la Perse du VIe siècle va devoir unir ses forces à celles de la belle et courageuse princesse Tamina pour empêcher un redoutable noble de s''emparer des Sables du Temps...', '02:06:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18964593', 'http://fr.web.img1.acsta.net/medias/nmedia/18/67/06/10/19419606.jpg'),
(810, 170858, 'Les Secrets', '2010-05-19', 'Aicha, Radia et leur mère vivent à l''écart du monde dans une maison à l''abandon dans laquelle elles ont déjà travaillé comme domestiques. L''équilibre de leur quotidien vacille le jour où un jeune couple vient s''installer dans la maison.', 'Aicha, Radia et leur mère vivent à l''écart du monde dans une maison à l''abandon dans laquelle elles ont déjà travaillé comme domestiques. L''équilibre de leur quotidien vacille le jour où un jeune couple vient s''installer dans la maison.', '01:30:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18955055', 'http://fr.web.img2.acsta.net/medias/nmedia/18/71/98/88/19264075.jpg'),
(811, 128902, 'Copie conforme', '2010-05-19', 'C''est l''histoire d''une rencontre entre un écrivain anglais et une galeriste française, dans un petit village italien du sud de la Toscane.', 'C''est l''histoire d''une rencontre entre un écrivain anglais et une galeriste française, dans un petit village italien du sud de la Toscane.', '01:46:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19109151', 'http://fr.web.img4.acsta.net/medias/nmedia/18/74/25/25/19439947.jpg'),
(812, 141699, 'Le Plan B', '2010-05-19', 'Après des années de liaisons décevantes, une jeune femme décide de faire un bébé toute seule. Pourtant, le jour même de l''insémination, cette dernière va faire une rencontre qui pourrait tout changer...', 'Après des années de liaisons décevantes, une jeune femme décide de faire un bébé toute seule. Pourtant, le jour même de l''insémination, cette dernière va faire une rencontre qui pourrait tout changer...', '01:47:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18947407', 'http://fr.web.img5.acsta.net/medias/nmedia/18/72/79/88/19449958.jpg'),
(813, 176732, 'StreetDance 3D', '2010-05-19', 'Alors que Carly et son groupe de street dance viennent de se qualifier pour la finale des championnats anglais, le départ de Jay, son partenaire et petit ami, remet tout en cause...', 'Alors que Carly et son groupe de street dance viennent de se qualifier pour la finale des championnats anglais, le départ de Jay, son partenaire et petit ami, remet tout en cause...', '01:38:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19099271', 'http://fr.web.img6.acsta.net/medias/nmedia/18/76/84/81/19434576.jpg'),
(814, 173124, 'Don Giovanni, naissance d''un opéra', '2010-05-12', 'Condamné à 15 ans d''exil pour complot contre l''église, le prêtre Lorenzo da Ponte quitte Venise pour Vienne en 1781. L''Empereur Joseph II, se prenant d''emblée d''amitié pour lui, lui demande d''écrire le livret des "Noces de Figaro" pour Mozart...', 'Condamné à 15 ans d''exil pour complot contre l''église, le prêtre Lorenzo da Ponte quitte Venise pour Vienne en 1781. L''Empereur Joseph II, se prenant d''emblée d''amitié pour lui, lui demande d''écrire le livret des "Noces de Figaro" pour Mozart...', '02:07:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19097632', 'http://fr.web.img2.acsta.net/medias/nmedia/18/77/49/26/19409005.jpg'),
