(821, 146954, 'L''Amour c''est mieux à deux', '2010-05-05', 'Michel rêve d''une rencontre parfaite, totalement due au hasard comme l''ont connu ses parents et ses grands-parents, alors que Vincent applique à la lettre l''adage qui dit que les hommes ont un sexe à la place du cerveau...', 'Michel rêve d''une rencontre parfaite, totalement due au hasard comme l''ont connu ses parents et ses grands-parents, alors que Vincent applique à la lettre l''adage qui dit que les hommes ont un sexe à la place du cerveau...', '01:40:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19069854', 'http://fr.web.img1.acsta.net/medias/nmedia/18/72/02/10/19266947.jpg'),
(822, 138808, 'Tengri, le bleu du ciel', '2010-04-28', 'Une histoire d''amour nomade au coeur de l''Asie Centrale d''aujourd''hui, parmi les décombres du soviétisme et en pleine renaissance des nationalités. Une jeune fille kirghize et un pécheur kazakh tentent chacun d''échapper à une histoire sans issue...', 'Une histoire d''amour nomade au coeur de l''Asie Centrale d''aujourd''hui, parmi les décombres du soviétisme et en pleine renaissance des nationalités. Une jeune fille kirghize et un pécheur kazakh tentent chacun d''échapper à une histoire sans issue...', '01:36:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19096176', 'http://fr.web.img1.acsta.net/medias/nmedia/18/76/83/93/19316468.jpg'),
