(855, 111727, 'The Good Heart', '2010-03-17', 'Jacques, patron de bar, décide de prendre sous son aile Lucas, un jeune SDF. Sachant que ses jours sont comptés, Jacques, qui a été victime de plusieurs crises cardiaques, demande à Lucas de s''occuper de l''établissement.', 'Jacques, patron de bar, décide de prendre sous son aile Lucas, un jeune SDF. Sachant que ses jours sont comptés, Jacques, qui a été victime de plusieurs crises cardiaques, demande à Lucas de s''occuper de l''établissement.', '01:35:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18951732', 'http://fr.web.img6.acsta.net/medias/nmedia/18/71/98/98/19248034.jpg'),
(856, 123270, 'Nous trois', '2010-03-17', 'Nous sommes en 1972 et Sébastien, 10 ans ½, enfant sensible et débordant d''imagination, perçoit de plein fouet les frustrations, et la solitude intérieure de sa mère en manque d''amour.\r\nUn soir, en lisant un magazine, il a une révélation...', 'Nous sommes en 1972 et Sébastien, 10 ans ½, enfant sensible et débordant d''imagination, perçoit de plein fouet les frustrations, et la solitude intérieure de sa mère en manque d''amour.\r\nUn soir, en lisant un magazine, il a une révélation...', '01:30:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18951757', 'http://fr.web.img3.acsta.net/medias/nmedia/18/74/17/89/19253323.jpg'),
(857, 139378, 'Blanc comme neige', '2010-03-17', 'Maxime a tout pour être heureux. Gérant d''une concession florissante de véhicules hauts de gamme, il est marié à une délicieuse jeune femme et vit dans une confortable villa. Tout bascule le jour où son associé est assassiné par des malfrats...', 'Maxime a tout pour être heureux. Gérant d''une concession florissante de véhicules hauts de gamme, il est marié à une délicieuse jeune femme et vit dans une confortable villa. Tout bascule le jour où son associé est assassiné par des malfrats...', '01:35:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18950543', 'http://fr.web.img4.acsta.net/medias/nmedia/18/69/40/83/19231757.jpg'),
(858, 142114, 'Bus Palladium', '2010-03-17', 'Au milieu des années 80, un groupe de rock, habitué des scènes parisiennes dont le Bus Palladium, évolue en même temps que Lucas et Manu, ses deux leaders charismatiques...', 'Au milieu des années 80, un groupe de rock, habitué des scènes parisiennes dont le Bus Palladium, évolue en même temps que Lucas et Manu, ses deux leaders charismatiques...', '01:40:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18950550', 'http://fr.web.img6.acsta.net/medias/nmedia/18/74/11/47/19238491.jpg'),
(859, 148441, 'L''Arnacoeur', '2010-03-17', 'Votre fille sort avec un sale type ? Votre soeur s''est enlisée dans une relation passionnelle destructrice ? Aujourd''hui, il existe une solution radicale, elle s''appelle Alex. Son métier : briseur de couple professionnel. Sa méthode : la séduction.', 'Votre fille sort avec un sale type ? Votre soeur s''est enlisée dans une relation passionnelle destructrice ? Aujourd''hui, il existe une solution radicale, elle s''appelle Alex. Son métier : briseur de couple professionnel. Sa méthode : la séduction.', '01:45:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18951660', 'http://fr.web.img1.acsta.net/medias/nmedia/18/72/58/93/19256845.jpg'),
(860, 116484, 'Chloe', '2010-03-10', 'Une femme pensant que son mari est infidèle décide d''embaucher une escort girl afin de prendre son époux en flagrant délit d''adultère...', 'Une femme pensant que son mari est infidèle décide d''embaucher une escort girl afin de prendre son époux en flagrant délit d''adultère...', '01:39:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18949782', 'http://fr.web.img6.acsta.net/medias/nmedia/18/73/85/43/19219894.jpg'),
(861, 138826, 'Fleur du désert', '2010-03-10', 'L''histoire vraie de Waris Dirie, de son enfance en Somalie à sa carrière de top model et son combat contre l''excision.', 'L''histoire vraie de Waris Dirie, de son enfance en Somalie à sa carrière de top model et son combat contre l''excision.', '02:00:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18949210', 'http://fr.web.img2.acsta.net/medias/nmedia/18/67/29/04/19244441.jpg'),
(862, 131751, 'Le Guerrier silencieux, Valhalla Rising', '2010-03-10', 'One-Eye, un guerrier muet et sauvage, a été le prisonnier de Barde, un redoutable chef de clan. Grâce à l''aide d''un enfant, Are, il parvient à tuer son geôlier et ensemble ils s''échappent, s''embarquant pour un voyage au coeur des ténèbres...', 'One-Eye, un guerrier muet et sauvage, a été le prisonnier de Barde, un redoutable chef de clan. Grâce à l''aide d''un enfant, Are, il parvient à tuer son geôlier et ensemble ils s''échappent, s''embarquant pour un voyage au coeur des ténèbres...', '01:30:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18920115', 'http://fr.web.img5.acsta.net/medias/nmedia/18/66/96/15/19214613.jpg'),
(863, 143767, 'Sans laisser de traces', '2010-03-10', 'A bientôt 40 ans, Etienne, sur le point de prendre la présidence de son groupe, veut soulager sa conscience d''une injustice qu''il a commise au début de sa carrière et qui, précisément, l''a lancée...', 'A bientôt 40 ans, Etienne, sur le point de prendre la présidence de son groupe, veut soulager sa conscience d''une injustice qu''il a commise au début de sa carrière et qui, précisément, l''a lancée...', '01:35:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18945030', 'http://fr.web.img1.acsta.net/medias/nmedia/18/73/91/76/19257467.jpg'),
(864, 137311, 'Le Rêve italien', '2010-03-10', 'Dans le Rome de 1968, un jeune policier passionné de cinéma accepte d''infiltrer les rangs des étudiants révolutionnaires. Il tombe alors amoureux de Laura, jeune étudiante idéaliste...', 'Dans le Rome de 1968, un jeune policier passionné de cinéma accepte d''infiltrer les rangs des étudiants révolutionnaires. Il tombe alors amoureux de Laura, jeune étudiante idéaliste...', '01:41:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18952899', 'http://fr.web.img1.acsta.net/medias/nmedia/18/74/10/15/19246235.jpg'),
(865, 136356, 'Les Chèvres du Pentagone', '2010-03-10', 'Bob Wilton, un journaliste désespéré fait l''heureuse rencontre de Lyn Cassady, un soldat aux pouvoirs paranormaux combattant le terrorisme. Ils se rendent ensemble en Irak ou ils rencontrent Bill Django, le fondateur de l''unité, et Larry Hooper...', 'Bob Wilton, un journaliste désespéré fait l''heureuse rencontre de Lyn Cassady, un soldat aux pouvoirs paranormaux combattant le terrorisme. Ils se rendent ensemble en Irak ou ils rencontrent Bill Django, le fondateur de l''unité, et Larry Hooper...', '01:30:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18937640', 'http://fr.web.img6.acsta.net/medias/nmedia/18/73/11/43/19207917.jpg'),
(866, 142306, 'Pièce montée', '2010-03-10', 'Bérengère et Vincent se marient dans le respect des traditions bourgeoises. Selon la coutume, familles et amis se réunissent à la campagne par une belle journée de printemps. Journée joyeuse pour certains, douloureuse pour d''autres...', 'Bérengère et Vincent se marient dans le respect des traditions bourgeoises. Selon la coutume, familles et amis se réunissent à la campagne par une belle journée de printemps. Journée joyeuse pour certains, douloureuse pour d''autres...', '01:33:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18954041', 'http://fr.web.img1.acsta.net/medias/nmedia/18/73/86/88/19219774.jpg'),
(867, 177208, 'Les Convois de la honte', '2010-03-10', 'Comment la SNCF a organisé et transporté les prisonniers notamment juifs de France en Allemagne, ainsi que les actes de résistance entrepris par des cheminots. De nombreuses scènes impressionnantes ont été reconstituées...', 'Comment la SNCF a organisé et transporté les prisonniers notamment juifs de France en Allemagne, ainsi que les actes de résistance entrepris par des cheminots. De nombreuses scènes impressionnantes ont été reconstituées...', '01:44:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18952444', 'http://fr.web.img2.acsta.net/medias/nmedia/18/73/92/40/19252016.jpg'),
(868, 129166, 'La Rafle', '2010-03-10', 'Un film sur la rafle du Vel'' d''Hiv'', dont furent victimes plus de 13 000 juifs français, parmi lesquels de nombreux enfants, les 16 et 17 juillet 1942.', 'Un film sur la rafle du Vel'' d''Hiv'', dont furent victimes plus de 13 000 juifs français, parmi lesquels de nombreux enfants, les 16 et 17 juillet 1942.', '01:55:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18947453', 'http://fr.web.img3.acsta.net/medias/nmedia/18/70/61/48/19242914.jpg'),
(869, 127947, 'Nine', '2010-03-03', 'Guido Contini est le plus grand réalisateur de son époque. Vénéré par les critiques et adulé par le public, il n''a qu''un seul point faible : les jolies femmes...', 'Guido Contini est le plus grand réalisateur de son époque. Vénéré par les critiques et adulé par le public, il n''a qu''un seul point faible : les jolies femmes...', '01:58:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18947593', 'http://fr.web.img2.acsta.net/medias/nmedia/18/72/92/57/19222960.jpg'),
(870, 137566, 'L''Arbre et la forêt', '2010-03-03', 'Depuis près de soixante ans, Frédérick cultive un secret. Autour de lui, seuls sa femme et son fils aîné savent la vérité sur son histoire. La mort de ce dernier le conduit à révéler enfin à ses proches ce qu''il n''avait jamais pu dire...', 'Depuis près de soixante ans, Frédérick cultive un secret. Autour de lui, seuls sa femme et son fils aîné savent la vérité sur son histoire. La mort de ce dernier le conduit à révéler enfin à ses proches ce qu''il n''avait jamais pu dire...', '01:37:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18950541', 'http://fr.web.img2.acsta.net/medias/nmedia/18/74/18/83/19251725.jpg'),
(871, 176770, 'Les Marais criminels', '2010-03-03', 'La cavale de deux jeunes femmes que tout oppose dans la vie : l''une est une danseuse strip-teaseuse, qui règne dans l''univers de son cabaret parisien et qui rêve de s''inscrire au conservatoire de danse, l''autre une serveuse en quête d''emplois...', 'La cavale de deux jeunes femmes que tout oppose dans la vie : l''une est une danseuse strip-teaseuse, qui règne dans l''univers de son cabaret parisien et qui rêve de s''inscrire au conservatoire de danse, l''autre une serveuse en quête d''emplois...', '01:26:00', 1.3, '', 'http://fr.web.img6.acsta.net/medias/nmedia/18/74/19/57/19244428.jpg'),
(872, 138239, 'Crazy Heart', '2010-03-03', 'L''unique chance d''un chanteur de country alcoolique pour relancer sa carrière et retrouver goût à la vie se trouve au travers de sa relation avec une femme journaliste...', 'L''unique chance d''un chanteur de country alcoolique pour relancer sa carrière et retrouver goût à la vie se trouve au travers de sa relation avec une femme journaliste...', '01:51:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18947273', 'http://fr.web.img5.acsta.net/medias/nmedia/18/73/39/26/19200864.jpg'),
(873, 138822, 'Thelma, Louise et Chantal', '2010-03-03', 'Chantal, Gabrielle et Nelly se rendent au mariage d''un ex. Au cours de cette virée pleine de péripéties, les trois femmes partageront coups de coeur, coups de gueule et coups de blues de la cinquantaine, tour à tour drôles, fragiles et émouvants.', 'Chantal, Gabrielle et Nelly se rendent au mariage d''un ex. Au cours de cette virée pleine de péripéties, les trois femmes partageront coups de coeur, coups de gueule et coups de blues de la cinquantaine, tour à tour drôles, fragiles et émouvants.', '01:30:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18943422', 'http://fr.web.img2.acsta.net/medias/nmedia/18/67/28/14/19240931.jpg'),
(874, 132242, 'Precious', '2010-03-03', 'Lorsqu''à 16 ans, Precious apprend à lire et à écrire dans une école alternative, un monde nouveau s''ouvre à elle. Un monde où elle peut enfin parler, raconter ce qui l''étouffe. Un monde où toutes les filles peuvent devenir belles, indépendantes...', 'Lorsqu''à 16 ans, Precious apprend à lire et à écrire dans une école alternative, un monde nouveau s''ouvre à elle. Un monde où elle peut enfin parler, raconter ce qui l''étouffe. Un monde où toutes les filles peuvent devenir belles, indépendantes...', '01:49:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18947706', 'http://fr.web.img5.acsta.net/medias/nmedia/18/73/22/91/19238382.jpg'),
(875, 132406, 'The Ghost Writer', '2010-03-03', 'Alors qu''il est engagé pour finir de rédiger les mémoires d''un ancien Premier Ministre britannique, un écrivain va découvrir des secrets qui vont mettre sa propre vie en danger.', 'Alors qu''il est engagé pour finir de rédiger les mémoires d''un ancien Premier Ministre britannique, un écrivain va découvrir des secrets qui vont mettre sa propre vie en danger.', '02:08:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18945885', 'http://fr.web.img1.acsta.net/medias/nmedia/18/73/96/74/19238405.jpg'),
(876, 134179, 'Une éducation', '2010-02-24', '1961, Angleterre. Jenny a seize ans. Élève brillante, elle se prépare à intégrer Oxford. Sa rencontre avec un homme deux fois plus âgé qu''elle va tout remettre en cause.', '1961, Angleterre. Jenny a seize ans. Élève brillante, elle se prépare à intégrer Oxford. Sa rencontre avec un homme deux fois plus âgé qu''elle va tout remettre en cause.', '01:35:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18947217', 'http://fr.web.img2.acsta.net/medias/nmedia/18/71/78/95/19214225.jpg'),
