(878, 140300, 'A Single Man', '2010-02-24', 'Professeur britannique à l''Université de Californie, George tente de se remettre de la mort accidentelle de Jim, son jeune compagnon. Son amie Charley, une femme qui s''interroge elle-même sur son avenir, tente de le consoler...', 'Professeur britannique à l''Université de Californie, George tente de se remettre de la mort accidentelle de Jim, son jeune compagnon. Son amie Charley, une femme qui s''interroge elle-même sur son avenir, tente de le consoler...', '01:40:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18949465', 'http://fr.web.img1.acsta.net/medias/nmedia/18/73/33/14/19216325.jpg'),
