(880, 132039, 'Shutter Island', '2010-02-24', '1954. Teddy Daniels et Chuck Aule enquêtent sur la disparition d''une patiente échappée d''un hôpital psychiatrique à sécurité maximale. L''hôpital en question est basé sur Shutter Island, une île située à environ une heure au large de Boston.', '1954. Teddy Daniels et Chuck Aule enquêtent sur la disparition d''une patiente échappée d''un hôpital psychiatrique à sécurité maximale. L''hôpital en question est basé sur Shutter Island, une île située à environ une heure au large de Boston.', '02:17:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18916868', 'http://fr.web.img4.acsta.net/medias/nmedia/18/69/96/84/19151192.jpg'),
(881, 143416, 'Ensemble c''est trop', '2010-02-17', 'Clémentine et Sébastien, jeunes parents débordés, pris en étau entre leur travail et leurs enfants, voient Marie-France, la mère de Sébastien, s''installer chez eux. Elle a découvert que son mari, Henri, la trompait et que sa maîtresse attendait un enfant.', 'Clémentine et Sébastien, jeunes parents débordés, pris en étau entre leur travail et leurs enfants, voient Marie-France, la mère de Sébastien, s''installer chez eux. Elle a découvert que son mari, Henri, la trompait et que sa maîtresse attendait un enfant.', '01:36:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18942147', 'http://fr.web.img2.acsta.net/medias/nmedia/18/73/77/23/19216672.jpg'),
(882, 136018, 'Hors de contrôle', '2010-02-17', 'La fille activiste d''un inspecteur de police est assassinée. Il mène l''enquête et découvre que le meurtre de sa fille est lié à une affaire de corruption au sein même de la ville...', 'La fille activiste d''un inspecteur de police est assassinée. Il mène l''enquête et découvre que le meurtre de sa fille est lié à une affaire de corruption au sein même de la ville...', '01:57:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18946494', 'http://fr.web.img1.acsta.net/medias/nmedia/18/70/45/25/19218996.jpg'),
(883, 135259, 'From Paris With Love', '2010-02-17', 'From Paris With Love'' relate la rencontre explosive entre un jeune ?insider'' et un agent secret américain aux méthodes musclées, embarqués tous les deux dans une mission à haut risque à travers les rues de Paris.', 'From Paris With Love'' relate la rencontre explosive entre un jeune ?insider'' et un agent secret américain aux méthodes musclées, embarqués tous les deux dans une mission à haut risque à travers les rues de Paris.', '01:33:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18945044', 'http://fr.web.img6.acsta.net/medias/nmedia/18/71/25/27/19207033.jpg'),
(884, 114976, 'Fantastic Mr. Fox', '2010-02-17', 'Trois fermiers doivent faire face à un renard très futé à la recherche de nourriture pour sa famille...', 'Trois fermiers doivent faire face à un renard très futé à la recherche de nourriture pour sa famille...', '01:28:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18942560', 'http://fr.web.img6.acsta.net/medias/nmedia/18/71/80/31/19225583.jpg'),
