(887, 56899, 'Lovely Bones', '2010-02-10', 'L''histoire d''une jeune fille assassinée qui, depuis l''au-delà, observe sa famille sous le choc de sa disparition et surveille son meurtrier, ainsi que la progression de l''enquête...', 'L''histoire d''une jeune fille assassinée qui, depuis l''au-delà, observe sa famille sous le choc de sa disparition et surveille son meurtrier, ainsi que la progression de l''enquête...', '02:08:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18925127', 'http://fr.web.img4.acsta.net/medias/nmedia/18/73/95/40/19245064.jpg'),
(888, 136392, 'L''Autre Dumas', '2010-02-10', 'Février 1848, Alexandre Dumas est à son apogée. Il s''est retiré dans un château où il travaille avec son collaborateur Auguste Maquet. Depuis dix ans, ce dernier est resté dans l''ombre du grand homme et n''a jamais contesté sa suprématie...', 'Février 1848, Alexandre Dumas est à son apogée. Il s''est retiré dans un château où il travaille avec son collaborateur Auguste Maquet. Depuis dix ans, ce dernier est resté dans l''ombre du grand homme et n''a jamais contesté sa suprématie...', '01:45:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18941850', 'http://fr.web.img4.acsta.net/medias/nmedia/18/73/76/14/19221367.jpg'),
(889, 110815, 'Wolfman', '2010-02-10', 'Un homme, de retour dans son Angleterre natale, se fait mordre par un loup-garou. Mi-homme, mi-bête, il est désormais contraint de mener une existence régie par les phases de la lune...', 'Un homme, de retour dans son Angleterre natale, se fait mordre par un loup-garou. Mi-homme, mi-bête, il est désormais contraint de mener une existence régie par les phases de la lune...', '01:39:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18933363', 'http://fr.web.img1.acsta.net/medias/nmedia/18/73/38/81/19212746.jpg'),
