(891, 128105, 'Percy Jackson : le voleur de foudre', '2010-02-10', 'Un jeune homme découvre qu''il est le descendant d''un dieu grec et s''embarque, avec l''aide d''un satyre et de la fille d''Athena, dans une dangereuse aventure pour résoudre une guerre entre dieux. Sur sa route, il devra affronter une horde d''ennemis...', 'Un jeune homme découvre qu''il est le descendant d''un dieu grec et s''embarque, avec l''aide d''un satyre et de la fille d''Athena, dans une dangereuse aventure pour résoudre une guerre entre dieux. Sur sa route, il devra affronter une horde d''ennemis...', '02:02:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18934004', 'http://fr.web.img5.acsta.net/medias/nmedia/18/71/92/68/19225578.jpg'),
