(904, 128955, 'Le Livre d''Eli', '2010-01-20', 'L''histoire d''un homme solitaire qui doit se frayer un chemin à travers les terres dévastées d''une Amérique postapocalyptique, afin de protéger un mystérieux livre sacré détenant la clé pour sauver l''avenir de l''Humanité.', 'L''histoire d''un homme solitaire qui doit se frayer un chemin à travers les terres dévastées d''une Amérique postapocalyptique, afin de protéger un mystérieux livre sacré détenant la clé pour sauver l''avenir de l''Humanité.', '01:49:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18925555', 'http://fr.web.img6.acsta.net/medias/nmedia/18/73/75/37/19214558.jpg'),
(905, 133717, 'Complices', '2010-01-20', 'Dès leur premier regard échangé dans un cybercafé, Vincent et Rebecca se sont aimés. Ils sont jeunes et regardent la vie avec insouciance. Pourtant deux mois plus tard, le corps de Vincent est retrouvé dans le Rhône, sans vie et salement amoché...', 'Dès leur premier regard échangé dans un cybercafé, Vincent et Rebecca se sont aimés. Ils sont jeunes et regardent la vie avec insouciance. Pourtant deux mois plus tard, le corps de Vincent est retrouvé dans le Rhône, sans vie et salement amoché...', '01:33:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18939174', 'http://fr.web.img4.acsta.net/medias/nmedia/18/71/70/89/19211058.jpg'),
