(907, 140335, 'Où sont passés les Morgan ?', '2010-01-20', 'Un jeune couple témoin d''un meurtre se retrouve contraint de quitter New York et d''aller s''exiler dans un centre de protection en plein coeur du Wyoming. Afin que rien ne leur arrive, ils se retrouvent sous surveillance, 24 heures sur 24...', 'Un jeune couple témoin d''un meurtre se retrouve contraint de quitter New York et d''aller s''exiler dans un centre de protection en plein coeur du Wyoming. Afin que rien ne leur arrive, ils se retrouvent sous surveillance, 24 heures sur 24...', '01:43:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18924279', 'http://fr.web.img5.acsta.net/medias/nmedia/18/72/55/24/19204643.jpg'),
