(914, 129694, 'Invictus', '2010-01-13', 'En 1994, l''élection de Mandela marque la fin de l''Apartheid, mais l''Afrique du Sud reste une nation profondément divisée sur le plan racial et économique. Pour unifier le pays et donner à chaque citoyen un motif de fierté, Mandela mise sur le sport.', 'En 1994, l''élection de Mandela marque la fin de l''Apartheid, mais l''Afrique du Sud reste une nation profondément divisée sur le plan racial et économique. Pour unifier le pays et donner à chaque citoyen un motif de fierté, Mandela mise sur le sport.', '02:12:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18934389', 'http://fr.web.img3.acsta.net/medias/nmedia/18/72/82/16/19187639.jpg'),
