(958, 141231, 'Divorces', '2009-10-14', 'Valentine et Alex sont mariés, avocats tous les deux, spécialistes des affaires familiales. Par faute d''un banal adultère, leur couple va voler en éclats. Et la réalité du divorce les rattrape : fini les beaux discours, place à la guerre...', 'Valentine et Alex sont mariés, avocats tous les deux, spécialistes des affaires familiales. Par faute d''un banal adultère, leur couple va voler en éclats. Et la réalité du divorce les rattrape : fini les beaux discours, place à la guerre...', '01:40:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18915813', 'http://fr.web.img6.acsta.net/medias/nmedia/18/72/21/39/19166035.jpg'),
(959, 131016, 'Mission-G', '2009-10-14', 'Le gouvernement a mis au point un programme classé secret défense qui forme des animaux à devenir de parfaits espions. Armés des tous derniers gadgets de haute technologie, des cochons d''Inde hyper entraînés découvrent que le destin du monde est entre leu', 'Le gouvernement a mis au point un programme classé secret défense qui forme des animaux à devenir de parfaits espions. Armés des tous derniers gadgets de haute technologie, des cochons d''Inde hyper entraînés découvrent que le destin du monde est entre leu', '01:29:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18903369', 'http://fr.web.img3.acsta.net/medias/nmedia/18/71/49/79/19165029.jpg'),
(960, 131336, 'Rose & noir', '2009-10-14', 'Au XVIe siècle, un grand couturier français et son équipe sont envoyés en Espagne, alors acquise aux valeurs de l''Inquisition, pour la préparation d''un mariage royal. Un périple qui prendra bientôt l''apparence d''un choc culturel...', 'Au XVIe siècle, un grand couturier français et son équipe sont envoyés en Espagne, alors acquise aux valeurs de l''Inquisition, pour la préparation d''un mariage royal. Un périple qui prendra bientôt l''apparence d''un choc culturel...', '01:37:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18915872', 'http://fr.web.img1.acsta.net/medias/nmedia/18/72/30/15/19166522.jpg'),
(961, 136372, 'Mademoiselle Chambon', '2009-10-14', 'Adaptation du roman d''Eric Holder, autour de l''idylle qui se noue entre une institutrice, Véronique Chambon, et le père d''un de ses élèves, Jean, un maçon.', 'Adaptation du roman d''Eric Holder, autour de l''idylle qui se noue entre une institutrice, Véronique Chambon, et le père d''un de ses élèves, Jean, un maçon.', '01:41:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18916023', 'http://fr.web.img6.acsta.net/medias/nmedia/18/69/18/88/19175118.jpg'),
(962, 128829, 'Fame', '2009-10-07', 'Les histoires d''un groupe d''étudiants de la célèbre "High School of Performing Arts" de New York.', 'Les histoires d''un groupe d''étudiants de la célèbre "High School of Performing Arts" de New York.', '01:45:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18898506', 'http://fr.web.img1.acsta.net/medias/nmedia/18/69/41/90/19151187.jpg'),
(963, 134695, 'Mères et filles', '2009-10-07', '3 femmes, 3 générations. Dans les années 50, Louise a quitté le domicile conjugal alors que ses enfants étaient encore jeunes. Elle n''a plus donné signe de vie. Sa fille est restée dans la petite ville de bord de mer où elle est devenue médecin...', '3 femmes, 3 générations. Dans les années 50, Louise a quitté le domicile conjugal alors que ses enfants étaient encore jeunes. Elle n''a plus donné signe de vie. Sa fille est restée dans la petite ville de bord de mer où elle est devenue médecin...', '01:45:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18917632', 'http://fr.web.img5.acsta.net/medias/nmedia/18/71/89/01/19163695.jpg'),
(964, 129802, 'Le Syndrome du Titanic', '2009-10-07', '" Ce film est davantage un appel à la raison et un acte politique qu''un documentaire sur la crise écologique. D''ailleurs, la "belle nature sauvage" est la grande absente..." (Nicolas Hulot)', '" Ce film est davantage un appel à la raison et un acte politique qu''un documentaire sur la crise écologique. D''ailleurs, la "belle nature sauvage" est la grande absente..." (Nicolas Hulot)', '01:33:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18918516', 'http://fr.web.img5.acsta.net/medias/nmedia/18/72/20/73/19159446.jpg'),
(965, 139043, 'Victor', '2009-10-07', 'Comment un octogénaire esseulé, sur le point d''être abandonné, va faire l''objet d''un élan de solidarité et être adopté.', 'Comment un octogénaire esseulé, sur le point d''être abandonné, va faire l''objet d''un élan de solidarité et être adopté.', '01:35:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18916552', 'http://fr.web.img5.acsta.net/medias/nmedia/18/71/51/60/19169068.jpg'),
(966, 134724, 'Funny People', '2009-10-07', 'Dans le monde du <i>stand-up</i>, un comédien se retrouve dans un état de mort imminente...', 'Dans le monde du <i>stand-up</i>, un comédien se retrouve dans un état de mort imminente...', '02:20:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18918677', 'http://fr.web.img1.acsta.net/medias/nmedia/18/71/80/48/19164070.jpg'),
(967, 129660, 'Le Petit Nicolas', '2009-09-30', 'Nicolas mène une existence paisible, il a des parents qui l''aiment, une bande de chouettes copains, et il n''a envie que ça change. Mais un jour, Nicolas surprend une conversation entre ses parents qui lui laisse penser que sa mère est enceinte...', 'Nicolas mène une existence paisible, il a des parents qui l''aiment, une bande de chouettes copains, et il n''a envie que ça change. Mais un jour, Nicolas surprend une conversation entre ses parents qui lui laisse penser que sa mère est enceinte...', '01:30:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18914012', 'http://fr.web.img6.acsta.net/medias/nmedia/18/68/44/39/19157064.jpg'),
(968, 134567, 'Je suis heureux que ma mère soit vivante', '2009-09-30', 'Notre identité est un vêtement dont notre enfance a dessiné les coutures. La présence de ceux qui nous ont élevés, nos parents, a été fondatrice de ce que nous sommes. Mais que se passe-t-il quand il s''agit d''absence ?', 'Notre identité est un vêtement dont notre enfance a dessiné les coutures. La présence de ceux qui nous ont élevés, nos parents, a été fondatrice de ce que nous sommes. Mais que se passe-t-il quand il s''agit d''absence ?', '01:30:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18914406', 'http://fr.web.img5.acsta.net/medias/nmedia/18/71/29/89/19154475.jpg');
