(969, 128377, '(500) jours ensemble', '2009-09-30', 'Un homme tombe fou amoureux d''une jeune femme qui ne croit pas à l''amour...', 'Un homme tombe fou amoureux d''une jeune femme qui ne croit pas à l''amour...', '01:36:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18913601', 'http://fr.web.img4.acsta.net/medias/nmedia/18/68/74/89/19139318.jpg'),
(970, 131248, 'Au voleur', '2009-09-30', 'Isabelle enseigne, Bruno cambriole. Ensemble, ils commencent à croire qu''ils pourraient être heureux. Le jour où l''étau policier se resserre, il l''entraîne dans sa fuite. Au coeur de la forêt, ils se cachent et s''aiment, hors du temps...', 'Isabelle enseigne, Bruno cambriole. Ensemble, ils commencent à croire qu''ils pourraient être heureux. Le jour où l''étau policier se resserre, il l''entraîne dans sa fuite. Au coeur de la forêt, ils se cachent et s''aiment, hors du temps...', '01:40:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18914840', 'http://fr.web.img1.acsta.net/pictures/14/06/27/10/54/535860.jpg'),
(971, 139621, 'Mary et Max.', '2009-09-30', 'L''amitié entre une petite fille grassouillette de 8 ans et un homme de 44 ans, obèse, atteint de la maldie d''Asperger. Tous deux vivent respectivement à Melbourne et New York.', 'L''amitié entre une petite fille grassouillette de 8 ans et un homme de 44 ans, obèse, atteint de la maldie d''Asperger. Tous deux vivent respectivement à Melbourne et New York.', '01:32:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18893735', 'http://fr.web.img4.acsta.net/medias/nmedia/18/68/27/63/19157079.jpg'),
(972, 51101, 'The Informant !', '2009-09-30', 'Quelle mouche a piqué Mark Whitacre ? Pourquoi un des cadres supérieurs les plus brillants du géant agroalimentaire Archer Daniel Midlands décide-t-il soudain de dénoncer les pratiques de sa société et de devenir le chevalier blanc du consommateur ?', 'Quelle mouche a piqué Mark Whitacre ? Pourquoi un des cadres supérieurs les plus brillants du géant agroalimentaire Archer Daniel Midlands décide-t-il soudain de dénoncer les pratiques de sa société et de devenir le chevalier blanc du consommateur ?', '01:47:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18903509', 'http://fr.web.img1.acsta.net/medias/nmedia/18/68/44/15/19153498.jpg'),
(973, 123021, 'Démineurs', '2009-09-23', 'Les exploits d''une unité de déminage américaine de nos jours à Bagdad. Forcés de jouer à un dangereux jeu de piste, ils se retrouvent au coeur d''une ville où chaque immeuble peut cacher un sniper et où chaque objet peut être piégé...', 'Les exploits d''une unité de déminage américaine de nos jours à Bagdad. Forcés de jouer à un dangereux jeu de piste, ils se retrouvent au coeur d''une ville où chaque immeuble peut cacher un sniper et où chaque objet peut être piégé...', '02:04:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18914302', 'http://fr.web.img2.acsta.net/medias/nmedia/18/70/49/71/19145564.jpg'),
(974, 135813, 'Hôtel Woodstock', '2009-09-23', 'Durant le turbulent été 69, un jeune homme travaille dans le motel de ses parents dans les Catskills, et va malgré lui mettre en branle ce qui deviendra Woodstock, le concert qui donna la définition de toute une génération...', 'Durant le turbulent été 69, un jeune homme travaille dans le motel de ses parents dans les Catskills, et va malgré lui mettre en branle ce qui deviendra Woodstock, le concert qui donna la définition de toute une génération...', '02:00:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18913235', 'http://fr.web.img6.acsta.net/medias/nmedia/18/70/19/12/19151198.jpg'),
(975, 129019, 'La Proposition', '2009-09-23', 'Une patronne exigeante est forcée de quitter les Etats-Unis pour retourner dans son pays d''origine : le Canada.  Elle accepte par la force des choses de contracter un mariage blanc avec son jeune assistant, dans le but de ne pas partir...', 'Une patronne exigeante est forcée de quitter les Etats-Unis pour retourner dans son pays d''origine : le Canada.  Elle accepte par la force des choses de contracter un mariage blanc avec son jeune assistant, dans le but de ne pas partir...', '01:48:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18911576', 'http://fr.web.img1.acsta.net/medias/nmedia/18/68/51/20/19095268.jpg'),
(976, 109410, 'Le Dernier pour la route', '2009-09-23', 'Hervé, patron d''une agence de presse, décide d''en finir avec l''alcool. Loin de tout et grâce aux autres, il parvient à combattre sa dépendance, en repartant vers une nouvelle vie...', 'Hervé, patron d''une agence de presse, décide d''en finir avec l''alcool. Loin de tout et grâce aux autres, il parvient à combattre sa dépendance, en repartant vers une nouvelle vie...', '01:47:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18906181', 'http://fr.web.img6.acsta.net/medias/nmedia/18/68/84/34/19142809.jpg'),
(977, 136105, 'London River', '2009-09-23', 'La rencontre d''Ousmane et Elisabeth, un musulman et une chrétienne, tous deux parents de jeunes victimes des attentats de Londres en 2005, et qui se rendent compte que leurs enfants vivaient ensemble.', 'La rencontre d''Ousmane et Elisabeth, un musulman et une chrétienne, tous deux parents de jeunes victimes des attentats de Londres en 2005, et qui se rendent compte que leurs enfants vivaient ensemble.', '01:28:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18915518', 'http://fr.web.img1.acsta.net/medias/nmedia/18/70/08/39/19086683.jpg'),
(978, 111721, 'L''Affaire Farewell', '2009-09-23', 'Moscou, au début des années 80, en pleine Guerre Froide. Sergueï Grigoriev, colonel du KGB déçu du régime de son pays, décide de faire tomber le système. Il prend contact avec un jeune ingénieur français en poste à Moscou, Pierre Froment...', 'Moscou, au début des années 80, en pleine Guerre Froide. Sergueï Grigoriev, colonel du KGB déçu du régime de son pays, décide de faire tomber le système. Il prend contact avec un jeune ingénieur français en poste à Moscou, Pierre Froment...', '01:53:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18902424', 'http://fr.web.img2.acsta.net/medias/nmedia/18/71/12/73/19133409.jpg'),
(979, 132302, 'Julie et Julia', '2009-09-16', 'Une secrétaire frustrée entreprend de réaliser, en un an, les 524 recettes de la célèbre cuisinière Julia Child !', 'Une secrétaire frustrée entreprend de réaliser, en un an, les 524 recettes de la célèbre cuisinière Julia Child !', '02:03:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18905377', 'http://fr.web.img4.acsta.net/medias/nmedia/18/68/31/75/19142936.jpg'),
(980, 144659, 'Fish Tank', '2009-09-16', 'A 15 ans, Mia est une adolescente rebelle avec une unique passion : la danse hip hop. Un jour d''été, sa mère rentre à la maison avec un nouvel amant, Connor, qui s''installe chez elles. Est-ce enfin une promesse de bonheur ou bien un leurre ?', 'A 15 ans, Mia est une adolescente rebelle avec une unique passion : la danse hip hop. Un jour d''été, sa mère rentre à la maison avec un nouvel amant, Connor, qui s''installe chez elles. Est-ce enfin une promesse de bonheur ou bien un leurre ?', '02:02:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18914742', 'http://fr.web.img1.acsta.net/medias/nmedia/18/70/33/47/19153496.jpg'),
(981, 135212, 'L''Armée du crime', '2009-09-16', 'En février 44, les visages de Rayman, Elek, Bocsov, Fontanot Alfonso, Manouchian, suppliciés après un procès expéditif, sont placardés sur les murs de toutes les villes françaises, dans une ultime opération de propagande xénophobe et antisémite...', 'En février 44, les visages de Rayman, Elek, Bocsov, Fontanot Alfonso, Manouchian, suppliciés après un procès expéditif, sont placardés sur les murs de toutes les villes françaises, dans une ultime opération de propagande xénophobe et antisémite...', '02:19:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18888673', 'http://fr.web.img4.acsta.net/medias/nmedia/18/66/25/77/19096724.jpg'),
(982, 140331, 'Rien de personnel', '2009-09-16', 'La société Muller organise une réception à l''occasion du lancement d''un nouveau produit. Au cours de la soirée, on découvre qu''il s''agit en réalité d''un exercice de coaching pour les cadres de l''entreprise.', 'La société Muller organise une réception à l''occasion du lancement d''un nouveau produit. Au cours de la soirée, on découvre qu''il s''agit en réalité d''un exercice de coaching pour les cadres de l''entreprise.', '01:31:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18905621', 'http://fr.web.img1.acsta.net/medias/nmedia/18/69/18/93/19143158.jpg'),
(983, 143026, 'District 9', '2009-09-16', 'Il y a 28 ans, des extraterrestres entrèrent en contact avec la Terre... Ces "visiteurs" étaient des réfugiés et furent installés dans le District 9, en Afrique du Sud, pendant que les nations du monde se querellaient pour savoir quoi en faire...', 'Il y a 28 ans, des extraterrestres entrèrent en contact avec la Terre... Ces "visiteurs" étaient des réfugiés et furent installés dans le District 9, en Afrique du Sud, pendant que les nations du monde se querellaient pour savoir quoi en faire...', '01:50:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18908098', 'http://fr.web.img5.acsta.net/medias/nmedia/18/70/45/12/19149593.jpg'),
(984, 137187, '36 vues du Pic Saint-Loup', '2009-09-09', 'Après la mort du propriétaire, les membres d''un troupe de cirque font appel à la fille de celui-ci, Kate, qui avait quitté l''aventure il y a une quinzaine d''années. Elle accepte de revenir, bientôt rejointe par Vittorio, un Italien...', 'Après la mort du propriétaire, les membres d''un troupe de cirque font appel à la fille de celui-ci, Kate, qui avait quitté l''aventure il y a une quinzaine d''années. Elle accepte de revenir, bientôt rejointe par Vittorio, un Italien...', '01:24:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18913611', 'http://fr.web.img1.acsta.net/medias/nmedia/18/70/92/08/19154442.jpg'),
(985, 130304, 'Ma vie pour la tienne', '2009-09-09', 'Une ancienne avocate reprend du service pour plaider sa cause et celle de son mari lorsque sa fille de 11 ans les attaque en justice pour demander son émancipation...', 'Une ancienne avocate reprend du service pour plaider sa cause et celle de son mari lorsque sa fille de 11 ans les attaque en justice pour demander son émancipation...', '01:47:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18906342', 'http://fr.web.img6.acsta.net/medias/nmedia/18/70/29/69/19142917.jpg'),
(986, 145883, 'Â Deriva', '2009-09-09', 'Une jeune fille, âgée de 14 ans, voit sa vie bouleversée par la découverte des infidélités de son père, alors qu''elle s''éveille elle-même à la sexualité.', 'Une jeune fille, âgée de 14 ans, voit sa vie bouleversée par la découverte des infidélités de son père, alors qu''elle s''éveille elle-même à la sexualité.', '01:43:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18890497', 'http://fr.web.img4.acsta.net/medias/nmedia/18/70/58/01/19155287.jpg'),
(987, 142560, 'A propos d''Elly', '2009-09-09', 'Un groupe d''amis étudiants passe des vacances dans une vaste demeure au bord de la mer Caspienne. Sepideh, qui s''est occupée de l''organisation, a décidé d''inviter Elly, en espérant que celle-ci ne soit pas indifférente au charme de son ami Ahmad...', 'Un groupe d''amis étudiants passe des vacances dans une vaste demeure au bord de la mer Caspienne. Sepideh, qui s''est occupée de l''organisation, a décidé d''inviter Elly, en espérant que celle-ci ne soit pas indifférente au charme de son ami Ahmad...', '01:59:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18910470', 'http://fr.web.img1.acsta.net/medias/nmedia/18/69/70/03/19769041.jpg'),
(988, 127660, 'Le Coach', '2009-09-09', 'Un coacheur professionnel se sert de son client, un cadre d''entreprise, pour décrocher un contrat important...', 'Un coacheur professionnel se sert de son client, un cadre d''entreprise, pour décrocher un contrat important...', '01:32:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18903507', 'http://fr.web.img5.acsta.net/medias/nmedia/18/70/30/66/19133063.jpg'),
(989, 128866, 'Ultimate Game', '2009-09-09', 'Dans un futur envahi par la nano-technologie, un jeu de simulation virtuelle qui commande d''autres êtres humains a été créé. Le "personnage" principal de ce jeu se bat pour retrouver son identité et détruire entièrement ce système.', 'Dans un futur envahi par la nano-technologie, un jeu de simulation virtuelle qui commande d''autres êtres humains a été créé. Le "personnage" principal de ce jeu se bat pour retrouver son identité et détruire entièrement ce système.', '01:35:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18903576', 'http://fr.web.img5.acsta.net/medias/nmedia/18/68/12/47/19142951.jpg'),
(990, 141376, 'Bienvenue à Cadavres-Les-Bains', '2009-09-02', 'Ancien inspecteur de police, Brenner doit élucider le mystère d''une curieuse auberge de campagne, truffée de pièges mortels. Mais la maîtresse des lieux lui tourne tant la tête qu''il pourra s''estimer heureux si celle-ci reste accrochée à ses épaules.', 'Ancien inspecteur de police, Brenner doit élucider le mystère d''une curieuse auberge de campagne, truffée de pièges mortels. Mais la maîtresse des lieux lui tourne tant la tête qu''il pourra s''estimer heureux si celle-ci reste accrochée à ses épaules.', '01:57:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18904289', 'http://fr.web.img5.acsta.net/medias/nmedia/18/70/48/75/19146824.jpg'),
(991, 137722, 'Non ma fille, tu n''iras pas danser', '2009-09-02', 'Depuis qu''elle s''est séparée de Nigel, Léna traverse la vie comme elle peut avec ses deux enfants. Elle triomphe avec vaillance des obstacles semés sur leur route. Mais il lui reste à affronter le pire : l''implacable bonté de sa famille...', 'Depuis qu''elle s''est séparée de Nigel, Léna traverse la vie comme elle peut avec ses deux enfants. Elle triomphe avec vaillance des obstacles semés sur leur route. Mais il lui reste à affronter le pire : l''implacable bonté de sa famille...', '01:45:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18906443', 'http://fr.web.img1.acsta.net/medias/nmedia/18/71/71/26/19159667.jpg'),
