(1028, 133546, 'Un mariage de rêve', '2009-05-06', 'Fraîchement divorcée, Larita Huntington, une séduisante Américaine, décide de partir dans le Sud de la France. Là, elle s''éprend d''un Britannique, John Whittaker, qu''elle épouse aussitôt. Tous deux repartent en Grande-Bretagne...', 'Fraîchement divorcée, Larita Huntington, une séduisante Américaine, décide de partir dans le Sud de la France. Là, elle s''éprend d''un Britannique, John Whittaker, qu''elle épouse aussitôt. Tous deux repartent en Grande-Bretagne...', '01:36:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18875728', 'http://fr.web.img5.acsta.net/medias/nmedia/18/68/72/33/19084621.jpg'),
(1029, 134701, 'Je l''aimais', '2009-05-06', 'Une jeune femme découvre la personnalité de son beau-père suite à une rupture amoureuse...', 'Une jeune femme découvre la personnalité de son beau-père suite à une rupture amoureuse...', '01:52:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18872622', 'http://fr.web.img4.acsta.net/medias/nmedia/18/69/39/46/19073020.jpg'),
(1030, 114887, 'Star Trek', '2009-05-06', 'L''adaptation cinématographique de la série "Star Trek". Une vision revue et corrigée de la plus grande aventure interstellaire de tous les temps, avec un jeune équipage parti explorer des lieux que personne n''a jamais visités avant lui.', 'L''adaptation cinématographique de la série "Star Trek". Une vision revue et corrigée de la plus grande aventure interstellaire de tous les temps, avec un jeune équipage parti explorer des lieux que personne n''a jamais visités avant lui.', '02:08:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18871971', 'http://fr.web.img6.acsta.net/medias/nmedia/18/62/88/99/19081675.jpg'),
(1031, 134316, 'Good Morning England', '2009-05-06', 'Carl s''est fait renvoyer du lycée, et sa mère a décidé qu''il irait réfléchir à son avenir auprès de son parrain. Il se trouve que celui-ci est le patron de Radio Rock, une radio pirate qui émet depuis un bateau en mer du Nord...', 'Carl s''est fait renvoyer du lycée, et sa mère a décidé qu''il irait réfléchir à son avenir auprès de son parrain. Il se trouve que celui-ci est le patron de Radio Rock, une radio pirate qui émet depuis un bateau en mer du Nord...', '02:15:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18874442', 'http://fr.web.img1.acsta.net/medias/nmedia/18/67/99/79/19064391.jpg'),
(1032, 133038, 'Incognito', '2009-04-29', 'Un chanteur devient une star grâce aux textes d''un ami qu''il croit mort...', 'Un chanteur devient une star grâce aux textes d''un ami qu''il croit mort...', '01:34:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18873588', 'http://fr.web.img2.acsta.net/medias/nmedia/18/67/44/77/19073170.jpg'),
(1033, 125145, 'Le Missionnaire', '2009-04-29', 'Un ancien détenu endosse la soutane de son frère prêtre, histoire de se faire oublier, et devient curé dans un village du sud de la France.', 'Un ancien détenu endosse la soutane de son frère prêtre, histoire de se faire oublier, et devient curé dans un village du sud de la France.', '01:30:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18862393', 'http://fr.web.img2.acsta.net/medias/nmedia/18/68/00/43/19085559.jpg'),
(1034, 130884, 'Romaine par moins 30', '2009-04-29', 'Romaine a 30 ans. Justin, son copain, décide de l''emmener à Noël dans le Grand Nord québécois pour y mener une nouvelle vie. Mais au-dessus de l''Atlantique, Romaine comprend que l''avion va s''écraser...', 'Romaine a 30 ans. Justin, son copain, décide de l''emmener à Noël dans le Grand Nord québécois pour y mener une nouvelle vie. Mais au-dessus de l''Atlantique, Romaine comprend que l''avion va s''écraser...', '01:25:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18877543', 'http://fr.web.img1.acsta.net/medias/nmedia/18/68/81/06/19068021.jpg'),
(1035, 127190, 'Soeur Sourire', '2009-04-29', 'Soeur Sourire est devenue un mythe international avec ses deux millions d''albums vendus en 1963 et cette chanson "Dominique", qui a plané au-dessus des Beatles ou d''Elvis Presley dans les hit-parades du monde entier. Mais qui était-elle réellement ?', 'Soeur Sourire est devenue un mythe international avec ses deux millions d''albums vendus en 1963 et cette chanson "Dominique", qui a plané au-dessus des Beatles ou d''Elvis Presley dans les hit-parades du monde entier. Mais qui était-elle réellement ?', '02:00:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18873644', 'http://fr.web.img3.acsta.net/medias/nmedia/18/64/13/27/19070312.jpg'),
(1036, 111544, 'X-Men Origins: Wolverine', '2009-04-29', 'Ce film nous fait découvrir les origines du plus rebelle des héros Marvel et son histoire avant les événements de la trilogie "X-Men". Hugh Jackman reprend son rôle fétiche de héros au pouvoir de régénération convoité par l''armée...', 'Ce film nous fait découvrir les origines du plus rebelle des héros Marvel et son histoire avant les événements de la trilogie "X-Men". Hugh Jackman reprend son rôle fétiche de héros au pouvoir de régénération convoité par l''armée...', '01:45:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18852662', 'http://fr.web.img1.acsta.net/medias/nmedia/18/68/62/70/19085550.jpg'),
(1037, 133360, 'Le Secret de Lily Owens', '2009-04-22', 'En 1964, Lily, 14 ans, vit en Caroline-du-Sud avec son père, un homme brutal, et Rosaleen, sa nourrice noire. Le décès de sa mère dans d''obscures conditions la hante. Lorsque Rosaleen se fait molester par des Blancs, Lily décide de fuir avec elle...', 'En 1964, Lily, 14 ans, vit en Caroline-du-Sud avec son père, un homme brutal, et Rosaleen, sa nourrice noire. Le décès de sa mère dans d''obscures conditions la hante. Lorsque Rosaleen se fait molester par des Blancs, Lily décide de fuir avec elle...', '01:50:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18877348', 'http://fr.web.img4.acsta.net/medias/nmedia/18/67/00/62/19054061.jpg'),
(1038, 138209, '17 ans encore', '2009-04-22', 'Mike O''Donnell, un homme de 37 ans, trouve sa vie ennuyeuse et pathétique. Il se sépare de sa femme et vit avec son meilleur ami. Ses enfants le considèrent comme un looser. "Si seulement on avait droit à une seconde chance ?"', 'Mike O''Donnell, un homme de 37 ans, trouve sa vie ennuyeuse et pathétique. Il se sépare de sa femme et vit avec son meilleur ami. Ses enfants le considèrent comme un looser. "Si seulement on avait droit à une seconde chance ?"', '01:40:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18860150', 'http://fr.web.img2.acsta.net/medias/nmedia/18/68/81/13/19059183.jpg'),
(1039, 128901, 'Coco avant Chanel', '2009-04-22', 'Un biopic sur la jeunesse de la célèbre styliste Coco Chanel, à l''époque où, pauvre et sans éducation, elle ne savait pas qu''elle deviendrait l''incarnation de la femme moderne.', 'Un biopic sur la jeunesse de la célèbre styliste Coco Chanel, à l''époque où, pauvre et sans éducation, elle ne savait pas qu''elle deviendrait l''incarnation de la femme moderne.', '01:50:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18872018', 'http://fr.web.img6.acsta.net/medias/nmedia/18/67/61/34/19063894.jpg'),
(1040, 138248, 'Celle que j''aime', '2009-04-22', 'Isabelle a la belle trentaine et mène une vie de femme active et de mère épanouie avec son fils Achille, 10 ans. Sa vie amoureuse se porte tout aussi bien : séparée du père de son fils, elle vit une histoire d''amour cachée avec Antoine...', 'Isabelle a la belle trentaine et mène une vie de femme active et de mère épanouie avec son fils Achille, 10 ans. Sa vie amoureuse se porte tout aussi bien : séparée du père de son fils, elle vit une histoire d''amour cachée avec Antoine...', '01:43:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18876668', 'http://fr.web.img3.acsta.net/medias/nmedia/18/69/83/89/19077771.jpg'),
(1041, 139132, 'Still Walking', '2009-04-22', 'Une journée d''été à Yokohama. Une famille se retrouve pour commémorer la mort tragique du frère aîné, décédé quinze ans plus tôt en tentant de sauver un enfant de la noyade. Rien n''a bougé dans la spacieuse maison des parents...', 'Une journée d''été à Yokohama. Une famille se retrouve pour commémorer la mort tragique du frère aîné, décédé quinze ans plus tôt en tentant de sauver un enfant de la noyade. Rien n''a bougé dans la spacieuse maison des parents...', '01:55:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18875119', 'http://fr.web.img4.acsta.net/medias/nmedia/18/67/57/63/19062292.jpg'),
(1042, 123537, 'Un été italien', '2009-04-15', 'Un veuf décide de partir pour l''Italie avec ses filles pour redémarrer leur vie.', 'Un veuf décide de partir pour l''Italie avec ses filles pour redémarrer leur vie.', '01:34:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18876719', 'http://fr.web.img1.acsta.net/medias/nmedia/18/69/05/87/19081536.jpg'),
(1043, 130131, 'Rachel se marie', '2009-04-15', 'Une ex-mannequin fait des allers et retours en cure de désintoxication. Après une nouvelle tentative de sevrage qui a duré 8 mois, la belle semble vraiment déterminée et retourne à la maison familiale afin d''assister au mariage de sa soeur...', 'Une ex-mannequin fait des allers et retours en cure de désintoxication. Après une nouvelle tentative de sevrage qui a duré 8 mois, la belle semble vraiment déterminée et retourne à la maison familiale afin d''assister au mariage de sa soeur...', '01:53:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18878826', 'http://fr.web.img2.acsta.net/medias/nmedia/18/67/27/70/19084864.jpg'),
(1044, 125128, 'Dans la brume électrique', '2009-04-15', 'Dave Robicheaux, ex-flic de Louisiane, enquête sur d''étranges incidents survenus pendant le tournage d''un film sur la Guerre de Sécession à New Iberia...', 'Dave Robicheaux, ex-flic de Louisiane, enquête sur d''étranges incidents survenus pendant le tournage d''un film sur la Guerre de Sécession à New Iberia...', '01:57:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18864629', 'http://fr.web.img4.acsta.net/medias/nmedia/18/65/14/26/19070273.jpg'),
(1045, 111835, 'OSS 117 : Rio ne répond plus', '2009-04-15', 'En 1967, douze ans après ses premières aventures au Caire, l''espion Hubert Bonisseur de la Bath, alias OSS 117, est envoyé en mission à Rio de Janeiro pour récupérer un microfilm détenu par un ancien dignitaire nazi...', 'En 1967, douze ans après ses premières aventures au Caire, l''espion Hubert Bonisseur de la Bath, alias OSS 117, est envoyé en mission à Rio de Janeiro pour récupérer un microfilm détenu par un ancien dignitaire nazi...', '01:40:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18873761', 'http://fr.web.img4.acsta.net/medias/nmedia/18/67/41/85/19057747.jpg'),
(1046, 125313, 'Villa Amalia', '2009-04-08', 'Comme la goutte d''eau fait déborder le vase, Ann voit une nuit Thomas embrasser une autre, et elle décide de le quitter, de tout quitter. Elle est musicienne, seule la musique la tient mais ne la retient pas. Elle ne tient qu''à la musique...', 'Comme la goutte d''eau fait déborder le vase, Ann voit une nuit Thomas embrasser une autre, et elle décide de le quitter, de tout quitter. Elle est musicienne, seule la musique la tient mais ne la retient pas. Elle ne tient qu''à la musique...', '01:31:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18872185', 'http://fr.web.img5.acsta.net/medias/nmedia/18/68/80/62/19051680.jpg'),
(1047, 127194, 'Ponyo sur la falaise', '2009-04-08', 'L''histoire du jeune Sosuke et de la princesse poisson rouge Ponyo qui rêve de devenir humaine.', 'L''histoire du jeune Sosuke et de la princesse poisson rouge Ponyo qui rêve de devenir humaine.', '01:41:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18872345', 'http://fr.web.img2.acsta.net/medias/nmedia/18/65/69/63/19063333.jpg'),
(1048, 142077, 'Ne me libérez pas je m''en charge', '2009-04-08', 'Ancien braqueur fiché au grand banditisme, Michel Vaujour a toujours préféré la fuite à la prison, l''aventure à la soumission, la liberté à la loi. En l''espace de 30 ans, il aura passé 27 ans en prison, dont 17 en cellule d''isolement...', 'Ancien braqueur fiché au grand banditisme, Michel Vaujour a toujours préféré la fuite à la prison, l''aventure à la soumission, la liberté à la loi. En l''espace de 30 ans, il aura passé 27 ans en prison, dont 17 en cellule d''isolement...', '01:47:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18864656', 'http://fr.web.img3.acsta.net/medias/nmedia/18/69/08/35/19053072.jpg'),
(1049, 133830, 'Chéri', '2009-04-08', 'Dans les années 1920, une courtisane d''une cinquantaine d''années est la maîtresse d''un jeune homme nommé Chéri...', 'Dans les années 1920, une courtisane d''une cinquantaine d''années est la maîtresse d''un jeune homme nommé Chéri...', '01:30:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18876361', 'http://fr.web.img3.acsta.net/medias/nmedia/18/69/07/66/19072599.jpg'),
