(1051, 120435, 'Frost / Nixon, l''heure de vérité', '2009-04-01', 'Le film montre la manière dont Richard Nixon a tenté de racheter les droits de l''interview de David Frost, qui le compromettait dans le scandale du Watergate afin que celle-ci ne soit jamais diffusée.', 'Le film montre la manière dont Richard Nixon a tenté de racheter les droits de l''interview de David Frost, qui le compromettait dans le scandale du Watergate afin que celle-ci ne soit jamais diffusée.', '02:02:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18848955', 'http://fr.web.img1.acsta.net/medias/nmedia/18/65/69/26/19007272.jpg'),
(1052, 131181, 'Country Teacher', '2009-04-01', 'Professeur de biologie dans un lycée de Prague, Petr quitte un jour la capitale pour devenir  instituteur dans un village de campagne. Les habitants s''interrogent sur les raisons qui ont pu le pousser à cet "exil"...', 'Professeur de biologie dans un lycée de Prague, Petr quitte un jour la capitale pour devenir  instituteur dans un village de campagne. Les habitants s''interrogent sur les raisons qui ont pu le pousser à cet "exil"...', '01:57:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18871842', 'http://fr.web.img2.acsta.net/medias/nmedia/18/69/49/90/19065773.jpg'),
(1053, 59827, 'Prédictions', '2009-04-01', 'Une capsule temporelle contenant des messages écrits par des enfants 50 ans auparavant est déterrée et ouverte. Chaque enfant emporte chez lui un message, mais celui du petit Caleb est illisible, car il s''agit d''une suite incohérente de chiffres...', 'Une capsule temporelle contenant des messages écrits par des enfants 50 ans auparavant est déterrée et ouverte. Chaque enfant emporte chez lui un message, mais celui du petit Caleb est illisible, car il s''agit d''une suite incohérente de chiffres...', '02:01:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18864744', 'http://fr.web.img6.acsta.net/medias/nmedia/18/68/32/64/19055024.jpg'),
(1054, 123533, 'Monstres contre Aliens', '2009-04-01', 'Un chasseur de monstres est appelé à la rescousse pour combattre une armada d''aliens qui s''en prennent aux services de télévision câblée.', 'Un chasseur de monstres est appelé à la rescousse pour combattre une armada d''aliens qui s''en prennent aux services de télévision câblée.', '01:33:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18866219', 'http://fr.web.img6.acsta.net/medias/nmedia/18/66/19/99/19063323.jpg'),
(1055, 132960, 'Safari', '2009-04-01', 'Six touristes français ont décidé de découvrir l''Afrique du Sud au cours d''un safari organisé par Richard Dacier. Ils ignorent alors que leur guide n''a pas mis les pieds dans la brousse depuis 30 ans... Et qu''il a peur des animaux !', 'Six touristes français ont décidé de découvrir l''Afrique du Sud au cours d''un safari organisé par Richard Dacier. Ils ignorent alors que leur guide n''a pas mis les pieds dans la brousse depuis 30 ans... Et qu''il a peur des animaux !', '01:46:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18870723', 'http://fr.web.img6.acsta.net/medias/nmedia/18/66/79/57/19053186.jpg'),
(1056, 57890, 'Les 3 royaumes', '2009-03-25', 'Basé sur des événements historiques survenus en Chine il y a 1 700 ans durant la période des "Trois Royaumes", le film se penche sur la bataille que se livrèrent les royaumes de Wu et de Shu contre le puissant ennemi Wei...', 'Basé sur des événements historiques survenus en Chine il y a 1 700 ans durant la période des "Trois Royaumes", le film se penche sur la bataille que se livrèrent les royaumes de Wu et de Shu contre le puissant ennemi Wei...', '02:25:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19450908', 'http://fr.web.img6.acsta.net/medias/nmedia/18/66/58/08/19039954.jpg'),
(1057, 134741, 'La Première étoile', '2009-03-25', 'Jean-Gabriel, marié et père de trois enfants, vit de petits boulots et passe son temps au bar PMU du coin. Un jour, pour faire plaisir à sa fille, il promet un peu vite à toute la famille de les emmener en vacances au ski...', 'Jean-Gabriel, marié et père de trois enfants, vit de petits boulots et passe son temps au bar PMU du coin. Un jour, pour faire plaisir à sa fille, il promet un peu vite à toute la famille de les emmener en vacances au ski...', '01:30:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18860569', 'http://fr.web.img3.acsta.net/medias/nmedia/18/66/85/88/19075067.jpg'),
(1058, 142311, 'La Journée de la jupe', '2009-03-25', 'Un jour, un professeur de collège à bout prend ses élèves en otage...', 'Un jour, un professeur de collège à bout prend ses élèves en otage...', '01:28:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18863048', 'http://fr.web.img3.acsta.net/medias/nmedia/18/69/05/89/19055076.jpg'),
(1059, 132303, 'Duplicity', '2009-03-25', 'Deux amants deviennent espions dans leurs entreprises respectives qui sont aussi rivales. Ils élaborent ensemble une escroquerie afin de les anarquer.', 'Deux amants deviennent espions dans leurs entreprises respectives qui sont aussi rivales. Ils élaborent ensemble une escroquerie afin de les anarquer.', '02:02:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18866171', 'http://fr.web.img3.acsta.net/medias/nmedia/18/68/27/98/19049751.jpg'),
(1060, 129150, 'Coco', '2009-03-18', 'Coco est l''exemple parfait de la réussite sociale. Parti de rien, immigré, il a réalisé en 15 ans une des plus fulgurantes success story des temps modernes. Mais pour Coco, la plus grande consécration est à venir : la bar-mitsva de son fils Samuel...', 'Coco est l''exemple parfait de la réussite sociale. Parti de rien, immigré, il a réalisé en 15 ans une des plus fulgurantes success story des temps modernes. Mais pour Coco, la plus grande consécration est à venir : la bar-mitsva de son fils Samuel...', '01:35:00', 1.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18863916', 'http://fr.web.img6.acsta.net/medias/nmedia/18/67/06/13/19041074.jpg'),
(1061, 134185, 'La Fille du RER', '2009-03-18', 'Jeanne vit en banlieue avec sa mère Louise. Les deux femmes s''entendent bien. Lisant une publicité sur Internet, Louise croit que le destin a enfin frappé à sa porte. Elle espère que sa fille va être engagée par Blumenstein, un avocat renommé...', 'Jeanne vit en banlieue avec sa mère Louise. Les deux femmes s''entendent bien. Lisant une publicité sur Internet, Louise croit que le destin a enfin frappé à sa porte. Elle espère que sa fille va être engagée par Blumenstein, un avocat renommé...', '01:45:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18863274', 'http://fr.web.img4.acsta.net/medias/nmedia/18/68/63/52/19038578.jpg'),
