(1136, 133029, 'Hello Goodbye', '2008-11-26', 'Sur un coup de tête, Gisèle décide de quitter Paris et de s''installer en Israël avec son mari pour retrouver des origines juives jusque-là mises de côté. Ils vont découvrir que la terre promise n''est pas forcément si idyllique qu''ils l''imaginaient...', 'Sur un coup de tête, Gisèle décide de quitter Paris et de s''installer en Israël avec son mari pour retrouver des origines juives jusque-là mises de côté. Ils vont découvrir que la terre promise n''est pas forcément si idyllique qu''ils l''imaginaient...', '01:39:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18842066', 'http://fr.web.img3.acsta.net/medias/nmedia/18/67/64/91/18991504.jpg');
