(1137, 128107, 'Aide-toi le ciel t''aidera', '2008-11-26', 'Sonia, jolie black, mariée, quatre enfants, est aide familiale dans sa cité. Le jour où elle marie sa fille, le ciel lui tombe sur la tête. Robert, son voisin de palier octogénaire, est son seul recours. Plus blanc que lui, difficile de trouver...', 'Sonia, jolie black, mariée, quatre enfants, est aide familiale dans sa cité. Le jour où elle marie sa fille, le ciel lui tombe sur la tête. Robert, son voisin de palier octogénaire, est son seul recours. Plus blanc que lui, difficile de trouver...', '01:32:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18840945', 'http://fr.web.img6.acsta.net/medias/nmedia/18/66/61/10/18943538.jpg'),
(1138, 133730, 'Le Transporteur III', '2008-11-26', 'Parce qu''il est le spécialiste incontesté des livraisons à haut risque, Frank Martin se voit contraint, sous la menace, de transporter deux sacs imposants et une jeune Ukrainienne depuis Marseille jusqu''à Odessa. Que contiennent les sacs ?', 'Parce qu''il est le spécialiste incontesté des livraisons à haut risque, Frank Martin se voit contraint, sous la menace, de transporter deux sacs imposants et une jeune Ukrainienne depuis Marseille jusqu''à Odessa. Que contiennent les sacs ?', '01:45:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18838707', 'http://fr.web.img2.acsta.net/medias/nmedia/18/66/69/68/18993217.jpg'),
(1139, 130210, 'J''irai dormir à Hollywood', '2008-11-19', 'Antoine de Maximy a déjà sillonné 30 pays, seul, s''invitant à dormir chez les gens pour la série culte J''irais dormir chez vous. Aujourd''hui, il va faire encore plus fort : réaliser un film en traversant les Etats-Unis au hasard des rencontres...', 'Antoine de Maximy a déjà sillonné 30 pays, seul, s''invitant à dormir chez les gens pour la série culte J''irais dormir chez vous. Aujourd''hui, il va faire encore plus fort : réaliser un film en traversant les Etats-Unis au hasard des rencontres...', '01:40:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18835849', 'http://fr.web.img5.acsta.net/medias/nmedia/18/66/85/44/18968652.jpg'),
