(1142, 130773, 'Two Lovers', '2008-11-19', 'New York. Un homme hésite entre suivre son destin et épouser la femme que ses parents lui ont choisi ou se rebeller et écouter ses sentiments pour sa nouvelle voisine, belle et volage, dont il est tombé éperdument amoureux.', 'New York. Un homme hésite entre suivre son destin et épouser la femme que ses parents lui ont choisi ou se rebeller et écouter ses sentiments pour sa nouvelle voisine, belle et volage, dont il est tombé éperdument amoureux.', '01:50:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18834437', 'http://fr.web.img4.acsta.net/medias/nmedia/18/66/51/56/18984918.jpg'),
(1143, 130305, 'The Duchess', '2008-11-12', 'L''histoire de Georgiana Spencer, duchesse du Devonshire dans l''Angleterre du XVIIIe siècle, ancêtre de la princesse Diana.', 'L''histoire de Georgiana Spencer, duchesse du Devonshire dans l''Angleterre du XVIIIe siècle, ancêtre de la princesse Diana.', '01:50:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18838105', 'http://fr.web.img3.acsta.net/medias/nmedia/18/65/70/87/19001284.jpg'),
(1144, 129305, 'La Bande à Baader', '2008-11-12', 'La Fraction Armée Rouge, un groupe de terroristes communistes allemands, organise des attentats, des vols, des enlèvements et des assassinats à la fin des années 60 et au début des années 1970.', 'La Fraction Armée Rouge, un groupe de terroristes communistes allemands, organise des attentats, des vols, des enlèvements et des assassinats à la fin des années 60 et au début des années 1970.', '02:25:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18841353', 'http://fr.web.img2.acsta.net/medias/nmedia/18/67/71/78/18994365.jpg'),
(1145, 130995, 'Les Grandes Personnes', '2008-11-12', 'Chaque été pour l''anniversaire de sa fille Jeanne, Albert l''emmène visiter un nouveau pays d''Europe. Pour ses dix-sept ans, il choisit une petite île suédoise, convaincu d''y trouver le trésor perdu d''un Viking légendaire...', 'Chaque été pour l''anniversaire de sa fille Jeanne, Albert l''emmène visiter un nouveau pays d''Europe. Pour ses dix-sept ans, il choisit une petite île suédoise, convaincu d''y trouver le trésor perdu d''un Viking légendaire...', '01:24:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18839897', 'http://fr.web.img6.acsta.net/medias/nmedia/18/66/61/93/18996546.jpg'),
(1146, 132426, 'Max Payne', '2008-11-12', 'Max Payne, un flic aux méthodes musclées, quitte son travail pour s''occuper de sa famille. Malheureusement, le jour de son départ, sa femme et son bébé sont sauvagement assassinés. Max décide donc de revenir aux affaires, et n''a plus rien à perdre...', 'Max Payne, un flic aux méthodes musclées, quitte son travail pour s''occuper de sa famille. Malheureusement, le jour de son départ, sa femme et son bébé sont sauvagement assassinés. Max décide donc de revenir aux affaires, et n''a plus rien à perdre...', '01:40:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18823195', 'http://fr.web.img1.acsta.net/medias/nmedia/18/66/86/49/18996479.jpg'),
(1147, 126884, 'L''Echange', '2008-11-12', 'Dans les années 20, une femme voit son fils se faire kidnapper. Elle finit par le récupérer, s''agit-il vraiment de son petit garçon ?', 'Dans les années 20, une femme voit son fils se faire kidnapper. Elle finit par le récupérer, s''agit-il vraiment de son petit garçon ?', '02:21:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18836728', 'http://fr.web.img3.acsta.net/medias/nmedia/18/65/69/25/18998101.jpg'),
(1148, 131014, 'Stella', '2008-11-12', '1977. Stella entre en sixième, dans un grand lycée parisien. Stella entre dans le monde. Un nouveau monde, à l''opposé de celui qu''elle connaît. Elle, elle vit dans un café, un café d''ouvrier, à la frontière de Paris. Cette rentrée va changer sa vie.', '1977. Stella entre en sixième, dans un grand lycée parisien. Stella entre dans le monde. Un nouveau monde, à l''opposé de celui qu''elle connaît. Elle, elle vit dans un café, un café d''ouvrier, à la frontière de Paris. Cette rentrée va changer sa vie.', '01:43:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18836255', 'http://fr.web.img2.acsta.net/medias/nmedia/18/67/44/93/18982095.jpg'),
(1149, 123751, 'Vilaine', '2008-11-12', 'C''est l''histoire d''une fille trop gentille qui décide un jour de devenir Vilaine. Et qui va découvrir que ce n''est pas si simple de faire le mal quand on a été gentille toute sa vie...', 'C''est l''histoire d''une fille trop gentille qui décide un jour de devenir Vilaine. Et qui va découvrir que ce n''est pas si simple de faire le mal quand on a été gentille toute sa vie...', '01:33:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18836711', 'http://fr.web.img3.acsta.net/medias/nmedia/18/66/77/56/18991623.jpg'),
