(1152, 130133, 'Les Bureaux de Dieu', '2008-11-05', 'La vie d''un centre du planning familial. Des jeunes filles, des femmes viennent s''informer, auprès de conseillères conjugales, des conditions d''un choix, celui de leur liberté sexuelle et du moment où elles auront un enfant ou pas.', 'La vie d''un centre du planning familial. Des jeunes filles, des femmes viennent s''informer, auprès de conseillères conjugales, des conditions d''un choix, celui de leur liberté sexuelle et du moment où elles auront un enfant ou pas.', '02:00:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18835859', 'http://fr.web.img2.acsta.net/medias/nmedia/18/66/05/70/18959520.jpg'),
