(1158, 110285, 'Mes stars et moi', '2008-10-29', 'Passionné par les actrices, Robert est sans doute le fan le plus collant du cinéma français. Réunies sur un même tournage, ses trois actrices préférées découvrent un jour qu''elles ont le même problème... avec le même fan...', 'Passionné par les actrices, Robert est sans doute le fan le plus collant du cinéma français. Réunies sur un même tournage, ses trois actrices préférées découvrent un jour qu''elles ont le même problème... avec le même fan...', '01:28:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18832966', 'http://fr.web.img1.acsta.net/medias/nmedia/18/66/93/06/18977303.jpg'),
