(1165, 128251, 'Course à la mort', '2008-10-15', 'Dans une Amérique futuriste, les prisonniers sont contraints de participer à de très violentes courses automobiles dans des arènes fermées. C''est dans ce contexte qu''un homme qui doit être libéré se voit assigné à participer à l''une de ces courses...', 'Dans une Amérique futuriste, les prisonniers sont contraints de participer à de très violentes courses automobiles dans des arènes fermées. C''est dans ce contexte qu''un homme qui doit être libéré se voit assigné à participer à l''une de ces courses...', '01:45:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18829995', 'http://fr.web.img4.acsta.net/medias/nmedia/18/65/69/22/18994820.jpg'),
