(1207, 127122, 'Bons Baisers de Bruges', '2008-06-25', 'Deux tueurs à gages se réfugient à Bruges, fuyant Londres après un coup qui a mal tourné. Ils rongent leur frein dans la cité belge jusqu''au moment où leur boss demande à l''un d''exécuter l''autre...', 'Deux tueurs à gages se réfugient à Bruges, fuyant Londres après un coup qui a mal tourné. Ils rongent leur frein dans la cité belge jusqu''au moment où leur boss demande à l''un d''exécuter l''autre...', '01:41:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18814808', 'http://fr.web.img1.acsta.net/medias/nmedia/18/65/57/31/18938156.jpg'),
(1208, 124884, 'Le Témoin amoureux', '2008-06-18', 'Tom et Claire sont amis depuis une dizaine d''années. Lorsque cette dernière lui demande d''être son garçon d''honneur, il s''aperçoit qu''il est en fait amoureux d''elle. Il accepte cependant sa proposition avec l''espoir secret de pouvoir la conquérir.', 'Tom et Claire sont amis depuis une dizaine d''années. Lorsque cette dernière lui demande d''être son garçon d''honneur, il s''aperçoit qu''il est en fait amoureux d''elle. Il accepte cependant sa proposition avec l''espoir secret de pouvoir la conquérir.', '01:41:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18812915', 'http://fr.web.img2.acsta.net/medias/nmedia/18/65/38/07/18926251.jpg'),
