(1210, 131034, 'La Nouvelle vie de Monsieur Horten', '2008-06-18', 'Odd Horten est un conducteur de train qui a atteint l''âge de la retraite. Loin des itinéraires balisés, c''est un nouveau voyage qui attend le vieil homme...', 'Odd Horten est un conducteur de train qui a atteint l''âge de la retraite. Loin des itinéraires balisés, c''est un nouveau voyage qui attend le vieil homme...', '01:30:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18818772', 'http://fr.web.img4.acsta.net/medias/nmedia/18/66/55/57/18951151.jpg'),
(1211, 126907, 'Sans Sarah rien ne va !', '2008-06-18', 'Le coeur en mille morceaux après sa rupture d''avec Sarah Marshall, une actrice de série télé, Peter part pour Hawaï avec l''espoir de l''oublier. Mais une fois sur place, il s''aperçoit que son ex a réservé une chambre dans le même hôtel que lui...', 'Le coeur en mille morceaux après sa rupture d''avec Sarah Marshall, une actrice de série télé, Peter part pour Hawaï avec l''espoir de l''oublier. Mais une fois sur place, il s''aperçoit que son ex a réservé une chambre dans le même hôtel que lui...', '01:51:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18812165', 'http://fr.web.img1.acsta.net/medias/nmedia/18/65/60/61/18944282.jpg'),
(1212, 124092, 'La Personne aux deux personnes', '2008-06-18', 'Gilles Gabriel, ex-star de la chanson des années 80, meurt dans un accident de voiture causé par Jean-Christian Ranu, un petit employé coincé de la COGIP, une grande entreprise de la Défense. Mais Gilles Gabriel n''est pas totalement mort...', 'Gilles Gabriel, ex-star de la chanson des années 80, meurt dans un accident de voiture causé par Jean-Christian Ranu, un petit employé coincé de la COGIP, une grande entreprise de la Défense. Mais Gilles Gabriel n''est pas totalement mort...', '01:24:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18816289', 'http://fr.web.img1.acsta.net/medias/nmedia/18/65/29/16/18936231.jpg'),
(1213, 127605, 'Les Insoumis', '2008-06-11', 'Drieu est un policier en fin de parcours usé, brisé, grillé. Ce mystérieux Capitaine de la B.R.B se retrouve muté dans un improbable commissariat de province promis à une démolition dans les six mois...', 'Drieu est un policier en fin de parcours usé, brisé, grillé. Ce mystérieux Capitaine de la B.R.B se retrouve muté dans un improbable commissariat de province promis à une démolition dans les six mois...', '01:40:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18814849', 'http://fr.web.img6.acsta.net/medias/nmedia/18/66/51/59/18938174.jpg'),
