(1219, 127455, 'Affaire de famille', '2008-06-04', 'Un père sans histoire, une femme dévouée, une fille studieuse. Une famille en apparence bien tranquille voit sa vie bouleversée par la découverte d''un sac de sport rempli de billets.\r\nBientôt l''image se fissure, le jeu des faux-semblants commence...', 'Un père sans histoire, une femme dévouée, une fille studieuse. Une famille en apparence bien tranquille voit sa vie bouleversée par la découverte d''un sac de sport rempli de billets.\r\nBientôt l''image se fissure, le jeu des faux-semblants commence...', '01:30:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18811620', 'http://fr.web.img4.acsta.net/medias/nmedia/18/65/17/45/18937810.jpg'),
