(1221, 111414, 'JCVD', '2008-06-04', 'Entre ses problèmes fiscaux, la bataille juridique qui l''oppose à sa femme pour l''obtention de la garde de son fils, les périodes de vache maigre du cinéma d''action, Van Damme est venu chercher dans son pays d''enfance le calme et le repos...', 'Entre ses problèmes fiscaux, la bataille juridique qui l''oppose à sa femme pour l''obtention de la garde de son fils, les périodes de vache maigre du cinéma d''action, Van Damme est venu chercher dans son pays d''enfance le calme et le repos...', '01:36:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18766303', 'http://fr.web.img1.acsta.net/medias/nmedia/18/65/25/75/18931367.jpg'),
