(1223, 109498, 'Maradona par Kusturica', '2008-05-28', 'Emir Kusturica célèbre dans ce film l''incroyable histoire de Diego Maradona : héros sportif, Dieu vivant du football, artiste de génie, champion du peuple, idole déchue et modèle pour des générations du monde entier.', 'Emir Kusturica célèbre dans ce film l''incroyable histoire de Diego Maradona : héros sportif, Dieu vivant du football, artiste de génie, champion du peuple, idole déchue et modèle pour des générations du monde entier.', '01:35:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18816821', 'http://fr.web.img2.acsta.net/medias/nmedia/18/36/31/40/18938146.jpg'),
(1224, 129923, 'Sex and the City - le film', '2008-05-28', 'Avec "Sex and The City", les tabous et les hypocrisies ont explosé. Contrairement à d''autres secteurs, en matière d''écran, la taille est importante... Il est temps de découvrir tout ce qu''un petit écran ne peut montrer !', 'Avec "Sex and The City", les tabous et les hypocrisies ont explosé. Contrairement à d''autres secteurs, en matière d''écran, la taille est importante... Il est temps de découvrir tout ce qu''un petit écran ne peut montrer !', '02:25:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18805894', 'http://fr.web.img5.acsta.net/medias/nmedia/18/66/32/90/18938386.jpg'),
(1225, 135064, 'Nés en 68', '2008-05-21', '1968. Catherine, Yves et Hervé ont vingt ans, sont étudiants à Paris et s''aiment. La révolte du mois de mai bouleverse leur existence. Gagnés par l''utopie communautaire, ils partent avec quelques amis s''installer dans une ferme abandonnée du Lot...', '1968. Catherine, Yves et Hervé ont vingt ans, sont étudiants à Paris et s''aiment. La révolte du mois de mai bouleverse leur existence. Gagnés par l''utopie communautaire, ils partent avec quelques amis s''installer dans une ferme abandonnée du Lot...', '02:53:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18813226', 'http://fr.web.img6.acsta.net/medias/nmedia/18/66/42/39/18933991.jpg'),
