(1227, 45890, 'Indiana Jones et le Royaume du Crâne de Cristal', '2008-05-21', 'Le quatrième épisode des aventures du célèbre archéologue Indiana Jones, lancé sur les traces des légendaires crânes de cristal. A ses trousses, la cruelle et somptueuse Irina Spalko et ses sinistres sbires russes...', 'Le quatrième épisode des aventures du célèbre archéologue Indiana Jones, lancé sur les traces des légendaires crânes de cristal. A ses trousses, la cruelle et somptueuse Irina Spalko et ses sinistres sbires russes...', '02:03:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18799137', 'http://fr.web.img5.acsta.net/medias/nmedia/18/63/95/41/18927494.jpg'),
