(1231, 110788, 'Le Journal d''une baby-sitter', '2008-05-14', 'Annie Braddock, une jeune baby-sitter venue du New Jersey, entre au service d''une famille aisée de l''Upper East Side de Manhattan. Mais très vite, elle sent qu''elle doit se soumettre aux moindres exigences de la mère de famille...', 'Annie Braddock, une jeune baby-sitter venue du New Jersey, entre au service d''une famille aisée de l''Upper East Side de Manhattan. Mais très vite, elle sent qu''elle doit se soumettre aux moindres exigences de la mère de famille...', '01:44:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18813134', 'http://fr.web.img4.acsta.net/medias/nmedia/18/62/81/48/18926127.jpg'),
