(1233, 127522, 'Tu peux garder un secret ?', '2008-05-07', 'Mais que s''est-il passé dans la tête de Delphine pour qu''un soir elle ose affirmer devant deux de ses collègues qu''elle a une liaison avec son patron ? En 24 heures, la rumeur fait le tour de la boîte. Elle s''est mise dans une situation intenable...', 'Mais que s''est-il passé dans la tête de Delphine pour qu''un soir elle ose affirmer devant deux de ses collègues qu''elle a une liaison avec son patron ? En 24 heures, la rumeur fait le tour de la boîte. Elle s''est mise dans une situation intenable...', '01:46:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18808747', 'http://fr.web.img4.acsta.net/medias/nmedia/18/64/16/04/18922754.jpg'),
