(1235, 118711, 'Bataille à Seattle', '2008-05-07', 'Lors de la réunion en 1999 de l''OMC à Seattle, un groupe de manifestants, comprenant des activistes environnementaux, des docteurs, des anarchistes, des avocats et des terroristes économiques, plongent la ville dans un état proche du chaos...', 'Lors de la réunion en 1999 de l''OMC à Seattle, un groupe de manifestants, comprenant des activistes environnementaux, des docteurs, des anarchistes, des avocats et des terroristes économiques, plongent la ville dans un état proche du chaos...', '01:40:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18810133', 'http://fr.web.img6.acsta.net/medias/nmedia/18/65/68/87/18936219.jpg'),
(1236, 128851, 'Jackpot', '2008-05-07', 'Un homme et une femme découvrent qu''ils se sont mariés lors d''une nuit de débauche à Las Vegas. Une nuit pendant laquelle l''un d''entre eux a gagné le jackpot. Chacun va tenter de faire vivre un enfer à l''autre afin de divorcer et garder l''argent...', 'Un homme et une femme découvrent qu''ils se sont mariés lors d''une nuit de débauche à Las Vegas. Une nuit pendant laquelle l''un d''entre eux a gagné le jackpot. Chacun va tenter de faire vivre un enfer à l''autre afin de divorcer et garder l''argent...', '01:40:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18811896', 'http://fr.web.img2.acsta.net/medias/nmedia/18/65/68/95/18930690.jpg'),
