(1239, 124826, 'Des temps et des vents', '2008-04-30', 'Dans un village proche de la mer Egée, les habitants vivent au rythme de l''air et de l''eau, des soins aux chèvres, de la nuit, des jours et des saisons. Entre culpabilité et colère, trois enfants vont grandir, et leurs personnalités vont se former...', 'Dans un village proche de la mer Egée, les habitants vivent au rythme de l''air et de l''eau, des soins aux chèvres, de la nuit, des jours et des saisons. Entre culpabilité et colère, trois enfants vont grandir, et leurs personnalités vont se former...', '01:45:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18809721', 'http://fr.web.img1.acsta.net/medias/nmedia/18/64/48/99/18918571.jpg'),
