(1279, 126169, 'Taken', '2008-02-27', 'Que peut-on imaginer de pire pour un père que d''assister impuissant à l''enlèvement de sa fille via un téléphone portable ? C''est le cauchemar vécu par Bryan, ancien agent des services secrets américains, qui n''a que quelques heures pour sauver Kim.', 'Que peut-on imaginer de pire pour un père que d''assister impuissant à l''enlèvement de sa fille via un téléphone portable ? C''est le cauchemar vécu par Bryan, ancien agent des services secrets américains, qui n''a que quelques heures pour sauver Kim.', '01:25:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18796157', 'http://fr.web.img6.acsta.net/medias/nmedia/18/65/13/27/18899329.jpg'),
