(1282, 132090, 'Le Cahier', '2008-02-20', 'Sous les anciennes statues géantes de Bouddhas détruites par les Talibans, des familles tentent de survivre dans des grottes. Une petite fille entend toute la journée son petit voisin réciter l''alphabet. Elle se met alors en tête d''aller à l''école...', 'Sous les anciennes statues géantes de Bouddhas détruites par les Talibans, des familles tentent de survivre dans des grottes. Une petite fille entend toute la journée son petit voisin réciter l''alphabet. Elle se met alors en tête d''aller à l''école...', '01:21:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18792557', 'http://fr.web.img4.acsta.net/medias/nmedia/18/65/75/32/18886510.jpg'),
(1283, 110662, 'La Famille Savage', '2008-02-20', 'Un frère et une soeur doivent prendre en charge leur père souffrant alors qu''ils n''ont jamais pris soin de lui auparavant.', 'Un frère et une soeur doivent prendre en charge leur père souffrant alors qu''ils n''ont jamais pris soin de lui auparavant.', '01:53:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18798661', 'http://fr.web.img2.acsta.net/medias/nmedia/18/64/11/98/18883132.jpg'),
(1284, 114653, 'Jumper', '2008-02-20', 'David Rice a toujours cru qu''il était un jeune homme comme les autres. Jusqu''à ce qu''il découvre, un jour où il frôle la mort, qu''il est doué d''un fantastique pouvoir... David est un Jumper, ce qui lui permet de se téléporter dans n''importe quel endroit.', 'David Rice a toujours cru qu''il était un jeune homme comme les autres. Jusqu''à ce qu''il découvre, un jour où il frôle la mort, qu''il est doué d''un fantastique pouvoir... David est un Jumper, ce qui lui permet de se téléporter dans n''importe quel endroit.', '01:35:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18798691', 'http://fr.web.img5.acsta.net/medias/nmedia/18/65/09/72/18888244.jpg'),
(1285, 114860, 'Paris', '2008-02-20', 'Un Parisien est malade et se demande s''il va mourir. Son état lui donne un regard neuf et différent sur tous les gens qu''il croise. Le fait d''envisager la mort met soudainement en valeur la vie, la vie des autres et celle de la ville toute entière...', 'Un Parisien est malade et se demande s''il va mourir. Son état lui donne un regard neuf et différent sur tous les gens qu''il croise. Le fait d''envisager la mort met soudainement en valeur la vie, la vie des autres et celle de la ville toute entière...', '02:10:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18776056', 'http://fr.web.img1.acsta.net/medias/nmedia/18/65/29/85/18894351.jpg'),
(1286, 57735, 'Les Cerfs-volants de Kaboul', '2008-02-13', 'Un Afghan ayant grandi en Californie est forcé de retourner dans son pays natal pour secourir le fils d''un ami d''enfance.', 'Un Afghan ayant grandi en Californie est forcé de retourner dans son pays natal pour secourir le fils d''un ami d''enfance.', '02:02:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18798832', 'http://fr.web.img3.acsta.net/medias/nmedia/18/65/41/35/18885178.jpg'),
(1287, 120643, 'La Jeune fille et les loups', '2008-02-13', 'Les aventures romanesques d''Angèle, une jeune fille désireuse de devenir la première femme vétérinaire au sortir de la Grande Guerre. Le destin l''amènera à s''opposer à l''éradication planifiée de la dernière meute de loups en France.', 'Les aventures romanesques d''Angèle, une jeune fille désireuse de devenir la première femme vétérinaire au sortir de la Grande Guerre. Le destin l''amènera à s''opposer à l''éradication planifiée de la dernière meute de loups en France.', '01:50:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18790252', 'http://fr.web.img5.acsta.net/medias/nmedia/18/65/08/06/18831299.jpg'),
(1288, 115682, 'Benjamin Gates et le Livre des Secrets', '2008-02-13', 'Les nouvelles aventures de Benjamin Gates, archéologue et aventurier, lancé sur les traces d''un trésor autour de Abraham Lincoln et son meurtrier, John Wilkes Booth.', 'Les nouvelles aventures de Benjamin Gates, archéologue et aventurier, lancé sur les traces d''un trésor autour de Abraham Lincoln et son meurtrier, John Wilkes Booth.', '02:08:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18778427', 'http://fr.web.img5.acsta.net/medias/nmedia/18/64/04/72/18869056.jpg'),
(1289, 127505, 'Notre univers impitoyable', '2008-02-13', 'Victor et Margot, avocats dans un cabinet de conseil, forment un couple uni et équilibré. Mais voilà qu''ils se retrouvent concurrents au même poste de direction. Comment leur couple va-t-il résister à l''une ou l''autre des éventualités ?', 'Victor et Margot, avocats dans un cabinet de conseil, forment un couple uni et équilibré. Mais voilà qu''ils se retrouvent concurrents au même poste de direction. Comment leur couple va-t-il résister à l''une ou l''autre des éventualités ?', '01:27:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18794378', 'http://fr.web.img5.acsta.net/medias/nmedia/18/64/40/10/18885324.jpg'),
