(1291, 111748, 'P.S. I Love You', '2008-02-06', 'Une jeune veuve essaie tant bien que mal de continuer à vivre après la mort de son mari. Chaque mois, elle reçoit des lettres qu''il a écrites avant sa mort, pour l''aider à surmonter sa peine et à reprendre le cours de sa vie.', 'Une jeune veuve essaie tant bien que mal de continuer à vivre après la mort de son mari. Chaque mois, elle reçoit des lettres qu''il a écrites avant sa mort, pour l''aider à surmonter sa peine et à reprendre le cours de sa vie.', '02:06:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18787715', 'http://fr.web.img2.acsta.net/medias/nmedia/18/65/41/52/18883963.jpg'),
(1292, 122737, 'La Fabrique des sentiments', '2008-02-06', 'Pour échapper à sa solitude et rencontrer l''âme soeur, Eloïse, une clerc de notaire célibataire, décide de participer à un speed dating.', 'Pour échapper à sa solitude et rencontrer l''âme soeur, Eloïse, une clerc de notaire célibataire, décide de participer à un speed dating.', '01:44:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18784166', 'http://fr.web.img6.acsta.net/medias/nmedia/18/65/17/38/18889753.jpg'),
(1293, 128745, 'Ca se soigne?', '2008-02-06', 'Adrienne et Tom ont tout pour eux : ils sont beaux, riches, et ont des jobs en or. Mais comment faire bonne figure lorsqu''un des deux sombre sans raison dans une profonde dépression ? Une chose est sûre : les dégâts collatéraux sont rudes...', 'Adrienne et Tom ont tout pour eux : ils sont beaux, riches, et ont des jobs en or. Mais comment faire bonne figure lorsqu''un des deux sombre sans raison dans une profonde dépression ? Une chose est sûre : les dégâts collatéraux sont rudes...', '01:42:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18794342', 'http://fr.web.img4.acsta.net/medias/nmedia/18/64/47/51/18889967.jpg'),
