(1296, 61139, 'John Rambo', '2008-02-06', 'John Rambo s''est retiré dans le nord de la Thaïlande et se tient à l''écart de la guerre civile qui fait rage non loin de là. Mais la violence du monde le rattrape lorsqu''un groupe de volontaires humanitaires vient le trouver...', 'John Rambo s''est retiré dans le nord de la Thaïlande et se tient à l''écart de la guerre civile qui fait rage non loin de là. Mais la violence du monde le rattrape lorsqu''un groupe de volontaires humanitaires vient le trouver...', '01:30:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18791182', 'http://fr.web.img1.acsta.net/medias/nmedia/18/36/26/82/18869492.jpg'),
(1297, 111437, 'Les Liens du sang', '2008-02-06', 'François, inspecteur de police, apprend la sortie de prison de son frère, Gabriel, qui vient de tirer dix ans pour meurtre. Entre le flic et son aîné, les retrouvailles ne sont pas évidentes, mais chacun a la volonté de tirer un trait sur le passé...', 'François, inspecteur de police, apprend la sortie de prison de son frère, Gabriel, qui vient de tirer dix ans pour meurtre. Entre le flic et son aîné, les retrouvailles ne sont pas évidentes, mais chacun a la volonté de tirer un trait sur le passé...', '01:46:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18780955', 'http://fr.web.img3.acsta.net/medias/nmedia/18/65/29/13/18884636.jpg'),
(1298, 132093, 'Battle For Haditha', '2008-01-30', 'Le film décrit à hauteur d''hommes l''incident tragique qui s''est déroulé le 19 novembre 2005 à Haditha en Irak : en représailles à un attentat qui coûte la vie à leur sergent, un bataillon de Marines tue 24 civils irakiens.', 'Le film décrit à hauteur d''hommes l''incident tragique qui s''est déroulé le 19 novembre 2005 à Haditha en Irak : en représailles à un attentat qui coûte la vie à leur sergent, un bataillon de Marines tue 24 civils irakiens.', '01:33:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18790573', 'http://fr.web.img4.acsta.net/medias/nmedia/18/65/23/76/18886539.jpg'),
