(1387, 110688, 'L''Invité', '2007-09-19', '50 ans, trois ans de chômage, des indemnités en chute libre... Gérard est au bout du rouleau quand s''offre à lui un poste inespéré en Indonésie. Pour se concilier les faveurs de son futur employeur, il l''invite à dîner à la maison...', '50 ans, trois ans de chômage, des indemnités en chute libre... Gérard est au bout du rouleau quand s''offre à lui un poste inespéré en Indonésie. Pour se concilier les faveurs de son futur employeur, il l''invite à dîner à la maison...', '01:22:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18734949', 'http://fr.web.img4.acsta.net/medias/nmedia/18/64/07/05/18799735.jpg'),
