(1389, 119065, 'L''Age d''homme... maintenant ou jamais', '2007-09-12', 'Samuel a 30 ans. Et il ne se sent pas à la hauteur. Ancien célibataire endurci, il vit depuis un an avec Chloé, photographe. Il a un boulot qu''il aime et qui le fait vivre généreusement. La vie semble lui sourire... Sauf que...', 'Samuel a 30 ans. Et il ne se sent pas à la hauteur. Ancien célibataire endurci, il vit depuis un an avec Chloé, photographe. Il a un boulot qu''il aime et qui le fait vivre généreusement. La vie semble lui sourire... Sauf que...', '01:28:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18739823', 'http://fr.web.img6.acsta.net/medias/nmedia/18/64/13/71/18783453.jpg'),
(1390, 59809, 'La Vengeance dans la peau', '2007-09-12', 'La CIA lance le programme Blackbriar, visant à fabriquer une nouvelle génération de tueurs supérieurement entraînés. Jason est, pour le directeur des opérations spéciales, une menace et une tache à effacer. Ordre est donné de le supprimer...', 'La CIA lance le programme Blackbriar, visant à fabriquer une nouvelle génération de tueurs supérieurement entraînés. Jason est, pour le directeur des opérations spéciales, une menace et une tache à effacer. Ordre est donné de le supprimer...', '01:56:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18727982', 'http://fr.web.img6.acsta.net/medias/nmedia/18/63/34/23/18794863.jpg'),
(1391, 109754, 'Rogue l''ultime affrontement', '2007-09-05', 'Depuis l''assassinat de son meilleur ami, l''agent du FBI Jack Crawford n''a plus qu''une obsession : retrouver Rogue, celui que tout désigne comme coupable, et faire justice lui-même...', 'Depuis l''assassinat de son meilleur ami, l''agent du FBI Jack Crawford n''a plus qu''une obsession : retrouver Rogue, celui que tout désigne comme coupable, et faire justice lui-même...', '01:42:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19450047', 'http://fr.web.img5.acsta.net/medias/nmedia/18/60/17/80/18802214.jpg'),
(1392, 54503, 'Sicko', '2007-09-05', 'Après s''être attaqué au marché des armes dans "Bowling for Columbine" et au président George W. Bush dans "Fahrenheit 9/11", Michael Moore mène l''enquête sur les failles du système de santé américain et fustige à nouveau l''Amérique.', 'Après s''être attaqué au marché des armes dans "Bowling for Columbine" et au président George W. Bush dans "Fahrenheit 9/11", Michael Moore mène l''enquête sur les failles du système de santé américain et fustige à nouveau l''Amérique.', '02:00:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18739811', 'http://fr.web.img3.acsta.net/medias/nmedia/18/64/31/88/18787768.jpg'),
(1393, 111824, 'La Vie d''artiste', '2007-09-05', 'Alice, actrice de doublage, rêve d''un rôle à sa mesure. Bertrand, prof de français espère devenir écrivain à part entière. Quant à Cora, jeune provinciale, elle veut percer dans\r\nla chanson. Les destins de ces trois-là vont s¹entrecroiser.', 'Alice, actrice de doublage, rêve d''un rôle à sa mesure. Bertrand, prof de français espère devenir écrivain à part entière. Quant à Cora, jeune provinciale, elle veut percer dans\r\nla chanson. Les destins de ces trois-là vont s¹entrecroiser.', '01:47:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18737961', 'http://fr.web.img4.acsta.net/medias/nmedia/18/63/78/21/18790274.jpg'),
