(1459, 110283, 'La Tête de maman', '2007-03-28', 'Lulu découvre quelques indices d''un bonheur passé : des photos, un film super 8 sur lequel sa mère, à 20 ans, s''affiche lumineuse, heureuse et amoureuse, au bras d''un inconnu, un certain Jacques. Lulu se met en tête de retrouver cet homme.', 'Lulu découvre quelques indices d''un bonheur passé : des photos, un film super 8 sur lequel sa mère, à 20 ans, s''affiche lumineuse, heureuse et amoureuse, au bras d''un inconnu, un certain Jacques. Lulu se met en tête de retrouver cet homme.', '01:35:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18722785', 'http://fr.web.img3.acsta.net/medias/nmedia/18/62/46/95/18741803.jpg'),
