(1470, 111566, 'After the wedding', '2007-03-07', 'Jacob Petersen a voué sa vie à la construction d''un orphelinat en Inde. Mais l''établissement est menacé de fermeture. Un donateur, Jorgen, lui demande alors de rentrer au Danemark pour effectuer la transaction financière...', 'Jacob Petersen a voué sa vie à la construction d''un orphelinat en Inde. Mais l''établissement est menacé de fermeture. Un donateur, Jorgen, lui demande alors de rentrer au Danemark pour effectuer la transaction financière...', '02:00:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18721500', 'http://fr.web.img5.acsta.net/medias/nmedia/18/62/79/84/18739743.jpg'),
(1471, 112382, 'Contre-enquête', '2007-03-07', 'Un flic brisé par le viol et le meurtre de sa fille reçoit une lettre de l''homme inculpé clamant son innocence. Il entame alors une enquête en solo.', 'Un flic brisé par le viol et le meurtre de sa fille reçoit une lettre de l''homme inculpé clamant son innocence. Il entame alors une enquête en solo.', '01:25:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18721410', 'http://fr.web.img3.acsta.net/medias/nmedia/18/63/09/30/18736402.jpg'),
(1472, 109394, 'Les Témoins', '2007-03-07', 'L''arrivée de Manu à Paris et son intrusion dans la vie de Julie, Adrien, Mehdi et Sarah vont bouleverser le paysage relationnel comme un tremblement de terre. Sans le vouloir, sans le savoir, Manu révélera le désir de chacun.', 'L''arrivée de Manu à Paris et son intrusion dans la vie de Julie, Adrien, Mehdi et Sarah vont bouleverser le paysage relationnel comme un tremblement de terre. Sans le vouloir, sans le savoir, Manu révélera le désir de chacun.', '01:52:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18721613', 'http://fr.web.img2.acsta.net/medias/nmedia/18/63/03/26/18727066.jpg');
