(1474, 48412, 'Le Nombre 23', '2007-02-28', 'Walter menait une vie paisible, jusqu''à ce qu''il découvre un étrange roman, "Le Nombre 23". D''abord intrigué par ce thriller, Walter s''aperçoit rapidement qu''il existe des parallèles troublants entre l''intrigue et sa propre vie...', 'Walter menait une vie paisible, jusqu''à ce qu''il découvre un étrange roman, "Le Nombre 23". D''abord intrigué par ce thriller, Walter s''aperçoit rapidement qu''il existe des parallèles troublants entre l''intrigue et sa propre vie...', '01:40:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18719137', 'http://fr.web.img2.acsta.net/medias/nmedia/18/63/71/35/18710993.jpg'),
(1475, 61126, 'Le Direktør', '2007-02-28', 'Le propriétaire d''une société informatique décide de vendre son entreprise. Le problème, c''est qu''il a inventé de toutes pièces un président, se retranchant derrière ce personnage fictif au moment de prendre des décisions impopulaires...', 'Le propriétaire d''une société informatique décide de vendre son entreprise. Le problème, c''est qu''il a inventé de toutes pièces un président, se retranchant derrière ce personnage fictif au moment de prendre des décisions impopulaires...', '01:40:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18720662', 'http://fr.web.img4.acsta.net/medias/nmedia/18/63/78/14/18743160.jpg'),
(1476, 60581, 'Dreamgirls', '2007-02-28', 'L''action de "Dreamgirls" débute dans la première moitié des turbulentes sixties et suit jusqu''au milieu des années 70 l''ascension d''un trio de chanteuses composé d''Effie, Deena et Lorrell.', 'L''action de "Dreamgirls" débute dans la première moitié des turbulentes sixties et suit jusqu''au milieu des années 70 l''ascension d''un trio de chanteuses composé d''Effie, Deena et Lorrell.', '02:11:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18706390', 'http://fr.web.img5.acsta.net/medias/nmedia/18/36/26/45/18747283.jpg'),
(1477, 109551, 'Chronique d''un scandale', '2007-02-28', 'Enseignante, à la veille de la retraite dans un collège de Londres, Barbara Covett n''a rien d''autre dans sa vie que son travail et un chat. Sa solitude prend fin avec l''arrivée du nouveau professeur d''art, Sheba Hart...', 'Enseignante, à la veille de la retraite dans un collège de Londres, Barbara Covett n''a rien d''autre dans sa vie que son travail et un chat. Sa solitude prend fin avec l''arrivée du nouveau professeur d''art, Sheba Hart...', '01:32:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18720599', 'http://fr.web.img3.acsta.net/medias/nmedia/18/36/26/70/18739714.jpg'),
(1478, 61510, 'Michou d''Auber', '2007-02-28', 'En 1961, Messaoud, un garçon d''origine kabyle, est placé en famille d''accueil dans le Berry profond. Gisèle, sa mère adoptive, travestit l''identité de l''enfant. De Messaoud il devient Michel, "Michou". Gisèle cache aussi la vérité à son propre mari...', 'En 1961, Messaoud, un garçon d''origine kabyle, est placé en famille d''accueil dans le Berry profond. Gisèle, sa mère adoptive, travestit l''identité de l''enfant. De Messaoud il devient Michel, "Michou". Gisèle cache aussi la vérité à son propre mari...', '02:04:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18719811', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/31/39/18710935.jpg'),
(1479, 112342, 'Lettres d''Iwo Jima', '2007-02-21', 'Près de 7000 soldats américains et plus de 20 000 Japonais ont perdu la vie à Iwo Jima. Leur sang s''est depuis longtemps perdu dans les profondeurs du sable noir, mais leurs sacrifices, leur courage et leur compassion ont survécu dans ces Lettres.', 'Près de 7000 soldats américains et plus de 20 000 Japonais ont perdu la vie à Iwo Jima. Leur sang s''est depuis longtemps perdu dans les profondeurs du sable noir, mais leurs sacrifices, leur courage et leur compassion ont survécu dans ces Lettres.', '02:19:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18720230', 'http://fr.web.img3.acsta.net/medias/nmedia/18/63/30/19/18721539.jpg'),
(1480, 110545, 'Nue Propriété', '2007-02-21', 'Quand leur mère décide de vendre la maison familiale, Thierry et François réalisent qu''ils vont devoir vivre leur vie d''adulte. Leur relation fusionnelle va alors se transformer en guerre fratricide sous les yeux impuissants de leur mère.', 'Quand leur mère décide de vendre la maison familiale, Thierry et François réalisent qu''ils vont devoir vivre leur vie d''adulte. Leur relation fusionnelle va alors se transformer en guerre fratricide sous les yeux impuissants de leur mère.', '01:30:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18720121', 'http://fr.web.img5.acsta.net/medias/nmedia/18/63/09/18/18716367.jpg'),
