(1485, 61207, 'Le Dernier roi d''Ecosse', '2007-02-14', 'Le destin extraordinaire et tragique d''un jeune docteur anglais, Nicholas Garrigan. Désigné médecin privé d''un dictateur africain, il en deviendra le confident puis le conseiller diplomatique et enfin le bouffon.', 'Le destin extraordinaire et tragique d''un jeune docteur anglais, Nicholas Garrigan. Désigné médecin privé d''un dictateur africain, il en deviendra le confident puis le conseiller diplomatique et enfin le bouffon.', '02:05:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18719500', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/24/17/18737349.jpg'),
