(1498, 109959, 'Molière', '2007-01-31', 'A 22 ans, Molière, libéré de prison, disparait pendant quelques mois. Que s''est-il passé durant cette éclipse ? Ce film se propose de répondre à cette question, en plongeant l''auteur dans une aventure qui va lui ouvrir les yeux et l''esprit.', 'A 22 ans, Molière, libéré de prison, disparait pendant quelques mois. Que s''est-il passé durant cette éclipse ? Ce film se propose de répondre à cette question, en plongeant l''auteur dans une aventure qui va lui ouvrir les yeux et l''esprit.', '02:00:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18719664', 'http://fr.web.img6.acsta.net/medias/nmedia/18/62/83/63/18702768.jpg'),
