(1530, 110263, 'Pardonnez-moi', '2006-11-22', 'Alors qu''elle attend son premier enfant, Violette décide de lui offrir un film sur sa famille. Caméra au poing, elle va faire éclater la vérité et révéler les secrets de famille...', 'Alors qu''elle attend son premier enfant, Violette décide de lui offrir un film sur sa famille. Caméra au poing, elle va faire éclater la vérité et révéler les secrets de famille...', '01:26:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18702526', 'http://fr.web.img1.acsta.net/medias/nmedia/18/63/09/17/18676875.jpg'),
(1531, 109504, 'Coeurs', '2006-11-22', 'Les destins croisés de Dan, Nicole, Lionel, Charlotte, Thierry et Gaëlle. Ou comment le mouvement d''un personnage peut bouleverser le destin d''un autre sans pour autant le connaître voire même le rencontrer.', 'Les destins croisés de Dan, Nicole, Lionel, Charlotte, Thierry et Gaëlle. Ou comment le mouvement d''un personnage peut bouleverser le destin d''un autre sans pour autant le connaître voire même le rencontrer.', '02:00:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19456668', 'http://fr.web.img2.acsta.net/medias/nmedia/18/62/85/02/18686674.jpg'),
(1532, 58525, 'Casino Royale', '2006-11-22', 'Les débuts de James Bond au service secret de sa Majesté, comment il acquiert le statut d''agent 007 et sa première mission consistant à déjouer les plans machiavéliques du Chiffre, le banquier d''une organisation terroriste internationale.', 'Les débuts de James Bond au service secret de sa Majesté, comment il acquiert le statut d''agent 007 et sa première mission consistant à déjouer les plans machiavéliques du Chiffre, le banquier d''une organisation terroriste internationale.', '02:18:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18604811', 'http://fr.web.img6.acsta.net/medias/nmedia/18/36/12/35/18674702.jpg'),
(1533, 58330, 'Le Concile de pierre', '2006-11-15', 'Laura se demande si elle ne perd pas la raison. Cauchemars et hallucinations la plongent depuis quelques semaines dans une angoisse incontrôlable. Qui est vraiment son fils ? D''ou vient-il ? Que signifie la marque apparue sur son torse ?', 'Laura se demande si elle ne perd pas la raison. Cauchemars et hallucinations la plongent depuis quelques semaines dans une angoisse incontrôlable. Qui est vraiment son fils ? D''ou vient-il ? Que signifie la marque apparue sur son torse ?', '01:40:00', 1.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18703729', 'http://fr.web.img2.acsta.net/medias/nmedia/18/36/26/55/18669873.jpg'),
(1534, 114635, 'Bab''Aziz, le prince qui contemplait son âme', '2006-11-15', 'Perdues dans un océan de sable, deux silhouettes cheminent : Ishtar, une petite fille pleine d''entrain, et son grand-père Bab''Aziz, un derviche aveugle. Leur voyage à travers l''immensité brûlante les amène à la croisée d''autres destins...', 'Perdues dans un océan de sable, deux silhouettes cheminent : Ishtar, une petite fille pleine d''entrain, et son grand-père Bab''Aziz, un derviche aveugle. Leur voyage à travers l''immensité brûlante les amène à la croisée d''autres destins...', '01:36:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18706377', 'http://fr.web.img5.acsta.net/medias/nmedia/18/62/93/14/18688796.jpg'),
(1535, 108998, 'Le Prestige', '2006-11-15', 'Londres, au début du siècle dernier... Robert Angier et Alfred Borden sont deux magiciens surdoués, promis dès leur plus jeune âge à un glorieux avenir. L''émulation tournera vite à la jalousie, puis à la haine...', 'Londres, au début du siècle dernier... Robert Angier et Alfred Borden sont deux magiciens surdoués, promis dès leur plus jeune âge à un glorieux avenir. L''émulation tournera vite à la jalousie, puis à la haine...', '02:08:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18701619', 'http://fr.web.img1.acsta.net/medias/nmedia/18/62/84/94/18680369.jpg'),
(1536, 109423, 'Mon colonel', '2006-11-15', '1957, est de l''Algérie : un jeune officier, Guy Rossi, prend ses fonctions auprès du colonel Duplan. La machine de la torture institutionnalisée se met tranquillement en route. Elle fera du jeune juriste un bourreau...', '1957, est de l''Algérie : un jeune officier, Guy Rossi, prend ses fonctions auprès du colonel Duplan. La machine de la torture institutionnalisée se met tranquillement en route. Elle fera du jeune juriste un bourreau...', '01:51:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19441886', 'http://fr.web.img6.acsta.net/medias/nmedia/18/63/09/43/18686238.jpg'),
(1537, 109678, 'Borat, leçons culturelles sur l''Amérique au profit glor', '2006-11-15', 'Borat, reporter kazakh, est envoyé aux Etats-Unis par la télévision de son pays pour y tourner des reportages.', 'Borat, reporter kazakh, est envoyé aux Etats-Unis par la télévision de son pays pour y tourner des reportages.', '01:30:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18701029', 'http://fr.web.img1.acsta.net/medias/nmedia/18/36/29/57/18682308.jpg'),
(1538, 20151, 'Babel', '2006-11-15', 'Quatre histoires entremêlées dont l''action se déroule dans un pays différent : le Maroc, le Mexique, le Japon et la Tunisie. L''une d''entre elles traitera d''un couple marié en vacances.', 'Quatre histoires entremêlées dont l''action se déroule dans un pays différent : le Maroc, le Mexique, le Japon et la Tunisie. L''une d''entre elles traitera d''un couple marié en vacances.', '02:15:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18704777', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/27/51/18680420.jpg'),
(1539, 109400, 'Nouvelle chance', '2006-11-08', 'Comment réunir des êtres aussi dissemblables qu''Odette Saint-Gilles, Augustin Dos Santos, Bettina Fleischer et Raphaël, jeune homme à la beauté troublante. Ensemble, auront-ils une dernière chance pour assouvir leurs rêves ?', 'Comment réunir des êtres aussi dissemblables qu''Odette Saint-Gilles, Augustin Dos Santos, Bettina Fleischer et Raphaël, jeune homme à la beauté troublante. Ensemble, auront-ils une dernière chance pour assouvir leurs rêves ?', '01:30:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18704213', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/35/24/18669723.jpg'),
(1540, 59632, 'Les Fragments d''Antonin', '2006-11-08', 'Cinq prénoms inlassablement répétés. Cinq gestes obsessionnels. Cinq moments de guerre. Antonin est revenu des combats sans blessure apparente. La sienne est intime, intérieure, enfouie...', 'Cinq prénoms inlassablement répétés. Cinq gestes obsessionnels. Cinq moments de guerre. Antonin est revenu des combats sans blessure apparente. La sienne est intime, intérieure, enfouie...', '01:30:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18701040', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/12/79/18669706.jpg'),
(1541, 110133, 'Shortbus', '2006-11-08', 'Différents personnages évoluant dans le New York artistique et intellectuel se retrouvent au Salon Shortbus, pour des performances, des lectures, et des relations sexuelles en public.', 'Différents personnages évoluant dans le New York artistique et intellectuel se retrouvent au Salon Shortbus, pour des performances, des lectures, et des relations sexuelles en public.', '01:42:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18704223', 'http://fr.web.img4.acsta.net/medias/nmedia/18/60/14/53/18682195.jpg'),
(1542, 109203, 'Désaccord parfait', '2006-11-08', 'Les retrouvailles inattendues d''Alice d''Abanville, célébrissime actrice du théâtre londonien, et de Louis Ruinard, réalisateur français, qui connut son heure de gloire dans les années 70, avec cinq films dont Alice fut l''héroïne.', 'Les retrouvailles inattendues d''Alice d''Abanville, célébrissime actrice du théâtre londonien, et de Louis Ruinard, réalisateur français, qui connut son heure de gloire dans les années 70, avec cinq films dont Alice fut l''héroïne.', '01:31:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18704065', 'http://fr.web.img6.acsta.net/medias/nmedia/18/36/40/43/18677024.jpg'),
(1543, 54771, 'Le Dahlia noir', '2006-11-08', 'Dans cette sombre histoire de meurtre située en 1947, un policier devient obsédé par l''odieux assassinat d''une célèbre actrice à Los Angeles. Un crime qui le renvoie au meurtre jamais élucidé de sa mère, et qu''il se jure de résoudre...', 'Dans cette sombre histoire de meurtre située en 1947, un policier devient obsédé par l''odieux assassinat d''une célèbre actrice à Los Angeles. Un crime qui le renvoie au meurtre jamais élucidé de sa mère, et qu''il se jure de résoudre...', '02:00:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18701888', 'http://fr.web.img1.acsta.net/medias/nmedia/18/36/09/81/18669698.jpg'),
(1544, 108784, 'John Tucker doit mourir', '2006-11-01', 'John Tucker est un séducteur invétéré : il séduit puis plaque. Aujourd''hui, l''heure de le revanche a sonné. Trois anciennes petites amies unissent leurs efforts afin de lui briser le coeur à leur tour !', 'John Tucker est un séducteur invétéré : il séduit puis plaque. Aujourd''hui, l''heure de le revanche a sonné. Trois anciennes petites amies unissent leurs efforts afin de lui briser le coeur à leur tour !', '01:30:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18705178', 'http://fr.web.img1.acsta.net/medias/nmedia/18/36/20/42/18673266.jpg'),
(1545, 56780, 'Les Fous du roi', '2006-11-01', '"Les Fous du roi" raconte l''ascension politique d''un idéaliste en Louisiane et révèle la corruption qui conduira à sa chute.', '"Les Fous du roi" raconte l''ascension politique d''un idéaliste en Louisiane et révèle la corruption qui conduira à sa chute.', '02:15:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18702236', 'http://fr.web.img5.acsta.net/medias/nmedia/18/36/06/81/18676701.jpg'),
(1546, 60736, 'Scoop', '2006-11-01', 'Durant un numéro du magicien Splendini, Sondra, étudiante en journalisme américaine de passage à Londres, entend le fantôme d''un reporter lui révéler un scoop sur l''identité d''un tueur en série. Elle se lance avec Splendini dans une enquête échevelée.', 'Durant un numéro du magicien Splendini, Sondra, étudiante en journalisme américaine de passage à Londres, entend le fantôme d''un reporter lui révéler un scoop sur l''identité d''un tueur en série. Elle se lance avec Splendini dans une enquête échevelée.', '01:36:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18703023', 'http://fr.web.img6.acsta.net/medias/nmedia/18/36/35/35/18674307.jpg'),
(1547, 60722, 'Ne le dis à personne', '2006-11-01', 'Sa femme Margot a été sauvagement assassinée par un serial killer. Totalement détruit, Alex ressasse jour après jour le souvenir bouleversant de son amour perdu. 8 ans plus tard, Alex reçoit un e-mail anonyme. Il clique : une image...', 'Sa femme Margot a été sauvagement assassinée par un serial killer. Totalement détruit, Alex ressasse jour après jour le souvenir bouleversant de son amour perdu. 8 ans plus tard, Alex reçoit un e-mail anonyme. Il clique : une image...', '02:11:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18703711', 'http://fr.web.img1.acsta.net/medias/nmedia/18/36/27/48/18674312.jpg'),
(1548, 61545, 'Prête-moi ta main', '2006-11-01', 'La vie est facile pour Luis, 43 ans, célibataire heureux, choyé, couvé par sa mère et ses cinq soeurs. Cela aurait pu durer toute une vie, mais voilà... Lassées de le materner, celles-ci décident qu''il est temps pour lui de se marier...', 'La vie est facile pour Luis, 43 ans, célibataire heureux, choyé, couvé par sa mère et ses cinq soeurs. Cela aurait pu durer toute une vie, mais voilà... Lassées de le materner, celles-ci décident qu''il est temps pour lui de se marier...', '01:30:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18704207', 'http://fr.web.img5.acsta.net/medias/nmedia/18/62/85/07/18673430.jpg'),
(1549, 109192, 'Poltergay', '2006-10-25', 'Un jeune couple emménage dans une maison hantée... Fantômes ou fantasmes ?', 'Un jeune couple emménage dans une maison hantée... Fantômes ou fantasmes ?', '01:33:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18703026', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/40/45/18662107.jpg'),
(1550, 60580, 'Mémoires de nos pères', '2006-10-25', 'L''hommage rendu par Clint Eastwood à l''héroïsme des six soldats qui participèrent en 1945 à la sanglante bataille d''Iwo Jima, pendant la Seconde Guerre mondiale, et plantèrent le drapeau américain sur le Mont Suribachi en signe de victoire.', 'L''hommage rendu par Clint Eastwood à l''héroïsme des six soldats qui participèrent en 1945 à la sanglante bataille d''Iwo Jima, pendant la Seconde Guerre mondiale, et plantèrent le drapeau américain sur le Mont Suribachi en signe de victoire.', '02:12:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18702860', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/23/61/18674321.jpg'),
(1551, 58066, 'La Californie', '2006-10-25', 'Depuis longtemps, rien ne peut séparer Mirko et Stefan. Les voici sur la Côte d''Azur. Ils n''ont rien, ils battent le pavé. A la sortie d''une discothèque, ils ont rencontré Maguy, une femme qui sort et boit beaucoup, qui claque beaucoup d''argent...', 'Depuis longtemps, rien ne peut séparer Mirko et Stefan. Les voici sur la Côte d''Azur. Ils n''ont rien, ils battent le pavé. A la sortie d''une discothèque, ils ont rencontré Maguy, une femme qui sort et boit beaucoup, qui claque beaucoup d''argent...', '01:45:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18704125', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/28/55/18679959.jpg'),
(1552, 57417, 'Azur et Asmar', '2006-10-25', 'Azur est un blond aux yeux bleus, Asmar un brun aux yeux noirs. Petits, ils se battent et s''aiment comme des frères. Grands, ils se retrouvent rivaux, en quête de la Fée des Djinns, dans un Maghreb médiéval, plein de dangers et de merveilles.', 'Azur est un blond aux yeux bleus, Asmar un brun aux yeux noirs. Petits, ils se battent et s''aiment comme des frères. Grands, ils se retrouvent rivaux, en quête de la Fée des Djinns, dans un Maghreb médiéval, plein de dangers et de merveilles.', '01:39:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18702027', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/52/37/18654088.jpg');
INSERT INTO `film` (`id`, `code`, `titre`, `date`, `synopsis`, `synopsisCourt`, `duree`, `note`, `trailer`, `affiche`) VALUES
(1553, 109300, 'Alex Rider : Stormbreaker', '2006-10-25', 'Après la mort de son oncle, le jeune héros de 14 ans Alex Rider est appelé par les services secrets britanniques pour accomplir une mission susceptible de sauver des millions de vies.', 'Après la mort de son oncle, le jeune héros de 14 ans Alex Rider est appelé par les services secrets britanniques pour accomplir une mission susceptible de sauver des millions de vies.', '01:33:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18604578', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/28/62/18659348.jpg'),
(1554, 109750, 'Les Lumières du faubourg', '2006-10-25', 'Koistinen, gardien de nuit, mène une vie solitaire et désoeuvré. Sa rencontre avec une jeune femme séduisante pourrait bien changer son existence.', 'Koistinen, gardien de nuit, mène une vie solitaire et désoeuvré. Sa rencontre avec une jeune femme séduisante pourrait bien changer son existence.', '01:18:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18703318', 'http://fr.web.img1.acsta.net/medias/nmedia/18/60/14/44/18629494.jpg'),
(1555, 108735, 'Lucky girl', '2006-10-18', 'Lorsque Ashley et Jake se retrouvent par hasard face à face sur la piste de danse, c''est le coup de foudre... et le baiser fatal. En s''embrassant, les deux jeunes gens échangent leur bonne fortune...', 'Lorsque Ashley et Jake se retrouvent par hasard face à face sur la piste de danse, c''est le coup de foudre... et le baiser fatal. En s''embrassant, les deux jeunes gens échangent leur bonne fortune...', '01:43:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18703940', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/29/54/18673830.jpg'),
(1556, 60792, 'Les Fils de l''homme', '2006-10-18', 'Dans une société futuriste où les êtres humains ne parviennent plus à se reproduire, une femme tombe enceinte et devient par la même occasion la personne la plus enviée et la plus recherchée de la Terre. Un homme est chargé de sa protection...', 'Dans une société futuriste où les êtres humains ne parviennent plus à se reproduire, une femme tombe enceinte et devient par la même occasion la personne la plus enviée et la plus recherchée de la Terre. Un homme est chargé de sa protection...', '01:50:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18702272', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/31/42/18674404.jpg'),
(1557, 61543, 'L''Ecole pour tous', '2006-10-18', 'Jahwad a trente ans, Bac moins huit et quatre redoublements à son actif. Il est recherché par la police et sa famille ne le supporte plus. Un jour, une occasion inespérée lui est offerte, celle de retourner au collège...', 'Jahwad a trente ans, Bac moins huit et quatre redoublements à son actif. Il est recherché par la police et sa famille ne le supporte plus. Un jour, une occasion inespérée lui est offerte, celle de retourner au collège...', '01:37:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18701745', 'http://fr.web.img3.acsta.net/medias/nmedia/18/36/31/36/18659946.jpg'),
(1558, 111202, 'Napoléon (et moi)', '2006-10-18', 'Sur l''île d''Elbe, en 1814, Martino, un jeune professeur, amoureux de la belle baronne Emily, combat avec ardeur les idées de Napoléon. Un jour, le voilà nommé bibliothécaire auprès de l''Empereur...', 'Sur l''île d''Elbe, en 1814, Martino, un jeune professeur, amoureux de la belle baronne Emily, combat avec ardeur les idées de Napoléon. Un jour, le voilà nommé bibliothécaire auprès de l''Empereur...', '01:40:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18703583', 'http://fr.web.img3.acsta.net/medias/nmedia/18/63/06/31/18676926.jpg'),
(1559, 109086, 'The Queen', '2006-10-18', 'Un portrait intime et saisissant d''Elizabeth II et de la famille royale au lendemain de la mort de Diana.', 'Un portrait intime et saisissant d''Elizabeth II et de la famille royale au lendemain de la mort de Diana.', '01:39:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18702623', 'http://fr.web.img2.acsta.net/medias/nmedia/18/36/27/50/18670495.jpg'),
