(1630, 59605, 'Volver', '2006-05-19', 'Madrid et les quartiers effervescents de la classe ouvrière. Au sein de cette trame sociale, trois générations de femmes survivent au vent, au feu, et même à la mort, grâce à leur bonté, à leur audace et à une vitalité sans limites.', 'Madrid et les quartiers effervescents de la classe ouvrière. Au sein de cette trame sociale, trois générations de femmes survivent au vent, au feu, et même à la mort, grâce à leur bonté, à leur audace et à une vitalité sans limites.', '02:01:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18604052', 'http://fr.web.img6.acsta.net/medias/nmedia/18/36/09/46/18608103.jpg'),
