(1632, 54226, 'Da Vinci Code', '2006-05-17', '"The Da Vinci code" commence par un meurtre spectaculaire perpétré dans le Musée du Louvre. Tous les indices pointent vers une organisation religieuse clandestine prête à tout pour protéger un secret qui menace un dogme acquis depuis 2000 ans.', '"The Da Vinci code" commence par un meurtre spectaculaire perpétré dans le Musée du Louvre. Tous les indices pointent vers une organisation religieuse clandestine prête à tout pour protéger un secret qui menace un dogme acquis depuis 2000 ans.', '02:32:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18406615', 'http://fr.web.img6.acsta.net/medias/nmedia/18/36/20/56/18613332.jpg');
