(1633, 34584, 'Chromophobia', '2006-05-10', 'Les dilemmes de la vie londonnienne moderne, dans laquelle les bonnes valeurs traditionnelles telles que l''honnêteté, la loyauté et l''amitié sont sacrifiées au profit d''une nouvelle morale basée sur le succès et la célébrité.', 'Les dilemmes de la vie londonnienne moderne, dans laquelle les bonnes valeurs traditionnelles telles que l''honnêteté, la loyauté et l''amitié sont sacrifiées au profit d''une nouvelle morale basée sur le succès et la célébrité.', '01:50:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18604207', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/79/41/18615829.jpg'),
(1634, 61762, 'Bubble', '2006-05-10', 'Dans une ville du Midwest, Martha et Kyle travaillent pour l''une des rares usines encore en activité. Malgré leur différence d''âge, le jeune homme et celle qui pourrait être sa mère sont devenus amis. L''arrivée de Rose va tout remettre en cause...', 'Dans une ville du Midwest, Martha et Kyle travaillent pour l''une des rares usines encore en activité. Malgré leur différence d''âge, le jeune homme et celle qui pourrait être sa mère sont devenus amis. L''arrivée de Rose va tout remettre en cause...', '01:13:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18602126', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/03/91/18604408.jpg'),
(1635, 108532, 'Les Aiguilles rouges', '2006-05-10', 'Septembre 1960. Patrick et sa patrouille, Les Aigles, sont en camp scout dans la vallée de Chamonix. Entre 12 et 16 ans, la hiérarchie, on ne connaît pas ! Ils doivent escalader le massif du Brévent, juste en face du Mont Blanc, 2 500 m d''altitude !', 'Septembre 1960. Patrick et sa patrouille, Les Aigles, sont en camp scout dans la vallée de Chamonix. Entre 12 et 16 ans, la hiérarchie, on ne connaît pas ! Ils doivent escalader le massif du Brévent, juste en face du Mont Blanc, 2 500 m d''altitude !', '01:33:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18600572', 'http://fr.web.img1.acsta.net/pictures/14/07/02/17/20/505881.jpg'),
(1636, 58209, 'Comme t''y es belle!', '2006-05-10', 'Quatre amies liées par leurs familles séfarades partagent leurs vies entre les histoires de coeur et un institut de beauté sous contrôle fiscal, mais avant d''être belles, leur plus gros challenge reste d''être elles-mêmes.', 'Quatre amies liées par leurs familles séfarades partagent leurs vies entre les histoires de coeur et un institut de beauté sous contrôle fiscal, mais avant d''être belles, leur plus gros challenge reste d''être elles-mêmes.', '01:25:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18604121', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/98/15/18603023.jpg'),
(1637, 108591, 'Secrets de famille', '2006-05-10', 'Un pasteur est tellement omnubilé par un sermon qu''il doit préparer qu''il en devient totalement aveugle à ce qui se passe dans sa propre famille.', 'Un pasteur est tellement omnubilé par un sermon qu''il doit préparer qu''il en devient totalement aveugle à ce qui se passe dans sa propre famille.', '01:42:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18601976', 'http://fr.web.img6.acsta.net/medias/nmedia/18/60/02/45/18611579.jpg'),
(1638, 44242, 'Lili et le baobab', '2006-05-03', 'Lili, 36 ans, est photographe municipale dans une petite ville portuaire de la Manche. Elle tente de prolonger comme elle peut une jeunesse qui lui échappe. Le hasard d''une commande professionnelle l''envoie en Afrique...', 'Lili, 36 ans, est photographe municipale dans une petite ville portuaire de la Manche. Elle tente de prolonger comme elle peut une jeunesse qui lui échappe. Le hasard d''une commande professionnelle l''envoie en Afrique...', '01:30:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18603317', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/31/75/18611245.jpg'),
(1639, 60164, 'Quatre étoiles', '2006-05-03', 'Une fille hérite de 50 000 euros dont elle ne sait pas trop quoi faire. C''est encombrant, l''argent. Ca vous attache, comme les sentiments. Elle décide alors de les dépenser en filant sur la Côte d''Azur. C''est au Carlton qu''elle tombe sur Stéphane...', 'Une fille hérite de 50 000 euros dont elle ne sait pas trop quoi faire. C''est encombrant, l''argent. Ca vous attache, comme les sentiments. Elle décide alors de les dépenser en filant sur la Côte d''Azur. C''est au Carlton qu''elle tombe sur Stéphane...', '01:40:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18404338', 'http://fr.web.img5.acsta.net/medias/nmedia/18/36/17/44/18603380.jpg'),
(1640, 92604, 'C.R.A.Z.Y.', '2006-05-03', 'Un portrait de famille qui dépeint la vie souvent extraordinaire de gens ordinaires à la poursuite de leur bonheur.', 'Un portrait de famille qui dépeint la vie souvent extraordinaire de gens ordinaires à la poursuite de leur bonheur.', '02:09:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18602783', 'http://fr.web.img1.acsta.net/medias/nmedia/18/36/35/33/18607470.jpg'),
(1641, 28602, 'Mission: Impossible III', '2006-05-03', 'Ethan a quitté le service actif de la Force Mission Impossible pour un poste de formateur ; pouvoir enfin mener une vie "normale"... Mais lorsque la plus brillante recrue de l''IMF "tombe" à Berlin, Ethan se sent obligé de lui porter secours...', 'Ethan a quitté le service actif de la Force Mission Impossible pour un poste de formateur ; pouvoir enfin mener une vie "normale"... Mais lorsque la plus brillante recrue de l''IMF "tombe" à Berlin, Ethan se sent obligé de lui porter secours...', '02:06:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18406598', 'http://fr.web.img2.acsta.net/medias/nmedia/18/36/00/63/18608448.jpg'),
(1642, 61491, 'Klimt', '2006-04-26', 'Paris, 1900. Klimt est fêté à l''exposition universelle pendant qu''il est condamné à Vienne comme provocateur. La controverse atteint son comble lorsque qu''il détourne ses allégories "scandaleuses" et les rachète.', 'Paris, 1900. Klimt est fêté à l''exposition universelle pendant qu''il est condamné à Vienne comme provocateur. La controverse atteint son comble lorsque qu''il détourne ses allégories "scandaleuses" et les rachète.', '02:07:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18603356', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/37/71/18608531.jpg'),
(1643, 108509, 'Un Ami parfait', '2006-04-26', 'Julien souffre d''une amnésie partielle qui a effacé de sa mémoire les soixante derniers jours qui précèdent son accident. Questionné par la police, il va rapidement se demander s''il s''agissait bien d''un accident ou de tout autre chose...', 'Julien souffre d''une amnésie partielle qui a effacé de sa mémoire les soixante derniers jours qui précèdent son accident. Questionné par la police, il va rapidement se demander s''il s''agissait bien d''un accident ou de tout autre chose...', '01:46:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18602120', 'http://fr.web.img1.acsta.net/medias/nmedia/18/36/35/17/18608440.jpg'),
(1644, 108597, 'Transamerica', '2006-04-26', 'Bree, transsexuel, travaille jour et nuit afin d''avoir assez d''argent pour payer une intervention chirurgicale. Un jour, elle reçoit un appel téléphonique d''un adolescent en fuite qui recherche son père. Elle comprend avec effarement qu''il est le résultat d''une liaison hétérosexuelle sans lendemain qu''elle a eu des années auparavant...', 'Bree, transsexuel, travaille jour et nuit afin d''avoir assez d''argent pour payer une intervention chirurgicale. Un jour, elle reçoit un appel téléphonique d''un adolescent en fuite qui recherche son père. Elle comprend avec effarement qu''il est le résultat d''une liaison hétérosexuelle sans lendemain qu''elle a eu des années auparavant...', '01:43:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18602755', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/02/22/18609479.jpg'),
(1645, 47754, 'Les Filles du botaniste', '2006-04-26', 'Min, une jeune orpheline, part faire ses études chez un botaniste de renom. Sa fille An accueille avec joie l''arrivée de l''étudiante. Complices, les deux jeunes femmes voient leur amitié évoluer vers une attraction troublante, sensuelle et interdite.', 'Min, une jeune orpheline, part faire ses études chez un botaniste de renom. Sa fille An accueille avec joie l''arrivée de l''étudiante. Complices, les deux jeunes femmes voient leur amitié évoluer vers une attraction troublante, sensuelle et interdite.', '01:45:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18601922', 'http://fr.web.img3.acsta.net/medias/nmedia/18/36/34/78/18606354.jpg'),
(1646, 61577, 'Camping', '2006-04-26', 'Michel Saint-Josse, un chirurgien esthétique, emmène, à bord de son Aston Martin, sa fille Vanessa en vacances à Marbella. Mais en cours de route, son véhicule tombe en panne, et tous deux échouent au camping des Flots Bleus, au Cap-Ferret...', 'Michel Saint-Josse, un chirurgien esthétique, emmène, à bord de son Aston Martin, sa fille Vanessa en vacances à Marbella. Mais en cours de route, son véhicule tombe en panne, et tous deux échouent au camping des Flots Bleus, au Cap-Ferret...', '01:35:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18600080', 'http://fr.web.img2.acsta.net/medias/nmedia/18/36/09/10/18603110.jpg'),
(1647, 61446, 'Les Enfants du pays', '2006-04-19', 'En mai 1940, la rencontre d''une patrouille de cinq tirailleurs sénégalais et d''un vieil autochtone dans un petit village des Ardennes.', 'En mai 1940, la rencontre d''une patrouille de cinq tirailleurs sénégalais et d''un vieil autochtone dans un petit village des Ardennes.', '01:27:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18602053', 'http://fr.web.img2.acsta.net/medias/nmedia/18/60/03/70/18608516.jpg'),
(1648, 58911, 'V pour Vendetta', '2006-04-19', 'Dans un avenir proche, alors que l''Angleterre dévastée par une guerre est en proie à un régime totalitaire, un mystérieux combattant s''appelant "V" et arborant un masque blanc en porcelaine s''engage dans une lutte contre l''ordre établi.', 'Dans un avenir proche, alors que l''Angleterre dévastée par une guerre est en proie à un régime totalitaire, un mystérieux combattant s''appelant "V" et arborant un masque blanc en porcelaine s''engage dans une lutte contre l''ordre établi.', '02:10:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18397304', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/31/71/18479867.jpg'),
(1649, 58358, 'The Secret life of words', '2006-04-19', 'Une femme mystérieuse et solitaire, essayant d''oublier son passé, débarque sur une\r\nplateforme pétrolière pour soigner un homme qui a temporairement perdu la vue. Entre eux se crée une étrange intimité...', 'Une femme mystérieuse et solitaire, essayant d''oublier son passé, débarque sur une\r\nplateforme pétrolière pour soigner un homme qui a temporairement perdu la vue. Entre eux se crée une étrange intimité...', '01:52:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18603092', 'http://fr.web.img1.acsta.net/medias/nmedia/18/36/31/96/18479836.jpg'),
(1650, 61099, 'OSS 117, Le Caire nid d''espions', '2006-04-19', 'Égypte, 1955, le Caire est un véritable nid d''espions. Le Président de la République Française, Monsieur René Coty, envoie son arme maîtresse mettre de l''ordre dans cette pétaudière au bord du chaos : Hubert Bonisseur de la Bath, dit OSS 117.', 'Égypte, 1955, le Caire est un véritable nid d''espions. Le Président de la République Française, Monsieur René Coty, envoie son arme maîtresse mettre de l''ordre dans cette pétaudière au bord du chaos : Hubert Bonisseur de la Bath, dit OSS 117.', '01:39:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18600055', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/95/94/18602611.jpg'),
(1651, 57055, 'Rent', '2006-04-12', 'Deux amis partagent un appartement à New York. Mark filme son entourage, tandis que Roger, atteint du sida, rêve d''écrire une dernière chanson avant que la maladie de l''emporte. Sa rencontre avec Mimi, jeune toxicomane séropositive, changera sa vie.', 'Deux amis partagent un appartement à New York. Mark filme son entourage, tandis que Roger, atteint du sida, rêve d''écrire une dernière chanson avant que la maladie de l''emporte. Sa rencontre avec Mimi, jeune toxicomane séropositive, changera sa vie.', '02:15:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18600961', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/88/53/18476751.jpg'),
(1652, 59719, 'Sophie Scholl les derniers jours', '2006-04-12', 'Munich, printemps 1943. Des étudiants pacifistes, formant un groupe baptisé "La Rose Blanche", distribuent des tracts antinazis. Deux d''entre eux, Sophie Scholl et son frère Hans, sont arrêtés et interrogés par la Gestapo...', 'Munich, printemps 1943. Des étudiants pacifistes, formant un groupe baptisé "La Rose Blanche", distribuent des tracts antinazis. Deux d''entre eux, Sophie Scholl et son frère Hans, sont arrêtés et interrogés par la Gestapo...', '01:57:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18601682', 'http://fr.web.img6.acsta.net/medias/nmedia/18/36/35/73/18608386.jpg'),
(1653, 60285, 'Inside Man - l''homme de l''intérieur', '2006-04-12', 'Un flic tenace se met en tête d''arrêter un ingénieux braqueur de banques, dont le nouveau hold up vire à la prise d''otages. L''intervention d''une négociatrice ambitieuse sur les lieux mêmes du casse va compliquer la situation.', 'Un flic tenace se met en tête d''arrêter un ingénieux braqueur de banques, dont le nouveau hold up vire à la prise d''otages. L''intervention d''une négociatrice ambitieuse sur les lieux mêmes du casse va compliquer la situation.', '02:10:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18410136', 'http://fr.web.img6.acsta.net/medias/nmedia/18/36/23/85/18479911.jpg'),
(1654, 61314, 'Cabaret Paradis', '2006-04-12', 'Shirley et Dino débarquent à Paris pour reprendre le cabaret que leur oncle leur a légué. Au bord de la faillite, l''établissement est convoité par des truands du quartier, prêts à tout pour se débarrasser des nouveaux propriétaires...', 'Shirley et Dino débarquent à Paris pour reprendre le cabaret que leur oncle leur a légué. Au bord de la faillite, l''établissement est convoité par des truands du quartier, prêts à tout pour se débarrasser des nouveaux propriétaires...', '01:38:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18414163', 'http://fr.web.img3.acsta.net/medias/nmedia/18/36/26/76/18602074.jpg'),
(1655, 54220, 'Astérix et les Vikings', '2006-04-12', 'Le petit village gaulois accueille Goudurix, le neveu du chef, et Astérix et Obélix sont chargés d''en faire un homme, un vrai. Au même moment, les Vikings débarquent en Gaule, décidés à trouver un "champion de la peur"...', 'Le petit village gaulois accueille Goudurix, le neveu du chef, et Astérix et Obélix sont chargés d''en faire un homme, un vrai. Au même moment, les Vikings débarquent en Gaule, décidés à trouver un "champion de la peur"...', '01:18:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18414352', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/84/31/18482223.jpg'),
(1656, 56062, 'Les Brigades du Tigre', '2006-04-12', 'Les aventures du commissaire Valentin et des inspecteurs Terrasson et Pujol, membres des Brigades mobiles, corps spécial de la police française créé avant la Première Guerre mondiale.', 'Les aventures du commissaire Valentin et des inspecteurs Terrasson et Pujol, membres des Brigades mobiles, corps spécial de la police française créé avant la Première Guerre mondiale.', '02:05:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18414315', 'http://fr.web.img3.acsta.net/medias/nmedia/18/36/09/30/18480424.jpg'),
(1657, 57216, 'Wassup Rockers', '2006-04-05', 'Au lieu d''adhérer aux normes de leur ghetto de Los Angeles, un groupe de skaters mexicanos opte pour aller à Beverly Hills séduire les jeunes filles riches en s''attirant les foudres de leurs parents, de la police locale et de leurs petits amis...', 'Au lieu d''adhérer aux normes de leur ghetto de Los Angeles, un groupe de skaters mexicanos opte pour aller à Beverly Hills séduire les jeunes filles riches en s''attirant les foudres de leurs parents, de la police locale et de leurs petits amis...', '01:46:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18414178', 'http://fr.web.img5.acsta.net/medias/nmedia/18/36/35/15/18482323.jpg'),
(1658, 59718, 'Carmen', '2006-04-05', 'Sur un opéra mondialement célèbre, celui de Georges Bizet, "Carmen" de Mark Dornford-May transpose les amours légendaires de Carmen et de Don José dans un township d''Afrique du Sud d''aujourd''hui.', 'Sur un opéra mondialement célèbre, celui de Georges Bizet, "Carmen" de Mark Dornford-May transpose les amours légendaires de Carmen et de Don José dans un township d''Afrique du Sud d''aujourd''hui.', '02:00:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18414097', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/61/06/18604925.jpg'),
(1659, 60180, 'L''Âge de glace 2', '2006-04-05', 'Manfred, Sid et Diego vont vite s''apercevoir que leur petit coin de paradis est en danger. La fonte des neiges menace d''inonder leur vallée. Nos héros doivent donc trouver une solution pour sauver les animaux du déluge imminent...', 'Manfred, Sid et Diego vont vite s''apercevoir que leur petit coin de paradis est en danger. La fonte des neiges menace d''inonder leur vallée. Nos héros doivent donc trouver une solution pour sauver les animaux du déluge imminent...', '01:26:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18389400', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/82/41/18603091.jpg'),
(1660, 56885, 'Firewall', '2006-04-05', 'Un expert en sécurité informatique d''une banque voit sa famille enlevée. Pour la sauver d''une mort certaine, il devra neutraliser son propre firewall, détourner 100 millions de dollars et les virer avant 24 heures sur un compte off-shore.', 'Un expert en sécurité informatique d''une banque voit sa famille enlevée. Pour la sauver d''une mort certaine, il devra neutraliser son propre firewall, détourner 100 millions de dollars et les virer avant 24 heures sur un compte off-shore.', '01:44:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18413224', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/21/64/18479329.jpg'),
(1661, 59720, '16 Blocs', '2006-04-05', 'A la fin de son service, l''inspecteur Jack Mosley se voit confier une petite mission. Il doit escorter le témoin Eddie Bunker jusqu''au palais de justice. Le trajet devait prendre à peine dix minutes, mais tout va déraper...', 'A la fin de son service, l''inspecteur Jack Mosley se voit confier une petite mission. Il doit escorter le témoin Eddie Bunker jusqu''au palais de justice. Le trajet devait prendre à peine dix minutes, mais tout va déraper...', '01:41:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18412880', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/86/33/18478341.jpg'),
