(1695, 55415, 'Syriana', '2006-02-22', 'L''héritier du trône d''un émirat arabe, un avocat ambitieux, un vétéran de la CIA, un expert en ressources énergétiques, un jeune ouvrier pakistanais. Les intérêts pétroliers américains dans le Golfe sont le trait d''union entre tous ces personnages.', 'L''héritier du trône d''un émirat arabe, un avocat ambitieux, un vétéran de la CIA, un expert en ressources énergétiques, un jeune ouvrier pakistanais. Les intérêts pétroliers américains dans le Golfe sont le trait d''union entre tous ces personnages.', '02:08:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18407212', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/52/36/18465348.jpg'),
(1696, 58160, 'Réussir ou mourir', '2006-02-22', 'Un rêve habite Marcus depuis toujours : devenir rappeur. Mais lorsque sa mère est assassinée, l''adolescent perd brutalement ses repères et plonge dans le crime. Devenu dealer par nécessité, il se voit rapidement entraîné dans une spirale infernale...', 'Un rêve habite Marcus depuis toujours : devenir rappeur. Mais lorsque sa mère est assassinée, l''adolescent perd brutalement ses repères et plonge dans le crime. Devenu dealer par nécessité, il se voit rapidement entraîné dans une spirale infernale...', '01:57:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18411242', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/96/35/18462784.jpg'),
(1697, 60027, 'L''Ivresse du pouvoir', '2006-02-22', 'Chargée d''instruire une affaire impliquant le président d''un grand groupe industriel, le juge Jeanne Charmant voit son pouvoir croître au fil de ses investigations. Mais au même moment, et pour les mêmes raisons, sa vie privée se fragilise.', 'Chargée d''instruire une affaire impliquant le président d''un grand groupe industriel, le juge Jeanne Charmant voit son pouvoir croître au fil de ses investigations. Mais au même moment, et pour les mêmes raisons, sa vie privée se fragilise.', '01:50:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18409833', 'http://fr.web.img2.acsta.net/medias/nmedia/18/36/02/68/18468944.jpg'),
(1698, 59323, 'The Ballad of Jack and Rose', '2006-02-15', 'Rose vit avec son père dans une commune abandonnée sur une île canadienne. Un isolement total et voulu par le père de la jeune fille qui espère ainsi la protéger du monde moderne. Mais celui-ci rencontre une femme à qui il propose de vivre ensemble.', 'Rose vit avec son père dans une commune abandonnée sur une île canadienne. Un isolement total et voulu par le père de la jeune fille qui espère ainsi la protéger du monde moderne. Mais celui-ci rencontre une femme à qui il propose de vivre ensemble.', '01:52:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18398620', 'http://fr.web.img5.acsta.net/medias/nmedia/18/36/22/85/18463705.jpg'),
(1699, 54786, 'Petites confidences (à ma psy)', '2006-02-15', 'Une psy de 60 ans apprend qu''une de ses patientes de 40 ans sort avec un jeune homme de 20 ans. Jusque-là, rien à redire, jusqu''au jour où... la psy en question réalise que le jeune homme est... son propre fils !', 'Une psy de 60 ans apprend qu''une de ses patientes de 40 ans sort avec un jeune homme de 20 ans. Jusque-là, rien à redire, jusqu''au jour où... la psy en question réalise que le jeune homme est... son propre fils !', '01:45:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18409189', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/85/51/18465720.jpg'),
(1700, 59116, 'Sauf le respect que je vous dois', '2006-02-15', 'A 40 ans, François a tout pour être heureux, une famille, un travail, des amis... Mais un tragique évènement au sein de son entreprise va remettre en question les principes qui régissaient sa vie...', 'A 40 ans, François a tout pour être heureux, une famille, un travail, des amis... Mais un tragique évènement au sein de son entreprise va remettre en question les principes qui régissaient sa vie...', '01:30:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18407620', 'http://fr.web.img1.acsta.net/medias/nmedia/18/36/06/92/18454479.jpg'),
(1701, 51768, 'Walk the Line', '2006-02-15', 'La vie de la légende de la country music américaine, le chanteur Johnny Cash, surnommé "l''homme en noir".', 'La vie de la légende de la country music américaine, le chanteur Johnny Cash, surnommé "l''homme en noir".', '02:17:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18409582', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/86/10/18470556.jpg'),
(1702, 56147, 'Le Nouveau monde', '2006-02-15', 'La confrontation au début du XVIIe siècle entre le peuple indien, les Powhatan, dont fait partie la belle Pocahontas, et les colons anglais menés par le fringant aventurier John Smith.', 'La confrontation au début du XVIIe siècle entre le peuple indien, les Powhatan, dont fait partie la belle Pocahontas, et les colons anglais menés par le fringant aventurier John Smith.', '02:16:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19446067', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/37/85/18473104.jpg'),
(1703, 59645, 'Fauteuils d''orchestre', '2006-02-15', 'Engagée comme serveuse dans un bar de l''avenue Montaigne, une jeune provinciale côtoie de nombreuses personnalités du monde de l''art, notamment un pianiste, une actrice et un collectionneur.', 'Engagée comme serveuse dans un bar de l''avenue Montaigne, une jeune provinciale côtoie de nombreuses personnalités du monde de l''art, notamment un pianiste, une actrice et un collectionneur.', '01:46:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19463208', 'http://fr.web.img1.acsta.net/medias/nmedia/18/36/26/09/18468984.jpg'),
(1704, 61653, 'L''honneur du dragon', '2006-02-08', 'Enfant, Kham n''avait que son père et ses éléphants pour toute famille. Mais ces derniers lui sont subtilisés et envoyés en Australie. Kham se rend à Sydney à la recherche de ces éléphants, désormais aux mains de l''impitoyable Madame Rose...', 'Enfant, Kham n''avait que son père et ses éléphants pour toute famille. Mais ces derniers lui sont subtilisés et envoyés en Australie. Kham se rend à Sydney à la recherche de ces éléphants, désormais aux mains de l''impitoyable Madame Rose...', '01:34:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18409199', 'http://fr.web.img6.acsta.net/medias/nmedia/18/36/20/35/18461316.jpg'),
(1705, 108494, 'Un couple parfait', '2006-02-08', 'Après plusieurs années de vie commune, Nicolas et Marie sont sur le point de divorcer. Ils décident pourtant de se rendre ensemble à la cérémonie de mariage d''un de leurs amis, en France. A leur arrivée, ils annoncent la nouvelle de leur rupture...', 'Après plusieurs années de vie commune, Nicolas et Marie sont sur le point de divorcer. Ils décident pourtant de se rendre ensemble à la cérémonie de mariage d''un de leurs amis, en France. A leur arrivée, ils annoncent la nouvelle de leur rupture...', '01:44:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18410123', 'http://fr.web.img2.acsta.net/medias/nmedia/18/36/03/17/18469168.jpg'),
(1706, 58173, 'Brothers', '2006-02-08', 'Michael est envoyé en mission en Afghanistan pour les Nations-Unies. Lorsque le militaire est porté disparu, son épouse Sarah trouve le réconfort auprès du frère de celui-ci, Jannik. Mais Michael fait bientôt son retour chez les siens.', 'Michael est envoyé en mission en Afghanistan pour les Nations-Unies. Lorsque le militaire est porté disparu, son épouse Sarah trouve le réconfort auprès du frère de celui-ci, Jannik. Mais Michael fait bientôt son retour chez les siens.', '01:50:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18409577', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/45/99/18458454.jpg'),
(1707, 56032, 'Toute la beauté du monde', '2006-02-08', 'Franck, amoureux de Tina, une jeune veuve inconsolable, va tenter de lui redonner goût à la vie. C''est en l''entraînant dans des balades magnifiques parmi les trésors d''une nature éblouissante qu''il installe peu à peu cette complicité entre eux...', 'Franck, amoureux de Tina, une jeune veuve inconsolable, va tenter de lui redonner goût à la vie. C''est en l''entraînant dans des balades magnifiques parmi les trésors d''une nature éblouissante qu''il installe peu à peu cette complicité entre eux...', '01:43:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18409309', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/58/55/18468591.jpg'),
(1708, 59991, 'Incontrôlable', '2006-02-08', 'Les mésaventures d''un homme qui perd le contrôle et la coordination des différentes parties de son corps !', 'Les mésaventures d''un homme qui perd le contrôle et la coordination des différentes parties de son corps !', '01:30:00', 1.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18407591', 'http://fr.web.img5.acsta.net/medias/nmedia/18/36/18/70/18467483.jpg');
INSERT INTO `film` (`id`, `code`, `titre`, `date`, `synopsis`, `synopsisCourt`, `duree`, `note`, `trailer`, `affiche`) VALUES
(1709, 50369, 'Nanny McPhee', '2006-02-08', 'Nanny McPhee, une nourrice aux pouvoirs magiques, est chargée de s''occuper d''un groupe d''enfants insupportables qui lui donneront du fil à retordre.', 'Nanny McPhee, une nourrice aux pouvoirs magiques, est chargée de s''occuper d''un groupe d''enfants insupportables qui lui donneront du fil à retordre.', '01:37:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18398281', 'http://fr.web.img6.acsta.net/medias/nmedia/18/36/00/46/18462126.jpg'),
(1710, 54772, 'Les Mots retrouvés', '2006-02-01', 'Eliza Naumann, 9 ans, vient d''une famille bourgeoise instable. Lorsqu''elle s''inscrit à un tournoi d''orthographe, sa famille est persuadée de son échec mais, à leur grande surprise, elle gagne. Son nouveau talent lui ouvre des portes...', 'Eliza Naumann, 9 ans, vient d''une famille bourgeoise instable. Lorsqu''elle s''inscrit à un tournoi d''orthographe, sa famille est persuadée de son échec mais, à leur grande surprise, elle gagne. Son nouveau talent lui ouvre des portes...', '01:45:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18406283', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/00/52/18468613.jpg'),
(1711, 59402, 'Sheitan', '2006-02-01', 'Trois gars draguent deux jeunes filles en discothèque. Mais en sortant de boîte, ils font une bien mauvaise rencontre : celle de Joseph, un berger qui prépare une nuit de culte satanique...', 'Trois gars draguent deux jeunes filles en discothèque. Mais en sortant de boîte, ils font une bien mauvaise rencontre : celle de Joseph, un berger qui prépare une nuit de culte satanique...', '01:35:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18408950', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/61/46/18468903.jpg'),
(1712, 56038, 'Faux amis', '2006-02-01', 'Charlie, un avocat sans scrupules, a dérobé 2 millions de dollars au roi de la pègre de Kansas City. Mais pour lui, son plus beau cadeau de Noël reste la splendide Renata, la gérante d''un club de strip-tease. Il espère quitter la ville avec elle...', 'Charlie, un avocat sans scrupules, a dérobé 2 millions de dollars au roi de la pègre de Kansas City. Mais pour lui, son plus beau cadeau de Noël reste la splendide Renata, la gérante d''un club de strip-tease. Il espère quitter la ville avec elle...', '01:28:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18408738', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/79/22/18468583.jpg'),
(1713, 60209, 'Cache-cache', '2006-02-01', 'C''est un conte. L''histoire d''un paysan exproprié qui se cache au fond d''un puits. De là, il observe les nouveaux venus dans sa propre maison. Il essaie de comprendre et aussi de participer à la vie familiale dont il est exclu...', 'C''est un conte. L''histoire d''un paysan exproprié qui se cache au fond d''un puits. De là, il observe les nouveaux venus dans sa propre maison. Il essaie de comprendre et aussi de participer à la vie familiale dont il est exclu...', '01:31:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18408571', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/78/80/18468955.jpg'),
(1714, 59308, 'Les Bronzés 3 amis pour la vie', '2006-02-01', 'Les Bronzés se retrouvent au Prunus Resort, un hôtel de luxe dont Popeye s''occupe plus ou moins bien en tant que gérant, et qui appartient à sa femme, héritière d''une grosse fortune italienne. Mais que sont devenus les Bronzés 27 ans après ?', 'Les Bronzés se retrouvent au Prunus Resort, un hôtel de luxe dont Popeye s''occupe plus ou moins bien en tant que gérant, et qui appartient à sa femme, héritière d''une grosse fortune italienne. Mais que sont devenus les Bronzés 27 ans après ?', '01:37:00', 1.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18407448', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/00/27/18467807.jpg'),
(1715, 109240, 'Familles à vendre', '2006-01-25', 'Le rêve de retrouver un vieil oncle en Amérique, tout le monde l''a fait, mais retrouver ses ancêtres, ses vraies racines, cela peut prendre une vie. Alors s''adresser à une agence spécialisée... quoi de plus normal pour Baruk, Andrew, Irène ou Samuel.', 'Le rêve de retrouver un vieil oncle en Amérique, tout le monde l''a fait, mais retrouver ses ancêtres, ses vraies racines, cela peut prendre une vie. Alors s''adresser à une agence spécialisée... quoi de plus normal pour Baruk, Andrew, Irène ou Samuel.', '01:46:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18408957', 'http://fr.web.img6.acsta.net/medias/nmedia/18/36/17/35/18465633.jpg'),
(1716, 60570, 'Kekexili', '2006-01-25', 'Pour empêcher le massacre des dernières antilopes du Tibet, une patrouille de volontaires part à la recherche d''un gang de braconniers sur les plateaux du Kekexili. Une poursuite s''engage entre les deux groupes dans des conditions extrêmes.', 'Pour empêcher le massacre des dernières antilopes du Tibet, une patrouille de volontaires part à la recherche d''un gang de braconniers sur les plateaux du Kekexili. Une poursuite s''engage entre les deux groupes dans des conditions extrêmes.', '01:35:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18409441', 'http://fr.web.img3.acsta.net/medias/nmedia/18/36/25/16/18465443.jpg'),
(1717, 52958, 'Vers le sud', '2006-01-25', 'Une plage, un hôtel, ses paillottes, ses cocotiers. De jeunes garçons échangent leurs charmes et leur tendresse contre quelques faveurs. Deux Américaines de 50 ans en mal de tendresse et de sexe et Legba, 18 ans tout au plus, beau comme un dieu...', 'Une plage, un hôtel, ses paillottes, ses cocotiers. De jeunes garçons échangent leurs charmes et leur tendresse contre quelques faveurs. Deux Américaines de 50 ans en mal de tendresse et de sexe et Legba, 18 ans tout au plus, beau comme un dieu...', '01:55:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18407409', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/99/84/18456387.jpg'),
(1718, 61447, 'Les Dames de Cornouailles', '2006-01-25', 'Deux soeurs d''un certain âge, Janet et Ursula Widdington, vivent dans une petite ville tranquille sur la côte de Cornouailles. Un matin, après une violente tempête, elles découvrent Andrea, un jeune homme échoué sur la plage et gravement blessé...', 'Deux soeurs d''un certain âge, Janet et Ursula Widdington, vivent dans une petite ville tranquille sur la côte de Cornouailles. Un matin, après une violente tempête, elles découvrent Andrea, un jeune homme échoué sur la plage et gravement blessé...', '01:43:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18407868', 'http://fr.web.img6.acsta.net/medias/nmedia/18/36/10/41/18465262.jpg'),
(1719, 60597, 'The King', '2006-01-25', 'Elvis Sandow, un jeune marin de 21 ans qui vient de quitter la Navy, est à la recherche de son père qu''il n''a jamais connu. Il découvre que celui-ci est en fait le pasteur d''une église baptiste en plein essor du Texas...', 'Elvis Sandow, un jeune marin de 21 ans qui vient de quitter la Navy, est à la recherche de son père qu''il n''a jamais connu. Il découvre que celui-ci est en fait le pasteur d''une église baptiste en plein essor du Texas...', '01:45:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18409587', 'http://fr.web.img2.acsta.net/medias/nmedia/18/36/06/00/18470646.jpg'),
(1720, 55595, 'Rochester, le dernier des libertins', '2006-01-25', 'L''existence tumultueuse du deuxième comte de Rochester, ami et confident du roi Charles II d''Angleterre. Au XVIIe siècle, cet homme d''exception, débauché notoire et libre penseur, mena une vie dédiée à la recherche du plaisir et de la vérité.', 'L''existence tumultueuse du deuxième comte de Rochester, ami et confident du roi Charles II d''Angleterre. Au XVIIe siècle, cet homme d''exception, débauché notoire et libre penseur, mena une vie dédiée à la recherche du plaisir et de la vérité.', '01:55:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18407821', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/55/05/18465223.jpg'),
(1721, 109375, 'Un Jour en septembre', '2006-01-25', '1972. Jeux Olympiques de Munich. 121 nations, 7 123 athlètes. Pour la première fois, les chaînes de télévision du monde entier sont là pour retransmettre en direct l''évènement. Des millions de spectateurs découvrent bientôt l''impensable...', '1972. Jeux Olympiques de Munich. 121 nations, 7 123 athlètes. Pour la première fois, les chaînes de télévision du monde entier sont là pour retransmettre en direct l''évènement. Des millions de spectateurs découvrent bientôt l''impensable...', '01:34:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18410147', 'http://fr.web.img5.acsta.net/medias/nmedia/18/36/19/94/18461305.jpg'),
(1722, 58225, 'La Véritable histoire du petit chaperon rouge', '2006-01-25', 'Une petite fille avec une capuche rouge, un loup, une mère-grand, une chevillette, une bobinette, un panier avec une galette... Vous pensez connaître cette histoire ? On ne vous a pas tout dit...', 'Une petite fille avec une capuche rouge, un loup, une mère-grand, une chevillette, une bobinette, un panier avec une galette... Vous pensez connaître cette histoire ? On ne vous a pas tout dit...', '01:20:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18405671', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/01/86/18465599.jpg'),
(1723, 57432, 'Munich', '2006-01-25', 'Avner, un jeune agent du Mossad, prend la tête d''une équipe de quatre hommes, chargée de traquer à travers le monde onze représentants de Septembre Noir désignés comme responsables de l''attentat de Munich...', 'Avner, un jeune agent du Mossad, prend la tête d''une équipe de quatre hommes, chargée de traquer à travers le monde onze représentants de Septembre Noir désignés comme responsables de l''attentat de Munich...', '02:40:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18406158', 'http://fr.web.img2.acsta.net/medias/nmedia/18/36/15/41/18464332.jpg'),
(1724, 58210, 'Riviera', '2006-01-18', 'Stella a 17 ans. Elle est danseuse dans une boîte techno, rose et blanche, sur la Riviera. Sa mère est femme de ménage dans un palace, elle est excessive, possessive et a tout misé sur sa fille. Un jour, un prince charmant se présente dans leur vie.', 'Stella a 17 ans. Elle est danseuse dans une boîte techno, rose et blanche, sur la Riviera. Sa mère est femme de ménage dans un palace, elle est excessive, possessive et a tout misé sur sa fille. Un jour, un prince charmant se présente dans leur vie.', '01:38:00', 1.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18408694', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/97/54/18443608.jpg'),
(1725, 57421, 'Bandidas', '2006-01-18', 'Mexique, 1880. Sara est la fille d''un riche banquier. Maria est la fille d''un pauvre fermier. N''ayant apparemment rien en commun, excepté leur culture mexicaine, elles sont entraînées dans la même aventure par le destin et les circonstances...', 'Mexique, 1880. Sara est la fille d''un riche banquier. Maria est la fille d''un pauvre fermier. N''ayant apparemment rien en commun, excepté leur culture mexicaine, elles sont entraînées dans la même aventure par le destin et les circonstances...', '01:35:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18405766', 'http://fr.web.img3.acsta.net/pictures/14/08/21/14/28/527932.jpg'),
(1726, 55467, 'Un ticket pour l''espace', '2006-01-18', '"Le ticket pour l''espace", un jeu à gratter, va permettre à deux civils de séjourner dans la station orbitale européenne, en compagnie d''un équipage professionnel. Tout se passe bien, jusqu''à ce que l''un des deux gagnants prenne la station en otage...', '"Le ticket pour l''espace", un jeu à gratter, va permettre à deux civils de séjourner dans la station orbitale européenne, en compagnie d''un équipage professionnel. Tout se passe bien, jusqu''à ce que l''un des deux gagnants prenne la station en otage...', '01:30:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18403946', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/82/72/18466699.jpg'),
(1727, 54989, 'Le Secret de Brokeback Mountain', '2006-01-18', 'La passion vécue par deux hommes, un propriétaire de ranch et un spécialiste du rodéo, qui se rencontrent à l''été 1961 entre le Wyoming et le Texas.', 'La passion vécue par deux hommes, un propriétaire de ranch et un spécialiste du rodéo, qui se rencontrent à l''été 1961 entre le Wyoming et le Texas.', '02:14:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18407815', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/87/12/18463378.jpg'),
(1728, 59068, 'Orgueil et préjugés', '2006-01-18', 'Dans un village d''Angleterre, sous George III, Mrs. Bennet veut marier ses filles pour leur assurer un avenir serein. L''arrivée de nouveaux voisins, Mr. Bingley et son ami Mr. Darcy, plonge Jane et Elisabeth dans des affaires de coeur tumultueuses...', 'Dans un village d''Angleterre, sous George III, Mrs. Bennet veut marier ses filles pour leur assurer un avenir serein. L''arrivée de nouveaux voisins, Mr. Bingley et son ami Mr. Darcy, plonge Jane et Elisabeth dans des affaires de coeur tumultueuses...', '02:07:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18402741', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/99/80/18461215.jpg'),
