(1760, 48636, 'Domino', '2005-11-23', 'Jeune mannequin célèbre issu d''une famille en vue, Domino Harvey décide de tout quitter pour devenir chasseuse de primes. Fuyant les défilés et les mondanités, elle se jette dans l''univers de la traque et du danger...', 'Jeune mannequin célèbre issu d''une famille en vue, Domino Harvey décide de tout quitter pour devenir chasseuse de primes. Fuyant les défilés et les mondanités, elle se jette dans l''univers de la traque et du danger...', '02:08:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19446074', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/57/75/18449675.jpg'),
(1761, 60767, 'Factotum', '2005-11-23', 'Hank Chinaski travaille comme manoeuvre dans des usines, ou des entrepôts pour s''offrir le luxe d''une vie qui consiste à boire, parier sur des chevaux, séduire des femmes, et surtout, écrire des histoires que personne ne veut publier.', 'Hank Chinaski travaille comme manoeuvre dans des usines, ou des entrepôts pour s''offrir le luxe d''une vie qui consiste à boire, parier sur des chevaux, séduire des femmes, et surtout, écrire des histoires que personne ne veut publier.', '01:38:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18402749', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/80/38/18459697.jpg'),
(1762, 59948, 'Et si c''était vrai...', '2005-11-23', 'Elizabeth est infirmière. Quand un accident la réduit à l''état de fantôme, elle est forcée de vivre jour après jour. Son appartement est reloué à David Abbott, un architecte esseulé qui s''attire les foudres d''Elizabeth...', 'Elizabeth est infirmière. Quand un accident la réduit à l''état de fantôme, elle est forcée de vivre jour après jour. Son appartement est reloué à David Abbott, un architecte esseulé qui s''attire les foudres d''Elizabeth...', '01:35:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18398815', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/92/43/18451650.jpg'),
(1763, 57961, 'Palais Royal!', '2005-11-23', 'Une orthophoniste toute simple, mais mariée au fils cadet du roi, devient reine malgré elle à la mort du monarque... Et ça rigole pas tous les jours sous les couronnes... Ou alors si.', 'Une orthophoniste toute simple, mais mariée au fils cadet du roi, devient reine malgré elle à la mort du monarque... Et ça rigole pas tous les jours sous les couronnes... Ou alors si.', '01:40:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18401868', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/53/46/18452858.jpg'),
(1764, 57695, 'Trois enterrements', '2005-11-23', 'Le corps de Melquiades Estrada, paysan mexicain, est retrouvé en plein désert, où il a été rapidement enterré après son assassinat. Pete Perkins, contremaître de la région, va mener lui-même l''enquête que les autorités locales refusent d''assumer.', 'Le corps de Melquiades Estrada, paysan mexicain, est retrouvé en plein désert, où il a été rapidement enterré après son assassinat. Pete Perkins, contremaître de la région, va mener lui-même l''enquête que les autorités locales refusent d''assumer.', '02:00:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18401667', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/79/49/18452676.jpg'),
(1765, 61182, 'Lady vengeance', '2005-11-16', 'Une jeune fille est accusée de l''enlèvement et du meurtre d''un enfant. Condamnée à une longue peine de prison, elle va consacrer ses 13 ans d''enfermement à la préparation méticuleuse de sa vengeance contre son ancien professeur...', 'Une jeune fille est accusée de l''enlèvement et du meurtre d''un enfant. Condamnée à une longue peine de prison, elle va consacrer ses 13 ans d''enfermement à la préparation méticuleuse de sa vengeance contre son ancien professeur...', '01:55:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18402467', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/92/63/18449804.jpg'),
(1766, 53755, 'In her shoes', '2005-11-16', 'L''histoire d''une rivalité entre deux soeurs aux caractères diamétralement opposés, l''une étant une fêtarde irresponsable et l''autre, une avocate maniaque de travail. Jusqu''à ce que les deux emménagent ensemble...', 'L''histoire d''une rivalité entre deux soeurs aux caractères diamétralement opposés, l''une étant une fêtarde irresponsable et l''autre, une avocate maniaque de travail. Jusqu''à ce que les deux emménagent ensemble...', '02:10:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18402758', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/93/12/18446445.jpg'),
(1767, 40772, 'Backstage', '2005-11-16', 'Lucie est une adolescente "ordinaire". Sa mère, collectionneuse d''autographes, voue un véritable culte à un tas de vedettes. Mais Lucie, elle, ne disperse pas ses sentiments. De star dans son coeur, dans sa tête, il n''y en a qu''une...', 'Lucie est une adolescente "ordinaire". Sa mère, collectionneuse d''autographes, voue un véritable culte à un tas de vedettes. Mais Lucie, elle, ne disperse pas ses sentiments. De star dans son coeur, dans sa tête, il n''y en a qu''une...', '01:55:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18398921', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/62/45/18443311.jpg'),
(1768, 58842, 'Le Petit lieutenant', '2005-11-16', 'Jeune lieutenant, Antoine est affecté dans un commissariat parisien. Il travaille sous la direction du Commandant Vaudieu, une séduisante quinquagénaire. Ces deux êtres vont apprendre à se connaître au cours d''une enquête menée en province.', 'Jeune lieutenant, Antoine est affecté dans un commissariat parisien. Il travaille sous la direction du Commandant Vaudieu, une séduisante quinquagénaire. Ces deux êtres vont apprendre à se connaître au cours d''une enquête menée en province.', '01:50:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18402186', 'http://fr.web.img5.acsta.net/medias/nmedia/18/36/09/42/18452271.jpg'),
(1769, 59982, 'Free Zone', '2005-11-09', 'A la suite d''un concours de circonstances, deux femmes sont amenées à se rencontrer. A cause d''une bagarre avec sa belle-mère, Rebecca fuit l''hôtel dans lequel elle était domiciliée. Embarquant dans un taxi, elle rencontre Hanna...', 'A la suite d''un concours de circonstances, deux femmes sont amenées à se rencontrer. A cause d''une bagarre avec sa belle-mère, Rebecca fuit l''hôtel dans lequel elle était domiciliée. Embarquant dans un taxi, elle rencontre Hanna...', '01:33:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18402372', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/79/45/18453385.jpg'),
(1770, 49149, 'Manderlay', '2005-11-09', 'En 1933, Grace et son père avaient laissé derrière eux la petite communauté de Dogville et s''en éloignaient pour retourner chez eux. Malheureusement, dans le métier de gangster, l''absence est souvent une source de gros désagrément...', 'En 1933, Grace et son père avaient laissé derrière eux la petite communauté de Dogville et s''en éloignaient pour retourner chez eux. Malheureusement, dans le métier de gangster, l''absence est souvent une source de gros désagrément...', '02:19:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18402840', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/60/03/18453868.jpg'),
(1771, 56539, 'Joyeux Noël', '2005-11-09', 'En 1914, la guerre emporte dans son tourbillon des millions d''hommes, dont Nikolaus, ténor à l''opéra de Berlin, le prêtre Palmer et le lieutenant Audebert. Arrive Noël. Mais la surprise ne viendra pas des colis généreux qui jonchent les tranchées...', 'En 1914, la guerre emporte dans son tourbillon des millions d''hommes, dont Nikolaus, ténor à l''opéra de Berlin, le prêtre Palmer et le lieutenant Audebert. Arrive Noël. Mais la surprise ne viendra pas des colis généreux qui jonchent les tranchées...', '01:55:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18400567', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/52/27/18450187.jpg'),
(1772, 52296, 'Les Chevaliers du ciel', '2005-11-09', 'Salon aéronautique de Farnborough, Angleterre. Alors qu''il était en pleine démonstration, un Mirage 2000 a disparu au-dessus de la Mer du Nord. Les capitaines Marchelli et Vallois sont immédiatement envoyés en patrouille pour retrouver l''avion...', 'Salon aéronautique de Farnborough, Angleterre. Alors qu''il était en pleine démonstration, un Mirage 2000 a disparu au-dessus de la Mer du Nord. Les capitaines Marchelli et Vallois sont immédiatement envoyés en patrouille pour retrouver l''avion...', '01:42:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19418797', 'http://fr.web.img6.acsta.net/medias/nmedia/18/36/09/03/18451645.jpg'),
(1773, 58606, 'Ralph', '2005-11-02', 'En 1954, recruté dans l''équipe de course à pieds de son école, Ralph se lance à corps perdu dans l''entraînement, avec un objectif colossal : gagner le mythique marathon de Boston.', 'En 1954, recruté dans l''équipe de course à pieds de son école, Ralph se lance à corps perdu dans l''entraînement, avec un objectif colossal : gagner le mythique marathon de Boston.', '01:38:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18401361', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/66/25/18450350.jpg'),
(1774, 59231, 'J''ai vu tuer Ben Barka', '2005-11-02', 'Un dénommé Georges Figon se voit confier par des officiels marocains la production d''un film sur la décolonisation, dont un certain Mehdi Ben Barka serait le conseiller technique. Mais ce long métrage est un piège...', 'Un dénommé Georges Figon se voit confier par des officiels marocains la production d''un film sur la décolonisation, dont un certain Mehdi Ben Barka serait le conseiller technique. Mais ce long métrage est un piège...', '01:41:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18402951', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/88/87/18454719.jpg'),
(1775, 45506, 'Edy', '2005-11-02', 'Patron d''un cabinet d''assurance en banlieue, Edy flingue un inconnu, licencie sa secrétaire brutalement et avoue à son vieux collègue Louis qu''il a foiré un contrat. Tous deux sont devenus spécialistes des arnaques à l''assurance !', 'Patron d''un cabinet d''assurance en banlieue, Edy flingue un inconnu, licencie sa secrétaire brutalement et avoue à son vieux collègue Louis qu''il a foiré un contrat. Tous deux sont devenus spécialistes des arnaques à l''assurance !', '01:41:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18400821', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/06/74/18452238.jpg'),
(1776, 57912, 'La Boîte noire', '2005-11-02', 'Sortant d''un coma dans lequel il était plongé depuis un accident de la route, un homme a accès à son inconscient et aux souvenirs d''un passé enfoui : la vérité sur ses origines, les trahisons amoureuses de sa jeunesse...', 'Sortant d''un coma dans lequel il était plongé depuis un accident de la route, un homme a accès à son inconscient et aux souvenirs d''un passé enfoui : la vérité sur ses origines, les trahisons amoureuses de sa jeunesse...', '01:30:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18402865', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/48/98/18455542.jpg'),
(1777, 55982, 'A History of Violence', '2005-11-02', 'Tom Stall, un père de famille à la vie paisiblement tranquille, abat dans un réflexe de légitime défense son agresseur dans un restaurant. Il devient alors un personnage médiatique, dont l''existence est dorénavant connue du grand public...', 'Tom Stall, un père de famille à la vie paisiblement tranquille, abat dans un réflexe de légitime défense son agresseur dans un restaurant. Il devient alors un personnage médiatique, dont l''existence est dorénavant connue du grand public...', '01:35:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19446071', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/52/32/18449720.jpg'),
(1778, 59881, 'Les amants réguliers', '2005-10-26', 'En 1969, un groupe de jeunes gens s''adonne à l''opium après avoir vécu les événements de 1968. Un amour fou naît au sein de ce groupe entre une jeune fille et un jeune homme de 20 ans qui s''étaient aperçus pendant l''insurrection.', 'En 1969, un groupe de jeunes gens s''adonne à l''opium après avoir vécu les événements de 1968. Un amour fou naît au sein de ce groupe entre une jeune fille et un jeune homme de 20 ans qui s''étaient aperçus pendant l''insurrection.', '03:03:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18401003', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/99/63/18449286.jpg'),
(1779, 57881, 'Red Eye / sous haute pression', '2005-10-26', 'Lisa s''apprête à prendre l''avion. Elle y retrouve Jackson, le jeune homme avec qui elle a pris un verre avant l''embarquement. Cependant, quelques instants après le décollage, ce dernier tombe le masque et révèle la vraie raison de sa présence à bord.', 'Lisa s''apprête à prendre l''avion. Elle y retrouve Jackson, le jeune homme avec qui elle a pris un verre avant l''embarquement. Cependant, quelques instants après le décollage, ce dernier tombe le masque et révèle la vraie raison de sa présence à bord.', '01:30:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18397482', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/85/91/18443181.jpg'),
(1780, 57866, 'Match Point', '2005-10-26', 'Prof de tennis, Chris se fait embaucher dans un club huppé de Londres. Il sympathise avec Tom, un jeune homme de la haute société, et séduit Chloe, sa soeur. Alors qu''il s''apprête à l''épouser, il rencontre la fiancée de Tom, Nola...', 'Prof de tennis, Chris se fait embaucher dans un club huppé de Londres. Il sympathise avec Tom, un jeune homme de la haute société, et séduit Chloe, sa soeur. Alors qu''il s''apprête à l''épouser, il rencontre la fiancée de Tom, Nola...', '02:03:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19418813', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/81/83/18451304.jpg'),
(1781, 54348, 'La Légende de Zorro', '2005-10-26', 'En 1850, la Californie aspire à devenir le 31e Etat de l''Union, mais les membres de la mystérieuse confrérie médiévale des Chevaliers d''Aragon sont décidés à l''en empêcher par tous les moyens... Seul Zorro peut intervenir...', 'En 1850, la Californie aspire à devenir le 31e Etat de l''Union, mais les membres de la mystérieuse confrérie médiévale des Chevaliers d''Aragon sont décidés à l''en empêcher par tous les moyens... Seul Zorro peut intervenir...', '02:10:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18401509', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/53/35/18447893.jpg'),
(1782, 57218, 'Combien tu m''aimes ?', '2005-10-26', 'Un homme qui vient de remporter une forte somme au loto propose à une call-girl de lui offrir pendant cinq ans le triple de ce quelle gagne si elle accepte de l''épouser. Mais on ne quitte pas comme ça Charly et le monde de la nuit...', 'Un homme qui vient de remporter une forte somme au loto propose à une call-girl de lui offrir pendant cinq ans le triple de ce quelle gagne si elle accepte de l''épouser. Mais on ne quitte pas comme ça Charly et le monde de la nuit...', '01:35:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18398623', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/85/67/18452160.jpg'),
(1783, 53969, 'Oliver Twist', '2005-10-19', 'Dans un orphelinat d''Angleterre, Oliver Twist survit au milieu de ses compagnons d''infortune. Il ne connaît que privations et mauvais traitements. Il endure tout, jusqu''au jour où une provocation de trop le pousse à s''enfuir vers Londres...', 'Dans un orphelinat d''Angleterre, Oliver Twist survit au milieu de ses compagnons d''infortune. Il ne connaît que privations et mauvais traitements. Il endure tout, jusqu''au jour où une provocation de trop le pousse à s''enfuir vers Londres...', '02:05:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18401881', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/87/10/18450857.jpg');
INSERT INTO `film` (`id`, `code`, `titre`, `date`, `synopsis`, `synopsisCourt`, `duree`, `note`, `trailer`, `affiche`) VALUES
(1784, 58396, 'Il était une fois dans l''Oued', '2005-10-19', 'En 1988, alors que tout le monde rêvait d''aller faire fortune en Amérique, Johnny Leclerc, lui, ne rêvait que de devenir petit épicier en Algérie. Voici l''histoire de sa réussite !', 'En 1988, alors que tout le monde rêvait d''aller faire fortune en Amérique, Johnny Leclerc, lui, ne rêvait que de devenir petit épicier en Algérie. Voici l''histoire de sa réussite !', '01:33:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18399739', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/54/62/18446428.jpg'),
(1785, 59638, 'L''Enfant', '2005-10-19', 'Bruno, 20 ans, et Sonia, 18 ans, vivent d''expédients. Sonia vient de donner naissance à Jimmy, leur enfant. L''insouciant Bruno doit alors apprendre à devenir père, lui qui jusqu''alors ne se préoccupait que de l''instant présent.', 'Bruno, 20 ans, et Sonia, 18 ans, vivent d''expédients. Sonia vient de donner naissance à Jimmy, leur enfant. L''insouciant Bruno doit alors apprendre à devenir père, lui qui jusqu''alors ne se préoccupait que de l''instant présent.', '01:35:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18397771', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/79/89/18430180.jpg'),
(1786, 57425, 'Les Parrains', '2005-10-19', 'Après un casse, Max, l''ami de Lucien, Henri et Gérard, s''est fait pincer. Pour fêter la prescription, il leur révèle où il a planqué le magot. Mais avant de toucher leur part, les 3 potes devront décider si son fils est digne de toucher la sienne...', 'Après un casse, Max, l''ami de Lucien, Henri et Gérard, s''est fait pincer. Pour fêter la prescription, il leur révèle où il a planqué le magot. Mais avant de toucher leur part, les 3 potes devront décider si son fils est digne de toucher la sienne...', '01:39:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18398189', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/96/51/18439219.jpg'),
(1787, 56718, 'Les Noces funèbres', '2005-10-19', 'Au XIXe siècle, dans un petit village d''Europe de l''est, Victor, un jeune homme, découvre le monde de l''au-delà après avoir épousé, sans le vouloir, le cadavre d''une mystérieuse mariée.', 'Au XIXe siècle, dans un petit village d''Europe de l''est, Victor, un jeune homme, découvre le monde de l''au-delà après avoir épousé, sans le vouloir, le cadavre d''une mystérieuse mariée.', '01:15:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18400109', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/52/33/18449288.jpg'),
(1788, 55129, 'Wallace et Gromit : le Mystère du lapin-garou', '2005-10-12', 'A quelques jours du Grand Concours Annuel de Légumes, les affaires de Wallace et Gromit n''ont jamais été aussi florissantes, et tout irait pour le mieux dans le meilleur des mondes, si un lapin-garou ne venait s''attaquer aux potagers de la ville...', 'A quelques jours du Grand Concours Annuel de Légumes, les affaires de Wallace et Gromit n''ont jamais été aussi florissantes, et tout irait pour le mieux dans le meilleur des mondes, si un lapin-garou ne venait s''attaquer aux potagers de la ville...', '01:25:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18397336', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/52/30/18444948.jpg'),
(1789, 58227, 'Saint-Jacques... La Mecque', '2005-10-12', 'Au décès de leur mère, deux frères et une soeur apprennent qu''ils ne toucheront leur héritage que s''ils font ensemble, à pied, la marche du Puy-en-Velay à Saint-Jacques-de-Compostelle. Mais ils se détestent autant qu''ils détestent la marche...', 'Au décès de leur mère, deux frères et une soeur apprennent qu''ils ne toucheront leur héritage que s''ils font ensemble, à pied, la marche du Puy-en-Velay à Saint-Jacques-de-Compostelle. Mais ils se détestent autant qu''ils détestent la marche...', '01:52:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18397252', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/79/18/18441765.jpg'),
(1790, 48883, 'Don''t Come Knocking', '2005-10-12', 'Autrefois héros de westerns, Howard ne décroche plus que des rôles secondaires. Il mène une existence solitaire et noie son dégoût de lui-même dans l''alcool et les femmes. Jusqu''à ce que sa mère lui apprenne qu''il a peut-être un enfant quelque part.', 'Autrefois héros de westerns, Howard ne décroche plus que des rôles secondaires. Il mène une existence solitaire et noie son dégoût de lui-même dans l''alcool et les femmes. Jusqu''à ce que sa mère lui apprenne qu''il a peut-être un enfant quelque part.', '02:02:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18400119', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/82/45/18450906.jpg'),
(1791, 60569, 'Je ne suis pas là pour être aimé', '2005-10-12', '50 ans, huissier de justice, le coeur et le sourire fatigués, Jean-Claude Delsart a depuis\r\nlongtemps abandonné l''idée que la vie pouvait lui offrir des cadeaux. Jusqu''au jour où\r\nil s''autorise à pousser la porte d''un cours de tango...', '50 ans, huissier de justice, le coeur et le sourire fatigués, Jean-Claude Delsart a depuis\r\nlongtemps abandonné l''idée que la vie pouvait lui offrir des cadeaux. Jusqu''au jour où\r\nil s''autorise à pousser la porte d''un cours de tango...', '01:33:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18400136', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/98/78/18441667.jpg'),
(1792, 59115, 'La Maison de Nina', '2005-10-12', 'Créées dans l''urgence de la Libération, les maisons d''enfants ont accueilli, dès 1944, les gamins sans famille, puis, dès juin 1945, les enfants déportés. Des milliers d''enfants s''y sont reconstruits...', 'Créées dans l''urgence de la Libération, les maisons d''enfants ont accueilli, dès 1944, les gamins sans famille, puis, dès juin 1945, les enfants déportés. Des milliers d''enfants s''y sont reconstruits...', '01:50:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18397594', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/95/54/18441653.jpg'),
(1793, 56435, 'Goal ! : naissance d''un prodige', '2005-10-12', 'Santiago rêve de devenir un grand joueur de foot. Parti pour l''Angleterre afin d''être engagé dans l''un des clubs les plus prestigieux du monde, il va devoir prouver qu''il a le talent et le cran nécessaire.', 'Santiago rêve de devenir un grand joueur de foot. Parti pour l''Angleterre afin d''être engagé dans l''un des clubs les plus prestigieux du monde, il va devoir prouver qu''il a le talent et le cran nécessaire.', '02:00:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18397991', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/99/88/18451581.jpg'),
(1794, 57491, 'La Main au collier', '2005-10-05', 'Sarah, une enseignante fraîchement divorcée, veut retrouver le grand amour. Pour l''aider dans sa tâche, une de ses soeurs passe une annonce sur le net. Elle précise dans son message que le prétendant "doit aimer les chiens"...', 'Sarah, une enseignante fraîchement divorcée, veut retrouver le grand amour. Pour l''aider dans sa tâche, une de ses soeurs passe une annonce sur le net. Elle précise dans son message que le prétendant "doit aimer les chiens"...', '01:38:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18400825', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/79/81/18449774.jpg'),
