(1797, 51499, 'Les Frères Grimm', '2005-10-05', 'Le périple des frères Jacob et Will Grimm, deux faussaires voyageant de ville en ville pour protéger les citadins de créatures imaginaires inventées par leurs soins. Jusqu''à ce qu''ils se retrouvent confrontés à une véritable malédiction...', 'Le périple des frères Jacob et Will Grimm, deux faussaires voyageant de ville en ville pour protéger les citadins de créatures imaginaires inventées par leurs soins. Jusqu''à ce qu''ils se retrouvent confrontés à une véritable malédiction...', '01:59:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18396443', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/85/89/18439036.jpg'),
(1798, 53883, 'Revolver', '2005-09-28', 'Jack Green est un expert au jeu, plein d''audace et dénué de bon sens. Un soir, il est invité à jouer dans un salon privé où il est censé perdre contre Dorothy Macha, un caïd de la pègre. Mais les choses ne se déroulent pas comme prévu...', 'Jack Green est un expert au jeu, plein d''audace et dénué de bon sens. Un soir, il est invité à jouer dans un salon privé où il est censé perdre contre Dorothy Macha, un caïd de la pègre. Mais les choses ne se déroulent pas comme prévu...', '01:55:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18398713', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/83/32/18443280.jpg'),
