(1800, 58241, 'Il ne faut jurer de rien !', '2005-09-28', 'Paris, juillet 1830. Valentin ne croit pas en la vie et surtout pas en l''amour. Son oncle Van Buck ne croit qu''aux vertus de l''argent et du commerce. Ce dernier veut lui faire épouser Cécile, la jeune fille de la baronne de Mantes...', 'Paris, juillet 1830. Valentin ne croit pas en la vie et surtout pas en l''amour. Son oncle Van Buck ne croit qu''aux vertus de l''argent et du commerce. Ce dernier veut lui faire épouser Cécile, la jeune fille de la baronne de Mantes...', '01:35:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18398160', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/49/25/18443203.jpg'),
