(1802, 59433, 'Les Ames grises', '2005-09-28', 'Durant l''hiver 1917, le meurtre d''une fillette met en émoi un paisible village situé non loin de la ligne de front. Plusieurs notables sont soupçonnés du crime.', 'Durant l''hiver 1917, le meurtre d''une fillette met en émoi un paisible village situé non loin de la ligne de front. Plusieurs notables sont soupçonnés du crime.', '01:46:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18397273', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/92/42/18435570.jpg'),
(1803, 61129, 'Rize', '2005-09-21', 'Un documentaire sur le "krumping". Cette danse agressive et visuellement incroyable prend ses racines dans les danses tribales africaines et se caractérise par des pas et des mouvements d''une vitesse et d''une difficulté inégalées.', 'Un documentaire sur le "krumping". Cette danse agressive et visuellement incroyable prend ses racines dans les danses tribales africaines et se caractérise par des pas et des mouvements d''une vitesse et d''une difficulté inégalées.', '01:24:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18394080', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/85/69/18444208.jpg'),
