(1827, 57731, 'La Moustache', '2005-07-06', 'Un jour exceptionnel : Marc décide de couper sa moustache. Mais sa compagne Agnès,  ses amis et collègues de travail ne remarquent rien. Marc se retrouve donc seul contre tous, seul convaincu que jusqu''à la veille il portait une moustache...', 'Un jour exceptionnel : Marc décide de couper sa moustache. Mais sa compagne Agnès,  ses amis et collègues de travail ne remarquent rien. Marc se retrouve donc seul contre tous, seul convaincu que jusqu''à la veille il portait une moustache...', '01:26:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18391641', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/47/58/18430437.jpg'),
(1828, 59127, 'Whisky Romeo Zulu', '2005-06-29', '31 août 1999. Le Boeing 737 de la compagnie argentine LAPA s''enflamme après avoir percuté un terre-plein dans le centre de Buenos Aires et provoque la mort de 67 personnes. Ce film narre l''histoire qui mène à ce terrible accident.', '31 août 1999. Le Boeing 737 de la compagnie argentine LAPA s''enflamme après avoir percuté un terre-plein dans le centre de Buenos Aires et provoque la mort de 67 personnes. Ce film narre l''histoire qui mène à ce terrible accident.', '01:45:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18391110', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/63/28/18429947.jpg'),
(1829, 57614, 'Le Courage d''aimer', '2005-06-29', '"Le Courage d''aimer" est le triomphe des autodidactes, des outsiders, de ceux qui n''auraient jamais dû être à l''arrivée. Un chanteur des rues...une voleuse à la tire... une serveuse de bar... une bonne à tout faire... et un camelot charismatique.', '"Le Courage d''aimer" est le triomphe des autodidactes, des outsiders, de ceux qui n''auraient jamais dû être à l''arrivée. Un chanteur des rues...une voleuse à la tire... une serveuse de bar... une bonne à tout faire... et un camelot charismatique.', '01:43:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18391664', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/86/45/18431221.jpg'),
(1830, 57857, 'Camping à la ferme', '2005-06-29', 'Six jeunes en difficulté de la banlieue parisienne débarquent au fin fond de la campagne française. Ils doivent montrer leur bonne volonté en effectuant des travaux d''intérêts généraux décidés par la pétillante juge d''application des peines...', 'Six jeunes en difficulté de la banlieue parisienne débarquent au fin fond de la campagne française. Ils doivent montrer leur bonne volonté en effectuant des travaux d''intérêts généraux décidés par la pétillante juge d''application des peines...', '01:32:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18390207', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/57/68/18427671.jpg'),
(1831, 57941, 'L''Amour aux trousses', '2005-06-29', 'Deux flics de la brigade des stups partagent tout, mais Franck va trahir la confiance de Paul en entretenant une liaison avec sa femme. Alors qu''ils sont envoyés sur une mission dangereuse, ce dernier découvre la vérité...', 'Deux flics de la brigade des stups partagent tout, mais Franck va trahir la confiance de Paul en entretenant une liaison avec sa femme. Alors qu''ils sont envoyés sur une mission dangereuse, ce dernier découvre la vérité...', '01:33:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18391419', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/54/68/18431419.jpg'),
