(1833, 59124, 'My Summer of Love', '2005-06-22', 'Mona vit avec son frère dans un village du Yorkshire et s''y s''ennuie ferme. Les choses changent le jour où elle rencontre Tamsin, une jolie jeune fille de bonne famille, un peu sombre et rebelle. Celle-ci fascine aussitôt Mona...', 'Mona vit avec son frère dans un village du Yorkshire et s''y s''ennuie ferme. Les choses changent le jour où elle rencontre Tamsin, une jolie jeune fille de bonne famille, un peu sombre et rebelle. Celle-ci fascine aussitôt Mona...', '01:26:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18391117', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/52/98/18430209.jpg'),
(1834, 47578, 'Dear Wendy', '2005-06-22', 'Un jour, un petit revolver tombe entre les mains de Dick, il se sent irrésistiblement attiré par l''objet. Avec ce nouvel ami, il va convaincre les autres jeunes désoeuvrés de la ville de le rejoindre dans un club secret "Les Dandys"...', 'Un jour, un petit revolver tombe entre les mains de Dick, il se sent irrésistiblement attiré par l''objet. Avec ce nouvel ami, il va convaincre les autres jeunes désoeuvrés de la ville de le rejoindre dans un club secret "Les Dandys"...', '01:41:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18391433', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/56/97/18427478.jpg'),
