(1837, 60766, 'Douches froides', '2005-06-22', 'A 17 ans, Mickael est capitaine de l''équipe de judo et prépare le bac. Tout irait bien s''il n''était pas étrangement tenté de partager sa petite amie, Vanessa, avec Clément, nouvellement débarqué, dont le père est devenu le sponsor de l''équipe.', 'A 17 ans, Mickael est capitaine de l''équipe de judo et prépare le bac. Tout irait bien s''il n''était pas étrangement tenté de partager sa petite amie, Vanessa, avec Clément, nouvellement débarqué, dont le père est devenu le sponsor de l''équipe.', '01:42:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18391557', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/80/37/18431730.jpg'),
