(1839, 15980, 'Mrs Winterbourne', '1996-12-18', 'Connie Doyle, séduite puis abandonnée par un petit malfrat quand il apprend qu''elle est enceinte, part en train. A la suite d''un accident, elle est prise pour Patricia Winterbourne, qui se rendait pour la première fois avec son mari dans sa riche famille. Le mari ayant trouvé la mort, Connie est reçue...', 'Connie Doyle, séduite puis abandonnée par un petit malfrat quand il apprend qu''elle est enceinte, part en train. A la suite d''un accident, elle est prise pour Patricia Winterbourne, qui se rendait pour la première fois avec son mari dans sa riche famille. Le mari ayant trouvé la mort, Connie est reçue...', '01:44:00', 3.7, '', 'http://fr.web.img3.acsta.net/medias/nmedia/18/71/65/72/19141341.jpg'),
(1840, 51013, 'Batman Begins', '2005-06-15', 'Comment un homme seul peut-il changer le monde ? Telle est la question qui hante Bruce Wayne depuis cette nuit tragique où ses parents furent abattus sous ses yeux. Il décide de fuir Gotham City pour un long et discret voyage à travers le monde...', 'Comment un homme seul peut-il changer le monde ? Telle est la question qui hante Bruce Wayne depuis cette nuit tragique où ses parents furent abattus sous ses yeux. Il décide de fuir Gotham City pour un long et discret voyage à travers le monde...', '02:19:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18391448', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/23/40/18431141.jpg'),
(1841, 55984, 'Les Poupées russes', '2005-06-15', 'Xavier, 30 ans, est devenu écrivain, mais il semble un peu perdu. Il a aussi des réticences à se fixer avec une fille. Ses nouveaux voyages à Londres et à Saint-Pétersbourg lui permettront peut-être de réconcilier le travail, l''amour et l''écriture.', 'Xavier, 30 ans, est devenu écrivain, mais il semble un peu perdu. Il a aussi des réticences à se fixer avec une fille. Ses nouveaux voyages à Londres et à Saint-Pétersbourg lui permettront peut-être de réconcilier le travail, l''amour et l''écriture.', '02:05:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18390085', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/79/54/18425307.jpg'),
