(1850, 52501, 'Sahara', '2005-06-01', 'Avec son inséparable partenaire et ami Al, l''explorateur Dirk Pitt se lance dans une chasse au trésor qui va les conduire dans les régions les plus reculées d''Afrique, sur les traces d''un navire mystérieusement disparu avec sa cargaison secrète.', 'Avec son inséparable partenaire et ami Al, l''explorateur Dirk Pitt se lance dans une chasse au trésor qui va les conduire dans les régions les plus reculées d''Afrique, sur les traces d''un navire mystérieusement disparu avec sa cargaison secrète.', '02:05:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18388541', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/53/33/18424020.jpg'),
