(1852, 60162, 'Le 7ème jour', '2005-05-25', 'Dans la chaleur aride de l''Espagne rurale, deux familles se disputent depuis des années les limites de propriété de leurs terres. Isabel, adolescente et fille aînée d''une des familles, tente de découvrir l''origine de cet horrible conflit...', 'Dans la chaleur aride de l''Espagne rurale, deux familles se disputent depuis des années les limites de propriété de leurs terres. Isabel, adolescente et fille aînée d''une des familles, tente de découvrir l''origine de cet horrible conflit...', '01:43:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18388340', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/63/02/18414508.jpg'),
