(1855, 58132, 'Cavalcade', '2005-05-25', 'Il y a des hommes qui ont tout et d''autres qui ont plus encore. Léo est de ceux-là. Noctambule branché, dragueur impénitent et figure de la jet-set, il dévore la vie comme d''autres la rêvent. Jusqu''au jour ou tout bascule un matin au fond d''un ravin.', 'Il y a des hommes qui ont tout et d''autres qui ont plus encore. Léo est de ceux-là. Noctambule branché, dragueur impénitent et figure de la jet-set, il dévore la vie comme d''autres la rêvent. Jusqu''au jour ou tout bascule un matin au fond d''un ravin.', '01:30:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18388233', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/61/14/18424671.jpg'),
(1856, 53680, 'Le Vol du Phoenix', '2005-05-11', 'Le Capitaine Frank Towns prend à bord de son avion les ouvriers d''une plateforme pétrolière. En direction de Pékin, ils croisent une tempête de poussière qui provoque le crash de l''engin. Ils se retrouvent alors en plein désert de Gobie...', 'Le Capitaine Frank Towns prend à bord de son avion les ouvriers d''une plateforme pétrolière. En direction de Pékin, ils croisent une tempête de poussière qui provoque le crash de l''engin. Ils se retrouvent alors en plein désert de Gobie...', '01:53:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18388248', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/49/23/18424092.jpg'),
(1857, 59903, 'Le Crime farpait', '2005-05-11', 'Le vendeur le plus séduisant d''un grand magasin tue un collègue rival par accident. Une des vendeuses du rayon parfumerie est témoin de la scène et en profite pour lui faire un perfide chantage sexuel.', 'Le vendeur le plus séduisant d''un grand magasin tue un collègue rival par accident. Une des vendeuses du rayon parfumerie est témoin de la scène et en profite pour lui faire un perfide chantage sexuel.', '01:44:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18386452', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/78/64/18424588.jpg'),
(1858, 54145, 'Lemming', '2005-05-11', 'Bénédicte et Alain Getty, brillant ingénieur en domotique, récemment installés dans une nouvelle ville, reçoivent à dîner le patron d''Alain, Richard, et son épouse Alice. Cette rencontre ne sera pas sans conséquences sur l''harmonie du jeune couple...', 'Bénédicte et Alain Getty, brillant ingénieur en domotique, récemment installés dans une nouvelle ville, reçoivent à dîner le patron d''Alain, Richard, et son épouse Alice. Cette rencontre ne sera pas sans conséquences sur l''harmonie du jeune couple...', '02:09:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18388513', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/79/57/18425367.jpg');
