(1859, 59615, 'Frères de sang', '2005-05-11', 'Les espoirs d''une famille coréenne s''effondrent brutalement le 25 juin 1950, lorsque la guerre éclate. Jin-suk est recruté de force et envoyé sur le front. Jin-tae, son frère aîné, subit le même sort. Tous deux rejoignent l''armée du Sud...', 'Les espoirs d''une famille coréenne s''effondrent brutalement le 25 juin 1950, lorsque la guerre éclate. Jin-suk est recruté de force et envoyé sur le front. Jin-tae, son frère aîné, subit le même sort. Tous deux rejoignent l''armée du Sud...', '02:20:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18387658', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/61/66/18424690.jpg'),
(1860, 54457, 'En bonne compagnie', '2005-05-11', 'Directeur des ventes publicitaires, Dan, 51 ans, a un nouveau patron, Carter, qui a la moitié de son âge. Entre les deux hommes, le courant ne passe pas. Le coup de foudre d''Alex, la fille de Dan, et de Carter va encore compliquer les choses...', 'Directeur des ventes publicitaires, Dan, 51 ans, a un nouveau patron, Carter, qui a la moitié de son âge. Entre les deux hommes, le courant ne passe pas. Le coup de foudre d''Alex, la fille de Dan, et de Carter va encore compliquer les choses...', '01:49:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18387737', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/48/66/18424540.jpg'),
(1861, 58206, 'Creep', '2005-05-04', 'A Londres, au sortir d''une soirée chic copieusement arrosée, Kate guette vainement un taxi avant de se résoudre à prendre le dernier métro. Sous l''effet de l''alcool, la jeune femme ne tarde pas à s''assoupir. A son réveil, la rame est déserte...', 'A Londres, au sortir d''une soirée chic copieusement arrosée, Kate guette vainement un taxi avant de se résoudre à prendre le dernier métro. Sous l''effet de l''alcool, la jeune femme ne tarde pas à s''assoupir. A son réveil, la rame est déserte...', '01:25:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18378641', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/54/95/18411718.jpg'),
(1862, 53974, 'L''intrus', '2005-05-04', 'A la veille d''une transplantation cardiaque, un homme malade décide de quitter la montagne où il mène une existence solitaire pour partir vers les îles à la recherche d''un passé et d''un paradis perdus.', 'A la veille d''une transplantation cardiaque, un homme malade décide de quitter la montagne où il mène une existence solitaire pour partir vers les îles à la recherche d''un passé et d''un paradis perdus.', '02:10:00', 2.3, '', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/41/90/18424106.jpg'),
(1863, 54205, 'Kingdom of Heaven', '2005-05-04', 'L''aventure extraordinaire d''un homme ordinaire, précipité dans un conflit qui va durer des décennies : les croisades. Il lui faudra protéger les habitants de Jérusalem, dont une immense armée a entrepris le siège...', 'L''aventure extraordinaire d''un homme ordinaire, précipité dans un conflit qui va durer des décennies : les croisades. Il lui faudra protéger les habitants de Jérusalem, dont une immense armée a entrepris le siège...', '02:25:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18379631', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/53/31/18425554.jpg'),
(1864, 52581, 'Vanity fair, la foire aux vanités', '2005-05-04', 'Fille d''un artiste peintre anglais sans le sou et d''une chanteuse de cabaret française, Becky Sharp va déployer toute son intelligence et son pouvoir de séduction pour progresser au sein de la haute société britannique du début du XIXe siècle.', 'Fille d''un artiste peintre anglais sans le sou et d''une chanteuse de cabaret française, Becky Sharp va déployer toute son intelligence et son pouvoir de séduction pour progresser au sein de la haute société britannique du début du XIXe siècle.', '02:22:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18376549', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/32/66/18413677.jpg'),
(1865, 51895, 'Shall we dance ? La Nouvelle vie de Monsieur Clark', '2005-05-04', 'Un avocat prospère mène une vie banale jusqu''au jour où, en rentrant du travail, il\r\naperçoit une belle femme à une fenêtre. Fasciné par son regard, il décide\r\nde se rendre à l''Académie de danse où elle est professeur et d''y prendre des cours...', 'Un avocat prospère mène une vie banale jusqu''au jour où, en rentrant du travail, il\r\naperçoit une belle femme à une fenêtre. Fasciné par son regard, il décide\r\nde se rendre à l''Académie de danse où elle est professeur et d''y prendre des cours...', '01:46:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18380823', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/26/00/18413330.jpg'),
(1866, 55776, 'Avant qu''il ne soit trop tard', '2005-05-04', 'Plusieurs amis, ayant en commun une connaissance brutalement décédée, évoquent leur souvenirs, s''avouent leurs secrets, retrouvent leurs fous rires et leur complicité au cours d''une nuit dans une maison isolée de montagne.', 'Plusieurs amis, ayant en commun une connaissance brutalement décédée, évoquent leur souvenirs, s''avouent leurs secrets, retrouvent leurs fous rires et leur complicité au cours d''une nuit dans une maison isolée de montagne.', '01:24:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18379186', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/58/81/18409908.jpg'),
(1867, 53982, 'Trois couples en quête d''orage', '2005-04-27', 'Olivier, Rémi et Pascale, trois amis de longue date, proches de la quarantaine, une femme, deux hommes, avec leurs femmes et époux respectifs, ont formé un clan. Mais ce groupe va connaître sa première remise en question...', 'Olivier, Rémi et Pascale, trois amis de longue date, proches de la quarantaine, une femme, deux hommes, avec leurs femmes et époux respectifs, ont formé un clan. Mais ce groupe va connaître sa première remise en question...', '01:45:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18388450', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/60/11/18411487.jpg'),
(1868, 58135, 'Un fil à la patte', '2005-04-27', 'Bois d''Enghien aime Lucette, la diva, sa maîtresse, mais il doit rompre, car il va signer, l''après-midi même, son contrat de mariage avec Viviane Duverger, jolie jeune fille et jolie dot...', 'Bois d''Enghien aime Lucette, la diva, sa maîtresse, mais il doit rompre, car il va signer, l''après-midi même, son contrat de mariage avec Viviane Duverger, jolie jeune fille et jolie dot...', '01:20:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18386419', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/58/87/18413050.jpg'),
(1869, 49350, 'Otage', '2005-04-27', 'Jeff Talley, ancien spécialiste des négociations en cas d''enlèvement, est devenu chef du bureau de police d''une ville reculée. Mais trois malfrats vont prendre en otage la famille d''un expert comptable bien moins banal qu''il n''y paraît...', 'Jeff Talley, ancien spécialiste des négociations en cas d''enlèvement, est devenu chef du bureau de police d''une ville reculée. Mais trois malfrats vont prendre en otage la famille d''un expert comptable bien moins banal qu''il n''y paraît...', '01:53:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18379362', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/51/11/18413138.jpg'),
(1870, 51742, 'J''adore Huckabees', '2005-04-27', 'Albert vit une série de coïncidences troublantes dont le sens lui échappe. Avec l''aide de deux detectives, Albert analyse sa vie, ses relations amoureuses, et son conflit avec Brad Stand, un jeune cadre dynamique et ambitieux chez Huckabees.', 'Albert vit une série de coïncidences troublantes dont le sens lui échappe. Avec l''aide de deux detectives, Albert analyse sa vie, ses relations amoureuses, et son conflit avec Brad Stand, un jeune cadre dynamique et ambitieux chez Huckabees.', '01:46:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18377012', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/49/27/18408357.jpg'),
(1871, 57479, 'Anthony Zimmer', '2005-04-27', 'En vacances sur la côte d''Azur, François est séduit par Chiara, le genre de créature de rêve qu''il n''aperçoit d''habitude que sur des couvertures de magazines. François vit un véritable conte de fées. Jusqu''au jour où on tente de l''abattre.', 'En vacances sur la côte d''Azur, François est séduit par Chiara, le genre de créature de rêve qu''il n''aperçoit d''habitude que sur des couvertures de magazines. François vit un véritable conte de fées. Jusqu''au jour où on tente de l''abattre.', '01:30:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18379391', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/50/82/18414107.jpg'),
(1872, 57050, 'Breaking news', '2005-04-20', 'Une fusillade opposant la police à des malfrats est retransmise à la télévision. La diffusion de la défaite humiliante des policiers porte un coup terrible à leur crédibilité. Le repère des truands est repéré. Un assaut "médiatique" se prépare...', 'Une fusillade opposant la police à des malfrats est retransmise à la télévision. La diffusion de la défaite humiliante des policiers porte un coup terrible à leur crédibilité. Le repère des truands est repéré. Un assaut "médiatique" se prépare...', '01:31:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18379000', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/31/32/18413650.jpg'),
(1873, 58905, 'Les Mauvais joueurs', '2005-04-20', 'Paris, le quartier du Sentier. La vie de Vahé part à vau-l''eau. Yuen, le frère de sa compagne, arrivé clandestinement en France, refuse de travailler pour le réseau qui l''a fait passer. Se prenant d''affection pour lui, Vahé décide de l''aider...', 'Paris, le quartier du Sentier. La vie de Vahé part à vau-l''eau. Yuen, le frère de sa compagne, arrivé clandestinement en France, refuse de travailler pour le réseau qui l''a fait passer. Se prenant d''affection pour lui, Vahé décide de l''aider...', '01:25:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18379543', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/58/83/18412221.jpg'),
(1874, 55721, 'L''Empire des loups', '2005-04-20', 'Paul Nerteaux enquête sur la mort de trois femmes d''origine turque dont les corps ont été mutilés. Pour l''aider à infiltrer la population turque du Xe arrondissement, il fait appel à Jean-Louis Schiffer, un ancien collègue connu pour sa ténacité.', 'Paul Nerteaux enquête sur la mort de trois femmes d''origine turque dont les corps ont été mutilés. Pour l''aider à infiltrer la population turque du Xe arrondissement, il fait appel à Jean-Louis Schiffer, un ancien collègue connu pour sa ténacité.', '02:08:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18378621', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/53/19/18406430.jpg'),
(1875, 47751, 'Garden State', '2005-04-20', 'Un jeune homme retourne dans sa famille après dix ans d''absence, à l''occasion des funérailles de sa mère. Sa rencontre avec la jolie Sam va le bouleverser encore un peu plus...', 'Un jeune homme retourne dans sa famille après dix ans d''absence, à l''occasion des funérailles de sa mère. Sa rencontre avec la jolie Sam va le bouleverser encore un peu plus...', '01:42:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18379275', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/20/90/18411673.jpg'),
(1876, 58136, 'Locataires', '2005-04-13', 'Tae-suk laisse des prospectus sur les poignées de porte des maisons. Quand il revient, il sait qu''elles sont désertées. Il y pénètre et occupe ces lieux inhabités. Un jour, il s''installe dans une maison où loge une femme maltraitée par son mari...', 'Tae-suk laisse des prospectus sur les poignées de porte des maisons. Quand il revient, il sait qu''elles sont désertées. Il y pénètre et occupe ces lieux inhabités. Un jour, il s''installe dans une maison où loge une femme maltraitée par son mari...', '01:30:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18379238', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/50/65/18413159.jpg'),
(1877, 57433, 'Dans tes rêves', '2005-04-13', 'Ixe est un jeune rappeur prometteur dont la réputation ne dépasse pas encore les quelques rues de son quartier. Soutenu par Keuj, un coiffeur apprenti producteur, il tente de participer à des concerts et cherche à percer dans le milieu de la musique.', 'Ixe est un jeune rappeur prometteur dont la réputation ne dépasse pas encore les quelques rues de son quartier. Soutenu par Keuj, un coiffeur apprenti producteur, il tente de participer à des concerts et cherche à percer dans le milieu de la musique.', '01:35:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18376651', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/52/96/18411781.jpg'),
(1878, 58226, 'Mon petit doigt m''a dit', '2005-04-13', 'Pourquoi Mme Evangelista a-t-elle quitté la maison de retraite où Bélisaire et Prudence sont venus voir leur tante Ada ? Pourquoi cette vieille dame faisait-elle allusion à un enfant emmuré dans une cheminée ? Bélisaire et Prudence mènent l''enquête.', 'Pourquoi Mme Evangelista a-t-elle quitté la maison de retraite où Bélisaire et Prudence sont venus voir leur tante Ada ? Pourquoi cette vieille dame faisait-elle allusion à un enfant emmuré dans une cheminée ? Bélisaire et Prudence mènent l''enquête.', '01:45:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18379297', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/62/27/18413387.jpg'),
(1879, 57435, 'Akoibon', '2005-04-13', 'Nader, un escroc, se rend sur une île du Sud pour débusquer Chris Barnes, ex-roi de la jet set. Daniel vient y rencontrer une énigmatique jeune femme. Convaincus que cela facilitera leur approche, Daniel et Nader décident d''échanger leurs identités.', 'Nader, un escroc, se rend sur une île du Sud pour débusquer Chris Barnes, ex-roi de la jet set. Daniel vient y rencontrer une énigmatique jeune femme. Convaincus que cela facilitera leur approche, Daniel et Nader décident d''échanger leurs identités.', '01:38:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18385319', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/45/63/18412139.jpg'),
(1880, 45649, 'Man to Man', '2005-04-13', 'En 1870, un anthropologue écossais ramènent en Europe deux pygmées qui deviendront des bêtes de foire. Il va alors s''acharner à prouver que ces indigènes sont des hommes à part entière et non des animaux destinés à faire sensation dans les zoos.', 'En 1870, un anthropologue écossais ramènent en Europe deux pygmées qui deviendront des bêtes de foire. Il va alors s''acharner à prouver que ces indigènes sont des hommes à part entière et non des animaux destinés à faire sensation dans les zoos.', '02:02:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18379286', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/32/03/18405778.jpg'),
(1881, 53218, 'Robots', '2005-04-06', 'Rodney est un jeune robot plein d''idées, mais son village est trop petit pour ses rêves. Il part à Robot Ville rencontrer Bigweld, le plus génial inventeur et bienfaiteur de tous les robots, pour lui proposer ses services...', 'Rodney est un jeune robot plein d''idées, mais son village est trop petit pour ses rêves. Il part à Robot Ville rencontrer Bigweld, le plus génial inventeur et bienfaiteur de tous les robots, pour lui proposer ses services...', '01:30:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18378934', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/46/07/18408708.jpg'),
(1882, 47748, 'Dr. Kinsey', '2005-04-06', 'En 1948, aux Etats-Unis, Alfred Kinsey publie un rapport historique sur les habitudes sexuelles de ses compatriotes. Ce document fait l''effet d''une bombe. Pour la première fois, le comportement sexuel humain fait l''objet d''une étude scientifique.', 'En 1948, aux Etats-Unis, Alfred Kinsey publie un rapport historique sur les habitudes sexuelles de ses compatriotes. Ce document fait l''effet d''une bombe. Pour la première fois, le comportement sexuel humain fait l''objet d''une étude scientifique.', '01:58:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18379298', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/44/73/18411316.jpg'),
(1883, 57727, 'Les Enfants', '2005-04-06', 'Jeanne et Pierre se rencontrent. Ils ont en commun d''être divorcé et d''avoir chacun deux enfants. Pas facile pour Pierre de vivre avec les enfants de Jeanne. Pas facile pour Jeanne d''être la mère de deux garçons qui ne sont pas les siens.', 'Jeanne et Pierre se rencontrent. Ils ont en commun d''être divorcé et d''avoir chacun deux enfants. Pas facile pour Pierre de vivre avec les enfants de Jeanne. Pas facile pour Jeanne d''être la mère de deux garçons qui ne sont pas les siens.', '01:28:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18378967', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/58/82/18409936.jpg'),
(1884, 56143, 'Brice de Nice', '2005-04-06', 'Eternel ado de presque trente ans, Brice est un surfeur qui attend SA vague à Nice ! Personne ne se risque à se moquer de lui : Brice s''est fait une spécialité de "casser" tout le monde. Il fallait bien qu''un jour il soit rattrapé par la réalité...', 'Eternel ado de presque trente ans, Brice est un surfeur qui attend SA vague à Nice ! Personne ne se risque à se moquer de lui : Brice s''est fait une spécialité de "casser" tout le monde. Il fallait bien qu''un jour il soit rattrapé par la réalité...', '01:38:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18379164', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/44/62/18411943.jpg'),
(1885, 56286, 'Une Femme coréenne', '2005-03-30', 'L''histoire d''une ancienne danseuse mariée à un avocat de renom infidèle. Femme au foyer, elle décide de sortir de sa torpeur quotidienne en cédant aux charmes de son jeune voisin, un adolescent timide.', 'L''histoire d''une ancienne danseuse mariée à un avocat de renom infidèle. Femme au foyer, elle décide de sortir de sa torpeur quotidienne en cédant aux charmes de son jeune voisin, un adolescent timide.', '01:47:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18378677', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/54/00/18414588.jpg'),
