(1887, 59125, 'Mysterious Skin', '2005-03-30', 'La vie de Brian change complètement après un incident survenu lorsqu''il avait huit ans. Dix ans plus tard, il est certain d''avoir été enlevé par des extraterrestres et pense que seul son ami Neil pourrait avoir la clé de l''énigme...', 'La vie de Brian change complètement après un incident survenu lorsqu''il avait huit ans. Dix ans plus tard, il est certain d''avoir été enlevé par des extraterrestres et pense que seul son ami Neil pourrait avoir la clé de l''énigme...', '01:39:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18377924', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/52/97/18405510.jpg'),
