(1921, 28560, 'Mon beau-père, mes parents et moi', '2005-02-16', 'L''ex-agent de la CIA Jack Byrnes ayant donné la permission à Greg Focker d''épouser sa fille, il se rend avec sa femme Dina en Floride afin de connaître les parents plutôt cool de son gendre.', 'L''ex-agent de la CIA Jack Byrnes ayant donné la permission à Greg Focker d''épouser sa fille, il se rend avec sa femme Dina en Floride afin de connaître les parents plutôt cool de son gendre.', '01:56:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369844', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/44/49/18403883.jpg'),
(1922, 52702, 'Le promeneur du champ de Mars', '2005-02-16', 'Les dernières années de la vie de François Mitterrand, Président de la République française de 1981 à 1995, à travers sa rencontre avec un jeune journaliste.', 'Les dernières années de la vie de François Mitterrand, Président de la République française de 1981 à 1995, à travers sa rencontre avec un jeune journaliste.', '01:57:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18375434', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/51/46/18401604.jpg'),
(1923, 55717, 'Chok-Dee', '2005-02-16', 'De combines en petits braquages, Ryan finit en prison. Il y rencontre Jean, un ancien champion de boxe. À son contact, il découvre un des sports les plus violents qui soit, la boxe thaïe, et toutes les valeurs morales qui s''y rattachent...', 'De combines en petits braquages, Ryan finit en prison. Il y rencontre Jean, un ancien champion de boxe. À son contact, il découvre un des sports les plus violents qui soit, la boxe thaïe, et toutes les valeurs morales qui s''y rattachent...', '01:45:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18374511', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/50/86/18400405.jpg'),
(1924, 58969, 'Bloom', '2005-02-09', '"Bloom" est un conte passionnant d''amour, de perte et de désir, une aventure fantastique à travers la conscience, l''imagination et les envies de Stephen Dedalus, Molly Bloom et Leopold Bloom.', '"Bloom" est un conte passionnant d''amour, de perte et de désir, une aventure fantastique à travers la conscience, l''imagination et les envies de Stephen Dedalus, Molly Bloom et Leopold Bloom.', '01:53:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18376636', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/53/27/18406046.jpg'),
(1925, 52289, 'Coup d''éclat', '2005-02-09', 'Max et Lola s''enfuient dans un paradis tropical pour profiter du fruit de leur coupable entreprise. Ils coulent des jours paisibles jusqu''à ce qu''un agent du FBI retrouve leur trace, convaincu qu''ils vont dérober un diamant lors de leur croisière.', 'Max et Lola s''enfuient dans un paradis tropical pour profiter du fruit de leur coupable entreprise. Ils coulent des jours paisibles jusqu''à ce qu''un agent du FBI retrouve leur trace, convaincu qu''ils vont dérober un diamant lors de leur croisière.', '01:38:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18370790', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/42/89/18405845.jpg'),
(1926, 57418, 'Vera Drake', '2005-02-09', 'Vera Drake est une mère de famille exemplaire et totalement dévouée à son entourage. Pourtant, derrière son quotidien apparemment banal, Vera cache une activité secrète : elle aide certaine femme à mettre fin à leur grossesse involontaire...', 'Vera Drake est une mère de famille exemplaire et totalement dévouée à son entourage. Pourtant, derrière son quotidien apparemment banal, Vera cache une activité secrète : elle aide certaine femme à mettre fin à leur grossesse involontaire...', '02:05:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18374054', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/40/21/18397931.jpg'),
(1927, 52406, 'Iznogoud', '2005-02-09', 'Le grand vizir Iznogoud a pour unique ambition de devenir Calife à la place du Calife Haroun El Poussah. Cet être mauvais et risible est prêt à tout pour parvenir à ses fins...', 'Le grand vizir Iznogoud a pour unique ambition de devenir Calife à la place du Calife Haroun El Poussah. Cet être mauvais et risible est prêt à tout pour parvenir à ses fins...', '01:35:00', 1.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18375264', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/40/18/18402481.jpg'),
(1928, 53496, 'Sideways', '2005-02-09', 'Deux amis font la route des vins en Californie. L''un est un écrivain raté et vient de divorcer ; l''autre, acteur, s''apprête à se marier. De cave en cave, de bar en bar, ils savourent cette semaine charnière, où leur amitié sera mise à rude épreuve.', 'Deux amis font la route des vins en Californie. L''un est un écrivain raté et vient de divorcer ; l''autre, acteur, s''apprête à se marier. De cave en cave, de bar en bar, ils savourent cette semaine charnière, où leur amitié sera mise à rude épreuve.', '02:04:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18375931', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/45/97/18404043.jpg'),
(1929, 58385, 'Tenja', '2005-02-02', 'Nordine, fils d''un mineur marocain, a grandi dans le Nord de la France. Afin de respecter les dernières volontés de son père qui souhaite reposer dans son village natal du Haut Atlas, il va l''accompagner pour son dernier voyage...', 'Nordine, fils d''un mineur marocain, a grandi dans le Nord de la France. Afin de respecter les dernières volontés de son père qui souhaite reposer dans son village natal du Haut Atlas, il va l''accompagner pour son dernier voyage...', '01:20:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18376134', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/49/01/18406600.jpg'),
(1930, 48273, 'Le Manège enchanté', '2005-02-02', 'Le chien Pollux et ses amis se retrouvent aux prises avec le méchant sorcier Zabadie, libéré du Manège Enchanté et retenant Margote prisonnière des glaces. Ils devront se mettre en quête de trois diamants que convoite Zabadie pour diriger la planète.', 'Le chien Pollux et ses amis se retrouvent aux prises avec le méchant sorcier Zabadie, libéré du Manège Enchanté et retenant Margote prisonnière des glaces. Ils devront se mettre en quête de trois diamants que convoite Zabadie pour diriger la planète.', '01:25:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18373466', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/49/75/18400214.jpg'),
(1931, 55502, 'L''Ex femme de ma vie', '2005-02-02', 'Un auteur à succès s''apprête à recevoir une de ses conquêtes à souper chez lui. Débarque alors son ex-femme, qu''il n''a pas vue depuis six ans. Enceinte de sept mois, elle vient tout juste de se faire larguer par son amant et ne sait pas où dormir...', 'Un auteur à succès s''apprête à recevoir une de ses conquêtes à souper chez lui. Débarque alors son ex-femme, qu''il n''a pas vue depuis six ans. Enceinte de sept mois, elle vient tout juste de se faire larguer par son amant et ne sait pas où dormir...', '01:35:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18373237', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/50/89/18400514.jpg'),
(1932, 53298, 'Espace détente', '2005-02-02', 'Au fond de la Veule, imaginaire province française, vivote la Geugène Electro Stim, une moyenne entreprise. L''opportunité d''un nouveau produit, le BodyCompact, va jeter cette communauté tranquille dans les affres d''un libéralisme sans foi ni loi...', 'Au fond de la Veule, imaginaire province française, vivote la Geugène Electro Stim, une moyenne entreprise. L''opportunité d''un nouveau produit, le BodyCompact, va jeter cette communauté tranquille dans les affres d''un libéralisme sans foi ni loi...', '01:42:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18374150', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/50/72/18399935.jpg'),
(1933, 53097, 'Mar adentro', '2005-02-02', 'La véritable histoire de Ramon Sampedro qui, devenu paralysé après d''un accident, s''est battu pour le droit à l''euthanasie.', 'La véritable histoire de Ramon Sampedro qui, devenu paralysé après d''un accident, s''est battu pour le droit à l''euthanasie.', '02:05:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18374601', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/53/21/18403631.jpg');
