(1934, 49935, 'Danny the Dog', '2005-02-02', 'Bart a élevé Danny comme un chien, dressé pour tuer. Il ne connaît de la vie que son maître et les combats sanguinaires. Après un règlement de compte, Danny se retrouve seul. Sam, artiste, et sa belle fille mélomane le recueillent...', 'Bart a élevé Danny comme un chien, dressé pour tuer. Il ne connaît de la vie que son maître et les combats sanguinaires. Après un règlement de compte, Danny se retrouve seul. Sam, artiste, et sa belle fille mélomane le recueillent...', '01:42:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18373896', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/50/74/18401024.jpg'),
(1935, 54124, 'Lila dit ça', '2005-01-26', 'Il n''a encore jamais parlé de "ça", comme ça, avec personne. Elle n''a encore jamais trouvé personne à qui parler. Elle ne pense qu''à ce garçon-là, il faut parler de ça pour s''en faire aimer. Elle a 16 ans et lui 19.', 'Il n''a encore jamais parlé de "ça", comme ça, avec personne. Elle n''a encore jamais trouvé personne à qui parler. Elle ne pense qu''à ce garçon-là, il faut parler de ça pour s''en faire aimer. Elle a 16 ans et lui 19.', '01:29:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18374200', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/49/28/18401334.jpg'),
(1936, 54646, 'Matrubhoomi un monde sans femmes', '2005-01-26', 'Dans une région rurale de l''Inde où depuis des années la population féminine est décimée, Ramcharan essaie de marier ses cinq fils. Non loin de là, un pauvre paysan cache son bien le plus précieux : Kalki, sa fille de 16 ans, véritable beauté...', 'Dans une région rurale de l''Inde où depuis des années la population féminine est décimée, Ramcharan essaie de marier ses cinq fils. Non loin de là, un pauvre paysan cache son bien le plus précieux : Kalki, sa fille de 16 ans, véritable beauté...', '01:38:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18375475', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/49/10/18401646.jpg'),
(1937, 55567, 'Lolita malgré moi', '2005-01-26', 'Cady atterrit dans un lycée, où chaque lolita aspire à devenir la fille la plus populaire. Voyant en elle une rivale potentielle, Regina se pose en amie pour mieux la contrôler. Mais Cady tombe amoureuse du bel Aaron, l''ancien petit ami de Regina...', 'Cady atterrit dans un lycée, où chaque lolita aspire à devenir la fille la plus populaire. Voyant en elle une rivale potentielle, Regina se pose en amie pour mieux la contrôler. Mais Cady tombe amoureuse du bel Aaron, l''ancien petit ami de Regina...', '01:38:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18364521', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/29/73/18380536.jpg'),
(1938, 57924, 'Tellement proches !', '2005-01-26', 'Madrid, un soir d''été. Leni a décidé de présenter son fiancé Rafi à sa famille. Jusque-là tout va bien, sauf que sa famille est juive et le fiancé palestinien. Commence alors une folle nuit pleine de quiproquos et de rebondissements...', 'Madrid, un soir d''été. Leni a décidé de présenter son fiancé Rafi à sa famille. Jusque-là tout va bien, sauf que sa famille est juive et le fiancé palestinien. Commence alors une folle nuit pleine de quiproquos et de rebondissements...', '01:29:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18374319', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/48/69/18397652.jpg'),
(1939, 58000, 'La Vie de Michel Muller est plus belle que la vôtre', '2005-01-26', 'Michel Muller triomphe au théâtre Déjazet, signe des autographes, et Luc Besson lui commande l''écriture d''un film dont il souhaite lui confier la réalisation. Pourtant, quand il accepte qu''une équipe de reporters le suive 24h/24, sa vie va basculer.', 'Michel Muller triomphe au théâtre Déjazet, signe des autographes, et Luc Besson lui commande l''écriture d''un film dont il souhaite lui confier la réalisation. Pourtant, quand il accepte qu''une équipe de reporters le suive 24h/24, sa vie va basculer.', '01:30:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18374166', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/52/12/18402472.jpg'),
(1940, 48371, 'Aviator', '2005-01-26', '"Aviator" couvre près de vingt ans de la vie tumultueuse d''Howard Hughes, industriel, milliardaire, casse-cou, pionnier de l''aviation civile, inventeur, producteur, réalisateur, directeur de studio et séducteur insatiable.', '"Aviator" couvre près de vingt ans de la vie tumultueuse d''Howard Hughes, industriel, milliardaire, casse-cou, pionnier de l''aviation civile, inventeur, producteur, réalisateur, directeur de studio et séducteur insatiable.', '02:45:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369346', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/44/61/18402266.jpg'),
(1941, 57615, 'La marche de l''empereur', '2005-01-26', 'L''histoire des manchots empereurs et de leur cycle de reproduction est unique au monde. Elle mêle amour, drame, courage et aventure au coeur de l''Antarctique, région la plus isolée et inhospitalière de la planète.', 'L''histoire des manchots empereurs et de leur cycle de reproduction est unique au monde. Elle mêle amour, drame, courage et aventure au coeur de l''Antarctique, région la plus isolée et inhospitalière de la planète.', '01:25:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18370973', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/47/16/18396216.jpg'),
(1942, 52316, 'The Machinist', '2005-01-19', 'Trevor est ouvrier dans une usine. Un métier répétitif, fatiguant, usant. Il a du mal à maintenir son attention, car il est très fatigué. Depuis quelque temps, sa vie devient de plus en plus étrange...', 'Trevor est ouvrier dans une usine. Un métier répétitif, fatiguant, usant. Il a du mal à maintenir son attention, car il est très fatigué. Depuis quelque temps, sa vie devient de plus en plus étrange...', '01:42:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18374584', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/40/81/18405123.jpg'),
(1943, 57041, 'Le Livre de Jérémie', '2005-01-19', 'L''histoire d''une enfance déchirée, vue par les yeux d''un petit garçon, Jérémie, et de sa mère, Sarah, jeune femme impulsive, insatiable et profondément perdue qui se prostitue pour des routiers sur des aires d''autoroute dans le sud des Etats-Unis.', 'L''histoire d''une enfance déchirée, vue par les yeux d''un petit garçon, Jérémie, et de sa mère, Sarah, jeune femme impulsive, insatiable et profondément perdue qui se prostitue pour des routiers sur des aires d''autoroute dans le sud des Etats-Unis.', '01:32:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19549792', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/31/81/18383858.jpg'),
(1944, 57037, 'Mon ami Machuca', '2005-01-19', 'Chili 1973. Deux enfants, l''un, timide, réside dans les beaux quartiers, l''autre, fils de paysans survit dans un bidonville. Ces garçons que tout oppose se rencontrent sur les bancs de l''école grâce à l''initiative idéaliste du Père Mac Enroe...', 'Chili 1973. Deux enfants, l''un, timide, réside dans les beaux quartiers, l''autre, fils de paysans survit dans un bidonville. Ces garçons que tout oppose se rencontrent sur les bancs de l''école grâce à l''initiative idéaliste du Père Mac Enroe...', '02:00:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18374318', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/29/72/18399721.jpg'),
(1945, 28695, 'Nèg Maron', '2005-01-19', 'Dans les petites Antilles, Josua et Silex, deux jeunes amis d''enfance à la dérive, mènent une existence insouciante. Mais la violence de l''île et l''escalade de situations déroutantes vont mettre leur amitié à rude épreuve...', 'Dans les petites Antilles, Josua et Silex, deux jeunes amis d''enfance à la dérive, mènent une existence insouciante. Mais la violence de l''île et l''escalade de situations déroutantes vont mettre leur amitié à rude épreuve...', '01:35:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18374047', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/50/64/18399780.jpg'),
(1946, 58393, 'Quand je serai star', '2005-01-19', 'Marc, 23 ans, a abandonné ses études pour devenir steward ; sa manière de se rebeller contre la civilisation de sa mère ; une civilisation féminine pleine d''une folle ambition ; une civilisation trop séduisante et trop factice à ses yeux...', 'Marc, 23 ans, a abandonné ses études pour devenir steward ; sa manière de se rebeller contre la civilisation de sa mère ; une civilisation féminine pleine d''une folle ambition ; une civilisation trop séduisante et trop factice à ses yeux...', '01:54:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18374013', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/50/63/18401945.jpg'),
(1947, 51594, 'Closer, entre adultes consentants', '2005-01-19', 'A un niveau extrême, deux hommes et deux femmes vont jouer le jeu pervers de la séduction et du désir. Alternant manipulations et trahisons, ils entament un diabolique chassé-croisé amoureux dont personne ne sortira indemne.', 'A un niveau extrême, deux hommes et deux femmes vont jouer le jeu pervers de la séduction et du désir. Alternant manipulations et trahisons, ils entament un diabolique chassé-croisé amoureux dont personne ne sortira indemne.', '01:45:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18370952', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/44/86/18402063.jpg'),
(1948, 57757, 'Criminal.', '2005-01-19', 'Rodrigo est un jeune escroc naïf et inexpérimenté, qui veut éponger les dettes de jeu de son père. Après avoir manqué une arnaque, il est sollicité par Richard Gaddis, un malfrat, qui lui propose d''être son complice pour une série de coups...', 'Rodrigo est un jeune escroc naïf et inexpérimenté, qui veut éponger les dettes de jeu de son père. Après avoir manqué une arnaque, il est sollicité par Richard Gaddis, un malfrat, qui lui propose d''être son complice pour une série de coups...', '01:26:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369108', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/40/29/18401458.jpg'),
(1949, 54485, 'Mon ange', '2005-01-19', 'Colette, une femme amoureuse, reçoit en pleine nuit un appel téléphonique. Une inconnue lui demande un service en forme d''appel au secours : aller chercher son petit garçon et le lui amener. Mais cet enfant approche de l''âge adulte...', 'Colette, une femme amoureuse, reçoit en pleine nuit un appel téléphonique. Une inconnue lui demande un service en forme d''appel au secours : aller chercher son petit garçon et le lui amener. Mais cet enfant approche de l''âge adulte...', '01:34:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18373477', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/49/24/18399346.jpg'),
(1950, 58181, 'Terre promise', '2005-01-12', 'Une nuit, dans un club, Diana fait la connaissance de Rose. Elle la supplie de l''aider. Leur rencontre est un signe d''espoir dans la descente aux enfers de ces femmes victimes de la traite des blanches.', 'Une nuit, dans un club, Diana fait la connaissance de Rose. Elle la supplie de l''aider. Leur rencontre est un signe d''espoir dans la descente aux enfers de ces femmes victimes de la traite des blanches.', '01:30:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18374155', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/45/95/18401455.jpg'),
