(1983, 54673, '36 Quai des Orfèvres', '2004-11-24', 'L''affrontement sur une période de 10 ans de deux grands flics hors pair affectés au 36, quai des Orfèvres, siège de la PJ. L''un est patron de la brigade de recherche et d''intervention, tandis que l''autre dirige la brigade de répression du banditisme.', 'L''affrontement sur une période de 10 ans de deux grands flics hors pair affectés au 36, quai des Orfèvres, siège de la PJ. L''un est patron de la brigade de recherche et d''intervention, tandis que l''autre dirige la brigade de répression du banditisme.', '01:50:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18368413', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/42/86/18395118.jpg'),
