(1985, 43407, 'Bad Santa', '2004-11-17', 'Chaque mois de décembre, Willie incarne le Père-Noël dans un grand magasin différent. Sous son habit, il cache une panoplie de perceur de coffres. La nuit de Noël, avec son acolyte, il cambriole la boutique. Mais, à Phoenix, le casse se complique...', 'Chaque mois de décembre, Willie incarne le Père-Noël dans un grand magasin différent. Sous son habit, il cache une panoplie de perceur de coffres. La nuit de Noël, avec son acolyte, il cambriole la boutique. Mais, à Phoenix, le casse se complique...', '01:28:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369570', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/27/89/18397076.jpg'),
(1986, 28756, 'Cellular', '2004-11-17', 'Une femme kidnappée et séquestrée passe un appel téléphonique au hasard et tombe sur un jeune homme à qui elle demande de l''aide. Celui-ci, qui n''a rien d''un super-héros, se lance dans une course contre la montre pour la sauver.', 'Une femme kidnappée et séquestrée passe un appel téléphonique au hasard et tombe sur un jeune homme à qui elle demande de l''aide. Celui-ci, qui n''a rien d''un super-héros, se lance dans une course contre la montre pour la sauver.', '01:35:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369736', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/41/80/18392340.jpg'),
(1987, 53769, 'She Hate Me', '2004-11-17', 'Jack vient d''être licencié. Quand son ex-compagne Fatima, devenue lesbienne, lui propose d''être le père biologique de son enfant et de celui de sa nouvelle petite amie contre paiement, il entrevoit le moyen de se faire de l''argent facile.', 'Jack vient d''être licencié. Quand son ex-compagne Fatima, devenue lesbienne, lui propose d''être le père biologique de son enfant et de celui de sa nouvelle petite amie contre paiement, il entrevoit le moyen de se faire de l''argent facile.', '02:18:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18371068', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/32/28/18393741.jpg'),
(1988, 53643, 'La demoiselle d''honneur', '2004-11-17', 'La rencontre de Philippe, un cadre commercial sans histoire, avec la jeune Senta, mystérieuse et passionnée. Philippe tombe amoureux, et auprès de la jeune femme, ses repères entre raison et passion vont s''évanouir peu à peu.', 'La rencontre de Philippe, un cadre commercial sans histoire, avec la jeune Senta, mystérieuse et passionnée. Philippe tombe amoureux, et auprès de la jeune femme, ses repères entre raison et passion vont s''évanouir peu à peu.', '01:50:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19433629', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/40/31/18391210.jpg'),
(1989, 56871, 'Le Secret des poignards volants', '2004-11-17', 'Au 9e siècle, la Chine est le théâtre de nombreux conflits. La dynastie Tang n''est plus aussi prospère que par le passé et le gouvernement corrompu tente de lutter contre les groupes de rebelles qui se multiplient sur le territoire.', 'Au 9e siècle, la Chine est le théâtre de nombreux conflits. La dynastie Tang n''est plus aussi prospère que par le passé et le gouvernement corrompu tente de lutter contre les groupes de rebelles qui se multiplient sur le territoire.', '01:59:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18371931', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/32/32/18397195.jpg'),
(1990, 57326, 'Le Prix du désir', '2004-11-10', 'Le romancier Daniel Boltanski vit avec sa belle femme, dont le fils Fabrizio, né d''une relation antérieure, va se marier à Capri. Sur le bateau qui l''emmène là-bas, il rencontre une jeune femme, Mila, avec laquelle il passe une nuit passionnée...', 'Le romancier Daniel Boltanski vit avec sa belle femme, dont le fils Fabrizio, né d''une relation antérieure, va se marier à Capri. Sur le bateau qui l''emmène là-bas, il rencontre une jeune femme, Mila, avec laquelle il passe une nuit passionnée...', '01:45:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18371321', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/32/12/18395258.jpg'),
(1991, 53820, 'La confiance règne', '2004-11-10', 'Ignares, menteurs et voleurs, Christophe et Chrystèle sont faits pour se rencontrer. Vu d''où ils viennent, ils auraient pu être pires...', 'Ignares, menteurs et voleurs, Christophe et Chrystèle sont faits pour se rencontrer. Vu d''où ils viennent, ils auraient pu être pires...', '01:38:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18370675', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/21/09/18392620.jpg'),
(1992, 56894, 'Nobody knows', '2004-11-10', 'Quatre frères et soeurs vivent avec leur mère.\r\nL''ainé, Akira, s''occupe de ses jeunes frères et soeurs, chacun d''un père différent.\r\nUn matin d''hiver, leur mère disparaît et les enfants commencent à vivre seuls.', 'Quatre frères et soeurs vivent avec leur mère.\r\nL''ainé, Akira, s''occupe de ses jeunes frères et soeurs, chacun d''un père différent.\r\nUn matin d''hiver, leur mère disparaît et les enfants commencent à vivre seuls.', '02:21:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18371000', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/27/87/18389249.jpg'),
(1993, 108101, 'Dogora - Ouvrons les Yeux', '2004-11-10', 'Un film musical sans acteur ni dialogue, tourné au Cambodge, et dont le scénario est constitué d''une suite symphonique du compositeur français Etienne Perruchon intitulée Dogora.', 'Un film musical sans acteur ni dialogue, tourné au Cambodge, et dont le scénario est constitué d''une suite symphonique du compositeur français Etienne Perruchon intitulée Dogora.', '01:20:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18370203', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/37/88/18390412.jpg'),
(1994, 56545, 'Les Fautes d''orthographe', '2004-11-03', 'Daniel Massu a quinze ans. Son père et sa mère sont proviseur et directeur des études de l''internat dont il est élève. Cette année, son père a décidé qu''il devait descendre au dortoir avec les autres. L''idée de cette promiscuité le terrorise...', 'Daniel Massu a quinze ans. Son père et sa mère sont proviseur et directeur des études de l''internat dont il est élève. Cette année, son père a décidé qu''il devait descendre au dortoir avec les autres. L''idée de cette promiscuité le terrorise...', '01:30:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18370603', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/40/78/18389068.jpg'),
(1995, 56835, 'Le dernier jour', '2004-11-03', 'A Noël, Simon débarque chez ses parents avec une jeune inconnue rencontrée dans le train de nuit. Durant le séjour, un coup de téléphone vient remuer cette famille sur laquelle un secret profondément gardé pèse depuis 20 ans.', 'A Noël, Simon débarque chez ses parents avec une jeune inconnue rencontrée dans le train de nuit. Durant le séjour, un coup de téléphone vient remuer cette famille sur laquelle un secret profondément gardé pèse depuis 20 ans.', '01:45:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18370483', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/40/83/18394671.jpg'),
(1996, 48084, 'Birth', '2004-11-03', 'L''équilibre psychologique d''une veuve new-yorkaise de 35 ans est perturbé par l''arrivée d''un enfant de dix ans qui se dit être la réincarnation de son mari, décédé dix ans plus tôt.', 'L''équilibre psychologique d''une veuve new-yorkaise de 35 ans est perturbé par l''arrivée d''un enfant de dix ans qui se dit être la réincarnation de son mari, décédé dix ans plus tôt.', '01:40:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369711', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/15/86/18394245.jpg'),
(1997, 49774, 'Un Crime dans la tête', '2004-11-03', 'Durant la Guerre du Golfe, le sergent Shaw, candidat à la présidence, se couvrit de gloire en sauvant sa patrouille. Pourtant, le major Marco doute de la véracité de cet acte. En revanche, chaque nuit, celui-ci est assailli de rêves terrifiants...', 'Durant la Guerre du Golfe, le sergent Shaw, candidat à la présidence, se couvrit de gloire en sauvant sa patrouille. Pourtant, le major Marco doute de la véracité de cet acte. En revanche, chaque nuit, celui-ci est assailli de rêves terrifiants...', '02:10:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18368595', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/40/14/18388190.jpg'),
(1998, 53527, 'L''Equipier', '2004-11-03', 'Camille débarque à Ouessant, son île natale, pour y vendre la maison familiale, devenu lieu de villégiature. Camille et Jeanne, sa tante, vont passer une dernière nuit dans la demeure, l''occasion pour Camille de découvrir le passé de ses parents...', 'Camille débarque à Ouessant, son île natale, pour y vendre la maison familiale, devenu lieu de villégiature. Camille et Jeanne, sa tante, vont passer une dernière nuit dans la demeure, l''occasion pour Camille de découvrir le passé de ses parents...', '01:44:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369657', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/26/93/18391062.jpg'),
(1999, 47002, 'AVP: Alien vs. Predator', '2004-10-27', 'Un industriel millionnaire finance une expédition en Antarctique. C''est au cours de celle-ci qu''un groupe de scientifiques découvre une pyramide où se joue une lutte ultime entre des Aliens et des Predators.', 'Un industriel millionnaire finance une expédition en Antarctique. C''est au cours de celle-ci qu''un groupe de scientifiques découvre une pyramide où se joue une lutte ultime entre des Aliens et des Predators.', '01:40:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369013', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/18/23/18393144.jpg'),
(2000, 52407, 'The Assassination of Richard Nixon', '2004-10-27', 'En 1974, avant que n''éclate le scandale du Watergate, Sam Bicke est au bord du gouffre. Cet homme effacé, cerné par les trahisons et les mensonges de la vie, va s''attaquer au plus puissant des menteurs politiques : le Président des Etats-Unis.', 'En 1974, avant que n''éclate le scandale du Watergate, Sam Bicke est au bord du gouffre. Cet homme effacé, cerné par les trahisons et les mensonges de la vie, va s''attaquer au plus puissant des menteurs politiques : le Président des Etats-Unis.', '01:35:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18370166', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/40/79/18390420.jpg'),
(2001, 53374, 'Les revenants', '2004-10-27', 'Les morts sont revenus en masse. Des milliers de personnes décédées ont quitté les cimetières pour investir les villes. Puis le phénomène s''est arrêté. On est entré dans une nouvelle phase délicate : la réinsertion des morts dans leurs familles.', 'Les morts sont revenus en masse. Des milliers de personnes décédées ont quitté les cimetières pour investir les villes. Puis le phénomène s''est arrêté. On est entré dans une nouvelle phase délicate : la réinsertion des morts dans leurs familles.', '01:45:00', 2.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18370494', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/40/32/18391182.jpg'),
(2002, 48349, 'Un long dimanche de fiançailles', '2004-10-27', 'Une femme cherche à découvrir la vérité sur la disparition de son fiancé pendant la Première Guerre mondiale. Ce dernier serait l''un des cinq soldats jugés en cour martiale puis mis en première ligne sur le front et abandonnés à l''ennemi.', 'Une femme cherche à découvrir la vérité sur la disparition de son fiancé pendant la Première Guerre mondiale. Ce dernier serait l''un des cinq soldats jugés en cour martiale puis mis en première ligne sur le front et abandonnés à l''ennemi.', '02:14:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369524', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/31/92/18390889.jpg'),
(2003, 54456, 'F.B.I. Fausses Blondes Infiltrées', '2004-10-20', 'Marcus et Kevin sont les gardes du corps de deux jeunes riches héritières. Mais les deux soeurs s''amochent la figure au point de ne plus pouvoir se rendre à une importante réception. Kevin et Marcus se font alors passer pour les jeunes filles...', 'Marcus et Kevin sont les gardes du corps de deux jeunes riches héritières. Mais les deux soeurs s''amochent la figure au point de ne plus pouvoir se rendre à une importante réception. Kevin et Marcus se font alors passer pour les jeunes filles...', '01:49:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369573', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/41/47/18389293.jpg'),
(2004, 57535, 'Cinq enfants et moi', '2004-10-20', '<p style="text-align: justify;">Cinq enfants sont envoyés chez leur oncle, un écrivain qui vit dans un immense manoir. Ils visitent une pièce interdite et découvrent un passage secret. Celui-ci les mène à une étrange créature, le génie des sables, qui peut exaucer leurs v?ux...', '<p style="text-align: justify;">Cinq enfants sont envoyés chez leur oncle, un écrivain qui vit dans un immense manoir. Ils visitent une pièce interdite et découvrent un passage secret. Celui-ci les mène à une étrange créature, le génie des sables, qui peut exaucer leurs v?ux...', '01:30:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18370608', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/31/91/18391763.jpg'),
(2005, 54639, 'Alive', '2004-10-20', 'Un metteur en scène de comédies musicales est bien décidé à revenir au premier plan. Considéré comme "has been" dans le milieu, il va s''investir à fond dans la conception d''un nouveau projet qui pourra lui permettre de reconquérir celle qu''il aime.', 'Un metteur en scène de comédies musicales est bien décidé à revenir au premier plan. Considéré comme "has been" dans le milieu, il va s''investir à fond dans la conception d''un nouveau projet qui pourra lui permettre de reconquérir celle qu''il aime.', '01:25:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369185', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/35/48/18391340.jpg'),
(2006, 51621, 'La Plus belle victoire', '2004-10-20', 'Peter Colt, une star de tennis déchue, fait la rencontre de Lizzie Bradbury, une pro de cette discipline, qui l''aidera à concourir au grand tournoi de Wimbledon.', 'Peter Colt, une star de tennis déchue, fait la rencontre de Lizzie Bradbury, une pro de cette discipline, qui l''aidera à concourir au grand tournoi de Wimbledon.', '01:38:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369181', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/41/70/18390128.jpg'),
(2007, 41419, 'Pédale dure', '2004-10-20', 'Marie Hagutte vit avec un couple d''homosexuels. Enceinte de l''un d''eux, elle rencontre l''homme de sa vie...', 'Marie Hagutte vit avec un couple d''homosexuels. Enceinte de l''un d''eux, elle rencontre l''homme de sa vie...', '01:30:00', 1.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369016', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/40/42/18390656.jpg');
