(2008, 28367, '2046', '2004-10-20', 'Un écrivain écrit sur l''an 2046, pensant qu''il s''agit du futur alors que c''est en réalité le passé.  Dans son roman, un train emmène parfois en 2046 des voyageurs voulant retrouver leurs souvenirs perdus. Seul l''un d''entre eux en était revenu.', 'Un écrivain écrit sur l''an 2046, pensant qu''il s''agit du futur alors que c''est en réalité le passé.  Dans son roman, un train emmène parfois en 2046 des voyageurs voulant retrouver leurs souvenirs perdus. Seul l''un d''entre eux en était revenu.', '02:09:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18370766', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/27/84/18393898.jpg'),
(2009, 48424, 'Genesis', '2004-10-20', 'Un griot africain raconte la création du monde. Une histoire à dormir debout, comme tous les contes. La naissance de l''univers, la formation de la Terre, l''apparition de la vie, la sortie de l''eau, la conquête du paradis terrestre...', 'Un griot africain raconte la création du monde. Une histoire à dormir debout, comme tous les contes. La naissance de l''univers, la formation de la Terre, l''apparition de la vie, la sortie de l''eau, la conquête du paradis terrestre...', '01:20:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18367096', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/39/87/18387743.jpg'),
(2010, 50840, 'Brodeuses', '2004-10-13', 'Claire vit dans la campagne nantaise quand elle se retrouve enceinte de cinq mois et demi sans l''avoir voulu. Elle décide d''accoucher sous X. C''est alors qu''elle rencontre Mme Melikian, brodeuse, qui lui apporte un nouveau regard sur la vie.', 'Claire vit dans la campagne nantaise quand elle se retrouve enceinte de cinq mois et demi sans l''avoir voulu. Elle décide d''accoucher sous X. C''est alors qu''elle rencontre Mme Melikian, brodeuse, qui lui apporte un nouveau regard sur la vie.', '01:28:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369257', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/29/46/18390246.jpg'),
(2011, 55905, 'Le Grand rôle', '2004-10-13', 'Maurice Kurtz a quatre amis acteurs comme lui. Ils travaillent ensemble mais ne sont pas connus du grand public. Ils apprennent que Grichenberg, immense réalisateur américain, cherche son Shylock pour une adaptation du "Marchand de Venise"...', 'Maurice Kurtz a quatre amis acteurs comme lui. Ils travaillent ensemble mais ne sont pas connus du grand public. Ils apprennent que Grichenberg, immense réalisateur américain, cherche son Shylock pour une adaptation du "Marchand de Venise"...', '01:29:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18368920', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/24/34/18387684.jpg'),
(2012, 52700, 'Arsène Lupin', '2004-10-13', 'Lancé sur la piste du trésor perdu des rois de France, Arsène Lupin multiplie les coups d''éclat : attaque d''un train lancé à pleine allure, course-poursuite dans les catacombes parisiennes, vol spectaculaire à la cathédrale de Rouen...', 'Lancé sur la piste du trésor perdu des rois de France, Arsène Lupin multiplie les coups d''éclat : attaque d''un train lancé à pleine allure, course-poursuite dans les catacombes parisiennes, vol spectaculaire à la cathédrale de Rouen...', '02:10:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18368622', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/18/12/18386594.jpg'),
(2013, 47141, 'Man on Fire', '2004-10-13', 'John Creasy, un garde du corps, se lie d''amitié avec la fillette dont il doit assurer la protection, mais celle-ci est kidnappée. John se lance alors à la poursuite des ravisseurs. Inflexible, il remonte la piste, se jurant de retrouver sa protégée.', 'John Creasy, un garde du corps, se lie d''amitié avec la fillette dont il doit assurer la protection, mais celle-ci est kidnappée. John se lance alors à la poursuite des ravisseurs. Inflexible, il remonte la piste, se jurant de retrouver sa protégée.', '02:26:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18369103', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/32/57/18393493.jpg'),
(2014, 44889, 'Gang de requins', '2004-10-13', '<p style="text-align: justify;">Oscar, un jeune poisson, assiste à la mort d''un dangereux requin. Il profite de la situation pour se faire passer pour un grand chasseur de squales. Mais il ignore que le requin en question était le fils du chef des requins-gangsters...', '<p style="text-align: justify;">Oscar, un jeune poisson, assiste à la mort d''un dangereux requin. Il profite de la situation pour se faire passer pour un grand chasseur de squales. Mais il ignore que le requin en question était le fils du chef des requins-gangsters...', '01:40:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18368305', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/23/52/18384755.jpg'),
(2015, 51386, 'Resident Evil : Apocalypse', '2004-10-06', 'Après avoir survécu aux zombies engendrés par un virus, Alice effectue des recherches sur cette terrifiante substance dans la ville de Raccoon City. Elle se retrouvera confrontée au monstre Nemesis qui a pour mission d''éliminer toute forme vivante.', 'Après avoir survécu aux zombies engendrés par un virus, Alice effectue des recherches sur cette terrifiante substance dans la ville de Raccoon City. Elle se retrouvera confrontée au monstre Nemesis qui a pour mission d''éliminer toute forme vivante.', '01:40:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19454632', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/14/37/18388458.jpg'),
