(2113, 54011, 'Tout pour l''oseille', '2004-05-12', 'Les petits boulots, les plans minables et les coups tordus que Charlie invente, ça ne fonctionne plus... Un soir, Prune, sa compagne, observe ses patrons manipuler une grosse somme d''argent. Et l''argent, ça peut changer de mains...', 'Les petits boulots, les plans minables et les coups tordus que Charlie invente, ça ne fonctionne plus... Un soir, Prune, sa compagne, observe ses patrons manipuler une grosse somme d''argent. Et l''argent, ça peut changer de mains...', '01:34:00', 1.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18362860', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/24/02/18378215.jpg'),
(2114, 47357, 'Troie', '2004-05-13', 'L''enlèvement d''Hélène, reine de Sparte, par Paris, prince de Troie, est une insulte que le roi Ménélas ne peut supporter. Agamemnon réunit les armées grecques pour récupérer Hélène. L''issue de la guerre de Troie dépendra d''un homme : Achille...', 'L''enlèvement d''Hélène, reine de Sparte, par Paris, prince de Troie, est une insulte que le roi Ménélas ne peut supporter. Agamemnon réunit les armées grecques pour récupérer Hélène. L''issue de la guerre de Troie dépendra d''un homme : Achille...', '02:35:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360934', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/23/55/18379045.jpg'),
(2115, 52306, 'La Mauvaise éducation', '2004-05-12', 'Deux garçons, Ignacio et Enrique, découvrent l''amour, le cinéma et la peur dans une école religieuse au début des années 60. Le père Manolo, directeur de l''institution et professeur de littérature, est témoin et acteur de ces premières découvertes...', 'Deux garçons, Ignacio et Enrique, découvrent l''amour, le cinéma et la peur dans une école religieuse au début des années 60. Le père Manolo, directeur de l''institution et professeur de littérature, est témoin et acteur de ces premières découvertes...', '01:50:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18362273', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/24/01/18377186.jpg'),
(2116, 53879, 'Kill Bill: Volume 2', '2004-05-17', 'Laissée pour morte après un massacre dans une chapelle où avait lieu son mariage, l''ancienne tueuse à gages Black Mamba savoure sa vengeance en se préparant à éliminer ses bourreaux Budd, Elle Driver et leur chef Bill qu''elle se réserve pour la fin.', 'Laissée pour morte après un massacre dans une chapelle où avait lieu son mariage, l''ancienne tueuse à gages Black Mamba savoure sa vengeance en se préparant à éliminer ses bourreaux Budd, Elle Driver et leur chef Bill qu''elle se réserve pour la fin.', '02:15:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18363156', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/13/45/18377926.jpg'),
(2117, 41514, 'La Vie est un miracle', '2004-05-14', 'Luka construit sa voie ferrée et ferme les yeux sur la guerre. Mais sa femme le quitte pour un musicien qui promet de relancer sa carrière de chanteuse d''opéra. La vie de Luka devient une zone de guerre jusqu''au jour où il rencontre Sabaho...', 'Luka construit sa voie ferrée et ferme les yeux sur la guerre. Mais sa femme le quitte pour un musicien qui promet de relancer sa carrière de chanteuse d''opéra. La vie de Luka devient une zone de guerre jusqu''au jour où il rencontre Sabaho...', '02:34:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18362842', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/26/04/18377677.jpg'),
(2118, 50833, 'Hypnotic', '2004-05-05', '<p style="text-align: justify;">Le Dr. Strother possède un don dangereux : lors de ses consultations, il est traversé par des flashes venant de l''esprit de ses patients. Il se retrouve impliqué dans la traque d''un tueur ritualiste qui croit avoir trouvé le secret de l''immortalité.', '<p style="text-align: justify;">Le Dr. Strother possède un don dangereux : lors de ses consultations, il est traversé par des flashes venant de l''esprit de ses patients. Il se retrouve impliqué dans la traque d''un tueur ritualiste qui croit avoir trouvé le secret de l''immortalité.', '01:45:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18362247', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/20/62/18379229.jpg'),
(2119, 41953, 'Là-haut, un roi au-dessus des nuages', '2004-05-05', 'Un cinéaste disparaît mystérieusement alors qu''il réalise le film de sa vie. Une journaliste enquête sur cette disparition et recueille les témoignages de nombreuses personnes qui l''ont connu.', 'Un cinéaste disparaît mystérieusement alors qu''il réalise le film de sa vie. Une journaliste enquête sur cette disparition et recueille les témoignages de nombreuses personnes qui l''ont connu.', '01:40:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18363002', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/25/94/18377273.jpg'),
(2120, 55466, 'Mambo Italiano', '2004-05-05', 'Angelo est un agent de voyage rêvant de devenir scénariste pour la télévision. Nino est un policier très respecté. Maria et Gino, parents d''Angelo, ont émigré dans les années 50. Leur monde bascule lorsque leur fils décide de partir en appartement...', 'Angelo est un agent de voyage rêvant de devenir scénariste pour la télévision. Nino est un policier très respecté. Maria et Gino, parents d''Angelo, ont émigré dans les années 50. Leur monde bascule lorsque leur fils décide de partir en appartement...', '01:30:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18362507', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/23/73/18377042.jpg'),
(2121, 46370, 'Van Helsing', '2004-05-05', 'Van Helsing est un ténébreux professeur et chasseur de monstres. Sa mission l''amène à affronter de terribles êtres en Transylvanie, parmi lesquels le loup-garou, la créature de Frankenstein ou encore le comte Dracula.', 'Van Helsing est un ténébreux professeur et chasseur de monstres. Sa mission l''amène à affronter de terribles êtres en Transylvanie, parmi lesquels le loup-garou, la créature de Frankenstein ou encore le comte Dracula.', '02:10:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18359597', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/19/42/18377156.jpg'),
(2122, 53390, 'Broken Wings', '2004-05-05', 'A la suite de la mort de son époux, Dafna se bat pour surmonter sa douleur et s''en sortir financièrement au détriment de ses enfants. Chacun tente de faire son deuil, mais la famille est menacée d''implosion. Un incident inattendu va les réunir...', 'A la suite de la mort de son époux, Dafna se bat pour surmonter sa douleur et s''en sortir financièrement au détriment de ses enfants. Chacun tente de faire son deuil, mais la famille est menacée d''implosion. Un incident inattendu va les réunir...', '01:27:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18362806', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/23/71/18377527.jpg'),
(2123, 52607, 'La Splendeur des McElwee', '2004-04-28', 'Ross McElwee s''installe en Caroline du Nord pour remonter la piste de son histoire familiale. Il découvre qu''un célèbre film hollywoodien raconte l''histoire de son aïeul, roi du tabac sudiste ruiné par un concurrent trop habile. Ross mène l''enquête.', 'Ross McElwee s''installe en Caroline du Nord pour remonter la piste de son histoire familiale. Il découvre qu''un célèbre film hollywoodien raconte l''histoire de son aïeul, roi du tabac sudiste ruiné par un concurrent trop habile. Ross mène l''enquête.', '01:47:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18363145', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/23/70/18376087.jpg'),
(2124, 54340, 'Au feu !', '2004-04-28', 'La Bosnie-Herzégovine après la guerre. La nouvelle de l''arrivée de Bill Clinton à Tesanj, petite ville tout à fait "normale", fait l''effet d''une bombe. Un vent de folie s''y déchaîne.', 'La Bosnie-Herzégovine après la guerre. La nouvelle de l''arrivée de Bill Clinton à Tesanj, petite ville tout à fait "normale", fait l''effet d''une bombe. Un vent de folie s''y déchaîne.', '01:45:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18362891', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/22/42/18376264.jpg'),
(2125, 54130, 'Devil''s fire', '2004-04-28', 'Charles Burnett explore son propre passé. Son film unit fiction et documentaire dans un conte sur la rencontre d''un garçon avec sa famille dans le Mississippi en 1955 et les tensions entre les accords célestes du gospel et les plaintes du blues.', 'Charles Burnett explore son propre passé. Son film unit fiction et documentaire dans un conte sur la rencontre d''un garçon avec sa famille dans le Mississippi en 1955 et les tensions entre les accords célestes du gospel et les plaintes du blues.', '01:29:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18362805', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/19/62/18374994.jpg'),
(2126, 35135, 'Alma la fiancée du vent', '2004-04-28', 'Alma, égérie de la vie culturelle viennoise, collectionne les maris. Tous lui dédient des symphonies et des recueils de poèmes. Talentueuse et libre, Alma Mahler est une femme de coeur et de tête qui annonce l''émancipation féminine du XXe siècle.', 'Alma, égérie de la vie culturelle viennoise, collectionne les maris. Tous lui dédient des symphonies et des recueils de poèmes. Talentueuse et libre, Alma Mahler est une femme de coeur et de tête qui annonce l''émancipation féminine du XXe siècle.', '01:40:00', 0, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18362858', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/23/28/18375515.jpg'),
(2127, 33900, 'Taking lives, destins violés', '2004-04-28', 'A Montréal, Illeana Scott, une profiler du FBI, se lance à la poursuite d''un "violeur de vies" qui usurpe les destins et l''identité de ses victimes.', 'A Montréal, Illeana Scott, une profiler du FBI, se lance à la poursuite d''un "violeur de vies" qui usurpe les destins et l''identité de ses victimes.', '01:43:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360607', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/22/31/18376101.jpg'),
(2128, 51769, 'Le P''tit curieux', '2004-04-28', 'Les péripéties de Clément, un garçon de neuf ans, dont les réflexions sur le bonheur le poussent à espionner les adultes de sa petite ville de province.', 'Les péripéties de Clément, un garçon de neuf ans, dont les réflexions sur le bonheur le poussent à espionner les adultes de sa petite ville de province.', '01:37:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18362515', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/21/00/18377675.jpg'),
(2129, 42152, 'Hidalgo', '2004-03-24', 'En 1890, Frank T. Hopkins, un agent du "Pony Express", envisage de participer avec son fidèle étalon Hidalgo à une prestigieuse course de chevaux qui se déroule dans un émirat arabe.', 'En 1890, Frank T. Hopkins, un agent du "Pony Express", envisage de participer avec son fidèle étalon Hidalgo à une prestigieuse course de chevaux qui se déroule dans un émirat arabe.', '02:16:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18359599', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/17/01/18373825.jpg'),
(2130, 47016, 'Rock Academy', '2004-03-24', 'Un musicien se fait virer de son groupe de rock et trouve un emploi de prof de musique dans une école privée stricte. Là, devant un parterre de tubas, de clairons, de pianos et de harpes, il décide de revoir l''approche de la musique de ses élèves...', 'Un musicien se fait virer de son groupe de rock et trouve un emploi de prof de musique dans une école privée stricte. Là, devant un parterre de tubas, de clairons, de pianos et de harpes, il décide de revoir l''approche de la musique de ses élèves...', '01:48:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360326', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/17/90/18373323.jpg'),
(2131, 54231, 'Au bout du monde à gauche', '2004-03-24', 'Deux familles, l''une d''origine indienne et l''autre d''origine marocaine, débarquent dans un petit village perdu de la France, à la recherche de leur idéal de vie. Ce qui les attend est assez différent de ce qu''elles imaginaient...', 'Deux familles, l''une d''origine indienne et l''autre d''origine marocaine, débarquent dans un petit village perdu de la France, à la recherche de leur idéal de vie. Ce qui les attend est assez différent de ce qu''elles imaginaient...', '01:50:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360907', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/15/85/18372786.jpg'),
(2132, 53323, 'La Vierge de la luxure', '2004-03-17', 'A Mexico, dans les années 40, la morne existence du serveur Le Mikado bascule lorsque Lola débarque un matin, ivre et désespérée, au café Ofelia. Entre elle et lui se noue une relation où règnent passion, sexe et domination.', 'A Mexico, dans les années 40, la morne existence du serveur Le Mikado bascule lorsque Lola débarque un matin, ivre et désespérée, au café Ofelia. Entre elle et lui se noue une relation où règnent passion, sexe et domination.', '02:19:00', 2.5, '', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/18/72/18370696.jpg'),
(2133, 47977, 'Les Disparues', '2004-03-17', 'En 1886, dans le Nouveau-Mexique, un père vient au secours de Maggie, sa fille qu''il a abandonnée lorsqu''elle était plus jeune. Celle-ci a grandi, est mariée et a deux petites filles, dont l''une vient de se faire kidnapper...', 'En 1886, dans le Nouveau-Mexique, un père vient au secours de Maggie, sa fille qu''il a abandonnée lorsqu''elle était plus jeune. Celle-ci a grandi, est mariée et a deux petites filles, dont l''une vient de se faire kidnapper...', '02:17:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19468333', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/15/99/18373040.jpg'),
(2134, 49334, 'Triple Agent', '2004-03-17', 'En 1936, le général tsariste Fiodor et son épouse grecque Arsinoé sont réfugiés à Paris. Pendant qu''elle sympathise avec des voisins communistes, il effectue des voyages secrets. Sait-il lui-même pour qui il travaille ?', 'En 1936, le général tsariste Fiodor et son épouse grecque Arsinoé sont réfugiés à Paris. Pendant qu''elle sympathise avec des voisins communistes, il effectue des voyages secrets. Sait-il lui-même pour qui il travaille ?', '01:55:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360777', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/19/52/18373496.jpg'),
(2135, 47401, 'Ce qu''ils imaginent', '2004-03-17', 'Bernard s''étouffe avec un ?uf, tandis que sa femme quitte la maison pour partir droit devant elle. Arrivée au Havre, elle tente de prendre un cargo et rencontre Santiago, un jeune homme qui vend des frites dans le camion ambulant de son père...', 'Bernard s''étouffe avec un ?uf, tandis que sa femme quitte la maison pour partir droit devant elle. Arrivée au Havre, elle tente de prendre un cargo et rencontre Santiago, un jeune homme qui vend des frites dans le camion ambulant de son père...', '01:30:00', 0, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360924', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/20/59/18372790.jpg'),
(2136, 52594, 'Japanese Story', '2004-03-17', 'Dans la canicule et l''immensité du désert australien, une géologue est confrontée à un homme d''affaires qui se montre antipathique au premier abord. Mais les deux individus vont apprendre à se connaître.', 'Dans la canicule et l''immensité du désert australien, une géologue est confrontée à un homme d''affaires qui se montre antipathique au premier abord. Mais les deux individus vont apprendre à se connaître.', '01:47:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360781', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/19/75/18372803.jpg'),
(2137, 50325, 'Les Choristes', '2004-03-17', 'En 1948, M. Mathieu, professeur de musique, devient surveillant dans un internat de rééducation pour mineurs et transforme le quotidien des pensionnaires en les familiarisant à la magie du chant.', 'En 1948, M. Mathieu, professeur de musique, devient surveillant dans un internat de rééducation pour mineurs et transforme le quotidien des pensionnaires en les familiarisant à la magie du chant.', '01:35:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360383', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/18/77/18373973.jpg'),
(2138, 52619, 'The Mother', '2004-03-10', 'A la mort de son mari, lors d''une visite chez ses enfants, May, une grand-mère, s''installe chez eux. Ayant peur de devenir l''une de ces vieilles femmes dont la vie touche à son terme, elle tombe amoureuse de Darren, un homme de trente ans son cadet.', 'A la mort de son mari, lors d''une visite chez ses enfants, May, une grand-mère, s''installe chez eux. Ayant peur de devenir l''une de ces vieilles femmes dont la vie touche à son terme, elle tombe amoureuse de Darren, un homme de trente ans son cadet.', '01:51:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360480', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/19/56/18374423.jpg'),
(2139, 55468, 'Five obstructions', '2004-03-10', 'Lars von Trier considère "The Perfect human" comme un film culte. Il défie son réalisateur, Jorgen Leth, de tourner cinq remakes de ce court métrage. Pour chaque projet, il va le forcer à repenser l''histoire et les personnages de son film original.', 'Lars von Trier considère "The Perfect human" comme un film culte. Il défie son réalisateur, Jorgen Leth, de tourner cinq remakes de ce court métrage. Pour chaque projet, il va le forcer à repenser l''histoire et les personnages de son film original.', '01:30:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360624', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/21/14/18374096.jpg'),
(2140, 52957, 'Chemins de traverse', '2004-03-10', 'Victor, un père de famille, parcourt les routes avec son fils adolescent, Félix. Il se débrouille comme il peut et rencontre des femmes sous l''oeil peu indulgent de son fils. Mais ce voyage sera pour Félix une école de la vie...', 'Victor, un père de famille, parcourt les routes avec son fils adolescent, Félix. Il se débrouille comme il peut et rencontre des femmes sous l''oeil peu indulgent de son fils. Mais ce voyage sera pour Félix une école de la vie...', '01:41:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360274', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/19/74/18372067.jpg'),
(2141, 44449, 'L''Effet papillon', '2004-03-10', 'Evan Treborn a la faculté de retourner dans le passé et de le modifier. Fasciné, il va mettre ce don au service de ceux dont les vies ont été brisées dans leur enfance. Mais Evan va découvrir que ce pouvoir est aussi puissant qu''incontrôlable...', 'Evan Treborn a la faculté de retourner dans le passé et de le modifier. Fasciné, il va mettre ce don au service de ceux dont les vies ont été brisées dans leur enfance. Mais Evan va découvrir que ce pouvoir est aussi puissant qu''incontrôlable...', '01:53:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18359713', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/19/79/18373133.jpg'),
(2142, 51408, 'Une Vie à t''attendre', '2004-03-10', 'Alors qu''il s''apprête à faire sa vie avec Claire, Alex, un restaurateur, retrouve Jeanne, son premier amour, de retour à Paris pour rendre visite à sa mère après douze ans d''absence... Ce qui était impossible hier sera-t-il possible aujourd''hui ?', 'Alors qu''il s''apprête à faire sa vie avec Claire, Alex, un restaurateur, retrouve Jeanne, son premier amour, de retour à Paris pour rendre visite à sa mère après douze ans d''absence... Ce qui était impossible hier sera-t-il possible aujourd''hui ?', '01:45:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18359962', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/19/58/18372853.jpg'),
(2143, 54679, 'Polly et moi', '2004-03-10', 'Deux surprises viennent troubler la vie ordonnée de Reuben : sa femme le plaque et il rencontre Polly. Se souvenant qu''ils firent ensemble leurs études et qu''elle était un modèle de sérieux, il n''y a aucune raison de penser qu''elle ait changé...', 'Deux surprises viennent troubler la vie ordonnée de Reuben : sa femme le plaque et il rencontre Polly. Se souvenant qu''ils firent ensemble leurs études et qu''elle était un modèle de sérieux, il n''y a aucune raison de penser qu''elle ait changé...', '01:30:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18358886', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/18/64/18373167.jpg'),
(2144, 55338, 'Nowhere in Africa', '2004-03-10', 'En 1938, une famille juive, les Redlich, quitte l''Allemagne et s''exile au Kenya. Le déracinement et la guerre qui éclate fragilisent le couple déjà mis en péril par un mode de vie qui n''est pas le sien...', 'En 1938, une famille juive, les Redlich, quitte l''Allemagne et s''exile au Kenya. Le déracinement et la guerre qui éclate fragilisent le couple déjà mis en péril par un mode de vie qui n''est pas le sien...', '02:21:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360598', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/20/60/18372815.jpg'),
(2145, 51336, 'Feux Rouges', '2004-03-03', 'En route pour le sud-ouest de la France, un couple en crise se sépare. Antoine traîne dans les bars, tandis qu''Hélène continue le voyage en train. A la sortie d''un café, ce dernier trouve dans sa voiture un détenu évadé...', 'En route pour le sud-ouest de la France, un couple en crise se sépare. Antoine traîne dans les bars, tandis qu''Hélène continue le voyage en train. A la sortie d''un café, ce dernier trouve dans sa voiture un détenu évadé...', '01:46:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19456880', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/19/27/18373700.jpg'),
(2146, 50688, 'Demain on déménage', '2004-03-03', 'Charlotte essaie d''écrire des livres érotiques pour survivre. Un jour, son père meurt et sa mère, professeur de piano, débarque chez elle. Charlotte se replie alors au deuxième étage, alors que sa mère, Catherine, occupe le premier...', 'Charlotte essaie d''écrire des livres érotiques pour survivre. Un jour, son père meurt et sa mère, professeur de piano, débarque chez elle. Charlotte se replie alors au deuxième étage, alors que sa mère, Catherine, occupe le premier...', '01:50:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360472', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/20/48/18372813.jpg'),
(2147, 45323, 'La Jeune fille à la perle', '2004-03-03', 'Delft, XVIIe siècle, l''âge d''or de la peinture hollandaise. Griet est engagée comme servante dans la maison du peintre Vermeer. La douceur, la sensibilité et la vivacité de la jeune fille émeuvent bientôt le maître qui l''introduit dans son univers...', 'Delft, XVIIe siècle, l''âge d''or de la peinture hollandaise. Griet est engagée comme servante dans la maison du peintre Vermeer. La douceur, la sensibilité et la vivacité de la jeune fille émeuvent bientôt le maître qui l''introduit dans son univers...', '01:40:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360560', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/18/50/18373958.jpg'),
(2148, 50843, 'Malabar Princess', '2004-03-03', 'Tom, perturbé par la disparition de sa mère, pousse les adultes qui l''entourent dans le chaos figé des secrets de famille que libère un séjour au Mont-Blanc. Avec l''aide de son institutrice, il ira au bout de lui-même et saura tout sur sa mère.', 'Tom, perturbé par la disparition de sa mère, pousse les adultes qui l''entourent dans le chaos figé des secrets de famille que libère un séjour au Mont-Blanc. Avec l''aide de son institutrice, il ira au bout de lui-même et saura tout sur sa mère.', '01:34:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18359863', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/19/48/18371380.jpg'),
(2149, 54862, 'La Vie comme elle va', '2004-03-03', 'Loin du cynisme de la ville, le film révèle la réalité décalée d''un village aveyronnais : un bouquet champêtre d''humanité dont les héros sont reliés par un même désir, celui de vivre à Najac, proches de la nature, et y vivre bien, libres.', 'Loin du cynisme de la ville, le film révèle la réalité décalée d''un village aveyronnais : un bouquet champêtre d''humanité dont les héros sont reliés par un même désir, celui de vivre à Najac, proches de la nature, et y vivre bien, libres.', '01:37:00', 4.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360384', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/20/53/18373631.jpg'),
(2150, 28644, 'Big Fish', '2004-03-03', 'William Bloom retourne au domicile familial pour être au chevet de son père mourant. Il souhaite mieux le connaître et découvrir ses secrets avant qu''il ne soit trop tard. William tentera de discerner le vrai du faux dans les propos de son père.', 'William Bloom retourne au domicile familial pour être au chevet de son père mourant. Il souhaite mieux le connaître et découvrir ses secrets avant qu''il ne soit trop tard. William tentera de discerner le vrai du faux dans les propos de son père.', '02:05:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18742412', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/13/25/18371040.jpg'),
(2151, 54133, 'La Route de Memphis', '2004-02-25', 'Richard Pearce retrace l''odyssée musicale de la légende du blues man B.B. King et rend hommage à la ville qui a donné naissance à un nouveau style de blues. Le film présente aussi des performances originales de Bobby Rush, Rosco Gordon et Ike Turner.', 'Richard Pearce retrace l''odyssée musicale de la légende du blues man B.B. King et rend hommage à la ville qui a donné naissance à un nouveau style de blues. Le film présente aussi des performances originales de Bobby Rush, Rosco Gordon et Ike Turner.', '01:29:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360331', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/18/63/18370433.jpg'),
(2152, 28980, 'In America', '2004-02-25', 'Après la perte tragique de leur fils, Johnny et Sarah décident de quitter l''Irlande accompagnés de leurs deux fillettes. En quête d''une vie nouvelle, ils s''installent à New York où leur rencontre avec un artiste tourmenté bouleversera leur existence.', 'Après la perte tragique de leur fils, Johnny et Sarah décident de quitter l''Irlande accompagnés de leurs deux fillettes. En quête d''une vie nouvelle, ils s''installent à New York où leur rencontre avec un artiste tourmenté bouleversera leur existence.', '01:46:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18358878', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/16/09/18372811.jpg');
