(2153, 48692, 'Paycheck', '2004-02-25', 'L''ingénieur Jennings, dont la mémoire est "effacée" pour l''empêcher de divulguer la moindre information confidentielle, n''a que quelques heures pour recomposer le puzzle de sa vie et échapper à la vengeance de son implacable employeur.', 'L''ingénieur Jennings, dont la mémoire est "effacée" pour l''empêcher de divulguer la moindre information confidentielle, n''a que quelques heures pour recomposer le puzzle de sa vie et échapper à la vengeance de son implacable employeur.', '01:58:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18358884', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/16/21/18370437.jpg'),
(2154, 44957, 'Open Range', '2004-02-25', 'Boss, Charley, Mose et Button, quatre amis au code d''honneur solide, mènent leurs troupeaux à travers les vastes plaines de l''Ouest. Leur migration les conduit à Harmonville, un patelin que dirigent un shérif corrompu et un rancher tyrannique...', 'Boss, Charley, Mose et Button, quatre amis au code d''honneur solide, mènent leurs troupeaux à travers les vastes plaines de l''Ouest. Leur migration les conduit à Harmonville, un patelin que dirigent un shérif corrompu et un rancher tyrannique...', '02:19:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360328', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/18/75/18371101.jpg'),
(2155, 48208, 'Confidences trop intimes', '2004-02-25', 'Parce qu''elle s''est trompée de porte, Anna s''est retrouvée à confier ses déboires conjugaux à un conseiller fiscal. Touché par sa détresse, l''homme n''a pas eu le courage de lui dire qu''il n''était pas psy. Un étrange rituel s''instaure entre eux...', 'Parce qu''elle s''est trompée de porte, Anna s''est retrouvée à confier ses déboires conjugaux à un conseiller fiscal. Touché par sa détresse, l''homme n''a pas eu le courage de lui dire qu''il n''était pas psy. Un étrange rituel s''instaure entre eux...', '01:44:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18358920', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/19/37/18372844.jpg'),
(2156, 47703, 'Les Rivières pourpres 2 - Les Anges de l''Apocalypse', '2004-02-18', 'Deux affaires intimement liées : la découverte par le commissaire Niemans d''un homme retrouvé emmuré dans un monastère de Lorraine et celle par Reda, jeune capitaine de la police, du sosie du Christ gisant à demi mort au pied d''une église...', 'Deux affaires intimement liées : la découverte par le commissaire Niemans d''un homme retrouvé emmuré dans un monastère de Lorraine et celle par Reda, jeune capitaine de la police, du sosie du Christ gisant à demi mort au pied d''une église...', '01:40:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18359097', 'http://fr.web.img6.acsta.net/pictures/14/08/21/14/25/489061.jpg'),
(2157, 35535, 'Retour à Cold Mountain', '2004-02-18', 'Dans une Amérique déchirée par la guerre de Sécession, un homme et une femme vont accomplir l''un vers l''autre le plus fabuleux des voyages. Un simple regard et un baiser volé à la veille de partir au front suffiront à leur inspirer un amour absolu.', 'Dans une Amérique déchirée par la guerre de Sécession, un homme et une femme vont accomplir l''un vers l''autre le plus fabuleux des voyages. Un simple regard et un baiser volé à la veille de partir au front suffiront à leur inspirer un amour absolu.', '02:33:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360004', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/18/47/18371702.jpg'),
(2158, 50334, 'Vert paradis', '2004-02-18', 'A l''occasion d''une enquête sur le célibat dans le Béarn, Lucas, un jeune sociologue parisien, retrouve dans son village natal deux amis. Découvrant qu''ils avaient failli se marier dix ans plus tôt, Lucas se met en tête de les rapprocher à nouveau...', 'A l''occasion d''une enquête sur le célibat dans le Béarn, Lucas, un jeune sociologue parisien, retrouve dans son village natal deux amis. Découvrant qu''ils avaient failli se marier dix ans plus tôt, Lucas se met en tête de les rapprocher à nouveau...', '01:40:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18359628', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/19/50/18371430.jpg'),
(2159, 44237, 'Le Manoir hanté et les 999 fantômes', '2004-02-18', 'L''agent immobilier Jim Evers traîne sa famille jusqu''à une grande et glaciale demeure qu''il rêve de transformer en un somptueux immeuble en copropriété. Mais à son arrivée, la famille Evers découvre qu''elle n''est pas seule dans la maison...', 'L''agent immobilier Jim Evers traîne sa famille jusqu''à une grande et glaciale demeure qu''il rêve de transformer en un somptueux immeuble en copropriété. Mais à son arrivée, la famille Evers découvre qu''elle n''est pas seule dans la maison...', '01:28:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18359514', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/17/26/18370842.jpg'),
(2160, 55343, 'L''âme en jeu', '2004-02-18', 'En 1905, Sabina Spielrein est internée pour hystérie et anorexie par ses parents. Le médecin Carl Gustave Jung prend en charge la patiente et expérimente sur elle une nouvelle méthode révélée par un certain Sigmund Freud : la psychanalyse.', 'En 1905, Sabina Spielrein est internée pour hystérie et anorexie par ses parents. Le médecin Carl Gustave Jung prend en charge la patiente et expérimente sur elle une nouvelle méthode révélée par un certain Sigmund Freud : la psychanalyse.', '01:29:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360111', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/18/73/18370698.jpg'),
(2161, 46699, 'Le Secret des frères McCann', '2004-02-18', 'Le jeune Walter est confié à la garde de deux grands-oncles réapparus après trente ans d''absence. Découvrant la photo d''une jolie femme, le garçon va obliger les deux vieux à tomber le masque et à se lancer dans la plus belle des quêtes.', 'Le jeune Walter est confié à la garde de deux grands-oncles réapparus après trente ans d''absence. Découvrant la photo d''une jolie femme, le garçon va obliger les deux vieux à tomber le masque et à se lancer dans la plus belle des quêtes.', '01:51:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360087', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/19/51/18371423.jpg'),
(2162, 53976, 'L''île de Black Mór', '2004-02-11', 'En 1803, Le Kid s''échappe d''un orphelinat. Il a pour seule richesse la carte d''une île au trésor tombée du livre du pirate Black Mor. Le garçon s''empare du bateau des garde-côtes et se lance à la recherche de la fameuse île...', 'En 1803, Le Kid s''échappe d''un orphelinat. Il a pour seule richesse la carte d''une île au trésor tombée du livre du pirate Black Mor. Le garçon s''empare du bateau des garde-côtes et se lance à la recherche de la fameuse île...', '01:21:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18359764', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/19/30/18371173.jpg'),
(2163, 54586, 'Demi-tarif', '2004-02-11', 'Les tribulations de trois enfants laissés à eux-mêmes pendant l''absence de leur mère.', 'Les tribulations de trois enfants laissés à eux-mêmes pendant l''absence de leur mère.', '01:03:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360158', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/19/31/18371084.jpg'),
(2164, 48638, 'Les mains vides', '2004-02-11', 'Une comédie dramatique dans laquelle apparaissent divers personnages liés à l''absence d''une femme appelée Madame Catherine dans une région frontalière. Parmi eux, Sophie, contrôleur nomade, le trop séduisant Gérard ou encore Yann le cafetier.', 'Une comédie dramatique dans laquelle apparaissent divers personnages liés à l''absence d''une femme appelée Madame Catherine dans une région frontalière. Parmi eux, Sophie, contrôleur nomade, le trop séduisant Gérard ou encore Yann le cafetier.', '02:10:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360134', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/19/49/18372569.jpg'),
(2165, 54644, 'La Mort suspendue', '2004-02-11', 'En mai 1985, dans la Cordillère des Andes, Joe Simpson et Simon Yates, deux talentueux alpinistes britanniques, tentent l''ascension de la face ouest du Siula Grande. Ils atteignent le sommet, mais c''est à la descente que se produit le drame...', 'En mai 1985, dans la Cordillère des Andes, Joe Simpson et Simon Yates, deux talentueux alpinistes britanniques, tentent l''ascension de la face ouest du Siula Grande. Ils atteignent le sommet, mais c''est à la descente que se produit le drame...', '01:46:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18359721', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/19/73/18372149.jpg'),
(2166, 45524, 'Company', '2004-02-11', 'Dans quelque temps aura lieu la première du ballet "Blue Snake". Chaque danseur du Joffret Ballet of Chicago se prépare et découvre ce que cet art exige pour parvenir au sommet. Ry doit saisir sa chance, mais ses déboires sentimentaux la perturbent.', 'Dans quelque temps aura lieu la première du ballet "Blue Snake". Chaque danseur du Joffret Ballet of Chicago se prépare et découvre ce que cet art exige pour parvenir au sommet. Ry doit saisir sa chance, mais ses déboires sentimentaux la perturbent.', '01:50:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18358986', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/16/26/18370992.jpg'),
(2167, 28712, 'Blueberry', '2004-02-11', 'Blueberry est marshall d''une ville tranquille à la frontière des terres indiennes. Tout bascule le jour où un tueur, Wally Blount, transforme la bourgade en brasier. Blueberry part à sa poursuite, aidé par un chamane indien avec qui il a grandi.', 'Blueberry est marshall d''une ville tranquille à la frontière des terres indiennes. Tout bascule le jour où un tueur, Wally Blount, transforme la bourgade en brasier. Blueberry part à sa poursuite, aidé par un chamane indien avec qui il a grandi.', '02:04:00', 1.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18358993', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/14/85/18365368.jpg'),
(2168, 48266, 'Podium', '2004-02-11', 'Un sosie professionnel de Claude François ambitionne de gagner le concours de la Nuit des sosies. Pris entre son désir de gloire et l''amour réel pour sa femme, tenaillé entre son chanteur idole et Véro, il lui faudra choisir.', 'Un sosie professionnel de Claude François ambitionne de gagner le concours de la Nuit des sosies. Pris entre son désir de gloire et l''amour réel pour sa femme, tenaillé entre son chanteur idole et Véro, il lui faudra choisir.', '01:35:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18359439', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/17/11/18371827.jpg'),
(2169, 51366, 'Les 11 commandements', '2004-02-04', 'Le monde va mal, les humains ne rigolent plus. Le Dieu de la blague n''a plus qu''une solution : Michaël Youn et sa bande. Leur mission : accomplir " Les 11 commandements " de la blague pour remettre les peuples sur le droit chemin de la rigolade.', 'Le monde va mal, les humains ne rigolent plus. Le Dieu de la blague n''a plus qu''une solution : Michaël Youn et sa bande. Leur mission : accomplir " Les 11 commandements " de la blague pour remettre les peuples sur le droit chemin de la rigolade.', '01:25:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19454661', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/18/35/18370087.jpg'),
(2170, 53658, 'Tout peut arriver', '2004-02-04', 'Harry Sanborn, directeur d''une maison de disques new-yorkaise, ne sort qu''avec des filles de moins de trente ans. Mais durant un rendez-vous romantique avec sa nouvelle petite amie, Marin, il tombe sous le charme de sa mère féministe divorcée.', 'Harry Sanborn, directeur d''une maison de disques new-yorkaise, ne sort qu''avec des filles de moins de trente ans. Mais durant un rendez-vous romantique avec sa nouvelle petite amie, Marin, il tombe sous le charme de sa mère féministe divorcée.', '02:13:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18359150', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/18/37/18370309.jpg'),
(2171, 49129, 'Grande école', '2004-02-04', 'Des jeunes gens intègrent l''une des grandes écoles où se forment les futurs dirigeants et où s''entrouvrent les portes du pouvoir. Ils sont la crème des étudiants et constitueront l''élite de demain. Mais la vie a toujours plus d''imagination que nous.', 'Des jeunes gens intègrent l''une des grandes écoles où se forment les futurs dirigeants et où s''entrouvrent les portes du pouvoir. Ils sont la crème des étudiants et constitueront l''élite de demain. Mais la vie a toujours plus d''imagination que nous.', '01:50:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18359657', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/19/54/18372080.jpg'),
(2172, 28760, 'Peter Pan', '2004-02-04', 'Une nouvelle évocation de la vie de Peter Pan, cet enfant qui n''a jamais grandi, face à son ennemi juré, le terrible capitaine Crochet.', 'Une nouvelle évocation de la vie de Peter Pan, cet enfant qui n''a jamais grandi, face à son ennemi juré, le terrible capitaine Crochet.', '01:53:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18356037', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/16/22/18370711.jpg'),
(2173, 29253, 'La Planète bleue', '2004-02-04', '"La Planète bleue" est un étonnant voyage d''une infinie richesse dans le monde marin et nous invite à découvrir des espèces inconnues vivant à des profondeurs jamais atteintes par l''homme.', '"La Planète bleue" est un étonnant voyage d''une infinie richesse dans le monde marin et nous invite à découvrir des espèces inconnues vivant à des profondeurs jamais atteintes par l''homme.', '01:32:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18360079', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/18/03/18369421.jpg'),
