(2204, 47605, 'Mister V.', '2003-11-12', 'A la mort de son frère Luigi, Lucas décide de s''occuper de son élevage de chevaux et de sa petite amie. Tiraillé entre ses sentiments et la mémoire de Luigi, il va puiser force et puissance auprès d''un étalon meurtrier dont la sauvagerie le fascine.', 'A la mort de son frère Luigi, Lucas décide de s''occuper de son élevage de chevaux et de sa petite amie. Tiraillé entre ses sentiments et la mémoire de Luigi, il va puiser force et puissance auprès d''un étalon meurtrier dont la sauvagerie le fascine.', '01:30:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18356435', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/15/43/18364762.jpg'),
(2205, 46549, 'La Petite prairie aux bouleaux', '2003-11-12', 'Lors d''une cérémonie de commémoration de la libération des camps d''extermination nazis, Myriam retrouve des anciennes compagnes de déportation. Au cours de la tombola, elle gagne un billet pour Cracovie, lieu de son adolescence meurtrie...', 'Lors d''une cérémonie de commémoration de la libération des camps d''extermination nazis, Myriam retrouve des anciennes compagnes de déportation. Au cours de la tombola, elle gagne un billet pour Cracovie, lieu de son adolescence meurtrie...', '01:30:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18356322', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/14/99/18365693.jpg'),
(2206, 28546, 'Matrix Revolutions', '2003-11-05', 'La quête de liberté des rebelles culmine en une bataille finale explosive. Tandis que l''armée des Machines sème la désolation sur Zion, ses citoyens organisent une défense acharnée. Mais pourront-ils retenir les nuées implacables des Sentinelles ?', 'La quête de liberté des rebelles culmine en une bataille finale explosive. Tandis que l''armée des Machines sème la désolation sur Zion, ses citoyens organisent une défense acharnée. Mais pourront-ils retenir les nuées implacables des Sentinelles ?', '02:08:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355497', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/14/64/18364977.jpg'),
(2207, 48272, 'Mauvais esprit', '2003-11-05', 'Après s''être fait renverser par la voiture du directeur d''une grosse société qui lui a volé son projet de construction d''un stade, Simon décède mais se réincarne en le bébé de son ennemi.', 'Après s''être fait renverser par la voiture du directeur d''une grosse société qui lui a volé son projet de construction d''un stade, Simon décède mais se réincarne en le bébé de son ennemi.', '01:30:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355894', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/13/28/18364615.jpg'),
(2208, 47139, 'Les Sentiments', '2003-11-05', 'La vie sentimentale de deux couples, d''une part Edith et François et d''autre part Jacques et Carole, et les ravages tragiques et comiques de l''amour.', 'La vie sentimentale de deux couples, d''une part Edith et François et d''autre part Jacques et Carole, et les ravages tragiques et comiques de l''amour.', '01:34:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355872', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/12/89/18365063.jpg'),
(2209, 28960, 'Frères du désert', '2003-11-05', 'Un officier britannique, qui a refusé de défendre la forteresse de Khartoum, apprend que son meilleur ami et son ancien régiment sont tombés aux mains des rebelles soudanais. Il tente alors de regagner son honneur en participant à leur sauvetage.', 'Un officier britannique, qui a refusé de défendre la forteresse de Khartoum, apprend que son meilleur ami et son ancien régiment sont tombés aux mains des rebelles soudanais. Il tente alors de regagner son honneur en participant à leur sauvetage.', '02:11:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355865', 'http://fr.web.img1.acsta.net/medias/nmedia/00/02/51/80/aff.jpg'),
(2210, 50986, 'Zatoichi', '2003-11-05', 'Au Japon, au 19e siècle, Zatoichi, voyageur aveugle mais aussi redoutable combattant, découvre une petite ville où Ginzo, le chef d''un gang, fait régner la terreur. Quand ses hommes de main croisent Zatoichi, l''affrontement est inévitable...', 'Au Japon, au 19e siècle, Zatoichi, voyageur aveugle mais aussi redoutable combattant, découvre une petite ville où Ginzo, le chef d''un gang, fait régner la terreur. Quand ses hommes de main croisent Zatoichi, l''affrontement est inévitable...', '01:56:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355815', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/09/53/affiche.jpg'),
(2211, 46729, 'Anything else, la vie et tout le reste', '2003-10-29', 'Entre Jerry, écrivain comique, et Amanda, ça a été le coup de foudre. Mais la vie au jour le jour avec elle, un peu névrosée, boulimique, jamais ponctuelle, n''est pas facile. Heureusement pour Jerry, il y a Dobel, un confrère qui a un avis sur tout.', 'Entre Jerry, écrivain comique, et Amanda, ça a été le coup de foudre. Mais la vie au jour le jour avec elle, un peu névrosée, boulimique, jamais ponctuelle, n''est pas facile. Heureusement pour Jerry, il y a Dobel, un confrère qui a un avis sur tout.', '01:48:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355611', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/15/58/18364875.jpg'),
(2212, 42103, 'La Couleur du mensonge', '2003-10-29', 'Accusé d''avoir tenu des propos racistes, le professeur de lettres Coleman Silk démissionne de son université et approche un écrivain à même de raconter son histoire. Il rencontre aussi une jeune employée avec qui va naître une relation passionnelle.', 'Accusé d''avoir tenu des propos racistes, le professeur de lettres Coleman Silk démissionne de son université et approche un écrivain à même de raconter son histoire. Il rencontre aussi une jeune employée avec qui va naître une relation passionnelle.', '01:48:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355814', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/15/00/18364349.jpg'),
(2213, 34194, 'France boutique', '2003-10-29', 'France et son mari Olivier ont créé une firme de téléachat dont ils sont les présentateurs vedettes : France Boutique. Mais la société accuse un tassement des résultats et une compagnie de vente sur internet, dirigée par Sofia, veut les faire chuter.', 'France et son mari Olivier ont créé une firme de téléachat dont ils sont les présentateurs vedettes : France Boutique. Mais la société accuse un tassement des résultats et une compagnie de vente sur internet, dirigée par Sofia, veut les faire chuter.', '01:35:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355877', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/14/25/18364613.jpg'),
(2214, 53828, 'Le Furet', '2003-10-29', 'Le Furet est un modeste serrurier. Sa passion ? Les films de gangsters qu''il visionne à maintes reprises sur son magnétoscope. Son rêve ? Devenir l''un d''eux. Pour y parvenir, Le Furet est prêt à tout et il a plus d''un tour dans son sac...', 'Le Furet est un modeste serrurier. Sa passion ? Les films de gangsters qu''il visionne à maintes reprises sur son magnétoscope. Son rêve ? Devenir l''un d''eux. Pour y parvenir, Le Furet est prêt à tout et il a plus d''un tour dans son sac...', '01:28:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355875', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/14/75/18364440.jpg'),
(2215, 43359, 'La Morsure du lézard', '2003-10-29', 'Stanley est condamné à plusieurs mois de détention pour un crime qu''il n''a pas commis. A Camp Green Lake, il est forcé par la redoutable directrice de creuser des trous. Stanley se demande bientôt s''il n''y aurait pas quelque chose à déterrer...', 'Stanley est condamné à plusieurs mois de détention pour un crime qu''il n''a pas commis. A Camp Green Lake, il est forcé par la redoutable directrice de creuser des trous. Stanley se demande bientôt s''il n''y aurait pas quelque chose à déterrer...', '01:57:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355313', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/13/70/18363152.jpg'),
(2216, 26880, 'Freddy contre Jason', '2003-10-29', 'Freddy ne hante plus les nuits des jeunes de Elm Street. Les drogues administrées aux adolescents empêchent les cauchemars et le condamnent à l''impuissance. Il pénètre alors l''esprit de Jason et en fait le bras armé de son terrifiant retour...', 'Freddy ne hante plus les nuits des jeunes de Elm Street. Les drogues administrées aux adolescents empêchent les cauchemars et le condamnent à l''impuissance. Il pénètre alors l''esprit de Jason et en fait le bras armé de son terrifiant retour...', '01:36:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355254', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/13/63/18363019.jpg'),
(2217, 42557, 'In This World', '2003-10-29', 'Jamal et Enayatullah sont deux cousins afghans qui vivent à Peshawar, au Pakistan. Partant pour l''Angleterre, ils rejoignent le million de réfugiés qui chaque année remettent leur vie entre les mains des passeurs. Leur voyage sera long et périlleux.', 'Jamal et Enayatullah sont deux cousins afghans qui vivent à Peshawar, au Pakistan. Partant pour l''Angleterre, ils rejoignent le million de réfugiés qui chaque année remettent leur vie entre les mains des passeurs. Leur voyage sera long et périlleux.', '01:28:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355656', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/15/67/18365046.jpg'),
(2218, 48382, 'Tais-toi !', '2003-10-22', 'Ruby souhaite venger la mort de sa femme. Son chemin va croiser celui de Quentin, un individu un peu naïf. La gentillesse catastrophique de Quentin parviendra-t-elle à désamorcer la violence meurtrière de Ruby ?', 'Ruby souhaite venger la mort de sa femme. Son chemin va croiser celui de Quentin, un individu un peu naïf. La gentillesse catastrophique de Quentin parviendra-t-elle à désamorcer la violence meurtrière de Ruby ?', '01:25:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355098', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/10/93/affiche.jpg'),
(2219, 47319, 'American pie : marions-les !', '2003-10-15', 'Jim et Michelle vont enfin se marier ! Michelle, qui rêve d''un mariage parfait, rameute sa famille et ses amis, et embauche une demoiselle d''honneur canon : sa jeune soeur, Cadence. Jim demande le concours de ses trois inséparables copains...', 'Jim et Michelle vont enfin se marier ! Michelle, qui rêve d''un mariage parfait, rameute sa famille et ses amis, et embauche une demoiselle d''honneur canon : sa jeune soeur, Cadence. Jim demande le concours de ses trois inséparables copains...', '01:36:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18353852', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/15/01/18364355.jpg'),
(2220, 47111, 'Bad Boys II', '2003-10-15', 'Marcus Burnett et Mike Lowrey enquêtent sur Tapia, un baron de la drogue. Ils se voient épaulés par Syd, la soeur de Marcus, également agent de la D.E.A. Mike s''éprend de la demoiselle, provoquant ainsi quelques tensions entre lui et son partenaire.', 'Marcus Burnett et Mike Lowrey enquêtent sur Tapia, un baron de la drogue. Ils se voient épaulés par Syd, la soeur de Marcus, également agent de la D.E.A. Mike s''éprend de la demoiselle, provoquant ainsi quelques tensions entre lui et son partenaire.', '02:27:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18350546', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/14/95/18364304.jpg'),
(2221, 47990, 'Janis et John', '2003-10-15', 'Devant rapidement trouver 500 000 francs, un certain Pablo décide de transformer sa femme Brigitte et un acteur ringard au chômage en sosies de Janis Joplin et John Lennon pour monter une escroquerie...', 'Devant rapidement trouver 500 000 francs, un certain Pablo décide de transformer sa femme Brigitte et un acteur ringard au chômage en sosies de Janis Joplin et John Lennon pour monter une escroquerie...', '01:45:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355089', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/13/34/18362491.jpg'),
(2222, 51397, 'Cette femme-là', '2003-10-15', 'Le meurtre d''une suicidée n''efface pas les regrets d''une femme flic endeuillée. Tous les quatre ans, le passé la rattrape. Tous les quatre ans, cette femme-là a très peur. Peur à en crever. Car dans ses rêves commence la réalité...', 'Le meurtre d''une suicidée n''efface pas les regrets d''une femme flic endeuillée. Tous les quatre ans, le passé la rattrape. Tous les quatre ans, cette femme-là a très peur. Peur à en crever. Car dans ses rêves commence la réalité...', '01:40:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355330', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/12/70/18363382.jpg'),
(2223, 48914, 'Evelyn', '2003-10-15', 'Dans l''Irlande des années 50, Desmond Doyle élève seul ses trois enfants depuis le départ de sa femme. Sous prétexte de revenus insuffisants, l''Etat place les petits en institution religieuse. Ce père va tenter de faire changer les choses.', 'Dans l''Irlande des années 50, Desmond Doyle élève seul ses trois enfants depuis le départ de sa femme. Sous prétexte de revenus insuffisants, l''Etat place les petits en institution religieuse. Ce père va tenter de faire changer les choses.', '01:40:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355426', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/12/18/affiche.jpg'),
(2224, 34680, 'Mystic River', '2003-10-15', 'Trois amis d''enfance se perdent de vue. 25 ans plus tard, une affaire de meurtre les réunit à nouveau. La fille de Jimmy est retrouvée assassinée. Le père endeuillé rêve de se venger et Sean, affecté à l''enquête, croit connaître le coupable...', 'Trois amis d''enfance se perdent de vue. 25 ans plus tard, une affaire de meurtre les réunit à nouveau. La fille de Jimmy est retrouvée assassinée. Le père endeuillé rêve de se venger et Sean, affecté à l''enquête, croit connaître le coupable...', '02:17:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355481', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/15/02/18364611.jpg'),
(2225, 47798, 'Um filme falado', '2003-10-15', 'Rosa Maria effectue une croisière en Méditerranée. Au cours de son voyage, elle rencontre trois femmes et un homme qui vont beaucoup l''impressionner. Mais une étrange menace va bientôt perturber le dîner qui se déroule à la table du capitaine...', 'Rosa Maria effectue une croisière en Méditerranée. Au cours de son voyage, elle rencontre trois femmes et un homme qui vont beaucoup l''impressionner. Mais une étrange menace va bientôt perturber le dîner qui se déroule à la table du capitaine...', '01:36:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355717', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/14/76/18364198.jpg');
