(2226, 47262, 'Pur Sang, la légende de Seabiscuit', '2003-10-08', 'En 1936, Charles Howard, un vendeur de bicyclettes, achète un étalon hargneux, aigri et sauvage. Il le confie à un entraîneur quasi mutique et à un jockey borgne. Ce trio insolite va métamorphoser le tocard Seabiscuit en un fabuleux champion...', 'En 1936, Charles Howard, un vendeur de bicyclettes, achète un étalon hargneux, aigri et sauvage. Il le confie à un entraîneur quasi mutique et à un jockey borgne. Ce trio insolite va métamorphoser le tocard Seabiscuit en un fabuleux champion...', '02:20:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18354901', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/12/03/affiche0.jpg'),
(2227, 41233, 'Le Temps du loup', '2003-10-08', 'Anne, son mari et leurs deux enfants, Ben et Eva, fuient leur ville à la suite d''une catastrophe pour rejoindre leur refuge privé à la campagne. Mais ils s''aperçoivent que leur résidence secondaire est occupée par des étrangers...', 'Anne, son mari et leurs deux enfants, Ben et Eva, fuient leur ville à la suite d''une catastrophe pour rejoindre leur refuge privé à la campagne. Mais ils s''aperçoivent que leur résidence secondaire est occupée par des étrangers...', '01:53:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355470', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/14/22/18363600.jpg'),
(2228, 45652, 'Errance', '2003-10-08', 'Une histoire d''amour dramatique, dont l''action se situe en 1968 dans la région du Gévaudan. Jacques, la trentaine, conduit à vive allure sur une route de montagne. Il est ivre. Au même moment, dans un hôpital, Lou, sa femme, met au monde leur enfant.', 'Une histoire d''amour dramatique, dont l''action se situe en 1968 dans la région du Gévaudan. Jacques, la trentaine, conduit à vive allure sur une route de montagne. Il est ivre. Au même moment, dans un hôpital, Lou, sa femme, met au monde leur enfant.', '01:35:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355312', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/11/75/afte.jpg'),
(2229, 47472, 'Ken Park', '2003-10-08', 'Un tableau provocant d''adolescents américains de classe moyenne qui trompent leur ennui avec du sexe, de la violence et de la perversion dans une petite ville de Californie. Leurs parents sont médiocres, aveugles, méprisants et alcooliques.', 'Un tableau provocant d''adolescents américains de classe moyenne qui trompent leur ennui avec du sexe, de la violence et de la perversion dans une petite ville de Californie. Leurs parents sont médiocres, aveugles, méprisants et alcooliques.', '01:35:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355100', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/13/47/18362805.jpg'),
(2230, 49503, 'Une souris verte...', '2003-10-08', 'Thomas Cross assiste en direct au meurtre de Cathy sur son site web. Seul témoin de l''affaire, il se trouve embarqué dans l''enquête menée par Claire, une jeune spécialiste du crime informatique...', 'Thomas Cross assiste en direct au meurtre de Cathy sur son site web. Seul témoin de l''affaire, il se trouve embarqué dans l''enquête menée par Claire, une jeune spécialiste du crime informatique...', '01:33:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355177', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/13/27/18362388.jpg'),
(2231, 52671, 'American Splendor', '2003-10-08', 'Harvey Pekar entrevoit dans la BD une façon d''exprimer ses frustrations. Si son premier album, "American Splendor", rencontre le succès, son existence lui paraît toujours aussi vide. Il rencontre Joyce, son âme s?ur qui partage un même mal de vivre.', 'Harvey Pekar entrevoit dans la BD une façon d''exprimer ses frustrations. Si son premier album, "American Splendor", rencontre le succès, son existence lui paraît toujours aussi vide. Il rencontre Joyce, son âme s?ur qui partage un même mal de vivre.', '01:41:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18355498', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/08/86/affiche.jpg'),
(2232, 48391, 'Je reste !', '2003-10-01', 'Marie-Dominique et Bertrand forment en apparence un couple uni. Mais Marie-Dominique fait la rencontre d''Antoine, un écrivain qui va l''entraîner dans le tourbillon d''une passion amoureuse. Bertrand décide de ne pas la laisser partir si facilement...', 'Marie-Dominique et Bertrand forment en apparence un couple uni. Mais Marie-Dominique fait la rencontre d''Antoine, un écrivain qui va l''entraîner dans le tourbillon d''une passion amoureuse. Bertrand décide de ne pas la laisser partir si facilement...', '01:44:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18354852', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/12/05/affiche.jpg'),
(2233, 42391, 'La Ligue des Gentlemen Extraordinaires', '2003-10-01', 'Une équipe de super-héros, composée de grandes figures de la littérature fantastique, s''efforce de combattre le diabolique Fantôme. Ce dernier se prépare en effet à saboter une conférence réunissant les plus grands chefs d''Etat.', 'Une équipe de super-héros, composée de grandes figures de la littérature fantastique, s''efforce de combattre le diabolique Fantôme. Ce dernier se prépare en effet à saboter une conférence réunissant les plus grands chefs d''Etat.', '01:50:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18354865', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/12/67/18362803.jpg'),
(2234, 43173, 'Confidence', '2003-10-01', 'Jake Big, un petit escroc, arnaque joliment un certain Lionel Dolby qui s''avère être le comptable d''un gros bonnet de la pègre. Le jeune homme va devoir rattraper son erreur en organisant, pour le compte du caïd, une arnaque de très grande envergure.', 'Jake Big, un petit escroc, arnaque joliment un certain Lionel Dolby qui s''avère être le comptable d''un gros bonnet de la pègre. Le jeune homme va devoir rattraper son erreur en organisant, pour le compte du caïd, une arnaque de très grande envergure.', '01:35:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18353229', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/09/94/affiche.jpg'),
