(2267, 33987, 'Sans nouvelles de Dieu', '2003-06-18', 'Les gardiens du paradis reçoivent une requête de la part d''une mère qui leur demande de sauver l''âme de son fils, Many, un boxeur au passé turbulent. Lola Nevado, un de leurs agents les plus doués, va tenter de le remettre sur le droit chemin...', 'Les gardiens du paradis reçoivent une requête de la part d''une mère qui leur demande de sauver l''âme de son fils, Many, un boxeur au passé turbulent. Lola Nevado, un de leurs agents les plus doués, va tenter de le remettre sur le droit chemin...', '01:55:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18353190', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/09/55/affiche.jpg'),
(2268, 29168, 'La Recrue', '2003-06-11', 'James Clayton, un jeune homme intelligent et rusé, est recruté par Walter Burke, vétéran de la CIA, pour faire partie des services secrets américains. Ce dernier le charge d''une mission à haut risque : démasquer une taupe à l''intérieur de l''Agence...', 'James Clayton, un jeune homme intelligent et rusé, est recruté par Walter Burke, vétéran de la CIA, pour faire partie des services secrets américains. Ce dernier le charge d''une mission à haut risque : démasquer une taupe à l''intérieur de l''Agence...', '01:55:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18351711', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/06/11/affiche.jpg'),
(2269, 44206, 'Les Triplettes de Belleville', '2003-06-11', 'Madame Souza, accompagnée de trois vieilles dames, les Triplettes, doit braver tous les dangers pour sauver son neveu orphelin, futur champion cycliste, des griffes de la mafia française.', 'Madame Souza, accompagnée de trois vieilles dames, les Triplettes, doit braver tous les dangers pour sauver son neveu orphelin, futur champion cycliste, des griffes de la mafia française.', '01:20:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18352255', 'http://fr.web.img4.acsta.net/medias/nmedia/00/02/51/64/affiche.jpg'),
(2270, 48324, 'Paris selon Moussa', '2003-06-11', 'L''agriculteur Moussa est envoyé en France par son village de Guinée pour acheter une nouvelle motopompe à eau, destinée à irriguer les champs de leur coopérative. Mais arrivé à Paris, il se fait voler la moitié de l''argent qui lui a été confié...', 'L''agriculteur Moussa est envoyé en France par son village de Guinée pour acheter une nouvelle motopompe à eau, destinée à irriguer les champs de leur coopérative. Mais arrivé à Paris, il se fait voler la moitié de l''argent qui lui a été confié...', '01:36:00', 4.5, '', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/09/48/affiche.jpg'),
(2271, 29087, 'Comment se faire larguer en 10 leçons', '2003-06-11', 'Un séducteur quelque peu macho parie avec ses amis qu''il parviendra à rendre une fille folle amoureuse de lui en dix jours. Malheureusement pour lui, l''"heureuse élue" a elle aussi parié... mais de se faire "larguer" en moins de dix jours !', 'Un séducteur quelque peu macho parie avec ses amis qu''il parviendra à rendre une fille folle amoureuse de lui en dix jours. Malheureusement pour lui, l''"heureuse élue" a elle aussi parié... mais de se faire "larguer" en moins de dix jours !', '01:50:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18352231', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/06/81/affiche2.jpg'),
(2272, 28824, 'Confessions d''un homme dangereux', '2003-06-11', 'Parallèlement à sa carrière d''animateur du <i>Gong Show</i>, un jeu télévisé de la télévision américaine, Chuck Barris aurait mené une carrière de tueur professionnel. Il aurait officié pour le compte de la CIA sous le nom de Sunny Sixkiller.', 'Parallèlement à sa carrière d''animateur du <i>Gong Show</i>, un jeu télévisé de la télévision américaine, Chuck Barris aurait mené une carrière de tueur professionnel. Il aurait officié pour le compte de la CIA sous le nom de Sunny Sixkiller.', '01:53:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18352851', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/08/99/affiche.jpg'),
(2273, 48862, 'Le mystère de la chambre jaune', '2003-06-11', 'Le jeune reporter Joseph Rouletabille se lance aux trousses du meurtrier qui a tenté d''assassiner Mathilde, la fille du célèbre professeur Stangerson. Il se rend dans la "chambre jaune" du château du Glandier pour mener l''enquête.', 'Le jeune reporter Joseph Rouletabille se lance aux trousses du meurtrier qui a tenté d''assassiner Mathilde, la fille du célèbre professeur Stangerson. Il se rend dans la "chambre jaune" du château du Glandier pour mener l''enquête.', '01:58:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18352977', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/08/48/affiche.jpg'),
(2274, 28852, 'Filles Uniques', '2003-06-11', 'Carole, juge d''instruction, et Tina, voleuse récidiviste, sont filles uniques. Elles vont se croiser dans un palais de justice et ne plus se quitter...', 'Carole, juge d''instruction, et Tina, voleuse récidiviste, sont filles uniques. Elles vont se croiser dans un palais de justice et ne plus se quitter...', '01:25:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19461167', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/09/14/affiche.jpg'),
(2275, 28927, 'Dogville', '2003-05-21', 'Dans les années 30, des coups de feu retentissent un soir dans Dogville. Grace, une belle femme terrifiée, fait la rencontre de Tom et lui explique qu''elle est traquée par des gangsters. Les habitants consentent alors à la cacher...', 'Dans les années 30, des coups de feu retentissent un soir dans Dogville. Grace, une belle femme terrifiée, fait la rencontre de Tom et lui explique qu''elle est traquée par des gangsters. Les habitants consentent alors à la cacher...', '02:57:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19368208', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/08/23/affiche.jpg'),
(2276, 47388, 'Dolls', '2003-04-30', 'Trois histoires d''amour basées sur un spectacle de poupées du théâtre Bunraku et dont les protagonistes sont un couple heureux forcé de faire un choix tragique, un chef yakuza nostalgique, et une ancienne star de la musique harcelée par un fan.', 'Trois histoires d''amour basées sur un spectacle de poupées du théâtre Bunraku et dont les protagonistes sont un couple heureux forcé de faire un choix tragique, un chef yakuza nostalgique, et une ancienne star de la musique harcelée par un fan.', '01:53:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18351910', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/06/58/affiche2.jpg'),
(2277, 29240, 'X-Men 2', '2003-04-30', 'Les mutants font face à une nouvelle menace : alors que la polémique fait rage autour d''un meurtre commis par l''un d''eux, le mouvement anti-mutants lance une attaque contre leur école. Magnéto se joint aux X-Men dans ce combat pour leur survie...', 'Les mutants font face à une nouvelle menace : alors que la polémique fait rage autour d''un meurtre commis par l''un d''eux, le mouvement anti-mutants lance une attaque contre leur école. Magnéto se joint aux X-Men dans ce combat pour leur survie...', '02:05:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18350995', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/06/08/affiche.jpg'),
(2278, 28891, 'L''Importance d''être constant', '2003-04-30', 'Dans les années 1890, pour conquérir deux jeunes filles de la haute société, deux gentlemen anglais, Jack et Algernon, s''amusent à transformer la vérité. Mais un jour, celle-ci est découverte et les situations absurdes vont aller en s''accumulant.', 'Dans les années 1890, pour conquérir deux jeunes filles de la haute société, deux gentlemen anglais, Jack et Algernon, s''amusent à transformer la vérité. Mais un jour, celle-ci est découverte et les situations absurdes vont aller en s''accumulant.', '01:37:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18352257', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/07/47/affiche.jpg'),
(2279, 48219, 'Le Club des empereurs', '2003-04-30', 'William Hundert, proviseur adjoint au lycée St Benedict, se heurte à Sedgewick Bell, un élève rebelle, fils de sénateur. Entre eux va se dessiner une relation faite d''affrontements, de compromis et de découvertes...', 'William Hundert, proviseur adjoint au lycée St Benedict, se heurte à Sedgewick Bell, un élève rebelle, fils de sénateur. Entre eux va se dessiner une relation faite d''affrontements, de compromis et de découvertes...', '01:45:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18351870', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/07/75/affiche.jpg'),
(2280, 47499, 'Tristan', '2003-04-30', 'Le commissaire de police Emmanuelle Barsac enquête sur une série de suicides amoureux dont les victimes sont des jeunes femmes. Celle-ci est persuadée qu''un serial killer, nommé Tristan, se cache derrière ce macabre rituel...', 'Le commissaire de police Emmanuelle Barsac enquête sur une série de suicides amoureux dont les victimes sont des jeunes femmes. Celle-ci est persuadée qu''un serial killer, nommé Tristan, se cache derrière ce macabre rituel...', '01:40:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18351866', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/06/88/affiche2.jpg'),
(2281, 28631, 'Avril brisé', '2003-04-30', 'En avril 1910, dans le nord-est pauvre du Brésil, Tonho est contraint par son père de venger la mort de son frère aîné. Angoissé à l''idée d''affronter la mort, il croise alors la route de deux artistes d''un petit cirque itinérant.', 'En avril 1910, dans le nord-est pauvre du Brésil, Tonho est contraint par son père de venger la mort de son frère aîné. Angoissé à l''idée d''affronter la mort, il croise alors la route de deux artistes d''un petit cirque itinérant.', '01:30:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19460754', 'http://fr.web.img3.acsta.net/medias/nmedia/00/02/53/07/affiche.jpg'),
(2282, 46924, 'Le Costume', '2003-04-30', 'Trois amis se procurent un costume taillé par un couturier occidental qui leur ouvrira, pensent-ils, les portes de l''âge adulte. Mais l''un d''eux trouve la mort. Ce drame provoque chez ses amis une prise de conscience sur la superficialité de la vie.', 'Trois amis se procurent un costume taillé par un couturier occidental qui leur ouvrira, pensent-ils, les portes de l''âge adulte. Mais l''un d''eux trouve la mort. Ce drame provoque chez ses amis une prise de conscience sur la superficialité de la vie.', '01:45:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19467688', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/06/93/affiche.jpg'),
(2283, 43958, 'Bon Voyage', '2003-04-16', 'En juin 1940, à l''hôtel Splendid de Bordeaux où sont réunis ministres et grands bourgeois, un jeune homme doit choisir entre une célèbre actrice et une étudiante passionnée, entre les politiques et les voyous, entre l''insouciance et l''âge adulte.', 'En juin 1940, à l''hôtel Splendid de Bordeaux où sont réunis ministres et grands bourgeois, un jeune homme doit choisir entre une célèbre actrice et une étudiante passionnée, entre les politiques et les voyous, entre l''insouciance et l''âge adulte.', '01:54:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18351796', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/07/51/affiche.jpg'),
(2284, 29094, 'Fureur', '2003-04-16', 'Une jeune Asiatique et un Français d''origine espagnole que tout sépare tentent envers et contre tout de s''unir. Contre leurs familles, contre leurs communautés, contre leurs propres intérêts, contre leur fureur, ils lutteront pour vivre ensemble.', 'Une jeune Asiatique et un Français d''origine espagnole que tout sépare tentent envers et contre tout de s''unir. Contre leurs familles, contre leurs communautés, contre leurs propres intérêts, contre leur fureur, ils lutteront pour vivre ensemble.', '01:47:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18350972', 'http://fr.web.img1.acsta.net/medias/nmedia/00/02/56/95/affiche.jpg'),
(2285, 44649, 'Il est plus facile pour un chameau...', '2003-04-16', 'Federica est si riche que ce privilège l''empêche d''assumer son quotidien : les attentes de son fiancé, le retour d''un ancien amant, les conflits avec une famille déconnectée de la réalité. Accablée, elle cherche le réconfort dans l''imaginaire...', 'Federica est si riche que ce privilège l''empêche d''assumer son quotidien : les attentes de son fiancé, le retour d''un ancien amant, les conflits avec une famille déconnectée de la réalité. Accablée, elle cherche le réconfort dans l''imaginaire...', '01:50:00', 2.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18351686', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/06/53/affiche.jpg'),
(2286, 29082, 'Frida', '2003-04-16', 'La vie mouvementée de Frida Kahlo, artiste peintre mexicaine du XXe siècle qui se distingua par son oeuvre surréaliste, son engagement politique en faveur du communisme et sa bisexualité.', 'La vie mouvementée de Frida Kahlo, artiste peintre mexicaine du XXe siècle qui se distingua par son oeuvre surréaliste, son engagement politique en faveur du communisme et sa bisexualité.', '02:00:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18351408', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/05/99/affiche.jpg'),
(2287, 44435, 'Wanted', '2003-04-16', 'Cinq malfrats français envisagent de faire le braquage du siècle à Chicago. Mais les choses ne se déroulent pas comme prévu. En effet, ils ont bientôt à leurs trousses la mafia, le FBI, et la police locale...', 'Cinq malfrats français envisagent de faire le braquage du siècle à Chicago. Mais les choses ne se déroulent pas comme prévu. En effet, ils ont bientôt à leurs trousses la mafia, le FBI, et la police locale...', '01:39:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18351680', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/06/78/affiche.jpg'),
(2288, 41300, 'Dreamcatcher, l''attrape-rêves', '2003-04-16', 'Dans les forêts du Maine, quatre amis d''enfance, dotés de pouvoirs télépathiques suite à un acte héroïque, sont surpris par un blizzard qui cache une étrange force maléfique. Le quatuor doit alors affronter cet horrible danger qui menace la Terre.', 'Dans les forêts du Maine, quatre amis d''enfance, dotés de pouvoirs télépathiques suite à un acte héroïque, sont surpris par un blizzard qui cache une étrange force maléfique. Le quatuor doit alors affronter cet horrible danger qui menace la Terre.', '02:16:00', 1.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19421169', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/06/63/affiche.jpg'),
(2289, 29100, 'Antwone Fisher', '2003-04-16', 'Antwone Fisher, un jeune noir engagé dans la marine américaine, connaît des poussées de violence et se retrouve forcé de consulter un psychiatre de la Navy. Ce dernier lui permettra d''exorciser son enfance et d''en évacuer les terribles séquelles.', 'Antwone Fisher, un jeune noir engagé dans la marine américaine, connaît des poussées de violence et se retrouve forcé de consulter un psychiatre de la Navy. Ce dernier lui permettra d''exorciser son enfance et d''en évacuer les terribles séquelles.', '01:57:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19427976', 'http://fr.web.img4.acsta.net/medias/nmedia/18/35/05/93/affiche2.jpg'),
(2290, 29226, 'Dina', '2003-04-09', 'Dans la Norvège des années 1840, Dina, une jeune fille solitaire et sensuelle, vit avec le traumatisme de la mort de sa mère. Sortant peu à peu de son isolement, elle s''engage dans des amours tumultueuses pour prendre une revanche sur la vie.', 'Dans la Norvège des années 1840, Dina, une jeune fille solitaire et sensuelle, vit avec le traumatisme de la mort de sa mère. Sortant peu à peu de son isolement, elle s''engage dans des amours tumultueuses pour prendre une revanche sur la vie.', '02:05:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18351588', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/06/62/affiche.jpg'),
(2291, 49489, 'Mimi', '2003-04-09', 'Claire Simon signe ici un documentaire sur la vie d''une dénommée Mimi Chiola. Cette femme, que la réalisatrice connaît de longue date, y décrit ses amours et revient sur les scènes qui composent son roman personnel.', 'Claire Simon signe ici un documentaire sur la vie d''une dénommée Mimi Chiola. Cette femme, que la réalisatrice connaît de longue date, y décrit ses amours et revient sur les scènes qui composent son roman personnel.', '01:47:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18351800', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/06/90/affiche.jpg'),
(2292, 43023, 'Destination finale 2', '2003-04-09', 'Kimberly et ses amis échappent de justesse à la mort. Sachant qu''elle n''évitera pas si facilement son destin, la jeune fille se tourne vers Clear Rivers, l''unique survivante d''une catastrophe aérienne.', 'Kimberly et ses amis échappent de justesse à la mort. Sachant qu''elle n''évitera pas si facilement son destin, la jeune fille se tourne vers Clear Rivers, l''unique survivante d''une catastrophe aérienne.', '01:30:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675311', 'http://fr.web.img4.acsta.net/medias/nmedia/00/02/58/30/affiche.jpg'),
(2293, 46416, 'Moi César, 10 ans 1/2, 1,39 m', '2003-04-09', 'Les parents, les disputes, les amis, le premier amour, la rivalité, l''école, ces quelques kilos en trop... Autant de choses qui font le petit monde de César. Comme ses parents ne prennent pas le temps de lui raconter la réalité, le garçon l''imagine.', 'Les parents, les disputes, les amis, le premier amour, la rivalité, l''école, ces quelques kilos en trop... Autant de choses qui font le petit monde de César. Comme ses parents ne prennent pas le temps de lui raconter la réalité, le garçon l''imagine.', '01:31:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19447743', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/05/98/affiche2.jpg'),
(2294, 46547, 'Bienvenue chez les Rozes', '2003-04-02', 'Deux repris de justice s''évadent de prison et trouvent refuge dans une charmante maison habitée par une sympathique famille, les Rozes. Parents et enfants sont bientôt pris en otages. Seulement voilà, les Rozes ne sont pas si charmants que ça...', 'Deux repris de justice s''évadent de prison et trouvent refuge dans une charmante maison habitée par une sympathique famille, les Rozes. Parents et enfants sont bientôt pris en otages. Seulement voilà, les Rozes ne sont pas si charmants que ça...', '01:30:00', 2.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19460938', 'http://fr.web.img5.acsta.net/medias/nmedia/00/02/59/27/affiche.jpg'),
(2295, 43553, 'Laisse tes mains sur mes hanches', '2003-04-02', 'Odile Rousselet, une comédienne de 42 ans, vit avec Marie, sa fille de 18 ans. Celle-ci décide d''emménager avec son petit ami. Sa mère se retrouve seule mais, loin de se laisser abattre, elle décide de profiter au maximum de la vie.', 'Odile Rousselet, une comédienne de 42 ans, vit avec Marie, sa fille de 18 ans. Celle-ci décide d''emménager avec son petit ami. Sa mère se retrouve seule mais, loin de se laisser abattre, elle décide de profiter au maximum de la vie.', '01:51:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18742376', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/06/73/laissetesmains_af.jpg'),
(2296, 48422, 'Le Coeur des hommes', '2003-04-02', 'Au cours d''un printemps, quatre pères de famille, dépassés par des situations affectives complexes, remettent en question leur rapport immature aux femmes.', 'Au cours d''un printemps, quatre pères de famille, dépassés par des situations affectives complexes, remettent en question leur rapport immature aux femmes.', '01:47:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19460659', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/06/68/affiche.jpg'),
(2297, 45263, 'Devdas', '2003-04-02', 'Devdas, le fils d''un riche propriétaire, et Paro, la fille d''un modeste voisin, s''aiment. Mais le père de Devdas n''accepte pas cette liaison en raison des différences sociales. Paro va alors épouser contre son gré un propriétaire plus âgé qu''elle...', 'Devdas, le fils d''un riche propriétaire, et Paro, la fille d''un modeste voisin, s''aiment. Mais le père de Devdas n''accepte pas cette liaison en raison des différences sociales. Paro va alors épouser contre son gré un propriétaire plus âgé qu''elle...', '03:00:00', 4.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18351102', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/06/13/affiche.jpg'),
(2298, 45456, 'Les Fils de Marie', '2003-04-02', 'A Montréal, un an après avoir perdu son fils dans un accident de voiture, Marie passe une petite annonce pour trouver un enfant de remplacement. A travers cette tentative pour sortir de son désarroi, celle-ci essaie de se construire une nouvelle vie.', 'A Montréal, un an après avoir perdu son fils dans un accident de voiture, Marie passe une petite annonce pour trouver un enfant de remplacement. A travers cette tentative pour sortir de son désarroi, celle-ci essaie de se construire une nouvelle vie.', '01:39:00', 0, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18351781', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/05/77/affiche2.jpg');
