(2299, 49506, 'Open hearts', '2003-04-02', 'Cecilie et Joachim ont tout pour être heureux. Mais leur bonheur s''écroule le jour où Joachim est victime d''un accident de voiture et se retrouve paralysé. Désespérée, Cecilie se rapproche de plus en plus du médecin chargé de soigner son compagnon.', 'Cecilie et Joachim ont tout pour être heureux. Mais leur bonheur s''écroule le jour où Joachim est victime d''un accident de voiture et se retrouve paralysé. Désespérée, Cecilie se rapproche de plus en plus du médecin chargé de soigner son compagnon.', '01:53:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18351610', 'http://fr.web.img6.acsta.net/medias/nmedia/18/35/06/12/affiche.jpg'),
(2300, 47835, 'Chouchou', '2003-03-19', 'Chouchou, un Maghrébin, débarque clandestinement à Paris à la recherche de son neveu, devenu "Vanessa", une chanteuse romantique au cabaret "L''Apocalypse". Le jeune homme y retrouve ses amis et décide de se travestir lui aussi...', 'Chouchou, un Maghrébin, débarque clandestinement à Paris à la recherche de son neveu, devenu "Vanessa", une chanteuse romantique au cabaret "L''Apocalypse". Le jeune homme y retrouve ses amis et décide de se travestir lui aussi...', '01:45:00', 2.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18350637', 'http://fr.web.img4.acsta.net/medias/nmedia/00/02/59/17/affiche.jpg'),
(2301, 46397, 'Stupeur et tremblements', '2003-03-12', 'Amélie vient de terminer ses études universitaires. Sa connaissance parfaite du japonais lui permet de travailler dans la compagnie Yumimoto. Pourtant, la jeune femme va rapidement déchanter à la découverte d''une culture qu''elle ne connaît pas...', 'Amélie vient de terminer ses études universitaires. Sa connaissance parfaite du japonais lui permet de travailler dans la compagnie Yumimoto. Pourtant, la jeune femme va rapidement déchanter à la découverte d''une culture qu''elle ne connaît pas...', '01:47:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18350920', 'http://fr.web.img3.acsta.net/medias/nmedia/00/02/58/06/affiche2.jpg'),
(2302, 42694, 'Un Coupable idéal', '2003-02-26', 'Brenton Butler, un adolescent noir âgé d''une quinzaine d''années, est accusé du meurtre d''une touriste blanche en mai 2000 à Jacksonville, en Floride. Ses avocats vont se battre contre les méthodes quelque peu discutables de la police locale.', 'Brenton Butler, un adolescent noir âgé d''une quinzaine d''années, est accusé du meurtre d''une touriste blanche en mai 2000 à Jacksonville, en Floride. Ses avocats vont se battre contre les méthodes quelque peu discutables de la police locale.', '01:51:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19466557', 'http://fr.web.img2.acsta.net/medias/nmedia/18/35/05/59/19133568.jpg'),
(2303, 46362, 'Dark Water', '2003-02-26', 'Une femme divorcée et sa petite fille de six ans s''installent dans un nouvel appartement. Une fois sur place, elles perçoivent des bruits étranges à l''étage supérieur. Puis, du plafond, commence à tomber de l''eau, qui envahit leur domicile.', 'Une femme divorcée et sa petite fille de six ans s''installent dans un nouvel appartement. Une fois sur place, elles perçoivent des bruits étranges à l''étage supérieur. Puis, du plafond, commence à tomber de l''eau, qui envahit leur domicile.', '01:37:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675501', 'http://fr.web.img5.acsta.net/medias/nmedia/00/02/58/40/affiche.jpg'),
(2304, 41244, 'Chicago', '2003-02-26', 'A Chicago, Roxie, une jeune femme accusée du meurtre de son amant, retrouve derrière les barreaux celle qu''elle admire, Velma, une chanteuse de jazz. L''avocat Billy Flynn attire bientôt l''attention des médias sur ces deux femmes à la superbe voix...', 'A Chicago, Roxie, une jeune femme accusée du meurtre de son amant, retrouve derrière les barreaux celle qu''elle admire, Velma, une chanteuse de jazz. L''avocat Billy Flynn attire bientôt l''attention des médias sur ces deux femmes à la superbe voix...', '01:53:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19460612', 'http://fr.web.img6.acsta.net/medias/nmedia/00/02/56/67/affiche.jpg'),
(2305, 41011, '8 Mile', '2003-02-26', 'En 1995, Jimmy Smith Jr., un jeune rebelle blanc de Detroit, accumule les déboires familiaux, professionnels et sentimentaux. Après une première humiliation dans une joute oratoire entre rappeurs, il tente de prendre sa revanche...', 'En 1995, Jimmy Smith Jr., un jeune rebelle blanc de Detroit, accumule les déboires familiaux, professionnels et sentimentaux. Après une première humiliation dans une joute oratoire entre rappeurs, il tente de prendre sa revanche...', '01:51:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675239', 'http://fr.web.img4.acsta.net/medias/nmedia/00/02/46/93/affiche.jpg'),
(2306, 50350, 'La Légende de Parva', '2003-02-12', 'Un soir, Parva, une jeune fille, trouve un petit chien. Elle est immédiatement séduite et l''adopte. L''animal, peu ordinaire, va la conduire jusqu''au golfe du Bengale, sur la mystérieuse île de Kiam, où le prince Shiva est prisonnier du tyran Malaw...', 'Un soir, Parva, une jeune fille, trouve un petit chien. Elle est immédiatement séduite et l''adopte. L''animal, peu ordinaire, va la conduire jusqu''au golfe du Bengale, sur la mystérieuse île de Kiam, où le prince Shiva est prisonnier du tyran Malaw...', '01:25:00', 1.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675473', 'http://fr.web.img3.acsta.net/medias/nmedia/00/02/58/26/affiche.jpg'),
(2307, 42992, 'Magic baskets', '2003-02-12', 'Le jeune Calvin rêve de devenir basketteur professionnel. Mais sa petite taille lui pose quelques problèmes. Un jour, il découvre une vieille paire de baskets qui lui permet de devenir un véritable champion et de rivaliser avec les plus grands.', 'Le jeune Calvin rêve de devenir basketteur professionnel. Mais sa petite taille lui pose quelques problèmes. Un jour, il découvre une vieille paire de baskets qui lui permet de devenir un véritable champion et de rivaliser avec les plus grands.', '01:42:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675283', 'http://fr.web.img2.acsta.net/medias/nmedia/00/02/56/34/affiche2.jpg'),
(2308, 41232, 'Petites coupures', '2003-02-12', 'En plein hiver, Bruno, un journaliste communiste dont les convictions vacillent, est partagé entre sa compagne Gaëlle et sa jeune maîtresse Nathalie. Mais deux autres femmes entreront dans sa vie : Béatrice et Mathilde.', 'En plein hiver, Bruno, un journaliste communiste dont les convictions vacillent, est partagé entre sa compagne Gaëlle et sa jeune maîtresse Nathalie. Mais deux autres femmes entreront dans sa vie : Béatrice et Mathilde.', '01:35:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675189', 'http://fr.web.img2.acsta.net/medias/nmedia/00/02/57/76/affiche1.jpg'),
(2309, 42093, 'Monsieur N.', '2003-02-12', 'Comment l''empereur Napoléon a-t-il accepté de se soumettre à cet emprisonnement sur l''île de Sainte-Hélène ? Et comment imagine-t-il desserrer l''emprise de ses geôliers ? C''est ce que Monsieur N. va tenter de révéler...', 'Comment l''empereur Napoléon a-t-il accepté de se soumettre à cet emprisonnement sur l''île de Sainte-Hélène ? Et comment imagine-t-il desserrer l''emprise de ses geôliers ? C''est ce que Monsieur N. va tenter de révéler...', '02:00:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675227', 'http://fr.web.img3.acsta.net/medias/nmedia/00/02/57/78/affiche.jpg'),
(2310, 34901, 'Othello 2003', '2003-02-12', 'Odin réussit tout ce qu''il entreprend : ses performances de basketteur dans l''équipe universitaire des "Hawks" sont remarquables, et Desi, une riche étudiante, a succombé à son charme. Mais Hugo, le fils du coach, veut la perte d''Odin...', 'Odin réussit tout ce qu''il entreprend : ses performances de basketteur dans l''équipe universitaire des "Hawks" sont remarquables, et Desi, une riche étudiante, a succombé à son charme. Mais Hugo, le fils du coach, veut la perte d''Odin...', '01:30:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675361', 'http://fr.web.img4.acsta.net/medias/nmedia/00/02/58/27/affiche.jpg'),
(2311, 35973, 'Arrête-moi si tu peux', '2003-02-12', 'Dans les années soixante, le jeune Frank Abagnale Jr., véritable caméléon, est passé maître dans l''art de l''escroquerie. Carl Hanratty, agent du FBI, fait de la traque de l''adolescent sa mission prioritaire, mais ce dernier reste insaisissable...', 'Dans les années soixante, le jeune Frank Abagnale Jr., véritable caméléon, est passé maître dans l''art de l''escroquerie. Carl Hanratty, agent du FBI, fait de la traque de l''adolescent sa mission prioritaire, mais ce dernier reste insaisissable...', '02:21:00', 4.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18674438', 'http://fr.web.img3.acsta.net/medias/nmedia/00/02/54/32/aff2.jpg'),
(2312, 48100, 'Le Livre de la jungle 2', '2003-02-05', 'Son nouveau père l''ayant défendu de quitter le village, Mowgli se glisse discrètement au dehors avec l''aide de Baloo. Shanti, sa nouvelle amie, se lance à sa poursuite dans la jungle, mais le serpent Kaa et le tigre Shere Khan ne sont pas loin...', 'Son nouveau père l''ayant défendu de quitter le village, Mowgli se glisse discrètement au dehors avec l''aide de Baloo. Shanti, sa nouvelle amie, se lance à sa poursuite dans la jungle, mais le serpent Kaa et le tigre Shere Khan ne sont pas loin...', '01:15:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19470429', 'http://fr.web.img2.acsta.net/medias/nmedia/00/02/55/79/affiche.jpg'),
(2313, 42552, 'Le Cercle - The Ring', '2003-02-05', 'Lorsque sa nièce trouve la mort une semaine après avoir visionné une étrange cassette vidéo, une journaliste décide d''enquêter sur ce fameux enregistrement et prend le risque de le regarder. Elle ne dispose plus que de sept jours pour sauver sa vie.', 'Lorsque sa nièce trouve la mort une semaine après avoir visionné une étrange cassette vidéo, une journaliste décide d''enquêter sur ce fameux enregistrement et prend le risque de le regarder. Elle ne dispose plus que de sept jours pour sauver sa vie.', '01:50:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675289', 'http://fr.web.img2.acsta.net/medias/nmedia/00/02/54/37/aff2.jpg'),
(2314, 45569, 'Mariage à la grecque', '2003-02-05', 'Toula Portokalos, une jeune femme d''origine grecque, va devoir faire accepter auprès de sa famille Ian Miller, son futur époux blanc de peau, et ceci malgré les différences culturelles et les préjugés.', 'Toula Portokalos, une jeune femme d''origine grecque, va devoir faire accepter auprès de sa famille Ian Miller, son futur époux blanc de peau, et ceci malgré les différences culturelles et les préjugés.', '01:35:00', 2.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18674991', 'http://fr.web.img3.acsta.net/medias/nmedia/00/02/56/64/affiche.jpg'),
(2315, 35990, '18 ans après', '2003-02-05', '18 ans après avoir été recueillie par ses trois pères adoptifs, Marie obtient son bac et passe l''été dans le midi avec sa mère revenue d''Amérique. Les premières amours se nouent et se dénouent sous les yeux effarés des trois pères...', '18 ans après avoir été recueillie par ses trois pères adoptifs, Marie obtient son bac et passe l''été dans le midi avec sa mère revenue d''Amérique. Les premières amours se nouent et se dénouent sous les yeux effarés des trois pères...', '01:30:00', 2.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675059', 'http://fr.web.img5.acsta.net/medias/nmedia/00/02/56/39/affiche.jpg'),
(2316, 48388, 'La Beuze', '2003-02-05', 'Après un an de prison, Alphonse retrouve Scotch, son ami d''enfance, avec la ferme intention de faire carrière dans la musique. Le soir de sa libération, sa vie bascule quand il découvre, dans un bunker, une vieille malle au contenu mystérieux...', 'Après un an de prison, Alphonse retrouve Scotch, son ami d''enfance, avec la ferme intention de faire carrière dans la musique. Le soir de sa libération, sa vie bascule quand il découvre, dans un bunker, une vieille malle au contenu mystérieux...', '01:30:00', 2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675270', 'http://fr.web.img2.acsta.net/medias/nmedia/00/02/56/63/affiche.jpg'),
(2317, 47707, 'The Magdalene Sisters', '2003-02-05', 'En Irlande, en 1964, quatre jeunes femmes sont condamnées par l''Eglise et leur famille au cauchemar qu''est la vie au couvent des soeurs de Marie-Madeleine. Les attende la misère matérielle et morale. Elles rêvent alors de s''échapper...', 'En Irlande, en 1964, quatre jeunes femmes sont condamnées par l''Eglise et leur famille au cauchemar qu''est la vie au couvent des soeurs de Marie-Madeleine. Les attende la misère matérielle et morale. Elles rêvent alors de s''échapper...', '02:00:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19454639', 'http://fr.web.img2.acsta.net/medias/nmedia/00/02/58/07/affiche.jpg'),
(2318, 41230, 'Taxi 3', '2003-01-29', 'C''est décembre à Marseille. Daniel rajoute des options à son taxi. Le commissaire est aveuglé par sa stagiaire japonaise. Emilien voit des pères Noël partout. De Marseille à Tignes, de la Canebière aux pistes de ski, l''aventure peut commencer...', 'C''est décembre à Marseille. Daniel rajoute des options à son taxi. Le commissaire est aveuglé par sa stagiaire japonaise. Emilien voit des pères Noël partout. De Marseille à Tignes, de la Canebière aux pistes de ski, l''aventure peut commencer...', '01:30:00', 1.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675065', 'http://fr.web.img6.acsta.net/medias/nmedia/00/02/57/84/affiche.jpg'),
(2319, 43188, 'Mafia Blues 2 - la rechute', '2003-01-22', 'Le psychothérapeute Ben Sobel aide malgré lui son patient, le mafioso Paul Vitti, à sortir de prison. Pour faciliter sa réinsertion, il lui cherche un travail honnête et lui obtient un poste de conseiller technique pour une série télé sur la mafia...', 'Le psychothérapeute Ben Sobel aide malgré lui son patient, le mafioso Paul Vitti, à sortir de prison. Pour faciliter sa réinsertion, il lui cherche un travail honnête et lui obtient un poste de conseiller technique pour une série télé sur la mafia...', '01:35:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675092', 'http://fr.web.img3.acsta.net/medias/nmedia/00/02/56/31/affiche.jpg'),
(2320, 29045, 'La Vérité sur Charlie', '2003-01-15', 'Regina quitte Charlie, séducteur désinvolte au passé trouble, épousé sur un coup de tête, et dont elle ne sait pas grand chose. A son retour de Martinique, la jeune femme découvre que ce dernier a été tué et que son appartement a été dévasté...', 'Regina quitte Charlie, séducteur désinvolte au passé trouble, épousé sur un coup de tête, et dont elle ne sait pas grand chose. A son retour de Martinique, la jeune femme découvre que ce dernier a été tué et que son appartement a été dévasté...', '01:45:00', 1.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675052', 'http://fr.web.img2.acsta.net/medias/nmedia/00/02/55/72/aff2.jpg'),
(2321, 40133, 'Le Château dans le ciel', '2003-01-15', 'Retenue prisonnière par des pirates dans un dirigeable, Sheeta est sauvée par Pazu, un jeune pilote d''avion travaillant dans une cité minière. Elle lui avoue qu''elle est la descendante des souverains de Laputa, la cité mythique située dans les airs.', 'Retenue prisonnière par des pirates dans un dirigeable, Sheeta est sauvée par Pazu, un jeune pilote d''avion travaillant dans une cité minière. Elle lui avoue qu''elle est la descendante des souverains de Laputa, la cité mythique située dans les airs.', '02:04:00', 4.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18675070', 'http://fr.web.img6.acsta.net/medias/nmedia/00/02/55/80/affiche.jpg'),
(2322, 45458, 'Respiro', '2003-01-01', 'L''histoire d''une famille de pêcheurs siciliens vue par regard de Pasquale, un garçon de treize ans, et de sa mère Grazia, une jeune femme fantasque montrée du doigt par les habitants de l''île, jaloux de sa beauté et de son sens de la liberté.', 'L''histoire d''une famille de pêcheurs siciliens vue par regard de Pasquale, un garçon de treize ans, et de sa mère Grazia, une jeune femme fantasque montrée du doigt par les habitants de l''île, jaloux de sa beauté et de son sens de la liberté.', '01:30:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18674776', 'http://fr.web.img4.acsta.net/medias/nmedia/00/02/54/56/affiche2.jpg'),
(2323, 28454, 'Jay & Bob contre-attaquent', '2002-11-06', 'Jay et Silent Bob apprennent que les studios Miramax sont sur le point de tourner, sans les dédommager, une version cinéma de "Bluntman et Chronicle", les héros de bande dessinée qu''ils ont inspirée. Ils décident alors de stopper le tournage du film.', 'Jay et Silent Bob apprennent que les studios Miramax sont sur le point de tourner, sans les dédommager, une version cinéma de "Bluntman et Chronicle", les héros de bande dessinée qu''ils ont inspirée. Ils décident alors de stopper le tournage du film.', '01:44:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19440858', 'http://fr.web.img1.acsta.net/medias/nmedia/00/02/53/56/affiche.jpg'),
(2324, 37643, 'Juste un baiser', '2002-11-06', 'L''histoire croisée de personnages aux âges différents mais aux mêmes préoccupations : la peur de s''engager des trentenaires et la peur de vieillir des plus de cinquante ans, deux générations partagées entre désir de liberté et besoin de sécurité.', 'L''histoire croisée de personnages aux âges différents mais aux mêmes préoccupations : la peur de s''engager des trentenaires et la peur de vieillir des plus de cinquante ans, deux générations partagées entre désir de liberté et besoin de sécurité.', '01:55:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18673588', 'http://fr.web.img2.acsta.net/medias/nmedia/00/02/53/15/affiche.jpg'),
(2325, 32704, 'Insomnia', '2002-11-06', 'Will Dormer, un policier expérimenté et désabusé, est envoyé au fin fond de l''Alaska pour enquêter sur le meurtre d''une adolescente. Après avoir tué accidentellement son partenaire, il devient victime d''un chantage orchestré par l''assassin.', 'Will Dormer, un policier expérimenté et désabusé, est envoyé au fin fond de l''Alaska pour enquêter sur le meurtre d''une adolescente. Après avoir tué accidentellement son partenaire, il devient victime d''un chantage orchestré par l''assassin.', '01:56:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19456443', 'http://fr.web.img6.acsta.net/medias/nmedia/00/02/50/25/affiche.jpg'),
(2326, 45272, 'L''Homme sans passé', '2002-11-06', 'En débarquant à Helsinki, un homme se fait voler et violemment frapper. Lorsqu''il reprend conscience, il a perdu la mémoire. Sans argent et sans identité, il est aidé par les SDF de la ville.', 'En débarquant à Helsinki, un homme se fait voler et violemment frapper. Lorsqu''il reprend conscience, il a perdu la mémoire. Sans argent et sans identité, il est aidé par les SDF de la ville.', '01:37:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18673657', 'http://fr.web.img4.acsta.net/medias/nmedia/00/02/46/15/affiche.jpg'),
(2327, 41010, 'Signes', '2002-10-16', 'En Pennsylvanie, une petite famille de fermiers découvre l''apparition dans ses champs de gigantesques signes et cercles étranges. Graham le patriarche et Merrill, son jeune frère, vont s''efforcer de percer le mystère qui entoure ces dessins.', 'En Pennsylvanie, une petite famille de fermiers découvre l''apparition dans ses champs de gigantesques signes et cercles étranges. Graham le patriarche et Merrill, son jeune frère, vont s''efforcer de percer le mystère qui entoure ces dessins.', '01:45:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18671992', 'http://fr.web.img3.acsta.net/medias/nmedia/00/02/48/21/affiche.jpg'),
(2328, 28874, 'Les Sentiers de la perdition', '2002-09-11', 'En 1930, Michael Sullivan est un tueur professionnel au service de la mafia irlandaise. Il engage une lutte sans merci contre Connor Rooney, le fils de son patron et mentor John Rooney, pour venger la mort de sa femme et de son fils cadet.', 'En 1930, Michael Sullivan est un tueur professionnel au service de la mafia irlandaise. Il engage une lutte sans merci contre Connor Rooney, le fils de son patron et mentor John Rooney, pour venger la mort de sa femme et de son fils cadet.', '02:05:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18672693', 'http://fr.web.img4.acsta.net/medias/nmedia/00/02/48/97/affiche.jpg'),
