(2340, 13143, 'Vigo, histoire d''une passion', '1999-02-17', 'Jean Vigo, fils d''anarchiste et jeune cinéaste qui connut une enfance difficile, a qui l''on doit une ?uvre mince mais dont l''influence fut majeure sur le cinéma, ("Zero de conduite", "A propos de Nice", "l''Atalante"), rencontre au début des années trente sa future femme Lydu dans un sanatorium pour tuberculeux dans les Pyrénées. Leur amour va devenir une force libératrice qui leur permettra d''affronter la maladie, de vivre dans l''instant et de défier l''adversité.', 'Jean Vigo, fils d''anarchiste et jeune cinéaste qui connut une enfance difficile, a qui l''on doit une ?uvre mince mais dont l''influence fut majeure sur le cinéma, ("Zero de conduite", "A propos de Nice", "l''Atalante"), rencontre au début des années trente sa future femme Lydu dans un sanatorium pour tuberculeux dans les Pyrénées. Leur amour va devenir une force libératrice qui leur permettra d''affronter la maladie, de vivre dans l''instant et de défier l''adversité.', '01:42:00', 1.5, '', 'http://fr.web.img6.acsta.net/medias/nmedia/images/affiches/033935.jpg'),
