(2384, 19087, 'L''Eternité et un jour', '1998-10-28', 'Alexandre, un grand écrivain, est sur le point de quitter définitivement la maison en bord de mer dans laquelle il a toujours vécu. Avant son départ, il retrouve une lettre de sa femme, Anna, qui lui parle d''un jour d''été, il y a trente ans. Pour Alexandre commence alors un étrange voyage où passé et présent vont s''entremêler.', 'Alexandre, un grand écrivain, est sur le point de quitter définitivement la maison en bord de mer dans laquelle il a toujours vécu. Avant son départ, il retrouve une lettre de sa femme, Anna, qui lui parle d''un jour d''été, il y a trente ans. Pour Alexandre commence alors un étrange voyage où passé et présent vont s''entremêler.', '02:12:00', 3.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18650026', 'http://fr.web.img4.acsta.net/medias/nmedia/18/64/04/37/18747866.jpg'),
