(2415, 17616, 'Terminale', '1998-05-27', 'Une bande de copains, quatre garcons et trois filles, en classe de terminale dans un lycée parisien, vivent leur adolescence avec gaité et insouciance, jusqu''au jour où Caroline, la plus fragile du groupe, se suicide en plein cours de philosophie en se précipitant dans le vide.Le reste de la bande s''interroge...', 'Une bande de copains, quatre garcons et trois filles, en classe de terminale dans un lycée parisien, vivent leur adolescence avec gaité et insouciance, jusqu''au jour où Caroline, la plus fragile du groupe, se suicide en plein cours de philosophie en se précipitant dans le vide.Le reste de la bande s''interroge...', '01:40:00', 1.9, '', 'http://fr.web.img4.acsta.net/medias/nmedia/18/65/55/64/18869866.jpg'),
(2416, 7165, 'Dark City', '1998-05-20', 'Un homme se réveille, amnésique, dans une chambre d''hôtel dont il ne sait rien. Il part à la recherche de son identité au coeur d''une cité où le soleil semble ne jamais briller...', 'Un homme se réveille, amnésique, dans une chambre d''hôtel dont il ne sait rien. Il part à la recherche de son identité au coeur d''une cité où le soleil semble ne jamais briller...', '01:35:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19464868', 'http://fr.web.img2.acsta.net/medias/02/08/42/020842_af.jpg'),
(2417, 8101, 'Aprile', '1998-05-20', 'Journal filmé qui commence le 28 mars 1994, le jour du résultat des élections où la droite a gagné, pour se terminer en août 1997, le jour du quarante-quatrième anniversaire de l''auteur.', 'Journal filmé qui commence le 28 mars 1994, le jour du résultat des élections où la droite a gagné, pour se terminer en août 1997, le jour du quarante-quatrième anniversaire de l''auteur.', '01:18:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19460015', 'http://fr.web.img4.acsta.net/medias/nmedia/images/affiches/023844.jpg'),
(2418, 6549, 'Primary Colors', '1998-05-13', 'Le petit-fils d''un des leaders noirs ayant milité pour la cause des droits civiques pour sa communauté, Henry Burton, jeune idéaliste, est à la recherche d''une belle et noble cause. C''est ainsi qu''il entre en politique et qu''il se joint à la campagne présidentielle de Jack Stanton, gouverneur progressiste...', 'Le petit-fils d''un des leaders noirs ayant milité pour la cause des droits civiques pour sa communauté, Henry Burton, jeune idéaliste, est à la recherche d''une belle et noble cause. C''est ainsi qu''il entre en politique et qu''il se joint à la campagne présidentielle de Jack Stanton, gouverneur progressiste...', '02:23:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18817537', 'http://fr.web.img6.acsta.net/medias/nmedia/images/affiches/018545.jpg'),
(2419, 81598, 'Ceux qui m''aiment prendront le train', '1998-05-13', 'Le peintre Jean-Baptiste Emmerich avait déclaré avant de mourir: "Ceux qui m''aiment prendront le train". Et ils ont pris le train pour Limoges. Les amis, les vrais, les autres: les faux-jetons, les héritiers, la famille naturelle et non naturelle. Il y a des familles qui ne se réunissent qu''aux...', 'Le peintre Jean-Baptiste Emmerich avait déclaré avant de mourir: "Ceux qui m''aiment prendront le train". Et ils ont pris le train pour Limoges. Les amis, les vrais, les autres: les faux-jetons, les héritiers, la famille naturelle et non naturelle. Il y a des familles qui ne se réunissent qu''aux...', '02:03:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19421836', 'http://fr.web.img6.acsta.net/medias/nmedia/images/affiches/019874.jpg'),
(2420, 17511, 'The Basketball diaries', '1998-05-06', 'Quatre copains dissipés d''une école catholique de New York ont une passion en commun : le basket. Lorsque Bobby meurt d''une leucémie, Jim et ses copains sont confrontés à la dure réalité de la vie...', 'Quatre copains dissipés d''une école catholique de New York ont une passion en commun : le basket. Lorsque Bobby meurt d''une leucémie, Jim et ses copains sont confrontés à la dure réalité de la vie...', '01:40:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19421620', 'http://fr.web.img5.acsta.net/medias/nmedia/18/66/11/72/18912130.jpg'),
(2421, 16727, 'Ça reste entre nous', '1998-05-06', 'Patrick aime son exquise femme, qui lui a fait deux beaux garcons, autant que sa charmante maîtresse, qui lui a donné une délicieuse petite fille. Tout va pour le mieux dans le meilleur des mondes possibles jusqu''au jour où sa femme décide de lui faire une surprise en organisant un grand dîner d''anniversaire...', 'Patrick aime son exquise femme, qui lui a fait deux beaux garcons, autant que sa charmante maîtresse, qui lui a donné une délicieuse petite fille. Tout va pour le mieux dans le meilleur des mondes possibles jusqu''au jour où sa femme décide de lui faire une surprise en organisant un grand dîner d''anniversaire...', '01:26:00', 2.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19377073', 'http://fr.web.img2.acsta.net/medias/04/03/51/040351_af.jpg'),
