(2423, 16468, 'Comme elle respire', '1998-05-06', 'Jeanne est mythomane. Elle ment comme elle respire. Elle ne peut pas s''empêcher de raconter des histoires fabuleuses dont elle est la magnifique héroïne. Elle quitte Bordeaux pour Paris, et après quelques jours d''errance, rencontre Madeleine, une vieille dame crédule qui la prend a son service. Mais...', 'Jeanne est mythomane. Elle ment comme elle respire. Elle ne peut pas s''empêcher de raconter des histoires fabuleuses dont elle est la magnifique héroïne. Elle quitte Bordeaux pour Paris, et après quelques jours d''errance, rencontre Madeleine, une vieille dame crédule qui la prend a son service. Mais...', '01:40:00', 3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19536493', 'http://fr.web.img6.acsta.net/medias/04/00/89/040089_af.jpg'),
(2424, 17370, 'Des hommes d''influence', '1998-04-29', 'Pour sauver le candidat Président des Etats-Unis, éclaboussé par un scandale de moeurs quelques jours avant l''élection presidentielle, ses conseillers décident, pour détourner l''attention des électeurs, d''inventer une guerre dans quelque coin obscur de la vieille Europe.', 'Pour sauver le candidat Président des Etats-Unis, éclaboussé par un scandale de moeurs quelques jours avant l''élection presidentielle, ses conseillers décident, pour détourner l''attention des électeurs, d''inventer une guerre dans quelque coin obscur de la vieille Europe.', '01:35:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19429491', 'http://fr.web.img6.acsta.net/medias/nmedia/images/affiches/041000.jpg'),
(2425, 17258, 'Paparazzi', '1998-04-29', 'Et voilà que Bordoni, gardien de nuit de son état, est pris en flagrant délit. Son patron lui brandit sous le nez le dernier numéro de "Devine quoi", un hebdo qui traque la vie privée des vedettes. Il fait la page de couverture juste derrière une star en flagrant délit d''adultère dans les tribunes...', 'Et voilà que Bordoni, gardien de nuit de son état, est pris en flagrant délit. Son patron lui brandit sous le nez le dernier numéro de "Devine quoi", un hebdo qui traque la vie privée des vedettes. Il fait la page de couverture juste derrière une star en flagrant délit d''adultère dans les tribunes...', '01:49:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19397253', 'http://fr.web.img4.acsta.net/medias/nmedia/18/36/08/55/18869240.jpg'),
(2426, 16467, 'Jeanne et le garçon formidable', '1998-04-22', 'Jeanne, réceptionniste dans une agence de voyage, est à la recherche de l''homme de sa vie. Elle pense l''avoir enfin trouvé en la personne d''Olivier. Mais ce dernier disparaît de sa vie dès qu''il apprend qu''il est atteint du sida. Jeanne tente alors de retrouver sa trace.', 'Jeanne, réceptionniste dans une agence de voyage, est à la recherche de l''homme de sa vie. Elle pense l''avoir enfin trouvé en la personne d''Olivier. Mais ce dernier disparaît de sa vie dès qu''il apprend qu''il est atteint du sida. Jeanne tente alors de retrouver sa trace.', '01:38:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=16467043', 'http://fr.web.img4.acsta.net/medias/04/00/88/040088_af.jpg'),
(2427, 16464, 'Déjà mort', '1998-04-22', 'Laure a vingt ans, elle veut quitter l''univers étriqué de cette ville de province où elle vit. Sa chance c''est Andréa, jeune homme pauvre ébloui par sa rencontre avec David et Romain, qui vivent sur les hauteurs de Nice.', 'Laure a vingt ans, elle veut quitter l''univers étriqué de cette ville de province où elle vit. Sa chance c''est Andréa, jeune homme pauvre ébloui par sa rencontre avec David et Romain, qui vivent sur les hauteurs de Nice.', '01:48:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=16464030', 'http://fr.web.img2.acsta.net/pictures/14/01/20/15/53/062808.jpg'),
(2428, 16463, 'The Big Lebowski', '1998-04-22', 'Jeff Lebowski dit Le Dude, est un paresseux qui passe son temps à boire des coups avec son copain Walter et jouer au bowling, jeu dont il est fanatique. Un jour, des inconnus rentrent chez lui pour récupérer une somme d''argent, mais il y a méprise sur la personne...', 'Jeff Lebowski dit Le Dude, est un paresseux qui passe son temps à boire des coups avec son copain Walter et jouer au bowling, jeu dont il est fanatique. Un jour, des inconnus rentrent chez lui pour récupérer une somme d''argent, mais il y a méprise sur la personne...', '01:57:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=16463031', 'http://fr.web.img6.acsta.net/medias/04/00/83/040083_af.jpg'),
(2429, 17033, 'Serial Lover', '1998-04-22', 'Claire, la directrice des Editions dangereuses, s''apprête a célébrer ses trente-cinq ans. Tout va bien pour elle hormis qu''elle est amoureuse de trois hommes aussi brillants, intelligents et généreux les uns autant que les autres et qu''elle aimerait vivre un unique grand amour.Pour les départager, elle...', 'Claire, la directrice des Editions dangereuses, s''apprête a célébrer ses trente-cinq ans. Tout va bien pour elle hormis qu''elle est amoureuse de trois hommes aussi brillants, intelligents et généreux les uns autant que les autres et qu''elle aimerait vivre un unique grand amour.Pour les départager, elle...', '01:25:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19438541', 'http://fr.web.img3.acsta.net/medias/nmedia/18/36/07/05/19209181.jpg');
