(2430, 16731, 'Le Dîner de cons', '1998-04-15', 'Tous les mercredis, Pierre Brochant et ses amis organisent un dîner où chacun doit amener un con. Celui qui a trouvé le plus spectaculaire est declaré vainqueur. Ce soir, Brochant exulte, il est sur d''avoir trouvé la perle rare, un con de classe mondiale: Francois Pignon, comptable au ministère des Finances...', 'Tous les mercredis, Pierre Brochant et ses amis organisent un dîner où chacun doit amener un con. Celui qui a trouvé le plus spectaculaire est declaré vainqueur. Ce soir, Brochant exulte, il est sur d''avoir trouvé la perle rare, un con de classe mondiale: Francois Pignon, comptable au ministère des Finances...', '01:20:00', 4.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18781052', 'http://fr.web.img1.acsta.net/medias/nmedia/18/36/10/96/19649758.jpg'),
