(2432, 17106, 'Taxi', '1998-04-08', 'Daniel est un fou du volant, un chauffeur de taxi qui sait échapper aux radars les plus perfectionnés. Pourtant, un jour, il croise la route d''Emilien, policier recalé pour la huitième fois à son permis de conduire. Pour conserver son taxi, il accepte le marché que lui propose Emilien : l''aider à démanteler un gang de braqueurs de banques', 'Daniel est un fou du volant, un chauffeur de taxi qui sait échapper aux radars les plus perfectionnés. Pourtant, un jour, il croise la route d''Emilien, policier recalé pour la huitième fois à son permis de conduire. Pour conserver son taxi, il accepte le marché que lui propose Emilien : l''aider à démanteler un gang de braqueurs de banques', '01:26:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18805253', 'http://fr.web.img5.acsta.net/medias/nmedia/00/02/49/22/affiche.jpg'),
