(2446, 694, 'Pour le pire et pour le meilleur', '1998-02-18', 'Melvin Udall, un écrivain misanthrope, écrit à la chaîne des romans sentimentaux qui comblent son sens pervers de l''autoridérision et lui permettent de vivre confortablement. Sa vie est réglée comme du papier à musique, il évite le contact humain hormis celui de Carol Connelly, une jeune mère célibataire...', 'Melvin Udall, un écrivain misanthrope, écrit à la chaîne des romans sentimentaux qui comblent son sens pervers de l''autoridérision et lui permettent de vivre confortablement. Sa vie est réglée comme du papier à musique, il évite le contact humain hormis celui de Carol Connelly, une jeune mère célibataire...', '02:18:00', 3.9, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19397437', 'http://fr.web.img2.acsta.net/medias/nmedia/18/64/69/75/18798065.jpg'),
