(2473, 12120, 'Ne pas avaler', '1997-11-05', 'L''histoire d''une famille ordinaire qui vit dans le sud de Londres. Film autobiographique, "je l''ai voulu honnete, vrai, sans concessions, declare le realisateur, comme l''album-photo de tous ceux qui m''ont touche et trouble dans ma vie".', 'L''histoire d''une famille ordinaire qui vit dans le sud de Londres. Film autobiographique, "je l''ai voulu honnete, vrai, sans concessions, declare le realisateur, comme l''album-photo de tous ceux qui m''ont touche et trouble dans ma vie".', '02:08:00', 4.2, '', 'http://fr.web.img4.acsta.net/medias/nmedia/images/affiches/031935.jpg'),
(2474, 9325, 'The Game', '1997-11-05', 'Nicholas Van Orton, homme d''affaires avisé, reçoit le jour de son anniversaire un étrange cadeau que lui offre son frère Conrad. Il s''agit d''un jeu. Nicholas découvre peu à peu que les enjeux en sont très élevés...', 'Nicholas Van Orton, homme d''affaires avisé, reçoit le jour de son anniversaire un étrange cadeau que lui offre son frère Conrad. Il s''agit d''un jeu. Nicholas découvre peu à peu que les enjeux en sont très élevés...', '02:08:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19376917', 'http://fr.web.img5.acsta.net/medias/nmedia/00/02/21/28/19163163.jpg'),
(2475, 9553, 'Vive la République !', '1997-11-05', '"Je suis là en tant que femme et en tant que Rmiste, après huit années d''études et un doctorat d''histoire", déclare Sabine. "Moi, je suis là en tant qu''homme, en tant que chômeur en fin de droits, en tant que père de famille... pas divorcé, et c''est tout", déclare Victor. "Je...', '"Je suis là en tant que femme et en tant que Rmiste, après huit années d''études et un doctorat d''histoire", déclare Sabine. "Moi, je suis là en tant qu''homme, en tant que chômeur en fin de droits, en tant que père de famille... pas divorcé, et c''est tout", déclare Victor. "Je...', '01:30:00', 2.9, '', 'http://fr.web.img6.acsta.net/medias/nmedia/18/93/90/23/20284724.jpg'),
(2476, 28232, 'Copland', '1997-10-29', 'A Garrison, cité-dortoir pour les flics de New York, le shérif Heflin est un dépressif obèse que personne ne respecte. La loi du silence de la profession lui impose un jour de masquer une bavure mortelle, mais l''insistance de l''incorruptible enquêteur Tilden va l''obliger à faire un choix...', 'A Garrison, cité-dortoir pour les flics de New York, le shérif Heflin est un dépressif obèse que personne ne respecte. La loi du silence de la profession lui impose un jour de masquer une bavure mortelle, mais l''insistance de l''incorruptible enquêteur Tilden va l''obliger à faire un choix...', '01:35:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19404517', 'http://fr.web.img5.acsta.net/medias/nmedia/18/67/67/24/18992443.jpg'),
(2477, 10436, 'Bean', '1997-10-29', 'Le richissime général Newton a fait don à la Galerie Grierson de cinquante millions de dollars pour rapatrier aux Etats-Unis le chef-d''oeuvre de la peinture américaine. Soucieux de donner le maximum de retentissement à cet évènement, les administrateurs invitent la Royal National Gallery de Londres à...', 'Le richissime général Newton a fait don à la Galerie Grierson de cinquante millions de dollars pour rapatrier aux Etats-Unis le chef-d''oeuvre de la peinture américaine. Soucieux de donner le maximum de retentissement à cet évènement, les administrateurs invitent la Royal National Gallery de Londres à...', '01:30:00', 3.2, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19430820', 'http://fr.web.img1.acsta.net/medias/nmedia/images/affiches/028707.jpg'),
(2478, 9786, 'Barracuda', '1997-10-29', 'M. Clement, vieux monsieur discret mais bougon en mal d''affection, cherche à se faire des amis. Un jeune dessinateur de BD emménage dans l''appartement d''en face. M. Clement cherche à tout prix à s''en faire un ami et l''invite à dîner...', 'M. Clement, vieux monsieur discret mais bougon en mal d''affection, cherche à se faire des amis. Un jeune dessinateur de BD emménage dans l''appartement d''en face. M. Clement cherche à tout prix à s''en faire un ami et l''invite à dîner...', '01:34:00', 3.7, '', 'http://fr.web.img6.acsta.net/medias/nmedia/18/68/14/12/19012341.jpg'),
(2479, 9827, 'Marthe ou La promesse du jour', '1997-10-29', 'Blessé dans les tranchées de la forêt d''Argonne au début de l''automne 1915, Simon est transféré vers un hôpital de l''arrière, loin du front. Ici, les blessures se referment et les hommes renaissent à la vie le temps d''une convalescence, avant de retourner dans la guerre. Simon va rencontrer Marthe et...', 'Blessé dans les tranchées de la forêt d''Argonne au début de l''automne 1915, Simon est transféré vers un hôpital de l''arrière, loin du front. Ici, les blessures se referment et les hommes renaissent à la vie le temps d''une convalescence, avant de retourner dans la guerre. Simon va rencontrer Marthe et...', '02:01:00', 3.8, '', 'http://fr.web.img1.acsta.net/medias/nmedia/images/affiches/027342.jpg'),
(2480, 64831, 'En chair et en os', '1997-10-29', 'Victor Plaza vit une nuit d''amour avec Elena, qu''il vient de rencontrer. Mais, lorsqu''il se présente chez elle quelques jours après leur brève rencontre, ce n''est pas lui qu''Elena attend mais son dealer. L''intrusion de deux policiers au sang chaud dans le', 'Victor Plaza vit une nuit d''amour avec Elena, qu''il vient de rencontrer. Mais, lorsqu''il se présente chez elle quelques jours après leur brève rencontre, ce n''est pas lui qu''Elena attend mais son dealer. L''intrusion de deux policiers au sang chaud dans le', '01:39:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19436569', 'http://fr.web.img6.acsta.net/pictures/741/74149_20131105152819397.jpg'),
(2481, 10442, 'Full Monty / Le Grand jeu', '1997-10-22', 'La venue trimphale de la troupe des Chippendales dans la ville de Sheffield va donner des idées a Gaz et ses copains. Si les femmes de Sheffield craquent pour des éphèbes anabolisés, que penseront-elles de vrais hommes, prêts à aller jusqu''au bout en s''exhibant entièrement nus ?', 'La venue trimphale de la troupe des Chippendales dans la ville de Sheffield va donner des idées a Gaz et ses copains. Si les femmes de Sheffield craquent pour des éphèbes anabolisés, que penseront-elles de vrais hommes, prêts à aller jusqu''au bout en s''exhibant entièrement nus ?', '01:32:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19363787', 'http://fr.web.img2.acsta.net/medias/nmedia/18/36/24/92/19470853.jpg'),
(2482, 9712, 'Le Monde Perdu : Jurassic Park', '1997-10-22', 'Quatre ans après le terrible fiasco de son Jurassic Park, le milliardaire John Hammond rappelle le Dr Ian Malcolm pour l''informer de son nouveau projet...', 'Quatre ans après le terrible fiasco de son Jurassic Park, le milliardaire John Hammond rappelle le Dr Ian Malcolm pour l''informer de son nouveau projet...', '02:09:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=9712030''', 'http://fr.web.img2.acsta.net/medias/nmedia/00/02/11/66/affiche.jpg'),
(2483, 9795, 'Alors voila,', '1997-10-22', 'Constantin a trois fils. Ils habitent avec leur famille dans le même immeuble, excepté Constantin, patriarche impitoyable, farceur, jouisseur. Il tient sa postérite sous surveillance. Avec Rose, sa seule fille, née d''une autre union, il partage une complicité à l''abri du regard des autres.', 'Constantin a trois fils. Ils habitent avec leur famille dans le même immeuble, excepté Constantin, patriarche impitoyable, farceur, jouisseur. Il tient sa postérite sous surveillance. Avec Rose, sa seule fille, née d''une autre union, il partage une complicité à l''abri du regard des autres.', '01:33:00', 0, '', 'http://fr.web.img1.acsta.net/medias/nmedia/images/affiches/027306.jpg'),
(2484, 10308, 'Le Pari', '1997-10-15', 'Bernard est professeur dans une banlieue et vit avec Victoria. Didier est un riche pharmacien du XIXe arrondissement de Paris, marié à Murielle, la soeur de Victoria. Tout oppose les deux beaux-freres et ils se détestent...', 'Bernard est professeur dans une banlieue et vit avec Victoria. Didier est un riche pharmacien du XIXe arrondissement de Paris, marié à Murielle, la soeur de Victoria. Tout oppose les deux beaux-freres et ils se détestent...', '01:40:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19426012', 'http://fr.web.img1.acsta.net/medias/nmedia/18/71/65/23/19142144.jpg'),
(2485, 10027, 'Rien ne va plus', '1997-10-15', 'Victor a soixante ans, Betty, la moitié de son âge. Ils forment un couple disparate et bien malin qui pourrait dire leurs rapports réels, sinon ceux d''une association de malfaiteurs. Ils sillonnent la France et les pays limitrophes a bord d''un camping-car, recherchant particulièrement les congrès professionnels...', 'Victor a soixante ans, Betty, la moitié de son âge. Ils forment un couple disparate et bien malin qui pourrait dire leurs rapports réels, sinon ceux d''une association de malfaiteurs. Ils sillonnent la France et les pays limitrophes a bord d''un camping-car, recherchant particulièrement les congrès professionnels...', '01:45:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19447463', 'http://fr.web.img3.acsta.net/medias/nmedia/18/65/54/85/18869533.jpg'),
(2486, 9921, 'Pour l''amour de Roseanna', '1997-10-08', 'Atteinte d''une grave maladie qui ne lui laisse que quelques mois à vivre, Roseanna demande à son bien-aimé mari, d''accomplir son voeu le plus cher: être enterrée auprès de leur petite fille dans l''antique cimetière de leur village. Seulement, le cimetière déjà fort peuplé n''a plus que trois concessions...', 'Atteinte d''une grave maladie qui ne lui laisse que quelques mois à vivre, Roseanna demande à son bien-aimé mari, d''accomplir son voeu le plus cher: être enterrée auprès de leur petite fille dans l''antique cimetière de leur village. Seulement, le cimetière déjà fort peuplé n''a plus que trois concessions...', '01:38:00', 3.1, '', 'http://fr.web.img1.acsta.net/medias/nmedia/images/affiches/027528.jpg'),
(2487, 12027, 'De beaux lendemains', '1997-10-08', 'Un drame unit les habitants d''une petite ville. Un avocat vient attiser leur haine, pour apaiser ses propres démons. Dans cette ambiance de méfiance et de doute, une adolescente parviendra à reconquérir sa dignité, et à préserver l''unité de la communauté.', 'Un drame unit les habitants d''une petite ville. Un avocat vient attiser leur haine, pour apaiser ses propres démons. Dans cette ambiance de méfiance et de doute, une adolescente parviendra à reconquérir sa dignité, et à préserver l''unité de la communauté.', '01:52:00', 3.5, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=12027030', 'http://fr.web.img4.acsta.net/medias/03/18/14/031814_af.jpg'),
(2488, 12032, 'L.A. Confidential', '1997-10-08', 'Los Angeles, années 50. Alors que la ville est sujette à une vague de règlements de comptes après la chute du caïd Mickey Cohen, la police criminelle se mobilise toute entière sur l''affaire de L''Oiseau de nuit, un massacre au cours duquel est tombé un ancien flic. Trois inspecteurs au style radicalement...', 'Los Angeles, années 50. Alors que la ville est sujette à une vague de règlements de comptes après la chute du caïd Mickey Cohen, la police criminelle se mobilise toute entière sur l''affaire de L''Oiseau de nuit, un massacre au cours duquel est tombé un ancien flic. Trois inspecteurs au style radicalement...', '02:18:00', 4.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19418768', 'http://fr.web.img2.acsta.net/medias/03/18/19/031819_af.jpg'),
(2489, 10233, 'Messieurs les enfants', '1997-10-01', 'Trois enfants de douze ans se réveillent un matin et constatent qu''ils ont été transformés en adultes dans la nuit. Affolés, ils se précipitent dans la chambre de leurs parents. Ceux-ci ont été transformés en enfants.', 'Trois enfants de douze ans se réveillent un matin et constatent qu''ils ont été transformés en adultes dans la nuit. Affolés, ils se précipitent dans la chambre de leurs parents. Ceux-ci ont été transformés en enfants.', '01:40:00', 1.7, '', 'http://fr.web.img6.acsta.net/medias/nmedia/18/97/35/36/20524342.jpg'),
(2490, 10243, 'J''irai au paradis car l''enfer est ici', '1997-10-01', 'Après le braquage d''une banque qui tourne mal, François se réfugie chez un ami de son père qui lui aussi est dans les "affaires". La menace de la traque policière va bientôt faire éclater la petite bande de truands.', 'Après le braquage d''une banque qui tourne mal, François se réfugie chez un ami de son père qui lui aussi est dans les "affaires". La menace de la traque policière va bientôt faire éclater la petite bande de truands.', '01:55:00', 3.4, '', 'http://fr.web.img2.acsta.net/medias/nmedia/images/affiches/028252.jpg'),
(2491, 10439, 'Le Mariage de mon meilleur ami', '1997-10-01', '<p style="text-align: justify;">Julianne et Michael se sont connus étudiants et ont vécu une liaison amoureuse aussi brève que passionnée. Devant les hésitations de Julianne, ils décident de rompre mais de rester amis. Ils concluent alors un étrange pacte : si à 28 ans aucun des deux n''a trouvé l''âme soeur, ils se marient.', '<p style="text-align: justify;">Julianne et Michael se sont connus étudiants et ont vécu une liaison amoureuse aussi brève que passionnée. Devant les hésitations de Julianne, ils décident de rompre mais de rester amis. Ils concluent alors un étrange pacte : si à 28 ans aucun des deux n''a trouvé l''âme soeur, ils se marient.', '01:45:00', 3.3, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19441095', 'http://fr.web.img2.acsta.net/pictures/195/377/19537702_20130805172629082.jpg'),
(2492, 10371, 'Air Force One', '1997-10-01', 'Apres avoir seme le trouble au Kazakhstan, le general Alexander Radek est capture par un commando russo-americain et jete en prison. Trois semaines apres, le president americain John Marshall recoit un accueil triomphal a Moscou et lance une solennelle declaration de guerre au terrorisme. Alors qu''il...', 'Apres avoir seme le trouble au Kazakhstan, le general Alexander Radek est capture par un commando russo-americain et jete en prison. Trois semaines apres, le president americain John Marshall recoit un accueil triomphal a Moscou et lance une solennelle declaration de guerre au terrorisme. Alors qu''il...', '02:05:00', 2.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19477120', 'http://fr.web.img3.acsta.net/medias/nmedia/18/78/33/92/19457123.jpg'),
(2493, 10231, 'Nettoyage à sec', '1997-09-24', 'Un groupe de copains en goguette, tous commerçants dans la même rue, se retrouvent un soir dans une boite de nuit. Parmi eux, Jean-Marie et son épouse Nicole. Quinze ans d''amour et de fidélite dans un pressing du centre-ville à traquer la moindre tâche. Sur la scène de la Nuit du temps, un jeune garçon...', 'Un groupe de copains en goguette, tous commerçants dans la même rue, se retrouvent un soir dans une boite de nuit. Parmi eux, Jean-Marie et son épouse Nicole. Quinze ans d''amour et de fidélite dans un pressing du centre-ville à traquer la moindre tâche. Sur la scène de la Nuit du temps, un jeune garçon...', '01:37:00', 3.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=10231030', 'http://fr.web.img2.acsta.net/medias/02/82/13/028213_af.jpg'),
(2494, 10370, 'Mimic', '1997-09-24', 'Pour juguler une épidémie propagée par des insectes, le docteur Susan Tyler et son mari Peter Mann manipulent le code génétique des petites bêtes, créant ainsi une génération de clones qui détruit ses congénères. Trois ans plus tard, le remède a donné vie à une espèce mutante qui habite dans les sous-sols...', 'Pour juguler une épidémie propagée par des insectes, le docteur Susan Tyler et son mari Peter Mann manipulent le code génétique des petites bêtes, créant ainsi une génération de clones qui détruit ses congénères. Trois ans plus tard, le remède a donné vie à une espèce mutante qui habite dans les sous-sols...', '01:42:00', 2.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19434643', 'http://fr.web.img5.acsta.net/medias/nmedia/18/35/16/38/19163464.jpg');
