(2495, 12109, 'La femme défendue', '1997-09-24', 'Francois, marié et père de famille, rencontre par hasard Muriel, jeune célibataire sans attache. Il la désire, elle résiste, capitule, s''enchaîne. Cela s''appelle l''adultère, avec son cortège de bonheur, de jalousie, de petites mesquineries, de larmes retenues ou versées.', 'Francois, marié et père de famille, rencontre par hasard Muriel, jeune célibataire sans attache. Il la désire, elle résiste, capitule, s''enchaîne. Cela s''appelle l''adultère, avec son cortège de bonheur, de jalousie, de petites mesquineries, de larmes retenues ou versées.', '01:40:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18742122', 'http://fr.web.img2.acsta.net/medias/nmedia/images/affiches/031924.jpg'),
(2496, 10437, 'Kolya', '1997-09-17', 'Frantisek Louka, ancien violoncelliste de l''Orchestre philharmonique de Prague, privé de son travail par la bureaucratie communiste, en est reduit à jouer pour les enterrements au crématorium de la ville. Criblé de dettes, il accepte de faire un mariage blanc avec une Russe qui a besoin de papiers tchèques...', 'Frantisek Louka, ancien violoncelliste de l''Orchestre philharmonique de Prague, privé de son travail par la bureaucratie communiste, en est reduit à jouer pour les enterrements au crématorium de la ville. Criblé de dettes, il accepte de faire un mariage blanc avec une Russe qui a besoin de papiers tchèques...', '01:52:00', 4.4, '', 'http://fr.web.img3.acsta.net/medias/nmedia/images/affiches/028709.jpg'),
(2497, 10353, 'Pour une nuit', '1997-09-17', 'Lors d''un voyage à New York, Max, jeune et brillant publicitaire de la côte Ouest, rencontre Karen, belle intellectuelle fascinante. C''est le coup de foudre. Ils s''aiment, le temps d''une nuit, et repartent chacun de son côté retrouver leurs conjoints. Un an plus tard, Max, de retour à New York, au chevet...', 'Lors d''un voyage à New York, Max, jeune et brillant publicitaire de la côte Ouest, rencontre Karen, belle intellectuelle fascinante. C''est le coup de foudre. Ils s''aiment, le temps d''une nuit, et repartent chacun de son côté retrouver leurs conjoints. Un an plus tard, Max, de retour à New York, au chevet...', '01:37:00', 3.2, '', 'http://fr.web.img3.acsta.net/medias/nmedia/images/affiches/028529.jpg'),
(2498, 15753, 'Contact', '1997-09-17', 'Ellie Arroway, passionnée depuis sa plus tendre enfance par l''univers, est devenue une jeune et brillante astronome. Avec une petite équipe de chercheurs elle écoute le ciel et guette un signe d''intelligence extraterrestre. Un jour, ils captent un message.', 'Ellie Arroway, passionnée depuis sa plus tendre enfance par l''univers, est devenue une jeune et brillante astronome. Avec une petite équipe de chercheurs elle écoute le ciel et guette un signe d''intelligence extraterrestre. Un jour, ils captent un message.', '02:33:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19459641', 'http://fr.web.img6.acsta.net/medias/nmedia/18/83/99/25/19721074.jpg'),
(2499, 11501, 'Alliance cherche doigt', '1997-09-17', 'Geneviève Lechat, la cinquantaine très sexy, directrice de Coeurs en fête, offre à son fils André, ethnologue poète, une agence matrimoniale branchée sur Internet. Belle aubaine pour André, si le destin ne jetait d''emblée sur sa route un client comme Jean Morlaud. Las de vendre des voitures, ce célibataire...', 'Geneviève Lechat, la cinquantaine très sexy, directrice de Coeurs en fête, offre à son fils André, ethnologue poète, une agence matrimoniale branchée sur Internet. Belle aubaine pour André, si le destin ne jetait d''emblée sur sa route un client comme Jean Morlaud. Las de vendre des voitures, ce célibataire...', '01:30:00', 1.4, '', 'http://fr.web.img5.acsta.net/medias/nmedia/images/affiches/030991.jpg'),
(2500, 99410, 'Volte/Face', '1997-09-10', 'Castor Troy, dangereux terroriste, est tombé dans le coma à la suite d''un affrontement avec Sean Archer, agent de la CIA. Grâce à une intervention chirurgicale, Archer prend le visage de Troy...', 'Castor Troy, dangereux terroriste, est tombé dans le coma à la suite d''un affrontement avec Sean Archer, agent de la CIA. Grâce à une intervention chirurgicale, Archer prend le visage de Troy...', '02:19:00', 4.1, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19541396', 'http://fr.web.img3.acsta.net/medias/nmedia/18/97/55/80/20535753.jpg'),
(2501, 12118, 'Western', '1997-08-27', 'C''est l''histoire de Paco et Nino. Paco, l''Espagnol qui plait aux femmes et Nino, petit émigré russe, qui marchent tous deux sur les routes de Bretagne. Ils se rencontrent, c''est l''aventure de leur amitié et de leurs nombreuses rencontres.', 'C''est l''histoire de Paco et Nino. Paco, l''Espagnol qui plait aux femmes et Nino, petit émigré russe, qui marchent tous deux sur les routes de Bretagne. Ils se rencontrent, c''est l''aventure de leur amitié et de leurs nombreuses rencontres.', '02:15:00', 3.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=12118031', 'http://fr.web.img1.acsta.net/medias/nmedia/18/66/83/22/18958211.jpg'),
(2502, 15374, 'Ponette', '1996-09-26', 'Ponette a 4 ans lorsque sa mère meurt accidentellement. Confiée à sa tante, la fillette ne supporte pas cette disparition. Elle continue obstinément de s''adresser à elle, convaincue qu''elle reviendra un jour.', 'Ponette a 4 ans lorsque sa mère meurt accidentellement. Confiée à sa tante, la fillette ne supporte pas cette disparition. Elle continue obstinément de s''adresser à elle, convaincue qu''elle reviendra un jour.', '01:37:00', 4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19542870', 'http://fr.web.img5.acsta.net/medias/nmedia/images/affiches/038290.jpg'),
(2503, 14711, 'Diabolique', '1996-05-22', 'Adaptation du film d''Henri-Georges Clouzot qui a lui-même adapté le roman de Pierre Boileau et Thomas Narcejac, "Celle qui n''était plus". "Diabolique" raconte à travers la manipulation, le mensonge et le meurtre, les relations entre deux femmes.', 'Adaptation du film d''Henri-Georges Clouzot qui a lui-même adapté le roman de Pierre Boileau et Thomas Narcejac, "Celle qui n''était plus". "Diabolique" raconte à travers la manipulation, le mensonge et le meurtre, les relations entre deux femmes.', '01:47:00', 1.8, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19453929', 'http://fr.web.img3.acsta.net/medias/nmedia/18/35/55/91/18802575.jpg'),
(2504, 14672, 'Le huitième jour', '1996-05-16', 'Harry est un homme seul qui se voue sept jours sur sept à son travail. Tout va basculer quand il va rencontrer Georges, une personne handicapée mentale, qui vit dans l''instant. Ces deux êtres que tout oppose vont devenir inséparables.', 'Harry est un homme seul qui se voue sept jours sur sept à son travail. Tout va basculer quand il va rencontrer Georges, une personne handicapée mentale, qui vit dans l''instant. Ces deux êtres que tout oppose vont devenir inséparables.', '01:58:00', 4, '', 'http://fr.web.img6.acsta.net/pictures/188/309/18830938_20130730121309814.jpg'),
(2505, 14666, 'Un héros très discret', '1996-05-15', 'Dans l''époque trouble et confuse de l''hiver 1944-1945, à Paris, un homme qui n''a pas participé à la guerre va se faire passer pour un héros en s''inventant une vie admirable. A force de mensonge, il va construire par omissions et allusions un personnage hors du commun.', 'Dans l''époque trouble et confuse de l''hiver 1944-1945, à Paris, un homme qui n''a pas participé à la guerre va se faire passer pour un héros en s''inventant une vie admirable. A force de mensonge, il va construire par omissions et allusions un personnage hors du commun.', '01:47:00', 3.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19447763', 'http://fr.web.img2.acsta.net/medias/nmedia/18/63/95/15/18928813.jpg'),
(2506, 9393, 'La Liste de Schindler', '1994-03-02', 'Evocation des années de guerre d''Oskar Schindler, industriel autrichien rentré à Cracovie en 1939 avec les troupes allemandes. Il va, tout au long de la guerre, protéger des juifs en les faisant travailler dans sa fabrique.', 'Evocation des années de guerre d''Oskar Schindler, industriel autrichien rentré à Cracovie en 1939 avec les troupes allemandes. Il va, tout au long de la guerre, protéger des juifs en les faisant travailler dans sa fabrique.', '03:15:00', 4.7, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18802634', 'http://fr.web.img5.acsta.net/medias/nmedia/18/66/03/76/18979736.jpg'),
(2507, 45284, 'Si ma gueule vous plaît...', '1981-12-23', 'Une femme se croit frigide. Elle essaie de rémédier à son problème en essayant tous les moyens mis à sa disposition par la société moderne.', 'Une femme se croit frigide. Elle essaie de rémédier à son problème en essayant tous les moyens mis à sa disposition par la société moderne.', '01:30:00', 0, '', 'http://fr.web.img1.acsta.net/medias/nmedia/18/73/93/44/19221818.jpg'),
(2508, 1153, 'Le Tambour', '1979-09-19', 'A la fin des années 1920, dans la région de Dantzig, Oskar, refusant le monde cruel et surfait des adultes, décide à l''age de trois ans de ne plus grandir.', 'A la fin des années 1920, dans la région de Dantzig, Oskar, refusant le monde cruel et surfait des adultes, décide à l''age de trois ans de ne plus grandir.', '02:42:00', 3.6, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=19431219', 'http://fr.web.img6.acsta.net/medias/nmedia/18/60/11/43/19767691.jpg'),
(2509, 25801, 'Star Wars : Episode IV - Un nouvel espoir (La Guerre de', '1977-10-19', 'Il y a bien longtemps, dans une galaxie très lointaine... La guerre civile fait rage entre l''Empire galactique et l''Alliance rebelle.', 'Il y a bien longtemps, dans une galaxie très lointaine... La guerre civile fait rage entre l''Empire galactique et l''Alliance rebelle.', '02:01:00', 4.4, 'http://www.allocine.fr/_video/iblogvision.aspx?cmedia=18732389', 'http://fr.web.img1.acsta.net/medias/nmedia/18/35/41/59/18422600.jpg');
