INSERT INTO `question` (`id`, `type`, `rep_id`, `contenu`) VALUES
(1, 'humeur', 0, 'Salut! Comment tu vas aujourd''hui?'),
(2, 'raison', 5, 'Oh, on pense avoir quelque chose pour toi mais aurais-tu une envie particulière?'),
(3, 'raison', 1, 'Et bien nous allons te faire plaisir! Tu aurais envie de...'),
(4, 'raison', 4, 'Pas ton ordi tout de même. Tu raterais quelque chose! Bon, tu aurais envie de...'),
(5, 'raison', 6, 'On va te tenir compagnie! Mais une petite question, que souhaiterais-tu?'),
(6, 'raison', 2, 'Et avec nous, c''est fini l''ennui! Aurais-tu une envie particulière?'),
(7, 'genre', 3, 'Et bien le changement c''est maintenant! Une préférence?'),
(8, 'genre', 7, 'Ça te semble être une bonne chose surtout pour les rides d''après les dires ! Mais attends, t''es plutôt du genre...'),
(9, 'genre', 8, 'Tu as raison ! Certains devraient y songer plus souvent... Mais pour toi, réfléchir c''est...'),
(10, 'genre', 9, 'Installe-toi bien confortablement alors. Et dis-nous ce qui te correspond le mieux...'),
(11, 'genre', 10, 'Nous allons te trouver de quoi te secouer un peu alors: Pour cela tu aurais besoin...'),
(12, 'genre', 11, 'Pas de soucis, on est là pour ça ! Qu''est-ce qu''on te sert ?'),
(13, 'genre', 12, 'Va pour une opération à coeur ouvert ! Quel parfum pour l''anesthésie générale ?'),
(14, 'genre', 13, 'On est entièrement d''accord avec toi ! Et qu''est-ce qui te ferait le plus rire ?'),
(15, 'genre', 14, 'Pas de soucis. A défaut d''un massage, on va te trouver quelque chose quand même ! Une préférence pour l''une de ces propositions? '),
(16, 'genre', 15, 'Très bonne initiative. Un esprit sain dans un corps sain ! Mais pour toi, se cultiver, ça rime avec ...'),
(17, 'genre', 16, 'D''accord, mais ne nous fais pas de mal, on y est pour rien! Par contre ce qui te permettrait d''évacuer, c''est...'),
(18, 'genre', 17, 'Installe-toi bien confortablement alors. Et dis-nous ce qui te correspond le mieux...'),
(19, 'genre', 18, 'Et bien nous allons te changer les idées, qu''est-ce qui te ferait oublier tes tracas?'),
(20, 'genre', 19, 'Nous aurons toujours quelque chose pour toi ! Mais qu''entends-tu par "pire"?'),
(21, 'genre', 20, 'Et bien nous allons te changer les idées. Qu''est-ce qui te ferait oublier tes tracas?'),
(22, 'genre', 21, 'Bien sûr que cela est possible! Toute chaussure peut trouver son pied! Ce qui pourrait te faire rire, c''est...'),
(23, 'genre', 22, 'Compte sur nous, ne t''en fais pas ! Qu''est-ce qui pourrait t''aider ?'),
(24, 'genre', 23, 'Ah.. Et bien, on va peut-être te laisser seul finalement ! Mais avant qu''on parte, as-tu une préférence ?'),
(25, 'genre', 24, 'On est là, compte sur nous ! De quoi as-tu besoin sinon ?'),
(26, 'genre', 25, 'Pas de soucis, tu peux nous faire confiance pour ça ! Qu''est-ce qui pourrait t''aider ?'),
(27, 'genre', 26, 'Et bien compte sur nous, on est là pour ça. Alors qu''est-ce qu''on te sert ?'),
(28, 'genre2', 121, 'Oh, mais nous avons de la réserve, ne t''en fais pas. Peut-être que, pour toi, se détendre rime plus avec...'),
(29, 'genre2', 122, 'Oh, mais nous avons de la réserve, ne t''en fais pas. Peut-être que tu préférerais...'),
(30, 'genre2', 123, 'Oh, mais nous avons de la réserve, ne t''en fais pas. Peut-être que, pour toi, se détendre rime plus avec...'),
(31, 'genre2', 124, 'Oh, mais nous avons de la réserve, ne t''en fais pas. Peut-être que, pour toi, se détendre rime plus avec...'),
(32, 'genre2', 125, 'Oh, mais nous avons de la réserve, ne t''en fais pas. Peut-être que tu préférerais...'),
(33, 'genre3', 157, 'Hum, Nous avons encore quelques idées pour toi, tu devrais sûrement trouver ton bonheur dans...');
